INSERT INTO `products_pri` VALUES (4001,3072,NULL,157,NULL,'Tire Repair Kit, 7 Piece',NULL,'<ul>\r\n	<li>\r\n		1 x Pistol grip plugger</li>\r\n	<li>\r\n		1 x Pistol grip reamer</li>\r\n	<li>\r\n		1 x 12 mL rubber cement</li>\r\n	<li>\r\n		3 x 4&quot; repair strings</li>\r\n	<li>\r\n		1 x Metal scuffer</li>\r\n</ul>\r\n',0,0,1,0,4001,NULL,NULL),(4002,3072,NULL,1,NULL,'Patch/Plug Lead Wire Dipped Stem Combination Tire Repair',NULL,'<ul>\r\n	<li>\r\n		Both the stem and the repair will vulcanize.</li>\r\n	<li>\r\n		Unit can be used with 25 degree tire injuries or less.</li>\r\n	<li>\r\n		Repair size - 2&quot;</li>\r\n	<li>\r\n		Stem size - 3/8&quot;</li>\r\n</ul>\r\n',0,0,1,NULL,4016,NULL,NULL),(4004,3366,NULL,1,NULL,'Hydraulic Floor Jack, 3 Ton Capacity',NULL,'<p>\r\n	Min height 145mm. Max height 510mm.</p>\r\n',0,0,1,0,4006,NULL,NULL),(4006,3366,NULL,1,NULL,'Ratchet Type Jack Stands, 3 Ton',NULL,'<p>\r\n	Sturdy 4 leg welded steel stands. Has load-lock handle that prevents stand from being lowered until load is removed from saddle. Wide saddle provides maximum stability. Sold by the pair. 11-3/16&quot; min height, 16-3/4&quot; max height, 5-3/4&quot; max lift, 3 tons capacity.</p>\r\n',0,0,1,0,5352,NULL,NULL),(7495,3358,NULL,77,NULL,'Magikist BX Series Stationary Pressure Washer','Description','<p>\r\n	The Magikist BX Series of pressure washers are industrial rated for heavy duty use. Uses an industrial rated TEFC Baldor electric motor.<br />\r\n	<br />\r\n	Belt driven triplex ceramic plunger pump operates at slow speeds for reduced pump wear and vibration when compared to direct drive pumps. This significantly extends the life of the pump.<br />\r\n	<br />\r\n	Stainless steel water reservoir with brass level control. Pressure regulating unloader valve for easy pressure adjustment.<br />\r\n	<br />\r\n	Glycerine filled pressure gauge, prime valve, and safety pressure relief valve. Durable powder coated components for resistance to moisture. Convenient carry handles.<br />\r\n	<br />\r\n	High pressure soap provides superior cleaning when compared with soap injector systems. Soap control allows for easy on and off operation of soap, as well as adjustment for desired soap concentration.<br />\r\n	<br />\r\n	Supplied with 35 feet of wire braid high pressure hose, quick couplers, easy-open trigger gun, high pressure swivel, insulated wand and stainless steel nozzle.</p>\r\n',0,0,1,0,7472,NULL,''),(4009,3073,NULL,1,NULL,'2 Inch Heavy-Duty Polyester Recovery Towing Straps','Length','<p>\r\n	Polyester recovery straps are great to have in case you find yourself stuck in snow, mud or sand. Made with lightweight polyester webbing which is resistant to weather and UV rays for longer lasting use.</p>\r\n<ul>\r\n	<li>\r\n		16,000 lb working load limit. 32,000 lb break strength.</li>\r\n</ul>\r\n',0,0,1,0,4008,NULL,NULL),(4010,3367,NULL,106,NULL,'Eagle P3120H1 Portable Air Compressor, 2.0 HP, 20 Gallon',NULL,'<p>\r\n	Rugged compressor with cast iron cylinders. &quot;V&quot; design minimizes vibration, improves cooling and extends compressor life. Thermally protected 3 HP 110V electric motor is CSA approved. 20 gallon tank, 150 PSIG rating. Sturdy tires for easy handling and maneuverability. Convenient oil drain on front of unit. Easy view oil sight gauge. High efficiency reed valves for maximum performance. Efficient heat removal from pulley-fan for cooler running and longer life. Sturdy metal belt guard. Outlet valve and regulator included. Metal air filters with &quot;Auto Drop&quot; feature. 6.0 CFM @ 100 PSI. Superior construction - designed for industrial users.</p>\r\n',0,0,1,0,4012,NULL,NULL),(4011,3367,NULL,144,NULL,'Bolton Pro Hand Carry Air Compressor, 2.0 HP, 4.2 Gal Cap.,Twin Stack, Oil Free',NULL,'<p>\r\n	Air cock. Outlet pressure gauge. Tank pressure gauge. Pressure regulator. Advanced air cooling system. 2 HP (120V, 60Hz) motor. 4.2 gallon tank capacity. Twin tanks. Oil free pump. 100 PSI max pressure. 4.4 CFM @ 40 PSI. 3.4 CFM @ 90 PSI.</p>\r\n',0,0,1,0,4014,NULL,NULL),(7033,3324,NULL,210,NULL,'Harmsco Premium 701 Series Filter Cartridges, 2-1/2\" OD, 40\" Length, Case of 20','Micron Rating','<p>\r\n	Designed for housings that use 2-1/2&quot; O.D. X 1-1/16&quot; ID filter cartridges. Cleanable pleated polyester filter media provides high flow rates with low initial pressure drop. Color coded end caps for easy micron identification. Harmsco pleated polyester filter cartridges typically offer 3 - 5 times longer filter runs than string wound or depth filter cartridges. Certified to NSF 61. All sizes below are sold by the case of 20.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Filters listed here are 40&quot; in length. </strong></li>\r\n	<li>\r\n		<strong>All sizes below are sold and priced by the case of 20.</strong></li>\r\n</ul>\r\n',0,0,1,0,7016,NULL,''),(4013,3367,NULL,1,NULL,'Red Rubber Air Hose Assemblies','Length','<p>\r\n	Tough flexible rubber air hose won\'t crack or kink. Reinforced braiding for extra durability. Has a working pressure of 300 PSI and a burst pressure of 800 PSI. 3/8&quot; diameter hose has 1/4&quot; brass male pipe thread fittings on each end to fit most compressors and air accessories.</p>\r\n',0,0,1,0,4021,NULL,NULL),(7098,3367,NULL,NULL,NULL,'North Wind Blue Thermoplastic Air Hose Assemblies','Length','<p>\r\n	North Wind Blue PVC Thermoplastic Hose is rated for use at -40<span class=\"st\">C. It has an amazingly supple and flexible feel at room temperature. In winter when most PVC hoses (and even some rubber ones) turn into rigid pipe, North Wind PVC thermoplastic hose still stays flexible.</span></p>\r\n<p>\r\n	<span class=\"st\">The inner tube is constructed of a smooth blue, medium oil-resistant, low temperature PVC compound. It is reinforced with high-tensile spiral polyester yarn. The covering on this hose is a smooth, blue, abrasion and weather resistant low temperature PVC compound. </span></p>\r\n<p>\r\n	<span class=\"st\">Has a working pressure of 300 PSI and a burst pressure of 800 PSI. 3/8&quot; diameter hose has 1/4&quot; brass male pipe thread fittings on each end to fit most compressors and air accessories.</span></p>\r\n',0,0,1,0,5608,NULL,''),(4014,3367,NULL,161,NULL,'14 Piece Air Compressor Accessory Kit',NULL,'<ul>\r\n	<li>\r\n		4 male quick connectors</li>\r\n	<li>\r\n		2 female quick connectors</li>\r\n	<li>\r\n		2 hose connectors</li>\r\n	<li>\r\n		One of each of: air blow gun, quick coupler, safety nozzle, inflating needle, tire chuck, 50 PSI air gauge</li>\r\n</ul>\r\n',0,0,1,0,7035,NULL,NULL),(7720,3321,NULL,26,NULL,'LMI PVC Pressure Relief Valves','Size','<p>\r\n	LMI\'s pressure relief valves are designed to protect chemical feed systems from overpressure damage caused by defective equipment or deheading.</p>\r\n',0,0,1,0,7698,NULL,''),(4016,3072,NULL,1,NULL,' 12\" Dual Tire Gauges','PSI',NULL,0,0,1,NULL,4020,NULL,NULL),(4017,3072,NULL,1,NULL,'Digital Tire Gauges','PSI',NULL,0,1,0,0,5584,NULL,NULL),(4018,3367,NULL,1,NULL,'Pistol Grip Blow Guns','Lance Length','<p>\r\n	Comfort grip squeeze handle allows variable air volume. Built in hang-up hole allows for easy storage. Angled nozzle allows easy access to hard to reach areas. 1/4&quot; NPT air inlet.</p>\r\n',0,1,0,0,7528,NULL,NULL),(4020,3072,NULL,157,NULL,'4 Way Valve Tool',NULL,'<p>\r\n	Removes core. Taps both internal and external threads and reams internal bore.</p>\r\n',0,0,1,0,5879,NULL,NULL),(4021,3367,NULL,NULL,NULL,'Tire Inflator with Dial Gauge',NULL,'<p>\r\n	Tire inflator has a built in air pressure gauge from 0 - 170 PSI. The rubber flex hose with valve gripper allows this inflator to be used in tight spots. Comes with a 1/4&quot; male pipe thread connector.</p>\r\n',0,1,0,0,7449,NULL,NULL),(4022,3367,NULL,157,NULL,'6 Inch Dual Air Chuck',NULL,'<p>\r\n	This heavy duty tire chuck is great for filling dual tires and tires with hard to get at stems. Each tire chuck comes complete with a quick coupler and 1/4&quot; female pipe thread connector for fast changes from tire chuck to air tools.</p>\r\n',0,1,0,0,7527,NULL,NULL),(6017,2049,NULL,NULL,NULL,'Stainless Steel Flexible Connector, NPT Ends','Size','<p>\r\n	Flexible stainles steel connectors are generally selected where rubber connectors are not suitable. For example, in permanent piping installations where flexibility is required, extreme high or low temperature applications, or corrosive, combustible or toxic environments. Male NPT hex fittings are welded to hose. All assemblies are 100% factory tested. Works up to 800<span class=\"st\">C, but working pressure decreases as temperature increases. Braiding is type 321 stainless steel, helical corrugated. All assemblies are 12&quot; in length.</span></p>\r\n',0,0,1,0,6007,NULL,''),(6018,2049,NULL,NULL,NULL,'Stainless Steel Flexible Connector, Floating Flanged Ends','Size','<p>\r\n	Flexible stainles steel connectors are generally selected where rubber connectors are not suitable. For example, in permanent piping installations where flexibility is required, extreme high or low temperature applications, or corrosive, combustible or toxic environments. 150# floating flanges on each end. All assemblies are 100% factory tested. Works up to 800<span class=\"st\">C, but working pressure decreases as temperature increases. Braiding is type 321 stainless steel, annular corrugated. All assemblies are 12&quot; in length.</span></p>\r\n',0,0,1,0,6008,NULL,''),(7002,3312,NULL,NULL,NULL,'Universal Silencer 81-1203 Replacement Filter, Pleated Polyester, 5.8\" O.D., 4.3\" I.D., 2.5\" Height',NULL,'<p>\r\n	End retainers are plastisol molds. Outer retainer is galvanized expanded metal. Inner retainer is galvanized wire screen. Media is pleated polyester (felt). Element is washable and reusable for exceptional life. Replaces Universal Silencer part no. 81-1203.</p>\r\n<ul>\r\n	<li>\r\n		Dimensions: 5.8&quot; O.D., 4.3&quot; I.D., 2.5&quot; Height.</li>\r\n</ul>\r\n',0,0,1,0,6985,NULL,''),(7807,3413,NULL,235,NULL,'Hypurion Spun Polypropylene Sediment Cartridges, 2-1/2\" OD, 40\" Length, Case of 20','Micron Rating','<p>\r\n	Fits Harmsco, Pentek, Waterite, Shelco and all other brands of filter housings that accept 2-1/2&quot; diameter standard filter cartridges. All cartridges are double open ended.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Filters listed here are 40&quot; in length. </strong></li>\r\n	<li>\r\n		<strong>All sizes below are sold and priced by the case of 20.</strong></li>\r\n</ul>\r\n',0,0,1,0,7784,NULL,''),(4028,3052,NULL,1,NULL,'Filter Restriction Gauge',NULL,'<p>\r\n	Universal\'s air filter restriction gauge ensures that filter elements are replaced and serviced when necessary. The yellow indicator in the gauge drops progressively as the filter element is loaded with dirt. When the indicator reaches the mark recommended by the manufacturer, it\'s time to change or service the filter.</p>\r\n',0,0,1,0,4028,NULL,NULL),(4029,3052,NULL,207,NULL,'Jet Air-Seal Diffusers',NULL,'<p>\r\n	Streams of air passing through Jet AIR-SEAL Diffusers are first broken up when passing through the sectioned orifice. Next, the rubber diaphragm blown aside by the force of in-rushing air continues breaking up the air stream. Finally, notches at the base of the diffuser break the air into still smaller bubbles giving a greater surface area for more contact with the wastewater. This greater bubble surface area transfers much more oxygen to the wastewater than larger bubbles do. The end result is high oxygen transfer efficiency and mixing action giving a smooth, even, fast aeration process.</p>\r\n<p>\r\n	These clog free, bottom discharge diffusers use a trapped bubble of air to keep wastewater out of the air pipes. Each diffuser can handle up to 12 CFM. Diffusers have 1/2&quot; diameter pipe threads. Diffuser measures 5&quot; diameter by 4-1/2&quot; hig</p>\r\n',0,0,1,0,4029,NULL,NULL),(4030,3052,NULL,1,NULL,'Perma Cap 5 Bubble Diffusers',NULL,'<p>\r\n	The check valve action of these coarse bubble diffusers makes them ideal for intermittent aeration requirements in digesters, SBR Plants and Extended Aeration Plants. 3/8&quot; NPT thread diffusers handle up to 15 CFM. 3/4&quot; NPT thread diffusers handle up to 20 CFM.</p>\r\n',0,0,1,NULL,4030,NULL,NULL),(4032,3265,NULL,154,NULL,'Justrite 28687 EcoPolyBlend Ramp',NULL,'<p>\r\n	Use this ramp for spill pallets that can hold two drums or more. 1000 pound capacity. 48&quot; width. 33&quot; length. 5.5&quot; height. UV protected poly material easily withstands acids, caustics and solvents.</p>\r\n',0,0,1,0,6353,NULL,NULL),(6987,3308,NULL,NULL,NULL,'Genesys LF Broad Spectrum Antiscalant','Size','<p>\r\n	Genesys LF has been developed as a broad spectrum liquid antiscalant for use in reverse osmosis and nano-filtration systems. It is effective at preventing inorganic scale, particularly calcium carbonate, iron and silica, thus reducing the frequency of membrane replacement and cleaning.</p>\r\n<p>\r\n	Genesys LF should be dosed continuously to the feed water upstream of the cartridge filters. Typical dosage rates are 2 - 4 mg/L. This product can be diluted and is fully miscible with water in all proportions. Meets NSF approvals.</p>\r\n',0,0,1,0,6970,NULL,''),(4034,3167,NULL,153,NULL,'5 Gallon Pail Truck',NULL,'<p>\r\n	55&quot; overall height, 20.5&quot; overall width. Handles up to four standard 5 gallon pails. Ergonomic design elminates the need to stack pails on a nose plate. 10&quot; semi-pneumatic wheels. Welded frame construction. 500 lbs capacity.</p>\r\n',0,0,1,0,4032,NULL,NULL),(4036,3167,NULL,87,NULL,'Low Profile Drum Truck',NULL,'<p>\r\n	Reduce injuries caused by manually lifting and moving drums. Transport (1) 30 or 55 gallon drum or (2) 5 gallon pails. Unit rolls easily on casters. Removable handle doubles as a bung nut wrench and seal remover. Steel construction. Yellow painted finish. 1200 lbs capacity.</p>\r\n',0,0,1,0,4034,NULL,NULL),(4037,3167,NULL,192,NULL,'Steel Deck Platform Truck','Size','<p>\r\n	Made of strong 14-gauge steel deck with a 2&quot; folded bottom lip for extra strength. Removable 1-1/4&quot; tubular chrome handle can be inserted into the double welded sockets at either end of platform. Two 5&quot; rigid and two 5&quot; swivel casters are made of non-marking rubber, which resists wet conditions, corrosive chemicals, and is good on uneven surfaces. Blue powder coat finish. Deck height is 8&quot;. Handle height is 36&quot;.</p>\r\n',0,0,1,0,4036,NULL,NULL),(4039,3167,NULL,1,NULL,'EZ Bucket Opener',NULL,'<p>\r\n	Opens and re-seals 2 to 5 gallon pails. Eliminates the need for a cutting device. Place the upper hook under the rim of the lid and push down on the handle, continuing around the rim to pry the lid free. Re-seal the lid by using the built-in hammer.</p>\r\n',0,0,1,0,4037,NULL,NULL),(4040,3167,NULL,153,NULL,'2\" Polyethylene Drum Faucet',NULL,'<p>\r\n	2&quot; polyethylene drum faucet features a drip catch bucket hook and a lockable handle to prevent unauthorized use. Good for viscous non-corrosive fluids. Includes three EPDM gaskets to ensure a proper fit. FDA approved.</p>\r\n',0,0,1,0,4039,NULL,NULL),(6986,3167,NULL,NULL,NULL,'Polyethylene Scoops','Size','<p>\r\n	Ideal for scooping and measuring of dry materials, including many dry/powder chemicals. Made of flexible, durable polyethylene. 52 oz. scoop measures 5.5&quot; wide X 7&quot; long. 104 oz. square scoop measures 6.5&quot; wide X 6&quot; tall X 10&quot; long and is calibrated in U.S. metric and imperial measurements.</p>\r\n',0,0,1,0,6969,NULL,''),(4041,3167,NULL,1,NULL,'Aluminum Drum Plug Wrench',NULL,'<p>\r\n	Wrench is spark-proof and safe around flammables. Offset handle design reduces user stress and minimizes knuckle injury. Designed to fit 2&quot; and 3/4&quot; drum plugs.</p>\r\n',0,0,1,NULL,4040,NULL,NULL),(4042,3079,NULL,26,NULL,'LMI 10 Gallon Chemical Tank',NULL,'<p>\r\n	Ultraviolet resistant, yellow polyethylene storage tank. Molded recess for mounting any LMI Series A, J or P pump. Large fill hole at top allows for easy replenishing of solution. Slightly translucent yet rugged design allows checking solution level at a glance. 14.20 inches in diameter, 17.75 inches in height.</p>\r\n',0,0,1,0,4042,NULL,NULL),(4043,3079,NULL,26,NULL,'LMI 35 Gallon Flooded Suction Tank',NULL,'<p>\r\n	Ultraviolet resistant, yellow polyethylene tank with recess for mounting of any LMI Series A, P or J pump. Fitted for mounting of agitator and liquid level switch. Provides an economical, all-in-one flooded suction installation. Less to assemble, less to maintain. Shut off valve, discharge tubing retainer and large upper fill hole complete this unique design. 5 gallon graduations. 20 liter graduations. Suitable for most corrosive and non-corrosive solutions. 20 inches in diameter, 31.25 inches in height.</p>\r\n',0,0,1,0,4044,NULL,NULL),(6976,3309,NULL,169,NULL,'EP75 Graffiti Remover','Qty','<p>\r\n	This graffiti remover is formulated with environmentally preferable ingredients. EP75 has low VOC\'s (Volatile Organic Compounds), all ingredients are biodegradable and there are no NPE\'s, no Methylene Chloride and no Butyl. EP75 will work fast and it will effectively remove spray paints, markers, and ink from both exterior and interior surfaces. EP75 is ideal for use on cement, brick, ceramic walls, metal lockers, desks and other hard surfaces.</p>\r\n',0,0,1,0,6959,NULL,''),(4044,3079,NULL,219,NULL,'Myers 50 Gallon Chemical Storage Tank',NULL,'<p>\r\n	High rigidity cover with molded recess for mounting of chemical pump and two agitators, or a liquid level control. Cover also has holes for filling and suction tubing. Self supporting tapered sides. Suitable for most corrosive and noncorossive solutions.</p>\r\n<p>\r\n	18.5&quot; diameter at bottom tapers to 22&quot; diameter at top. 40&quot; total height. 50 US gallons total capacity.</p>\r\n',0,0,1,0,4486,NULL,NULL),(6370,3261,NULL,155,NULL,'Non-Mercury Low Water Alarm w/ Float Switch','Float Switch Cable Length','<p>\r\n	The Tulsar Low Water Alarm is an all-in-one alarm package used to provide an audible and visual warning when a tank level is empty or when water drops to a certain level. This alarm can be used for water storage tanks or any tank that requires periodic filling. This alarm is equipped with a buzzer, a red alarm light, and a buzzer silence switch. The red low water alarm light remains lit until the water level is returned to an acceptable level. A test switch allows you to ensure that the alarm is operational. Comes complete with float switch cable, a non-mercury sensor float switch, an attractive and functional plastic control panel, and a six foot 120 volt power cord. CSA Certified and UL Listed.</p>\r\n',0,1,0,0,7451,NULL,''),(4046,3214,NULL,1,NULL,'Polypro Rotary Chemical Drum Pump',NULL,'<ul>\r\n	<li>\r\n		Glass filled polypropylene construction.</li>\r\n	<li>\r\n		Suitable for petroleum products, water, water-based chemicals, alcohol and mild alkaline products.</li>\r\n	<li>\r\n		360 degree rotation.</li>\r\n	<li>\r\n		Movable outlet spout.</li>\r\n	<li>\r\n		Pumps 60 GPM @ 70 revolutions.</li>\r\n	<li>\r\n		Supplied with 47&quot; polypropylene suction tube and 2&quot; NPT bung adapter.</li>\r\n	<li>\r\n		1&quot; OD barbed spout end.</li>\r\n	<li>\r\n		46&quot; polyethylene delivery hose included.</li>\r\n</ul>\r\n',0,0,1,NULL,4046,NULL,NULL),(4047,3214,NULL,1,NULL,'Beckson Acid Transfer Pump',NULL,'<p>\r\n	Designed to transfer most acids with relative ease. Shaft and body constructed of unique PVC compound, seals are patented and constructed of FKM. Operates by lifting action  no pressure hazards. Delivers 28 oz per stroke. Self priming and will not siphon. One-piece, molded copolymer polyethylene flexible discharge hose is 1-1/4&quot; ID X 6 length. Pump and hose withstand temps to 135F. UL listed for transferring sulfuric acid up to 50% concentrations. Includes 2 IPS bung adapter. Will pump liquids to 1.8 specific gravity.</p>\r\n',0,0,1,0,4047,NULL,NULL),(4048,3214,NULL,1,NULL,'Rotary Sodium Hypochlorite Drum Pump',NULL,'<p>\r\n	Designed for use with sodium hypochlorite in concentrations up to 20%, and other compatible chemicals. Features HDPE construction with Teflon vanes, Viton shaft seal and Hastelloy spring. For 15, 30 or 55 gallon drums with standard 2&quot; bung. Pumps 8 GPM. 1&quot; OD discharge.</p>\r\n',0,0,1,0,4048,NULL,NULL),(4049,3214,NULL,152,NULL,'Ezi-Action Chemical Drum Pump',NULL,'<p>\r\n	Polypropylene and polyethylene construction - chemical resistant. True double action pump  innovative, easy, patented pumping technology. Delivers on both the up and down stroke - continuous fast flow</p>\r\n<p>\r\n	Anti-pumping/safety device  deters access by children and unauthorised personnel. Pumps from base of container  all contents emptied. Leak free, secure fit fittings.</p>\r\n<p>\r\n	Constructed from FDA compliant plastics. Fully serviceable  dispense container after container, year after year. Spout style  Extender hose can be attached to outlet spout. Delivers 15 oz/stroke.</p>\r\n',0,1,0,0,4049,NULL,NULL),(7355,3374,NULL,NULL,NULL,'Daptex Plus Non-Expanding Latex Foam Sealant','Size, Qty','<p>\r\n	<span id=\"ctl00_ContentPlaceHolder1_lblProductDesc\">Designed to meet the tough standards demanded for professional window and door installations while effectively filling and sealing large cracks, gaps and voids. Unlike polyurethane foams, DAPtex Plus will not overexpand, is toolable, moldable and cleans up easily with water. Remains soft and flexible when dry so it will not bow, buckle or distort frames. </span></p>\r\n<p>\r\n	<span>The innovative latex polymer foam technology provides water resistance and is paintable with latex paints once cured. Helps reduce energy loss as well as pest infiltration. Ideal for sealing air leaks to improve energy efficiency and reduce heating and cooling costs. Non-clogging, reusable applicator. Indoor/outdoor use.</span></p>\r\n',0,0,1,1,7333,NULL,''),(4050,3215,NULL,26,NULL,'LMI Milton Roy Liquid Level Switches','Fits Tanks','<p>\r\n	115VAC, 50/60 Hz, max load: 3 amps. Corrosion resistant glass fiber reinforced polpropylene housing. Chemical resistant polypropylene float. Two receptacles are provided on the switch assembly housing. Stops your pump or mixer and starts the alarm when liquid level descends to within one inch of the end of the float tube.</p>\r\n',0,0,1,0,6348,NULL,NULL),(7721,3321,NULL,NULL,NULL,'LMI Syphon Breakers','Connection ','<p>\r\n	LMI\'s syphon breaker, when installed in-line on the pump\'s discharge tubing line, offers added protection against syphoning and enhances pump priming capabilities.</p>\r\n<p>\r\n	This safety valve is recommended in all fluoridation applications as secondary anti-syphon protection. It may be used wherever auto priming and/or protection against syphoning is a requirement.</p>\r\n<p>\r\n	Under syphoning conditions, negative pressure draws a floating ball away from the atmospheric vent, thus allowing air to enter the chamber and break syphoning action. When prime is lost, the ball drops, opening the system to atmosphere, allowing the pump to self prime.</p>\r\n<p>\r\n	The clear acrylic body and cap houses a teflon ball, polypropylene ball and Polyprel seal rings.</p>\r\n<p>\r\n	The Syphon breaker should always be installed in the discharge line vertically at least 2 feet above the maximum level of liquid in the supply tank.</p>\r\n',0,0,1,0,7699,NULL,''),(4052,3215,NULL,26,NULL,'LMI Milton Roy 10998 Corporation Stop & Nozzle Assembly',NULL,'<p>\r\n	Injects chemical into the center of the water flow. Maximum 150 PSI. Accepts 1/2&quot; NPT injection check valve.</p>\r\n',0,0,1,0,6350,NULL,NULL),(6264,3191,NULL,14,7,'LMI Milton Roy Roytronic Series B, B921-D90HI, 2.5 GPH, 100 PSI, Programmable Electronic Metering Pump',NULL,'<p>\r\n	NSF &amp; cUL approved.</p>\r\n<p>\r\n	Roytronic Series B pumps offer a new robust design with the high end performance you expect from LMI.</p>\r\n<p>\r\n	The new AutoPrime Liquid End automatically and continuously purges entrapped air from process fluid. It also eliminates air binding when used with liquids such as sodium hypochlorite.</p>\r\n<p>\r\n	The tubing line includes ferrule designed fittings that set a new standard for secure, leak-proof tubing connections.</p>\r\n<p>\r\n	Type 9 configuration. This configuration allows the user to control the pump manually or by an external signal generated by a flowmeter, controller, transmitter, PLC or other device.</p>\r\n<p>\r\n	LCD screen provides user with operational status.</p>\r\n<p>\r\n	5-level power control reduces system shock and extends life of pump.</p>\r\n<p>\r\n	Pump kit includes instructions, suction and discharge valves, and tubing. Everything you need to get started!</p>\r\n<p>\r\n	<strong>Maximum output of 2.5 GPH, 60.0 GPD. Maximum PSI of 100. </strong><strong>3/8&quot; O.D. </strong><strong>tubing . </strong></p>\r\n',0,0,1,0,6254,NULL,''),(6282,3194,NULL,14,7,'LMI Milton Roy Roytronic RPM Pro Pac Pump Repair Kit, RPM-940A',NULL,'<p>\r\n	A RPM Pro Pac pump repair kit contains everything needed to maintain optimum performance in LMI\'s Roytronic series of metering pumps. Containing only quality, recommended replacement parts, these kits provide an easy, economical solution to annual pump maintenance.</p>\r\n<p>\r\n	Kit includes: diaphragm, cartridge valve assemblies, check balls, valve seats, o-rings, and pump head screws.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 940AX, 940HX, 948AX, 948HX</strong></p>\r\n',0,0,1,0,6272,NULL,''),(6272,3192,NULL,14,7,'LMI Milton Roy Roytronic Series A, A141-910HI, 0.25 GPH, 150 PSI, Dual Dial Metering Pump',NULL,'<p>\r\n	NSF &amp; cUL approved.</p>\r\n<p>\r\n	These metering pumps are designed for reliable metering of sodium hypochlorite.The new AutoPrime Liquid End automatically and continuously purges entrapped air from process fluid. It also eliminates air binding when used with liquids such as sodium hypochlorite.The tubing line includes ferrule designed fittings that set a new standard for secure, leak-proof tubing connections.Dual manual control of stroke speed and stroke length are provided.</p>\r\n<p>\r\n	Pump kit includes instructions, suction and discharge valves, and tubing. Everything you need to get started!</p>\r\n<p>\r\n	<strong>Maximum output of 0.25 GPH, 6.0 GPD. Maximum PSI of 150. </strong><strong>1/4&quot; O.D. </strong><strong>tubing . </strong></p>\r\n',0,0,1,0,6262,NULL,''),(6141,3111,NULL,72,NULL,'Garant Muck Scoop',NULL,'<ul>\r\n	<li>\r\n		4.5 lb head weight w/ 32&quot; premium varnished ash handle w/ safety grip.</li>\r\n	<li>\r\n		Cleans up small amounts of muck in akward areas.</li>\r\n	<li>\r\n		Specialized shape allows workers to move muck behind through legs</li>\r\n</ul>\r\n',0,0,1,NULL,6131,NULL,''),(6291,3195,NULL,35,7,'LMI Milton Roy Liquipro RPM Pro Pac Pump Repair Kit, RPM-352/358',NULL,'<p>\r\n	A RPM Pro Pac pump repair kit contains everything needed to maintain optimum performance in LMI\'s Roytronic series of metering pumps. Containing only quality, recommended replacement parts, these kits provide an easy, economical solution to annual pump maintenance.</p>\r\n<p>\r\n	Kit includes: diaphragm, cartridge valve assemblies, check balls, valve seats, o-rings, and pump head screws.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 352, 358, 450, 458</strong></p>\r\n',0,0,1,0,6281,NULL,''),(6289,3161,NULL,14,7,'LMI Milton Roy Roytronic 3/8\" Ferrule Set, 50509',NULL,'<p>\r\n	Sold per set.</p>\r\n<p>\r\n	Not reusable.</p>\r\n<p>\r\n	Replace when replacing tubing.</p>\r\n',0,0,1,0,6303,NULL,''),(6290,3161,NULL,14,7,'LMI Milton Roy Roytronic 1/2\" Ferrule Set, 50510',NULL,'<p>\r\n	Sold per set.</p>\r\n<p>\r\n	Not reusable.</p>\r\n<p>\r\n	Replace when replacing tubing.</p>\r\n',0,0,1,0,7701,NULL,''),(5931,3161,NULL,14,7,'LMI Roytronic Injection Valve Assembly',NULL,'<p>\r\n	Roytronic injection valve fits LMI series A, B, C, and P metering pumps.</p>\r\n<p>\r\n	Injection valve body is 1/2&quot; MNPT. It will thread into most chemical injection ports.</p>\r\n<p>\r\n	Roytronic injection valve fits 1/4&quot;, 3/8&quot; and 1/2&quot; tubing sizes. The appropriate sized tubing connection kit must be ordered separately.</p>\r\n',0,0,1,0,5921,NULL,''),(4070,3164,NULL,26,7,'LMI Milton Roy Non-LiquiPro Pump Repair Kit, SP-U3',NULL,'<p>\r\n	These LMI pump repair kits contain all parts needed to maintain performance in most discontinued models of A, B and P series of LMI metering pumps. Contains quality recommened parts that provide an easy economical solution to annual pump maintenance.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 81FS, 91FS</strong></p>\r\n',0,0,1,NULL,4070,NULL,NULL),(4071,3163,NULL,36,NULL,'Pulsatron Pulsafeeder KOPkit Pump Repair Kit, K2VTC1',NULL,'<p>\r\n	A Keep On Pumping kit can help you cut downtime and put you back in business fast. Use KOPkits for preventative maintenance to ensure continuous high performance from your Pulsatron metering pump. KOPkit ordering codes are conveniently located on the pump nameplate.</p>\r\n<ul>\r\n	<li>\r\n		Kit includes: instructions, pump head, diaphragm, machine screws, suction valve set, seal set, and tubing connector set.</li>\r\n	<li>\r\n		<strong>This kit is for wet end VTC1, head size 2</strong></li>\r\n</ul>\r\n',0,0,1,0,4071,NULL,NULL),(4072,3143,NULL,65,NULL,'General Pipe Cleaners KR-C-WC Kinetic Water Ram',NULL,'<p>\r\n	Here\'s a compact, light weight tool for quickly opening clogged sinks, toilets and tubs. It handles rust, grease, sediment, and scale in lines up through 4&quot; in diameter.<br />\r\n	<br />\r\n	The Kinetic Water Ram uses a burst of compressed air that drives a shock wave (kinetic energy) through water to break up stoppage. It\'s particularly useful when the stoppage is on the far side of a drum trap or series of tight bends, since the shock wave can travel around bends without losing its force.<br />\r\n	<br />\r\n	The Ram has a self-contained pump and gearless pressure gauge, so you can hit the stoppage with just the right amount of force. You get instant impact with no build-up of pressure in the plumbing system. The force is transmitted through water, so it\'s not affected by stacks or vents. Ram is also equipped with Schraeder valve for use with external air compressor for those more difficult stoppages.<br />\r\n	<br />\r\n	A toilet attachment screws onto the front of the Ram and enables you to position the cone in the bowl to get a tighter seal. As a result, you can strike the blockage with greater impact without causing splash back.<br />\r\n	<br />\r\n	Other standard aceessories include a caulking hose, 4&quot; rubber cone and a set of 5 tapered rubber plugs for sealing openings from 1-1/4&quot; through 4&quot;.</p>\r\n',0,0,1,0,5764,NULL,NULL),(4073,3143,NULL,1,NULL,'Master Plunger MP100',NULL,'<p>\r\n	Has seven times more plunge per push than your average rubber cup plunger&nbsp; Fits in sinks, garbage disposals, drains, and toilets. Patented nozzle design prevents slippage and splash back.</p>\r\n',0,1,0,0,4072,NULL,NULL),(4074,3143,NULL,18,NULL,'Ridgid 59797 K-6 Toilet Auger, 6 Ft Cable w/ Bulb Head',NULL,'<p>\r\n	High quality tool in 6 foot length provides fast and safe clearing of toilet obstructions. 6 foot toilet auger with bulb head. Vinyl guard to protect porcelain. Durable, kink-resistant, 1/2&quot; compression-wrapped inner core cable. Large, ergonomically designed handles. Able to negotiate water-conserving toilets</p>\r\n',0,1,0,0,7204,NULL,NULL),(5772,3143,NULL,65,NULL,'General Pipe Cleaners 3FL-DH Flexicore Closet Auger, 3 Foot Cable',NULL,'<p>\r\n	Two layers of tempered spring steel are coiled tightly over a core of 49-strand wire rope. It gives the tool tremendous resistance to kinking. Unit has a flexible down head which follows bowl contours, springs through sharply angled passages, while also protecting inner walls from chipping or breaking. Cable is 3 feet in length.</p>\r\n',0,0,1,0,4073,NULL,''),(7044,3327,NULL,65,NULL,'General Pipe Cleaners Sectional Cable, Small Diameter','Size','<p>\r\n	For use with General\'s Root 66 and I-95 sectional cable machines, these cables will help you get the job done.</p>\r\n<p>\r\n	7/8&quot; cable is used for clearing 4&quot; lines.</p>\r\n<p>\r\n	5/8&quot; cable is used for clearing 2&quot; - 3&quot; lines.</p>\r\n<p>\r\n	5/16&quot; cable is used for clearing 1-1/2&quot; - 2&quot; lines. Must be used with a drum.</p>\r\n',0,0,1,0,7027,NULL,''),(4078,3048,NULL,207,NULL,'Bio Jet 7 Bacterial Supplement, 1 Gallon Container','Size','<p>\r\n	BioJet 7 is formulated to replenish and supplement bacterial populations and functions in wastewater treatment plants, lift stations, septic tanks, sand filters, drain lines, commercial grease traps and lagoons. It contains patented bacteria strain to quickly degrade detergents, tissue, fats, oil and greases as they digest starches, cellulose, protein and vegetable gum. Helps to overcome related problems such as odor and excessive solids accumulation.</p>\r\n<p>\r\n	By improving the oxidation of fats, oils, grease, and detergents, Bio Jet 7 can reduce the required aeration capacity. It can also reduce your need to use chemical settling acids (polymers), cut your energy costs, save defoamer expenses, cut down on routine maintenance, and lower your overall labor costs.</p>\r\n<p>\r\n	No dangerous chemicals to worry about - Bio Jet 7 is approved for waste related applications by the USDA. It is non-toxic, and will not damage equipment or harm the environment.</p>\r\n<p>\r\n	Bio Jet 7 Bacterial Supplement is available in 1-gallon, a case of (4) 1-gallon containers,</p>\r\n',0,0,1,0,4078,NULL,NULL),(4398,2040,NULL,1,NULL,'Brown Hollow Coffee Stirrer','','6\" in length, 1000 stirrers per pack.',0,0,1,NULL,4398,NULL,NULL),(4080,3295,NULL,65,NULL,'General Pipe Cleaners P-ME-A-S Metro Rooter',NULL,'<p>\r\n	The MetroRooter is a tough root cutting machine in a compact, lightweight package, at a price thats easy on tight budgets. With 75 feet of 5/8&quot; cable it handles roots and other difficult obstructions in 3&quot; to 6&quot; lines  ideal for drain cleaners, plumbers, contractors and building maintenance. This easy to use, one-person operation machine is light enough to take down to the basement or up on the roof.<br />\r\n	<br />\r\n	The MetroRooter has many of the features of the bigger capacity root cutting machines, including a variable speed Power Cable Feed that drives and retracts 9/16&quot;, 5/8&quot;, and 3/4&quot; cable at up to 20 ft. per minute. The heavy-duty powder coated steel drum holds 100 ft. of 9/16&quot; cable for inside lines, 75 ft. of 5/8&quot; cable for roots, or 50 ft. of 3/4&quot; cable for tough jobs. Plus, it features a unique self-aligning Flexitube distributor tube to reduce cable tangling.<br />\r\n	<br />\r\n	The MetroRooters heavy-duty reinforced frame and drum support shaft takes rough handling in the field. The 1/3 hp capacitor motor has plenty of power to drive more than 100 ft. of cable. A passive brake system holds the machine in place on the job or in your truck. The ten-inch heavy-duty wheels and a truck loading wheel make it easier for you to transport the machine to and from the job. A cutter holder on the frame keeps all the cutters within easy reach.<br />\r\n	<br />\r\n	Includes 75\' of 5/8&quot; cable, power cable feed, guide tube, arrow head cutter, 1-1/2&quot; U-cutter, 2&quot; U-cutter and a small retrieving tool.</p>\r\n',0,0,1,0,4080,NULL,NULL),(6515,3143,NULL,18,NULL,'Ridgid 62535 One-Piece Flat Sewer Tape, 50 Ft Length, 1/2\" Width, 1/16\" Thick',NULL,'<ul>\r\n	<li>\r\n		For use on drains from 3/4&quot; to 1-1/2&quot;.</li>\r\n	<li>\r\n		Includes carrier for easy transportation.</li>\r\n	<li>\r\n		Has a hand grip, as well as a spear point at one end and roller ball at the other.</li>\r\n	<li>\r\n		50 feet in length, 1/2&quot; in width, 1/16&quot; thick.</li>\r\n</ul>\r\n',0,1,0,0,6505,NULL,''),(6516,3143,NULL,18,NULL,'Ridgid 62555 One-Piece Flat Sewer Tape, 50 Ft Length, 3/4\" Width, 1/16\" Thick',NULL,'<ul>\r\n	<li>\r\n		For use on drains from 2&quot; to 4&quot;.</li>\r\n	<li>\r\n		Includes carrier for easy transportation.</li>\r\n	<li>\r\n		Has a hand grip, as well as a spear point at one end and roller ball at the other.</li>\r\n	<li>\r\n		50 feet in length, 3/4&quot; in width, 1/16&quot; thick.</li>\r\n</ul>\r\n',0,1,0,0,6506,NULL,''),(6520,3143,NULL,65,NULL,'General Pipe Cleaners One-Piece Flat Sewer Rods','Length, Width, Thickness','<p>\r\n	Made from non-kinkable, high carbon, oil tempered steel. All sizes equipped with aluminum grip handle and spear head. Oil tempered spring steel is resistant to rusting and kinking. The rod is bolted to the frame at the back, so it can\'t spring out of the frame when you near the end. A comfortable, efficient Quick-Grip handle makes the work go faster.</p>\r\n<ul>\r\n	<li>\r\n		<strong>1/2 In. X 1/16 In. sizes for 2 to 3 In. pipes.</strong></li>\r\n	<li>\r\n		<strong>1/2 In. X 1/8 In. sizes for 2 to 4 In. pipes.</strong></li>\r\n	<li>\r\n		<strong>3/4 In. X 1/16 In. sizes for 2 to 4 In. pipes.</strong></li>\r\n	<li>\r\n		<strong>3/4 In. X 1/8 In. sizes for 4 to 6 In. pipes.</strong></li>\r\n	<li>\r\n		<strong>1 In. X 1/8 In. sizes for 4 to 8 In. pipes</strong>.</li>\r\n</ul>\r\n',1,0,1,0,5765,NULL,''),(7047,3327,NULL,65,NULL,'General Pipe Cleaners Sectional Cable Carrier, Small Diameter','Size','<p>\r\n	Use a cable carrier to help keep your extra cable organized.</p>\r\n',0,0,1,0,7030,NULL,''),(6509,3143,NULL,42,NULL,'Test Tite Drain Flush',NULL,'<p>\r\n	Connects to garden hose to safely, cleanly and easily clear drain pipes of obstructions with pulsating water pressure. Works in minutes without the use of harsh chemicals. Effective up to 1000\'. Completely reusable.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Use the 1&quot;- 2&quot; model (# 83500) for shower or bathtub drains, washer drains, and sink drains.</strong></li>\r\n	<li>\r\n		<strong>Use the 1-1/2&quot;- 3&quot; model (# 83505) for shower or bathtub drains, washer drains, and sink drains.</strong></li>\r\n	<li>\r\n		<strong><strong>Use the 3&quot; - 6&quot; model (# 83515) for main drains, surface drains and basement drains.</strong></strong></li>\r\n</ul>\r\n',0,1,0,0,6504,NULL,''),(4085,3220,NULL,77,NULL,'Magikist PJDX-C Pulse Jet De-Icer',NULL,'<p>\r\n	Provides the safest, most effective method for thawing frozen water service lines, without the fire risk associated with other thawing methods. This industrial quality de-icer can be used on plastic, copper and iron service lines. Stainless steel water reservoir holds 9 gallons. Immersion heater pre-warms water.</p>\r\n<p>\r\n	Flow/Pulse control allows the operator to select between high pulse to feed the tubing down the line, or maxium flow to allow for maximum thawing. Probe tip is self-feeding and self-centering to assist in moving tubing down water line. Extra long return hose allows unit to be operated at a distance from the water line. Includes valve for controlling water return to reservoir.</p>\r\n<p>\r\n	Completely self contained one person operation. Compact design allows unit to be moved up and down staircases by just one person. Pneumatic wheels allow for easy movement over any surface.</p>\r\n<p>\r\n	TEFC electric motor operates from standard 115V outlet. High quality pump has bronze and stainless steel wetted parts. Comes complete with reel, 100 feet of 5/16&quot; red tubing, and a probe tip.</p>\r\n',0,0,1,0,4085,NULL,NULL),(6787,3049,NULL,65,NULL,'General Pipe Cleaners HECS 5 Piece Cutter Set',NULL,'<p>\r\n	Replacement 5 piece cutter set for the Super-Vee, Power-Vee, and Handylectric. Includes arrow head, boring gimlet, flexible arrow head, downhead boring gimlet, and side cutter blade.</p>\r\n',0,0,1,0,6771,NULL,''),(6788,3049,NULL,65,NULL,'General Pipe Cleaners CAA Closet Auger Attachment',NULL,'<p>\r\n	Guides 1/4&quot; or 5/16&quot; cable into toilet bowl. Compatible with any machine that uses 1/4&quot; or 5/16&quot; cable.</p>\r\n',0,0,1,0,6772,NULL,''),(6789,3049,NULL,65,NULL,'General Pipe Cleaners HST Handy-Stand',NULL,'<p>\r\n	This rugged stand turns your hand-held drain cleaners into practical countertop or floor machines. Ergonomically balanced for maximum stability, the lightweight portable Handy-Stand fits the Super-Vee, Power-Vee, and Handylectric.</p>\r\n<p>\r\n	Can be positioned either horizontally or vertically for optimal job-site flexibility. Four-point base for increased stability. Power cord holder for fewer work obstructions. Lift handle that doubles as a spare cable cartridge holder.</p>\r\n',0,0,1,0,6773,NULL,''),(4087,3000,NULL,147,NULL,'Gates Truflex Type 3L V-Belts',NULL,'<p>\r\n	Suitable for all industrial light duty applications, usually using fractional horsepower (FHP) motors.</p>\r\n<p>\r\n	Gates Curves provide proper cord support and full contact with the sheave-groove for uniform loading, uniform wear, and increased belt life.</p>\r\n<p>\r\n	Flex Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</p>\r\n<p>\r\n	The Flex-Weave<span class=\"st\"> Cover is a patented construction for longer cover life, providing extended protection to the core of the belt from oil, dirt, and heat.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,4087,NULL,NULL),(4088,3000,NULL,147,NULL,'Gates Tri-Power Type AX V-Belts',NULL,'<p>\r\n	Constructed with Gates proprietary construction, this belt has a superior combination of flex and load carrying capacity, as well as less stretch resulting in less maintenance.</p>\r\n<p>\r\n	Suitable for all industrial applications, particularly where small or sub-minimal sheave diameters are required.</p>\r\n<p>\r\n	Notches molded into the belt during manufacturing make this belt well suited for drives with smaller diameter sheaves.</p>\r\n<p>\r\n	Belt Edge is machined for even sheave groove contact resulting in less slip and wear.</p>\r\n<p>\r\n	<span class=\"st\">Flex-Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,5629,NULL,NULL),(4089,3000,NULL,147,NULL,'Gates Hi-Power II Type B V-Belts',NULL,'<p>\r\n	Featuring a composite, multi-purpose construction, these belts resist oil and heat, ozone, sunlight, weather, and aging.</p>\r\n<p>\r\n	Suitable for all industrial applications, including v-flat drives</p>\r\n<p>\r\n	Gates Curves provide proper cord support and full contact with the sheave-groove for uniform loading, uniform wear, and increased belt life.</p>\r\n<p>\r\n	Flex Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</p>\r\n<p>\r\n	The Flex-Weave<span class=\"st\"> Cover is a patented construction for longer cover life, providing extended protection to the core of the belt from oil, dirt, and heat.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,5625,NULL,NULL),(4090,3000,NULL,147,NULL,'Gates Super HC Type 3VX Molded Notch Belts',NULL,'<p>\r\n	Constructed with Gates proprietary construction, this belt has a superior combination of flex and load carrying capacity, as well as ltransmitting more horsepower than the classical cross sections in the same amount of drive space.</p>\r\n<p>\r\n	Suitable for all industrial applications, particularly where space, weight and horsepower capacity are critical.</p>\r\n<p>\r\n	Notches molded into the belt during manufacturing make this belt well suited for drives with smaller diameter sheaves.</p>\r\n<p>\r\n	Belt Edge is machined for even sheave groove contact resulting in less slip and wear.</p>\r\n<p>\r\n	<span class=\"st\">Flex-Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,5636,NULL,NULL),(4091,3001,NULL,1,NULL,'One Piece EPDM Sure Flex Coupling Insert','OD X Width','<p>\r\n	Sure-Flex insert couplings can be installed quickly and easily because there are no bolts, gaskets, covers or seals. Alignement can be checked with a straight edge placed across the outside of the precision machined flanges. No special tools are required for installation, alignement or removal. This EPDM flexible coupling insert is ideal for general purpose use and remains flexible from -30F to 275F.</p>\r\n',0,0,1,0,4091,NULL,NULL),(4381,3001,NULL,1,NULL,'Split One Piece EPDM Sure Flex Coupling Insert','OD X Width','<p>\r\n	This one piece JES split sleeve with saw cut permits insert coupling replacement where there is insufficient gap between shafts. This EPDM flexible coupling insert is ideal for general purpose use and remains flexible from -30F to 275F.</p>\r\n',0,0,1,0,4381,NULL,NULL),(7715,3001,NULL,NULL,NULL,'Sure Flex Type J Coupling Flanges','Size','<p>\r\n	Type J flanges sizes 3.4 and 5 are manufactured of sintered carbon steel. The powdered metal manufacturing process provides high dimensional accuracy and uniform material properties for high strength. Size 6 is made of high strength cast iron.<br />\r\n	All flanges are bored-to-size for a slip fit on standard shafts. The outside diameter of the flange is machined so the surface can be used to check alignment without a special tool.</p>\r\n<p>\r\n	Each flange has a keyseat and one (1) setscrew over the keyway. All have a setscrew at 90 from the keyway. &quot;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n',0,0,1,0,7692,NULL,''),(7635,3039,NULL,NULL,NULL,'Basic PVC Swing Check Valve','Size','<p>\r\n	Socket weld ends. For water and sewage use.</p>\r\n',0,0,1,0,7612,NULL,''),(7638,3040,NULL,171,NULL,'Apollo 60A Series Stainless Steel Needle Valves','Size','<p>\r\n	Apollo\'s stainless steel needle valves are ideally suited for use in instrumentation, sampling lines and flow control applications.</p>\r\n<p>\r\n	Backseat stem designs helps take the pressure off the packing, thereby prolonging the packing life. The backseat also prevents the stem from being accidently turned out of the valve. Externally adjustable PTFE packing. 100% pressure tested. 5000 psig maximum operating pressure. FNPT ends.</p>\r\n',0,0,1,0,7615,NULL,''),(6926,3040,NULL,185,NULL,'RIV Piston Gate Valve, NPT Threads','Size','<p>\r\n	Use these all-bronze piston action valves on septic trucks and tanks. They\'re specifically designed, refined and cast for the liquid waste industry. Valves feature high-quality solid bronze fittings for reliability. Detachable bolt cap for inspections. Made in Italy. NPT threads. Operating handle available separately.</p>\r\n',0,0,1,0,6910,NULL,''),(6631,3216,NULL,NULL,NULL,'1 Inch Heavy-Duty Nylon Ratchet Tie-Down Strap Assemblies w/ Wire Hooks','Length','<ul>\r\n	<li>\r\n		Assembly break strength of 2,500 pounds.</li>\r\n	<li>\r\n		Working load limit of 833 pounds.</li>\r\n	<li>\r\n		Heavy gauge steel ratchet handle includes safety lock to ensure load security.</li>\r\n	<li>\r\n		Industrial grade stitching helps prevent strap breakage.</li>\r\n	<li>\r\n		Steel double j-hook provides exceptional strength and ease of attachment.</li>\r\n</ul>\r\n',0,0,1,0,5639,NULL,''),(4097,2010,NULL,1,NULL,'GFCI Protected Tri-Cord',NULL,'<p>\r\n	Creates a safe environment in damp, wet areas to reduce the risk of electric shock. PVC housing resists moisture, chemicals, and sunlight. Waterproof mechanism allows indoor/outdoor use. 12/3 AWG. 20 Amps/125V/2500 Watts. LED power indicator. Reset and test buttons. Meets cUL requirements.</p>\r\n',0,0,1,0,4097,NULL,NULL),(4098,2010,NULL,135,NULL,'Ericson 1610-CW6P Perma-Tite 2 Connector, 125V, 15A',NULL,'<p>\r\n	&nbsp;Perma-Tite 2 connectors are engineered and manufactured to the highest quality standards to provide the ultimate in electrical service and protection. They are designed and proven to do their best under the worst conditions in a broad array of the most severe food processing, industrial, marine, construction and petro-chemical work environments.</p>\r\n<ul>\r\n	<li>\r\n		UL Listed &amp; CSA Certified</li>\r\n	<li>\r\n		Tongue and groove sealing system provides environmental protection of :NEMA Type 4, 4X, 6, 6P &amp; IP67</li>\r\n	<li>\r\n		Devices resist high-pressure hose down of 1000 psi.</li>\r\n	<li>\r\n		Connector body made with PBT chosen for its high resistance to moisture absorption, high voltage arcing and carbon tracking.</li>\r\n	<li>\r\n		Keyed body and cover for easy alignment/assembly</li>\r\n	<li>\r\n		Color coded sealing bushings are provided to fit a variety of cord diameters</li>\r\n	<li>\r\n		Removable/replaceable self-retained sealing cap provided with connector to keep out contaminants when not in use.</li>\r\n	<li>\r\n		Transparent back-plate makes for quick visual wiring checks.</li>\r\n	<li>\r\n		Corrosion resistant nickel plated blades.</li>\r\n	<li>\r\n		Impact, corrosion, crushing and chemical resistant.</li>\r\n</ul>\r\n',0,0,1,NULL,6174,NULL,NULL),(6942,3178,NULL,149,NULL,'Yellow Commercial Extension Cord, 10 Gauge, 2 Ft Cord, 3 Outlet',NULL,'<p>\r\n	Commercial grade 10 gauge extension cord is construced with STW cable, making it a hard serving, weather and water resistant outdoor-use cord. Extremely flexible from -40C to 105C. LED power indicator. 3 conductors grounded. Weather and water resistant. Plugs in to any standard 120V wall outlet, allowing up to three devices to be connected. PVC housing resists moisture, chemicals, and sunlight. Meets cUL requirements.</p>\r\n',0,0,1,0,6925,NULL,''),(4100,2010,NULL,NULL,NULL,'Ultimate Surge Protector, 10 Outlets, 6 Ft Cord',NULL,'<p>\r\n	(10) surge protected transformer spaced outlets (5 outlets on each side). (1) Broadband ethernet protection port. (3) phone/fax line protection ports. (4) Coaxial protection ports (safeguards your cable/satellite signal). (2) USB chargers. Two lights to indicate equipment is protected and grounded. Power on/off switch. 6 foot 3-wire grounded power cord. 125V, 15A, 60 Hz, 1875W, 3000 Joules. Meets cUL requirments.</p>\r\n',0,0,1,0,4098,NULL,NULL),(4101,2011,NULL,57,NULL,'Raintight Weather Resistant NEMA 4X Thermostat',NULL,'<p>\r\n	The TF115 NEMA 4X Thermostat is designed specifically for use in applications requiring a rugged, weather resistant, durable control for both heating and cooling (ventilation) in agricultural, industrial and commercial environments.</p>\r\n<ul>\r\n	<li>\r\n		NEMA 4X Enclosure</li>\r\n	<li>\r\n		Rugged weather resistamt enclosure made of corrosion resistant materials for long life.</li>\r\n	<li>\r\n		Low mass, high surface area of stainless steel coiled sensor provides rapid response to temperature change.</li>\r\n	<li>\r\n		Large, readily visible dial with 40<span class=\"st\"> - 100</span><span class=\"st\">F temperature range.</span></li>\r\n	<li>\r\n		<span class=\"st\">Multi-positional mounting offers flexibility in either new or existing installations.</span></li>\r\n	<li>\r\n		<span class=\"st\">One control for both heating and cooling applications.</span></li>\r\n	<li>\r\n		<span class=\"st\">UL listed and CSA Certified.</span></li>\r\n</ul>\r\n',0,0,1,NULL,4101,NULL,NULL),(4102,2011,NULL,57,NULL,'King Electric KCH2440T Portable Fan Heater, 4000W, 240V',NULL,'<p>\r\n	240 Volt, 1 Phase, 4000W, portable fan heater has a built-in thermostat (60F to 170F). This high power heater is designed to provide a back-up heating source at an affordable price. The convenient 6 foot cord allows greater mobility to areas needing heating. Easily set the desired temperature with the built-in thermostat. A high limit temperature control with automatic reset provides overheat protection. Tubular steel heating elements for outstanding durability and long life. 300 CFM fan. Grounded 3-prong plug. High temperature control with automatic reset. Electrical insulating mica plates. 51 F temperature rise. 6 ft electric cord. Handle used as cord reel. Meets cETL requirements.</p>\r\n',0,0,1,0,4102,NULL,NULL),(7711,2011,NULL,57,NULL,'King Electric PUH1215T Portable Workshop Radiant Heater, 120V',NULL,'<p>\r\n	The King Electric portable workshop radiant heater is designed to provide a back-up heating source at an affordable price. Perfectly suited for small workshop areas. The convenient 6 foot cord allows greater mobility to areas needing heat. Easily set the desired temperature with the built-in thermostat. The auto-reset high-limit temperature control provides overheat protection.</p>\r\n<p>\r\n	120V - 750W/1500W. 2 dual on/off rocker switches with power indicator (750W ea.). 6 foot cord with 15A grounded plug. Rugged steel construction. Durable scratch and rust resistant finish. Comfort grip handle. Auto-reset safety limit ensures the heater shut off if an unsafe condition occurs. Ceramic heating element. Permanently lubricated motor ensures long life. Meets cETL requirements.</p>\r\n',0,0,1,0,7688,NULL,''),(4103,2011,NULL,57,NULL,'King Electric PWH2424 Industrial Portable Unit Heater, 240V, 2400W',NULL,'<p>\r\n	The King Electric PWH Series Portable Shop Electric Heater features a swivel bracket that will allow for wall or ceiling mounting of the heater. The heater can be rotated to direct the warm air to exactly where it is needed. It comes with a built-in thermostat and a 6\', 3-wire plug. The quiet operation allows you to place this heater in any and all applications that need heating.</p>\r\n<ul>\r\n	<li>\r\n		Thermal overload Smart Limit Protection<span class=\"st\"> disconnects elements and motor in the event normal operating temperatures are exceeded.</span></li>\r\n	<li>\r\n		<span class=\"st\">Dual open coil element.</span></li>\r\n	<li>\r\n		<span class=\"st\">C-Frame motor.</span></li>\r\n	<li>\r\n		<span class=\"st\">Squirrel cage blower.</span></li>\r\n	<li>\r\n		<span class=\"st\">Quiet running.</span></li>\r\n	<li>\r\n		<span class=\"st\">Safety limit turns off power to the element if it overheats and automatically resets.</span></li>\r\n	<li>\r\n		<span class=\"st\">1-Pole built-in capillary tube thermostat, 45</span><span class=\"st\"> - 80</span><span class=\"st\"> operating range.</span></li>\r\n	<li>\r\n		<strong><span class=\"st\">Heater is 240V, 2400W.</span></strong></li>\r\n</ul>\r\n',0,1,0,0,4106,NULL,NULL),(7592,3262,NULL,43,NULL,'Pyrex Glass Filtering Flasks, 1000 ml','Qty','<p>\r\n	Glass filtering flask with side-arm at 90 angle. Heavy-walled with graduated capacity scale. Designed to ASTM E1406, Type II, Class I requirements. Hose connection accepts 5/16 I.D. flexible tubing.<br />\r\n	<br />\r\n	These 1000 ml flasks are sold per each or case of 6.</p>\r\n',0,0,1,0,7566,NULL,''),(7794,3395,NULL,NULL,NULL,'Pioneer 5516 Navy Reflective Coveralls, Tall Sizes','Size, Qty Available','<p>\r\n	Meets CSA Z96-09 Class 1, Level 2. 2-way heavy-duty brass zipper closure. Adjustable snap wrists. 7 storage pockets: 2 back, 2 chest, 2 side, 1 tool. 2 pass-through pockets. Action back and elastic waist. Tall sizes are 3&quot; longer than regular sizes.</p>\r\n',0,1,0,0,7771,NULL,''),(7795,3397,NULL,124,NULL,'Viking 6210J Journeyman Heavy Duty PVC Jacket, Orange','Size, Qty Available','<p>\r\n	Tough 0.45mm PVC/Polyester/PVC material, superior resistance to delamination. Medium to heavy risk chemical splash protection. Excellent chemical protection against acids, animal fats, and motor oils. Good protection against foul weather wind and cold protection. 2&quot; prism reflective safety strips. Generously sized for working comfort. Durable double welded seams. Dual button snap closure system. Vented back for breathability. Cotton corduroy collar for comfort. Hood not included.</p>\r\n',0,1,0,0,7772,NULL,''),(4109,3172,NULL,1,NULL,'Submersible Pump Wire Splice Kits','Wire Gauge Range','<p>\r\n	Includes the four crimp connectors and necessary heat shrink tubing required when replacing a submersible well pump.</p>\r\n',0,0,1,0,7598,NULL,NULL),(4110,3148,NULL,136,NULL,'Thomas & Betts CIDUCT-1 Asbestos-Free Duct Seal, 1 Lb',NULL,'<ul>\r\n	<li>\r\n		Seals irregular openings from air, dust or water.</li>\r\n	<li>\r\n		Non-corrosive, non-staining.</li>\r\n	<li>\r\n		Will not harm your hands.</li>\r\n	<li>\r\n		Non-hardening sealant adheres to metal, masonry, wood, and plastic.</li>\r\n	<li>\r\n		Continuous operating range of -34C to 88C (-30F to 190F).</li>\r\n</ul>\r\n',0,0,1,NULL,6178,NULL,NULL),(4111,3148,NULL,1,NULL,'72 Piece Heat Shrink Tubing Kit',NULL,'<p>\r\n	General purpose, flexible heat shrink tubing comes in various diameters: 3/16&quot;, 1/4&quot;, 3/8&quot;, 1/2&quot;, 3/4&quot; and 1&quot;. All pieces are 6&quot; in length.</p>\r\n',0,0,1,NULL,6179,NULL,NULL),(6484,3250,NULL,2,NULL,'3M  H-97 Scotch-Brite Scour Pad No.97, 6\" X 9\"','Qty','<ul>\r\n	<li>\r\n		3M\'s original synthetic scouring pad.</li>\r\n	<li>\r\n		Replaces steel wool and metal sponges.</li>\r\n	<li>\r\n		Won\'t leave metal slivers in hands.</li>\r\n	<li>\r\n		Long lasting, non-rusting and resilient.</li>\r\n	<li>\r\n		Will not scratch glass or stainless steel.</li>\r\n	<li>\r\n		Each pad measures 6&quot; x 9&quot;, and can be purchased by the pack of 10 or case of 100.</li>\r\n</ul>\r\n',0,0,1,0,7532,NULL,''),(4112,3147,NULL,1,NULL,'Dual Temperature 10 Piece Heat Gun Kit',NULL,'<p>\r\n	Includes 1 heat gun, 4 nozzles and 5 paint scrapers, all contained within a durable plastic case. 12.5A. Nominal Voltage 120V~60HZ. Power Rating 1500W. 375C/ Level 1, Air Rate 4001/ Level 1. 500C/ Level 2, Air Rate 5001/ Level 2. Meets cUL requirements.</p>\r\n',0,0,1,0,4112,NULL,NULL),(4113,3148,NULL,1,NULL,'Dow Corning 4 Electrical Insulating Compound 150 Gram Tube',NULL,'<p>\r\n	Never hardens. Keeps moisture and corrosion off of electrical connections such as UV bulb pins, light sockets, electrical plugs, and wire connections inside of junction boxes. Keeps brass and copper looking and performing like new. Comes in a 150 g (5.3 oz) tube.</p>\r\n',0,0,1,NULL,6181,NULL,NULL),(4114,3147,NULL,1,NULL,'Mini Heat Gun Kit',NULL,'<p>\r\n	Nozzle temperature to 1000F. 110V AC outlet. 6\' electrical cord with workbench storage loop. Comes with 60 pieces of general purpose heat-shrink tubing. Sizes include 1/8&quot;, 3/16&quot;, 1/4&quot;, 3/8&quot; and 1/2&quot;. All sizes are 5&quot; in length. Meets UL requirements.</p>\r\n',0,0,1,0,4114,NULL,NULL),(4115,3149,NULL,49,NULL,'Greenlee DM-200A Digital-Multi Meter',NULL,'<p>\r\n	Measures voltage, current, resistance and frequency. Tests continuity and diodes. Backlit LCD with 6,000 count display. Two voltage detection modes - non-contact or using a single test lead. BeepJack warns when test leads are incorrectly inserted in current measurement terminals. Automatic and manual range selection. Relative offset mode to see changes in measurements. Data hold. Use optional USB / RS-232 interface DMSC-2U for direct-to-PC logging Accessories included: (2)1.5V AAA batteries, bead temperature probe, test leads, protective boot</p>\r\n<div class=\"ajax__tab_panel\" id=\"ctl00_ContentPlaceHolder1_ctrlDetails_ctrlDetailsTabHolder_ctl01\" style=\"visibility: visible;\" tabindex=\"1\">\r\n	<ul>\r\n		<li>\r\n			<span itemprop=\"description\">Amperage Measurement : 600, 6000 MICAMP, 60, 600 MILAMP, 6, 8 AMP</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Capacitance : 60, 600 NFD, 6, 60, 600, 3000MFD</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Frequency Measurement : 10 HZ - 50 KHZ Sine Wave, 5 HZ - 999.9 KHZ Logic Level Square Wave</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Measurement Category : CAT IV 300 V, CAT III 600 V, CAT II 1000 V</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Resistance Measurement : 600 OHM, 6, 60, 600 KOHM, 6, 60 MOHM</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Standard : CAT IV, CAT II, C/UL US Listed, CAT III, CE Listed</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Temperature Rating : K Type, -58 To 1832 DEG F (-50 To 1000 DEG C)</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Voltage Measurement : 60, 600 MILV, 6, 60, 600, 1000 V</span></li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,4115,NULL,NULL),(4116,3149,NULL,49,NULL,'Greenlee CM-860 AC True RMS Clamp Meter',NULL,'<p>\r\n	True RMS for the most accurate measurement when harmonics are present. AC amperage, AC/DC voltage, frequency and resistance measuring capability. Easy-to-read backlit LCD display for use in low light conditions. Peak and data hold to capture measurement. MIN/MAX feature for added versatility. Analog bar graph to view quick changes. Selectable Auto Off for longer battery life. Accessories included: (1) 9V battery, test leads, carrying case.</p>\r\n<div class=\"ajax__tab_panel\" id=\"ctl00_ContentPlaceHolder1_ctrlDetails_ctrlDetailsTabHolder_ctl01\" style=\"visibility: visible;\" tabindex=\"1\">\r\n	<ul>\r\n		<li>\r\n			<span itemprop=\"description\">Amperage Measurement : 60, 600 Amps AC</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Frequency Rating :Voltage and AmpTip current: 50/60 Hz. High current 50 to 400 Hz</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Measurement Category : CAT III, 600 V, CAT IV 300V</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Resistance Measurement : 600, 6k, 60k Ohms</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Standard : CAT III, C/US UL Listed, CE</span></li>\r\n		<li>\r\n			<span itemprop=\"description\">Voltage Measurement : 600 Volts AC/DC</span></li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,4116,NULL,NULL),(4117,3149,NULL,49,NULL,'Greenlee GT-12A Non-Contact Pocket Voltage Detector',NULL,'<p>\r\n	Automatic self-test verifies the integrity of the unit. Bright LEDs and audible alarm sound if voltage is present. Silent-mode feature for use in quiet settings. Safe, non-contact voltage detection. Use to detect voltage in outlets, lighting fixtures, circuit breakers, wires, and cables or to find a break in a wire. Automatically turns off after five minutes of non-use to conserve battery life. Low battery indicator. (2) 1.5V AAA batteries included.&nbsp;<span style=\"font-size: 12px;\">Frequency : 50 - 500 HZ.&nbsp;</span><span style=\"font-size: 12px;\">Measurement Category : CAT IV, 1000V.&nbsp;</span><span style=\"font-size: 12px;\">Standard : C/US UL Listed, CE Listed.&nbsp;</span><span style=\"font-size: 12px;\">Voltage Rating : 50 - 1000 VAC.</span></p>\r\n',0,0,1,0,4117,NULL,NULL),(6660,3156,NULL,188,NULL,'Dunham & Morrow DML200-XRM Metered Magnetic Locator w/ Hard Case',NULL,'<p>\r\n	<font color=\"#000000\" face=\"Arial\" size=\"2\">The DML200-XRM is unsurpassed as a buried septic tank locator, finder of survey markers, or as a buried pipe locator.<font size=\"2\"> </font>Even manhole covers, water valves and water meters are a snap to pinpoint with t<font size=\"2\">his metal detector. Overall, this is a highly accurate, reliable, durabl<font size=\"2\">e, user-fr<font size=\"2\">iendly magnetic locator.</font></font></font></font></p>\r\n<p>\r\n	<font color=\"#000000\" face=\"Arial\" size=\"2\"><font size=\"2\">This unit is waterproof from the base to the tip of the sensor tube, a total of 36 inches. There are two seperate power and sen<font size=\"2\">sitivity controls, as well as a flashing LED low battery indicator. </font></font></font>Operates up to 50 hours on four standard AA alkaline batteries.</p>\r\n<p>\r\n	<u><strong>Additional features include:</strong></u></p>\r\n<ul>\r\n	<li>\r\n		Made in the USA.</li>\r\n	<li>\r\n		Visual output: 3.5&quot; digital LCD meter; audio output: variable frequency (20 to 3500 hertz)</li>\r\n	<li>\r\n		Lifetime warranty.</li>\r\n	<li>\r\n		Electronics package is made of resillient, impact resistant ABS.</li>\r\n	<li>\r\n		Sensor tube and base plate are made of strong 6060-T6 aluminum.</li>\r\n	<li>\r\n		Critical sensing elements are isolated from damage inside a separate shock-mounted tube withing the yellow external sensor tube.</li>\r\n	<li>\r\n		Waterproof sensor housing and water-resistant electronics enclosure guarantees all-weather performance.</li>\r\n	<li>\r\n		Innovative circuit design and component selection ensures perfect operation whether it\'s -20<span class=\"st\">F or 120</span><span class=\"st\">F outside.</span><br />\r\n		&nbsp;</li>\r\n</ul>\r\n',0,0,1,0,6645,NULL,''),(4119,3147,NULL,1,NULL,'Nylon Fuse Pullers ','Fuse Diameter, Size','<p>\r\n	Fully insulated with non-slip handles and protective finger stops.</p>\r\n',0,0,1,0,4119,NULL,NULL),(4120,3150,NULL,89,NULL,'Duracell Procell Professional Alkaline Battery - 9 Volt',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		Duracell Procell batteries are manufactured to rigid specifications to meet some of the highest standards of durability and longevity that professional users demand and expect. Procell batteries deliver outstanding performance with a 7-year freshness guarantee backed up with date coding.</p>\r\n	<p>\r\n		Procell batteries are rated for reliable operation in temperature extremes from -20C to 54C and contain no added mercury.</p>\r\n	<p>\r\n		12 9 volt batteries per box, 6 boxes per case.</p>\r\n	</section></div>\r\n',0,0,1,NULL,5785,NULL,NULL),(4384,3149,NULL,202,NULL,'Greyline DFM 5.0 Doppler Flow Meter',NULL,'<p>\r\n	Measure flow from outside a pipe. The Greyline DFM 5.0 is designed for &quot;difficult liquids&quot; that would damage regular flow meters - wastewater, slurries, sludge, chemicals, viscous liquids and abrasives. There is no obstruction to flow and no pressure drop. The non-intrusive, clamp-on ultrasonic sensor fits any pipe 1/2&quot; (12.5 mm) Inside Diameter or larger. The electronics/display enclosure can be mounted nearby.<br />\r\n	<br />\r\n	Use the isolated 4-20mA to transmit flow to remote displays, recorders or controllers. The programmable relays can be used for flow control, pump protection or flow proportionate pulse. Calibration is easy with the built-in 5-key calibrator. Display and totalize flow in your choice of engineering units (gallons, liters etc.)<br />\r\n	&nbsp;&nbsp; &nbsp;<br />\r\n	Sensor cable can be extended up to 500 ft. (152 m) with no loss of signal. The standard sensor is rated non-incendive for Class I, Division 2 hazardous locations and the DFM 5.0 can be equipped with optional Intrinsic Safety Barriers for sensor installation in Class I, Division I hazardous locations. Other options include extra control relays and a built-in 2 million point Data Logger with USB output to Flash Drives.<br />\r\n	<br />\r\n	The DFM 5.0 includes a new digital signal processor to filter background noise and interference, and to measure flow rates accurately in liquids containing gas bubbles or solids particles.</p>\r\n<p>\r\n	The DFM 5.0 Doppler Flow Meter includes Greyline\'s user-friendly calibration system. Use the built-in keypad to select pipe diameter and units of measurement. It\'s easy. You can calibrate the flowmeter in just a few minutes.</p>\r\n',0,0,1,0,7686,NULL,NULL),(6376,3261,NULL,155,NULL,'Non-Mercury Wide Angle Float Switch, Three Wire','Float Switch Cable Length','<p>\r\n	The Tulsar Three Wire Wide Angle Float Switch is used to directly control fractional horsepower pumps under 13 amps. This float switch comes with a cast iron weight that can be adjusted to a 4&quot; minimum tether. Contains a mechanical switch encapsulated within a waterproof plastic casing that is freely suspended at the desired height from its own cable. A cast iron weight attached to the cable provides the pivot point for the float switch operation. Also contains a micro switch, max rated 120 VAC/13A. This three-wire single pole double throw (SPDT) float switch can be wired normally open (NO) or normally closed (NC). When the liquid level reaches the float switch, the waterproof plastic casing will tilt and the mechanical switch will close or break the circuit, thereby starting or stopping a pump or actuating an alarm circuit. Can be used for either normally open or normally closed applications. CSA Certified and UL Listed.</p>\r\n',0,1,0,0,7441,NULL,''),(6865,3260,NULL,186,NULL,'Cofra Typhoon Premium Utility Worker\'s Nitrile Boot, Steel Toe & Plate','Size','<p>\r\n	Ergonomic nitrile upper is sturdy, yet flexible. Abrasion resistant polyester lining is comfortable and long-wearing. Full piece insole is removable, anti-static, anti-bacterial, and anti-fungal. Liner also guarantees absorption and deabsorption of perspiration over all areas of the foot, while also being washable. Reinforced at the toe cap and all stress areas for extra long boot life. 8mm cleats for guaranteed stability, even on very uneven ground.</p>\r\n<p>\r\n	Designed for workers constantly on the move. Regarded by many workers as one of the best pairs of boots they\'ve ever owned. Steel toecap and steel plate. CSA and ESR compliant.</p>\r\n',0,0,1,0,6848,NULL,''),(7475,3261,NULL,218,NULL,'SJE Elapsed Time Meter with Piggyback Plug, 120V',NULL,'<p>\r\n	The Elapsed Time Meter with Piggyback Plug records the total pump run time. It plugs into switched outlet or piggy-back switch of a plugger-style control panel. The unit must be placed inside of an enclosure. Comes complete with screws and mounting adhesive.</p>\r\n',0,0,1,0,7453,NULL,''),(6867,3261,NULL,NULL,NULL,'Five Float Switch Hanger',NULL,'<p>\r\n	Galvanized steel construction. Includes mounting bracket and (5) bushings.</p>\r\n',0,1,0,0,7440,NULL,''),(6381,3261,NULL,156,NULL,'Flygt 5828811 Non-Mercury ENM-10 Level Regulator Float Switch, 20 Ft Cable',NULL,'<ul>\r\n	<li>\r\n		The Flygt ENM-10 level regulator float switch offers the simplest possible method for liquid level control.</li>\r\n	<li>\r\n		This float switch contains a mechanical switch encapsulated within a waterproof tear drop shaped plastic casing that is freely suspended at the desired height from its own cable. Impurities and deposits will not adhere to the smooth float switch casing.</li>\r\n	<li>\r\n		When the liquid level reaches the float switch, the waterproof plastic casing will tilt and the mechanical switch will close or break the circuit, thereby starting or stopping a pump or actuating an alarm circuit.</li>\r\n	<li>\r\n		The Flygt ENM-10 level regulator contains a micro switch, max rated 250 VAC/10A. This three-wire single pole double throw (SPDT) float switch can be wired normally open (NO) or normally closed (NC).</li>\r\n	<li>\r\n		The Flygt ENM-10 float switch casing is made of polypropylene and the cable is sheathed with a special PVC or Nitrile/PVC rubber compound. The plastic components are welded and screwed together, adhesive is never used.</li>\r\n	<li>\r\n		The 20\' Flygt Non-Mercury ENM-10 Float Switch can be used for either normally open or normally closed applications.</li>\r\n</ul>\r\n',0,0,1,0,6359,NULL,''),(4127,2014,NULL,1,NULL,'Thermoplastic Square Head Combination Exit',NULL,'<p>\r\n	Ideal for both commercial and industrial applications. Universal mounting capability. 4.4 watt energecy efficient LED. Durable V-O flame retardent housing. Comes complete with 2 fully adjustable glare-free light heads. Remote capability. Charge/Power LED indicator. Push-to-test switch. Solid state charger. Meets NFPA Life Safety Code. Sealed maintenance-free lead calcium batteries. Contractor friendly installation. 90 minute emergency operation. Meets cETL requirements.</p>\r\n',0,0,1,0,4127,NULL,NULL),(4128,2014,NULL,1,NULL,'NEMA 4X Vandal Resistant, Wet Location Exit/Emergency Light Combo',NULL,'<div>\r\n	NEMA 4X rated exit signs are ideal for use in hostile environments where dirt, dust, oil, water or corrosive elements such as salt, acids and alkalines are present. Units are built into a nema enclosure that is weather and corrosion resistant. Enclosures include a uniformly illuminated polycarbonate face and a rugged fiberglass housing with a special one-way venting system.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Waterproof. Surge protected. Oil-resistant gasket provides water-tight and dust-tight seal. AC and battery backup. Remote capability. Meets cETL requirements.&nbsp;</div>\r\n',0,0,1,0,4128,NULL,NULL),(4129,2014,NULL,1,NULL,'NEMA 4X Wet Location Emergency Light',NULL,'<div>\r\n	NEMA 4X rated exit signs are ideal for use in hostile environments where dirt, dust, oil, water or corrosive elements such as salt, acids and alkalines are present. This emergency light is ideal for use in industrial facilities with harsh or corrosive environments, where a sealed and gasketed maintenance free unit, with oil, water and dust-tight construction is required. This emergency light is 6 volts and 36 watts. It has two 18 watt lamps. and 120V input.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Reinforced fiberglass housing with gray epoxy finish. Lamp terminals, heads &amp; swivels are sealed with construction grade RTV silicon. Sealed maintenance free NiCad battery. Provides a minimum emergency duration of 90 minutes. Low voltage disconnect. Brownout and short circuit protection. Pulse switching charger. Push-to-test switch. Dual diagnostic LED display. Pre-drille