re medium is non-corrosive to brass or phosphor bronze. Drawn steel case with black corrosion resistant paint. Window is general purpose acrylic. Applications include air, oil, gas and water service. 2-1/2&quot; dial size. All gauges have  NPT threaded bottoms.</p>\r\n',0,0,1,0,4160,NULL,NULL),(6941,3096,NULL,NULL,NULL,'Painted Steel Dry Pressure Gauges, Brass Mount, 4\" Dial','PSI/kPa Range','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">For general use wherever stem mounting is desirable and the pressure medium is non-corrosive to brass or phosphor bronze. Drawn steel case with black corrosion resistant paint. Window is general purpose acrylic. Applications include air, oil, gas and water service. 4&quot; dial size. All gauges have  NPT threaded bottoms.</span></p>\r\n',0,0,1,0,6924,NULL,''),(4161,3097,NULL,1,NULL,'Liquid Filled Pressure Gauge with Stainless Case and Brass Stem, 2.5\" Dial','PSI/kPa Range','<p>\r\n	These stainless steel liquid filled pressure gauges are ideal where vibration, corrosion, and pulsating conditions exist. Window is heavy glass crystal. Glycerine filled, 2.5&quot; dial, brass wetted parts, stainless case. All gauges have  NPT threaded bottoms.</p>\r\n',0,0,1,0,4161,NULL,NULL),(6939,3097,NULL,NULL,NULL,'Liquid Filled Pressure Gauge with Stainless Case and Brass Stem, 4\" Dial','PSI/kPa Range','<p>\r\n	These stainless steel liquid filled gauges are ideal where vibration, corrosion, and pulsating conditions exist. Window is heavy glass crystal. Glycerine filled, 4&quot; dial, brass wetted parts, stainless case. All gauges have  NPT threaded bottoms.</p>\r\n',0,0,1,0,6922,NULL,''),(4162,3098,NULL,1,NULL,'Stainless Steel Industrial Liquid Filled Pressure Gauges, Stainless Steel Mount, 2-1/2\" Dial','PSI/kPa Range','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">These stainless steel liquid filled gauges are ideal where vibration, corrosion, and pulsating conditions exist. Window is heavy glass crystal. Glycerine filled, 2-1/2&quot; dial provides exceptional vibration resistance. Stainless steel wetted parts and stainless steel case f</span><span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">or the very best corrosion resistance</span><span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">. All gauges have  NPT threaded bottoms.</span></p>\r\n',0,0,1,0,4162,NULL,NULL),(5700,3086,NULL,146,NULL,'Guzzler Extra Heavy-Duty Multi-Purpose Diaphragm Pump w/ 1-1/2 MPT Ends ',NULL,'<p>\r\n	Small, lightweight, and portable, this rugged epoxy-coated aluminum hand pump is capable of pumping up to 20 gallons per minute. Sets up in seconds and finishes the job in less time than it would take to set up a powered pump. Bigger stones, slurry, and debris can pass through this Guzzler without hampering use. Use to start a siphon, prime jet pumps, de-water pits, fire hydrants, trenches, septic tanks, holding tanks, toilet bowls and tanks, clogged sinks, and anything else you can think of. Fill overhead tanks in areas where there is no electricity. Has 1-1/2 MPT ends for secure connections. 12 feet of suction lift and 30 feet of discharge head.</p>\r\n',0,0,1,0,5694,NULL,''),(4164,3222,NULL,150,NULL,'Kuri-Tec Natural Polyethylene Food Grade Low Density (LDPE) Tubing, 1/2\" O.D.','Sold Per','<p>\r\n	Free from impurities, offering excellent resistance to stress cracking.&nbsp;<span style=\"font-size: 12px;\">Use for instrumentation tubing or as transmission lines for various materials intended for human consumption.&nbsp;</span><span style=\"font-size: 12px;\">Tubing is non-corrosive, odourless and tasteless.&nbsp;</span><span style=\"font-size: 12px;\">Complies with all applicable FDA, 3