 the same pressure and flow rate of its big brothers. It\'s driven by a 13 HP Honda engine connected directly to a 3000 psi, 4 GPM triplex pump with Vibra-pulse on demand. </font></p>\r\n<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">A 200 ft. capacity hose reel with drag brake, reel lock and brass swivel is mounted on a very maneuverable heavy duty frame with two pneumatic tires. A passive brake keeps the machine solidly positioned on the job. </font></p>\r\n<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">Standard safety features include a thermal relief valve to protect the pump from heat damage, along with a back-flow check valve and inlet filter.Unit comes complete with tool box.</font></p>\r\n<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">In addition to it\'s other great features, our J-2900-B model also includes 200\' of 3/8&quot; drain cleaning hose, </font>15<span class=\"st\"> angle nozzle, 15</span><span class=\"st\"> angle nozzle with forward jet, 40</span><span class=\"st\"> angle nozzle, spring leader nozzle and a nozzle cleaning tool.</span></p>\r\n',0,0,1,0,5703,NULL,''),(4229,3284,NULL,114,NULL,'Nelson Industrial Fireman\'s Style High-Flow Nozzle',NULL,'<p>\r\n	Heavy duty, die-cast metal body with Gripguard insulation. Has up to 300% more water flow compared to standard nozzles for superior cleaning power. Adjustable from gentle shower to powerful stream. Engineered from zinc, aluminum, glass filled nylon and brass. Protective rubber coating prevents scratching of surfaces when dropped. Metal shut-off handle.</p>\r\n',0,0,1,0,6575,NULL,NULL),(4230,3284,NULL,114,NULL,'Nelson Industrial Adjustable-Pattern Nozzle',NULL,'<p>\r\n	Heavy-duty, die-case zinc body and brass spray tip. Handle with Gripguard Insulation provides both hot and cold water protection. Hot water rated to 160F, pressure rated to 125 PSI. Brass memory adjustable spray pattern control. Trigger guard minimized accidental spray and damage when dropped. Crush-resistant, glass-filled nylon handle.</p>\r\n',0,0,1,0,6576,NULL,NULL),(4231,3284,NULL,114,NULL,'Nelson Industrial Gripguard Twist Nozzle',NULL,'<p>\r\n	No trigger to squeeze. Water pressure rated to 200 PSI. Adjustable spray pattern. Heavy-duty, die-cast zinc body with brass spray tip. Ergonomic grip handle with Gripguard Insulation provides both hot and cold water protection.</p>\r\n',0,0,1,0,6577,NULL,NULL),(4232,3284,NULL,114,NULL,'Nelson Industrial Pistol Grip Nozzle',NULL,'<p>\r\n	Hot water rated to 160F. Reinforced solid brass stem designed for high pressure, up to 100 PSI. Heavy-duty die-cast metal body. Handle with Gripguard Insulation provides both hot and cold water protection.</p>\r\n',0,0,1,0,6579,NULL,NULL),(6908,2036,NULL,NULL,NULL,'Clarifier Weir Swivel Brush',NULL,'<p>\r\n	The bristles on this swivel weir cleaning brush offer a super-aggressive scrubbing action for very dirty surfaces. The stiff synthetic fibres feature an extra abrasive on the bristles. Swivel connection can be used with any standard threaded handle and allows ease of maneuvering in corners or around obstacles. Recommened for use with our Twist N\' Lock Poles.</p>\r\n',0,0,1,0,6891,NULL,''),(7553,3065,NULL,NULL,NULL,'Heavy-Duty Sawhorses','Dimensions','<p>\r\n	2000 lb capacity. Overbuilt to be the last sawhorse you\'ll ever need. Powder coated finish safety yellow.</p>\r\n',0,0,1,0,7530,NULL,''),(6687,3057,NULL,191,NULL,'Komelon Open Reel Fiberglass Measuring Tapes','Length','<p>\r\n	Metric and standard. Lightweight ABS open reel design. Tough, flexible tape. Folding rewind handle. Steel claw included. All lengths are 1/2 in. width.</p>\r\n',0,0,1,0,5130,NULL,''),(4235,3363,NULL,1,NULL,'1 1/2\" Fire Hose Rack Assemblies','Length','<p>\r\n	Rack hose assemblies are designed for racks and reels for interior protection and occupant use applications. Synthetic rubber lined, mildew and rot resistant. Acceptance tested up to 500 PSI and service tested up to 250 PSI. Pre-f