ed.</li>\r\n	<li>\r\n		Contains aloe and specially formulated with moisturizers that leave hands feeling soft and refreshed without stickiness or residue.</li>\r\n	<li>\r\n		236 ml.</li>\r\n</ul>\r\n',0,0,1,1,6534,NULL,''),(4303,3148,NULL,NULL,NULL,'CSA Black PVC Electrical Tape','Description','<p>\r\n	<strong>Regular CSA Black PVC Electrical Tape </strong>measures 3/4&quot; x 66\', and is 7 mil thick. It has a temperature range of -7<span class=\"st\">C to 80</span><span class=\"st\">C.</span><span class=\"st\"> Dielectric breakdown at 9,000 volts.</span></p>\r\n<p>\r\n	<strong>Extended Temperature Range CSA Black PVC Electrical Tape </strong>measures 3/4&quot; x 66\', and is 7 mil thick. It has an extended temperature range of -18<span class=\"st\">C to 90</span><span class=\"st\">C.</span><span class=\"st\"> Dielectric breakdown at 9,000 volts.</span></p>\r\n',0,0,1,0,4303,NULL,NULL),(6791,3221,NULL,NULL,NULL,'Black Aluminum 3C LED Flashlight',NULL,'<p>\r\n	Made from aircraft grade aluminum. CREE LED used as light source. Push on/off switch. Has flasher mode when switch pushed halfway. Bright 190 lumens output. Highly efficient, 3 &quot;C&quot; cells will provide light for up to 10 hours.</p>\r\n',0,0,1,0,5601,NULL,''),(4378,2038,NULL,24,NULL,'MasterLock Commercial Grade Laminated Steel Padlock, Keyed Alike','Qty','<p>\r\n	Wide laminated steel body offers superior protection from drilling and prying. Hardened steel shackle for superior cut resistance. Dual locking levers provide additional pry resistance. Keyed alike to key # 2077. 1-3/4&quot; body width, 5/16&quot; shackle height.</p>\r\n',0,0,1,0,6462,NULL,NULL),(6832,3255,NULL,NULL,NULL,'Parts Cleaning Brush, Wooden Handle, Stainless Bristles','Qty','<p>\r\n	Brush is 8&quot; in length and has 3 rows of stainless steel bristles and a wooden handle.</p>\r\n',0,0,1,0,4270,NULL,''),(6833,3255,NULL,NULL,NULL,'Parts Cleaning Brush, Poly Handle, Stainless Bristles','Qty','<p>\r\n	Brush is 7&quot; in length and has 3 