nce. Good water resistance. Ensures lasting protection even in the presence of large amounts of water. High dropping point. Long operational life at high temperatures. Effective corrosion protection. Ensures components/bearings do not fail due to corrosion.</p>\r\n',0,0,1,0,4386,NULL,NULL),(7569,3251,NULL,NULL,NULL,'National Premium Motor Oil','Type, Qty','<p>\r\n	National Premium motor oils are formulated from quality base stocks combined with advanced additive technology to protect today\'s engines against undesirable deposits, viscosity and thermal breakdown under severe service conditons.</p>\r\n<p>\r\n	Excellent low-temperature pumpability for protection during cold starts. Formulated to protect emissions control system catalysts. Keeps engine clean by minimizing deposit formation. Sold per quart or case of 12.</p>\r\n',0,0,1,0,7546,NULL,''),(4390,3251,NULL,1,NULL,'Chevron Starplex EP-2 Lithium Complex Grease','Qty','<p>\r\n	Water resistant, extreme pressure, heavy duty chassis, wheel bearing and general purpose lubricating grease.</p>\r\n<p>\r\n	Good water resistance. Good rust and corrosion protection. Extreme pressure protection. Protection against shock loading. Outstanding film strength. Good low temperature pumpability.</p>\r\n<p>\r\n	400 gram tube.</p>\r\n',0,0,1,0,4389,NULL,NULL),(4391,3251,NULL,1,NULL,'Jax Magna-Plate 44-2 Food Grade Grease','Qty','<p>\r\n	Provides a high degree of water resistance, oxidation stability and antiwear protection that gives superior performance formerly thought to be unavailable in ordinary food-grade greases.</p>\r\n<p>\r\n	Has a propreitary base soap formulation which defies oil and soap separation to a degree rarely found in grease of any soap type.</p>\r\n<p>\r\n	State-of-the-art FDA-approved antiwear, rust and corrosion and anti-oxidant additives provide performance not usually associated with a food-grade lubricant.</p>\r\n<p>\r\n	For use wherever high water contamination, corrosion, or washdown presents an issue.</p>\r\n<p>\r\n	NSF approved, 400 gram tube.</p>\r\n',0,0,1,0,4385,NULL,NULL),(4392,3251,NULL,41,NULL,'Spray Lubricants','Type','<p>\r\n	3 in One Professional Line. Set includes penetrating spray which loosens nuts and bolts, silicone based spray which is a general purpose lubricant, and lithium based spray which is a water resistant lubricant.</p>\r\n',0,1,0,1,7544,NULL,NULL),(4393,2040,NULL,1,NULL,'Folgers Classic Roast Ground Coffee - 48 oz.',NULL,'<ul>\r\n	<li>\r\n		Classic roast is made from Mountain Grown beans.</li>\r\n	<li>\r\n		Interlocking AromaSeal lid to ensure freshness.</li>\r\n	<li>\r\n		Makes up to 380 six ounce cups.</li>\r\n</ul>\r\n',0,0,1,NULL,4393,NULL,NULL),(5841,2041,NULL,NULL,NULL,'Mobile Computer Workstation',NULL,'<ul>\r\n	<li>\r\n		Durable steel frame, easy to assemble.</li>\r\n	<li>\r\n		Compact design.</li>\r\n	<li>\r\n		Pullout keyboard tray.</li>\r\n	<li>\r\n		4 swivel castors (2 locking).</li>\r\n	<li>\r\n		Complete with power surge outlet.</li>\r\n</ul>\r\n',0,0,1,NULL,5831,NULL,''),(7802,3325,NULL,234,NULL,'Excelpure NX Polydepth Sediment Cartridges, 2-1/2\" OD,  20\" Length, Case of 20','Micron Rating','<p>\r\n	Fits Harmsco, Pentek, Waterite, Shelco and all other brands of filter housings that accept 2-1/2&quot; diameter standard filter cartridges. NSF-61 certified - will not impart taste, odour or colour into water being filtered. All cartridges are double open ended.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Filters listed here are 20&quot; in length. </strong></li>\r\n	<li>\r\n		<strong>All sizes below are sold and priced by the case of 20.</strong></li>\r\n</ul>\r\n',0,0,1,0,7779,NULL,''),(4396,2040,NULL,1,NULL,'Sugar Packets','','White sugar. 3.5 g per packet. 2000 packets per case.',0,0,1,NULL,4396,NULL,NULL),(4397,2040,NULL,88,NULL,'Kirkland Signature 100% Colombian Coffee',NULL,'<ul>\r\n	<li>\r\n		Remarkably full bodied and smooth.</li>\r\n	<li>\r\n		Made of 100% Arabica beans, grown in the Andes mountains of Colombia.</li>\r\n	<li>\r