,NULL),(4417,2042,NULL,NULL,NULL,'Industrial Grade Gray PVC Cement','Size','<p>\r\n	Medium-bodied, fast setting, PVC cement for all classes and schedules through 6&quot; diameter interference fit, Schedule 80 through 4&quot; diameter.</p>\r\n',0,0,1,1,4417,NULL,NULL),(4418,2042,NULL,NULL,NULL,'Clear PVC Primer','Size','<p>\r\n	Most aggressive PVC and CPVC primer available. Excellent product for cold weather applications. If used properly, will soften pipe and fitting surfaces which is necessary for the proper solvent welding of the materials.</p>\r\n',0,0,1,1,4418,NULL,NULL),(7654,3358,NULL,77,NULL,'Magikist MX Series Industrial Stationary Floor Stand Electric Pressure Washer','Description','<p>\r\n	The Magikist MX Series of pressure washers are industrial rated for heavy duty use. Uses an industrial rated TEFC Baldor electric motor.</p>\r\n<p>\r\n	Belt driven triplex ceramic plunger pump operates at slow speeds for reduced pump wear and vibration when compared to direct drive pumps. This significantly extends the life of the pump.</p>\r\n<p>\r\n	Compact and sturdy powder coated floor stand minimizes floor space requirements. Perfect for shop applications.</p>\r\n<p>\r\n	Pressure regulating unloader valve for easy pressure adjustment. Metering valve allows for desired soap concentration. Safety relief valve, pressure gauge and prime valve all included.</p>\r\n<p>\r\n	Supplied with 35 feet of wire braid high pressure hose, quick couplers, easy-open trigger gun, high pressure swivel, insulated wand and stainless steel nozzle.</p>\r\n',0,0,1,0,7631,NULL,''),(7641,2042,NULL,NULL,NULL,'Pow-R-Wrap Water Activated Fiberglass Wrap','Description','<p>\r\n	Water activated fiberglass wrap is ANSI/NSF certified - safe for drinking water system repairs. EPA approved. Repairs any material, pipe or hose. Cures in 30 minutes. Conforms to a standard water main pressure test. Withstands temperatures to 425F. Ideal for emergencies and frozen pipe breaks. Impervious to water, oils, chemicals, solvents and acids. Conforms to a standard water main pressure test.</p>\r\n',0,0,1,0,7618,NULL,''),(5903,3147,NULL,NULL,NULL,'100 Watt Soldering Gun',NULL,'<div>\r\n	Soldering gun comes complete with solder wire and solder paste. Also includes a replacement tip. Meets cUL requirements.</div>\r\n',0,0,1,0,5893,NULL,''),(7704,3148,NULL,NULL,NULL,'Electrical Wire Connectors','Description','<p>\r\n	Connect and insulate 2 or more bare copper wires. Each wire connector is constructed of durable flame-retardant material to help provide long-lasting use. CSA Certified and UL Listed as a pressure type connector for 600V maximum building wire, and 1000V maximum for use in signage/fixture applications. Superior corrosion resistance.</p>\r\n<p>\r\n	Choose the small orange connectors for wire gauge range 14 to 18. Choose the medium yellow connectors for wire gauge range 10 to 18. Choose the large red connectors for wire gauge range 8 to 22.</p>\r\n',0,0,1,0,5895,NULL,''),(7706,3064,NULL,NULL,NULL,'Contractor Series Intrinsically Safe Work Light',NULL,'<p>\r\n	Designed to meet the needs of hazardous work environments by combining the major performance advantages of LED without sacrificing brightness. Chemical-resistant, anti-static polyethylene construction. Carabiner belt hook on tall cap. CUL 913 Certified Intrinsically Safe for Class I, Groups A, B, C and D; Class II Groups E, F and G; Class III. CAN/CSA C22.2 No. 157-92. IEC 60529 waterproof and dust proof. Lumens: 18. Run Time Hrs.: 12. Batteries Required: 2 x AA.</p>\r\n',0,0,1,0,7683,NULL,''),(7430,3172,NULL,219,NULL,'1 HP Myers Ranger Series 4\" Submersible Well Pump and Motor','Description','<p>\r\n	Ranger 4&quot; high-flow submersible pumps are perfect for applications requiring a large volume of water. Stainless steel components and high-density composite resin impellers provide exceptional resistance to corrosion in harsh water conditions. The high-torque motor and superior pump hydraulics are carefully matched to handle virtually any job. All Ranger pumps have a 2&quot; discharge.</p>\r\n<p>\r\n	Included with the pump is a Pentek 3-wire 4&quot; XE Series motor. These motors utilize a 304 stainless steel epoxy stator design and professional-grade Class F insulation, providing longer life in harsh environments. Each motor is 100% factory pressure and run tested. The motors are equipped with surge arrestors to provide maximum protection against lightning, transient and voltage surge conditions. All motors are 3-wire, UL, CSA and NSF approved.</p>\r\n<p>\r\n	1 phase packages include a control box.</p>\r\n<p>\r\n	The pumps listed here have a 35 GPM capacity, 4 stages, 105 feet total head, and 45 PSI</p>\r\n<p>\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n',0,0,1,0,4113,NULL,''),(7431,3367,NULL,NULL,NULL,'Adjustable Air Regulators','Pipe Size X Flow Capacity',NULL,0,0,1,0,7081,NULL,''),(7432,3367,NULL,NULL,NULL,'5 Micron Air Particulate Filters','Pipe Size X Flow Capacity',NULL,0,0,1,0,7408,NULL,''),(7433,3367,NULL,NULL,NULL,'Combined Air Particulate Filter & Regulator','Pipe Size X Flow Capacity',NULL,0,0,1,0,7409,NULL,''),(4426,2043,NULL,1,NULL,'PVC Schedule 80 Pipe (Grey) Per Foot','Size, Sold Per','<p>\r\n	Price per cut foot. Please specify length required.</p>\r\n',0,0,1,NULL,4426,NULL,NULL),(4428,2043,NULL,NULL,NULL,'Schedule 80 PVC Tee, Socket','Size','<ul>\r\n	<li>\r\n		These schedule 80 PVC tee\'s are socketed for solvent welding on each end.</li>\r\n	<li>\r\n		Sch 80 PVC tee\'s are NSF Listed for potable water services.</li>\r\n</ul>\r\n',0,0,1,0,4428,NULL,NULL),(4429,2043,NULL,1,NULL,'Schedule 80 PVC 45 Elbow, Socket','Size','<ul>\r\n	<li>\r\n		These schedule 80 PVC 45 elbows are socketed for solvent welding on each end.</li>\r\n	<li>\r\n		Sch 80 PVC 45 elbows are NSF Listed for potable water services.</li>\r\n</ul>\r\n',0,0,1,0,4429,NULL,NULL),(4430,2043,NULL,1,NULL,'Schedule 80 PVC 90 Elbow, Socket','Size','<ul>\r\n	<li>\r\n		These schedule 80 PVC 90 elbows ar