ew standard for secure, leak-proof tubing connections.Dual manual control of stroke speed and stroke length are provided.</p>\r\n<p>\r\n	Pump kit includes instructions, suction and discharge valves, and tubing. Everything you need to get started!</p>\r\n<p>\r\n	<strong>Maximum output of 0.13 GPH, 3.1 GPD. Maximum PSI of 150. </strong><strong>1/4&quot; O.D. </strong><strong>tubing . </strong></p>\r\n',0,0,1,0,6261,NULL,''),(6263,3191,NULL,14,7,'LMI Milton Roy Roytronic Series B, B911-D90HI, 1.6 GPH, 150 PSI, Programmable Electronic Metering Pump',NULL,'<p>\r\n	NSF &amp; cUL approved.</p>\r\n<p>\r\n	Roytronic Series B pumps offer a new robust design with the high end performance you expect from LMI.</p>\r\n<p>\r\n	The new AutoPrime Liquid End automatically and continuously purges entrapped air from process fluid. It also eliminates air binding when used with liquids such as sodium hypochlorite.</p>\r\n<p>\r\n	The tubing line includes ferrule designed fittings that set a new standard for secure, leak-proof tubing connections.</p>\r\n<p>\r\n	Type 9 configuration. This configuration allows the user to control the pump manually or by an external signal generated by a flowmeter, controller, transmitter, PLC or other device.</p>\r\n<p>\r\n	LCD screen provides user with operational status.</p>\r\n<p>\r\n	5-level power control reduces system shock and extends life of pump.</p>\r\n<p>\r\n	Pump kit includes instructions, suction and discharge valves, and tubing. Everything you need to get started!</p>\r\n<p>\r\n	<strong>Maximum output of 1.6 GPH, 38.0 GPD. Maximum PSI of 150. </strong><strong>3/8&quot; O.D. </strong><strong>tubing . </strong></p>\r\n',0,0,1,0,6253,NULL,''),(4369,3237,NULL,24,NULL,'MasterLock Commercial Passage Knob Set',NULL,'<p>\r\n	Brushed chrome finish. Cylindrical construction for enhanced durability. 2-3/4&quot; fixed backset latch. 3 hr UL listing. Meets ANSI/BHMA A156.2, Grade 2 Standards. For nonlocking interior applications. Plain knob both sides.</p>\