with built in pressure switch.</li>\r\n</ul>\r\n',0,0,1,0,4945,NULL,NULL),(7427,3091,NULL,33,NULL,'Flotec FP2800DCC High-Capacity Back Up Sump Pump System, 3000 GPH',NULL,'<p>\r\n	Heavy-duty professional, fully automatic 12V back-up sump pump system. Battery sold separately. Smart and powerful UL/CUL approved charging system efficiently restores a safe charge to your battery. Leading edge technology constantly monitors sump activity and responds instantly.</p>\r\n<p>\r\n	Maximum capacity 3000 GPH. Flow at 10 ft lift: 2000 GPH. Fittings included for 1-1/4&quot; and 1-1/2&quot; discharge. 115V, 10 A.</p>\r\n',0,1,0,0,7404,NULL,''),(7563,3369,NULL,NULL,NULL,'Industrial Angle Grinders','Size','<p>\r\n	<strong>4-1/2&quot; angle grinder </strong>features a 10 Amp AC/DC 11,000 RPM motor. Dust ejection system ejects dust that enters the tool through the air intake vents. Low gear case provides precise gear alignment for a smoother, quieter transmission while allowing access to tight spaces. Quick Change Wheel Release provides simple wheel removal without the need for a wrench. Comes complete with 2-position side handle, depressed center wheel, keyless adjustable guard, wrench, kit box.</p>\r\n<p>\r\n	<strong>5&quot; angle grinder</strong> is very versatile - can do all the toughest jobs of a 7&quot; grinder, while having the comfort and control of a 4-1/2&quot; grinder. High power-to-weight ratio offers greater efficiency and reduced user fatigue. Keyless adjustable guard can be adjusted without tools. Rear handle design provides greater comfort and control. 12 Amp AC/DC 10,000 RPM motor provides high speed for fast material removal, and sealed ball and roller bearings for extended motor life. Includes grinding wheel, wrench, backing flange, clamp nut, keyless adjustable guard and 2-position side handle.</p>\r\n',0,0,1,0,5353,NULL,''),(4948,3176,NULL,132,NULL,'Parts2O TC2160 Pressure Relief Valve',NULL,'<ul>\r\n	<li>\r\n		Constructed from lead free brass, this valve is good