T threaded inlet and outlet. Spring loaded.</p>\r\n',0,0,1,NULL,5147,NULL,NULL),(7380,3302,NULL,NULL,NULL,'Red Gas/Oil Polyethylene Food Grade Linear Low Density (LLDPE) Tubing, 1/4\" O.D.','Sold Per','<p>\r\n	<span style=\"font-size: 12px;\">Commonly used with gas/oil in order to quickly identify the line amongst many other lines. &nbsp;LLDPE has a slightly higher pressure rating than LDPE. Offers exceptional resistance to stress cracking, more so than LDPE. Tubing is non-corrosive, odourless and tasteless. Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements.&nbsp; Temperature Range: -45C to +60C.</span></p>\r\n<p>\r\n	<strong><span style=\"font-size: 12px;\">1/4&quot; O.D., 1/8&quot; I.D</span></strong></p>\r\n',0,0,1,0,7360,NULL,''),(7377,3334,NULL,NULL,NULL,'Industrial Pressure Washer Spray Gun and Lance Assembly, 36\" Length',NULL,'<p>\r\n	Industrial quality gun comes complete with comfort-grip handle and insulated plated steel 36&quot; lance. Rated to 5000 PSI, maximum 10 GPM. 3/8&quot; quick coupling inlet. 1/4&quot; female quick coupling tip for attaching spray tips.</p>\r\n',0,0,1,0,7354,NULL,''),(7378,3302,NULL,NULL,NULL,'Blue Potable Water Polyethylene Food Grade Linear Low Density (LLDPE) Tubing, 1/4\" O.D.','Sold Per','<p>\r\n	<span style=\"font-size: 12px;\">Commonly used with potable water in order to quickly identify the line amongst many other lines. &nbsp;LLDPE has a slightly higher pressure rating than LDPE. Offers exceptional resistance to stress cracking, more so than LDPE. Tubing is non-corrosive, odourless and tasteless. Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements. Temperature Range: -45C to +60C.</span></p>\r\n<p>\r\n	<strong><span style=\"font-size: 12px;\">1/4&quot; O.D., 1/8&quot; I.D.</span></strong></p>\r\n',0,0,1,0,7355,NULL,''),(7492,3358,NULL,77,NULL,'Magikist MD Series Industrial Electric Pressure Washer, 1000 PSI, 120V',NULL,'<p>\r\n	The Magikist MD Series of pressure washers are industrial rated for heavy duty use. Uses an industrial rated Baldor electric motor. 1.5 HP, TEFC, 120V, 15A, 1 phase. Maximum 1000 PSI at 2 GPM.</p>\r\n<p>\r\n	Triplex ceramic plunger pump operates at only 1750 RPM for reduced pump wear when compared with 3600 RPM pumps. This significantly extends the life of the pump.</p>\r\n<p>\r\n	Pressure regulating unloader valve for easy pressure adjustment.</p>\r\n<p>\r\n	Durable powder coated components for resistance to moisture. Handle can be removed for transport or storage of washer. Pneumatic wheels for easy movement.</p>\r\n<p>\r\n	High pressure soap provides superior cleaning when compared with soap injector systems. Soap container holds 4 US gallons. Screw on filler cap and drain plug for easy fill and drain. Soap control allows for easy on and off operation of soap, as well as adjustment for desired soap concentration.</p>\r\n<p>\r\n	Supplied with 35 feet of wire braid high pressure hose, quick couplers, easy-open trigger gun, 24&quot; wand and stainless steel nozzle.</p>\r\n',0,0,1,0,7469,NULL,''),(7379,3302,NULL,NULL,NULL,'Green Compressed Air Polyethylene Food Grade Linear Low Density (LLDPE) Tubing, 1/4\" O.D.','Sold Per','<p>\r\n	<span style=\"font-size: 12px;\">Commonly used with compressed air in order to quickly identify the line amongst many other lines. &nbsp;LLDPE has a slightly higher pressure rating than LDPE. Offers exceptional resistance to stress cracking, more so than LDPE. Tubing is non-corrosive, odourless and tasteless. Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements. Temperature Range: -45C to +60C.</span></p>\r\n<p>\r\n	<strong><span style=\"font-size: 12px;\">1/4&quot; O.D., 1/8&quot; I.D</span></strong></p>\r\n',0,0,1,0,7358,NULL,''),(4515,3285,NULL,1,NULL,'Giant Heavy-Duty Rotating Nozzles','Orifice','<ul>\r\n	<li>\r\n		Robust brass body with plastic cover.</li>\r\n	<li>\r\n		Nozzle and ceramic seat.</li>\r\n	<li>\r\n		Starting recommended by pointing to the ground.</li>\r\n	<li>\