onfined and open area applications.</p>\r\n<p>\r\n	<strong>Unique casing design of pump permits it to draw water to a level of 1/16 without having to place the pump in any kind of sump. </strong></p>\r\n<p>\r\n	Versatile, low maintenance pump is perfect for a wide range of operations supporting contractors, service utilities, municipalities, and homeowners.</p>\r\n<p>\r\n	The ST2038P incorporates a rugged cast aluminum housing, internal thermal overload protection, dual shaft seals, sealed ball bearings, wear resistant impeller, and molded 19\' power cable with strain relief.</p>\r\n<p>\r\n	2 Inch Discharge, 115V 6.5A , 2/3 HP, Max 60 GPM , Max 38\' Total. Meets UL/cUL requirements.</p>\r\n<p>\r\n	<img alt=\"\" src=\"/resources/pages/Puddle Sucker Pump Table.jpg\" style=\"width: 330px; height: 215px;\" /></p>\r\n',0,0,1,0,4525,NULL,NULL),(7623,3084,NULL,216,NULL,'Kodiak PSP125SSU 1-1/4\" Stainless Steel Submersible Dewatering Pump, 120V, 36 GPM',NULL,'<p>\r\n	Hardworking pump is able to draw water down to 1/8&quot;. 1/3 HP motor with thermal overload protection offers added protection for extended life.</p>\r\n<p>\r\n	Comes complete with garden hose adapter - just attach your garden hose and begin pumping! CSA-certified for guaranteed safe performance under tough conditions.</p>\r\n<p>\r\n	Maximum capacity of 36 GPM. Maximum head of 27 ft. 1-1/4&quot; NPT discharge (garden hose adapter included). 115 V, 3A.</p>\r\n',0,0,1,0,4523,NULL,''),(4521,3084,NULL,22,NULL,'Multiquip ST2037 2\" Standard Submersible Dewatering Pump, 120V, 73 GPM',NULL,'<p>\r\n	Lightweight, compact submersible centrifugal pump is ideal for moving water in multiple confined and open area applications.</p>\r\n<p>\r\n	This is a powerful, versatile, low maintenance pump that is perfect for a wide range of operations supporting contractors, service utilities, municipalities, and homeowners.</p>\r\n<p>\r\n	Further, the ST2037 incorporates a rugged cast aluminum housing, internal thermal overload protec