,NULL,'<p>\r\n	Superior pumping performance in a pedestal design in rugged cast iron and stainless steel is engineered for an easy installation. Rugged, cast iron and stainless steel construction. Heavy-duty motor with overload protection extends pump life. Replaces any resedential pedestal pump and offers quick and easy installation.</p>\r\n<p>\r\n	Fits in a 12&quot; diamater basin and offers a 1-1/2&quot; discharge. Max 4800 GPH. 7.3 Amps. 115V, 60 Hz.</p>\r\n',0,1,0,0,7606,NULL,NULL),(7629,3087,NULL,226,NULL,'Flotec Professional Series E5005TLT 1/2 HP Cast Iron Effluent Pump',NULL,'<p>\r\n	<span style=\"color: rgb(95, 95, 95); font-family: Arial, Helvetica, sans-serif;\">This rugged cast iron effluent pump handles up to  solids virtually without clogging.&nbsp; It is perfect for septic tank systems where effluent has to be pumped up to a tank or leach field.&nbsp; It is capable of handling grey water produced by laundry, bath and dishwashers.&nbsp; This pump is does not pump flushable waste such as sewage.</span></p>\r\n<p>\r\n	<span style=\"color: rgb(95, 95, 95); font-family: Arial, Helvetica, sans-serif; background-color: initial;\">Rust-proof impeller.&nbsp;</span><span style=\"color: rgb(95, 95, 95); font-family: Arial, Helvetica, sans-serif; background-color: initial;\">Reliable, professional design.&nbsp;</span><span style=\"color: rgb(95, 95, 95); font-family: Arial, Helvetica, sans-serif; background-color: initial;\">Superior performance. 1-1/2&quot; female discharge. Minimum sump diameter 14&quot;. Mamimum capacity of 3720 GPH. 115V. 12.5A.&nbsp;</span></p>\r\n',0,0,1,0,4521,NULL,''),(4527,2054,NULL,33,NULL,'Flotec FPSE3601A Cast Iron Sewage Pump - 1/2 HP ',NULL,'<ul>\r\n	<li>\r\n		Heavy duty, rugged pump is capable of handling solids up to 2&quot;.</li>\r\n	<li>\r\n		Includes by-pass float switch for automatic or manual operation.</li>\r\n	<li>\r\n		Pumps up to 9000 gallons per hour.</li>\r\n	<li>\r\n		115 Volt.</li>\r\n	<li>\r\n		10\' power cord and f