atch Brush, Wooden Handle, Tempered Steel Bristles','Qty','<p>\r\n	Brush is 14&quot; in length and has 4 rows of tempered steel bristles and a wooden handle.</p>\r\n',0,0,1,0,5767,NULL,''),(5369,2081,NULL,198,NULL,'Irega Adjustable Wrenches w/ Black Phosphate Finish','Size, Capacity','<p>\r\n	Perfectly parallel jaw surfaces ensure perfect grip of fastener. Precision-ground jaw slides ensure smoother action and accurate adjustment of jaw and handle. Double security threaded pin and visible stake for working under extreme conditions. Manufactured from high quality chrome alloy steel. Black phosphate finish helps prevent slippage when hands are soiled.</p>\r\n',0,0,1,0,5370,NULL,NULL),(5370,2081,NULL,11,NULL,'Super Ego Hydraulic Pressure Test Pump',NULL,'<ul>\r\n	<li>\r\n		Used to test systems such as heating, compressed air, refrigeration, oil, sprinklers, etc.</li>\r\n	<li>\r\n		Two piece handle and heavy-duty connecting rod.</li>\r\n	<li>\r\n		Heavy-duty steel tank, 12 litre capacity.</li>\r\n	<li>\r\n		Designed to test up to 860 PSI.</li>\r\n</ul>\r\n',0,0,1,NULL,7461,NULL,NULL),(5823,3057,NULL,18,NULL,'Ridgid Nightshade Torpedo Level',NULL,'<p>\r\n	Ideal for general use and work in tight places. Glow in the dark vial frames for dark areas. Three vials for plumb, level and 45<span class=\"st\"> miter.</span><span class=\"st\"> Three strong rare earth magnets.</span><span class=\"st\"> V-grooved edge for pipe and conduit work.</span><span class=\"st\"> Large top-read level vial.</span></p>\r\n',0,1,0,0,6673,NULL,''),(5433,3308,NULL,102,NULL,'Nalco PC191T Permatreat , 20L Pail','Qty','<p>\r\n	Permatreat PC-191T is a highly effective scale inhibitor whose active components were developed to treat reverse osmosis (RO) systems. Permatreat PC-191 has shown for over 20 years excellent performance against the following scalants: calcium carbonate, calcium sulfate, barium sulfate, strontium sulfate, calcium fluoride, silica and iron.</p>\r\n',0,0,1,0,5436,NULL,''),(5372,208