',0,0,1,0,7507,NULL,''),(5434,3307,NULL,1,NULL,'Sodium Carbonate, Dense, 25 Kg Bag','Qty','<p>\r\n	Sodium Carbonate (soda ash) is a sodium salt of carbonic acid. Sodium carbonate is domestically well known for its everyday use as a water softener. It is a common additive in municipal pools used to neutralize the acidic effects of chlorine and raise pH.</p>\r\n<p>\r\n	<strong>When purchased per bag (less than skid quantity), bags will be over-wrapped with a plastic bag and cardboard box to prevent damage during shipping.</strong></p>\r\n',0,0,1,0,6474,NULL,''),(5380,3328,NULL,18,NULL,'Ridgid Pipe Extractors','Size','<ul>\r\n	<li>\r\n		These pipe extractors make easy work of removing broken threaded ends of schedule 40 pipe, pipe plugs and fittings.</li>\r\n	<li>\r\n		Each is plainly marked showing drill size used when solid ends of plugs and fittings must be drilled to receive extractor.</li>\r\n</ul>\r\n',0,1,0,0,7458,NULL,NULL),(5381,3328,NULL,18,NULL,'Ridgid NPT Pipe Taps: Hand Use Only','Size','<ul>\r\n	<li>\r\n		Made from carbon steel in right hand configuration.</li>\r\n	<li>\r\n		These taps are especially suited for restricted area work.</li>\r\n	<li>\r\n		All taps have taper of 3/4&quot; per foot.</li>\r\n	<li>\r\n		Marked with drill size for pilot hole.</li>\r\n</ul>\r\n',0,1,0,0,5395,NULL,NULL),(6793,3268,NULL,62,NULL,'Baffin Ice Bear -50 Winter Work Boots, Non-Metallic Toe & Plate','Size','<p>\r\n	Engineered to insulate the foot from the outer climate without the need of a bulky liner. Blown polyurethane lining adds warmth through trapped air molecules in the material.The lightweight metal free safety toe and plate provide increased comfort and reduced fatigue. Acid and oil resistant rubber outsoles bring improved flexibility and traction. Wide fit through calf and foot. Warmer, lighter and longer-wearing than traditional rubber boots. Lug outsole design provides added traction on packed snow and icy conditions. Comfort crafed insole. Gelflex midsole for c