g-term wear. PVC/Polyester/PVC material has a thickness of .35mm. Heat sealed grommets are rustproof with ties and seamless edges that prevent build-up of bacteria and residue. Apron is 36&quot; x 48&quot;.</p>\r\n<p>\r\n	<strong>Heavy Duty Neoprene/Nylon Rubber Apron</strong> is suitable for heavy-duty industrial applications and extremely abrasive environments. Apron is made of neoprene/nylon with a material thickness of .45mm. Apron is 35&quot; x 48&quot;.</p>\r\n',0,0,1,0,5399,NULL,NULL),(5200,3272,NULL,NULL,NULL,'Orange PVC Coated Insulated Gloves, 12/pk',NULL,'<p>\r\n	PVC coating will stay soft and flexible in cold working environments. Offers resistance to oils, acids, caustics and alcohols while providing insulation from the cold. Curved fingers, wing thumb and soft insulative lining provide comfort. Rough finish for excellent gripping capabilites of wet and dry materials. 12 inches in length. Sold by the pack of 12.</p>\r\n',0,0,1,0,5206,NULL,NULL),(5868,3369,NULL,100,NULL,'Abmast Premium Bench Grinder Wheels, 6\" and 8\"','Size','<p>\r\n	Each wheel is balanced to ensure safe and efficient grinding of metals. Use on any 6&quot; or 8&quot; bench grinder. Multiple-sized nested bushings included to ensure perfect fit to spindle. Made in U.S.A.<strong> Sold per each.</strong></p>\r\n',0,0,1,0,5863,NULL,''),(5203,3272,NULL,1,NULL,'Green 14\" PVC Double-Dipped Gloves, 12/pk',NULL,'<p>\r\n	PVC coating remains soft when cold. Excellent insulation against cold temperatures. Offers resistance to oils, acids, caustics and alcohols. 14 inches in length. Sold by the pack of 12.</p>\r\n',0,0,1,0,5203,NULL,NULL),(5204,3272,NULL,1,NULL,'Yellow 12\" PVC Coated Single Dipped Gloves, 12/pk',NULL,'<p>\r\n	Stays soft when cold. Excellent wet grip. Resists abrasions and oils, keeps hand clean, dry and chemical free. Comfortable and long wearing. Sold per pack of 12.</p>\r\n',0,0,1,0,5205,NULL,NULL),(5205,3272,NULL,103,NULL,'Ansell Hyd-Tuf 52-547 Nitrile Coated Work Glove, 6/pk','Size','<p>\r\n	Outperforms cotton and leather. Driver\'s style with cloth back and soft jersey lining. Snug and comfortable fit. Nitrile coating resists snags, punctures, abrasions and cuts. Excellent dry grip. Repels oil, grease and grime. Nitrile knuckle strap provides added protection across the back of the hand. Safety cuff. Longer lasting alternative to leather and PVC gloves. Sold per pack of 6</p>\r\n',0,0,1,0,6625,NULL,NULL),(5206,3272,NULL,103,NULL,'Ansell Hyd-Tuf 52-590 Nitrile Coated Winter Series Work Glove, 6/pk','Size','<p>\r\n	Outperforms cotton and leather. Snug and comfortable fit. Nitrile coating resists snags, punctures, abrasions and cuts. Insulated for use in cold weather. Excellent dry grip. Repels oil, grease and grime. Nitrile knuckle strap provides added protection across the back of the hand. Longer lasting alternative to leather and PVC gloves. Sold per pack of 6.</p>\r\n',0,0,1,0,6626,NULL,NULL),(5678,3276,NULL,59,NULL,'GlovePlus Black Nitrile Industrial Disposable Gloves, 6 Mil Thickness','Size, Qty','<p>\r\n	GlovePlus Black Nitrile offers 20% thicker protection than our standard blue nitrile, and in a great professional color! Black nitrile gloves are perfect for automotive, janitorial or plumbing work, and industrial applications. Textured for non-slip wet or dry gripping powder, they are also powder free so they won\'t interfere with fresh paint finishes or adhesives. Latex free, they are perfect for those who are sensitive to latex proteins. Black nitrile is terrific for anyone who wants to impart a high-tech or hard working image. Packaged 100 gloves per box, 10 boxes per case.Tough protection in a bold, professional color.6 mil gloves are powder free.Textured for non-slip gripping power.100 gloves per box, 10 boxes per case.</p>\r\n',0,0,1,0,5674,NULL,''),(7505,3351,NULL,NULL,NULL,'Universal 95 Gallon Shop Spill Kit',NULL,'<p>\r\n	For all types of spills, including chemical and oil. Polyethylene drum measures 32&quot; x 26&quot; x