 for hardness and chelant determination by titration, pH 10.1  0.1 at 20C. Hach methods 8213 and 8226. Also used in Hach Phenols method 8047. 100 mL Marked Dropping Bottle.</p>\r\n',0,0,1,0,5505,NULL,''),(5546,3202,NULL,32,NULL,'Hach 42532 Hardness 2 Indicator Solution, 100 mL MDB',NULL,'<p>\r\n	ManVer (Calmagite) Hardness Indicator, for hardness and chelant determination by titration. 100 mL Marked Dropping Bottle</p>\r\n',0,0,1,1,5506,NULL,''),(5547,3202,NULL,32,NULL,'Hach 42632 Hardness 3 Titrant Solution, 100 mL MDB',NULL,'<p>\r\n	EDTA titrant solution for hardness determination by drop-count titration. 0.03 N (0.015 M) 100 mL Marked Dropping Bottle</p>\r\n',0,0,1,0,5507,NULL,''),(5565,3203,NULL,32,NULL,'Hach 85499 25 ml FerroVer Powder Pillows, pk/100',NULL,'<p>\r\n	For Iron determination by the 1,10 phenanthroline method, using FerroVer Iron Reagent.<br />\r\n	Hach Method 8008. Sample size: 25 mL.<br />\r\n	USEPA approved for reporting wastewater analysis.<br />\r\n	Pack of 100 Powder Pillows</p>\r\n',0,0,1,0,5511,NULL,''),(5548,3212,NULL,32,NULL,'Hach 1457799 Ascorbic Acid Powder Pillows, Pack/100',NULL,'<p>\r\n	Reagent for aluminum determination by the aluminon method (Method 8012), manganese determination by the PAN method (Method 8149) and total chelant determination by titration (Method 8350).<br />\r\n	Pack of 100 powder pillows.</p>\r\n',0,0,1,0,5514,NULL,''),(5637,3000,NULL,147,NULL,'Gates Hi-Power II Type C V-Belts',NULL,'<p>\r\n	Featuring a composite, multi-purpose construction, these belts resist oil and heat, ozone, sunlight, weather, and aging.</p>\r\n<p>\r\n	Suitable for all industrial applications, including v-flat drives</p>\r\n<p>\r\n	Gates Curves provide proper cord support and full contact with the sheave-groove for uniform loading, uniform wear, and increased belt life.</p>\r\n<p>\r\n	Flex Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</p>\r\n<p>\r\n	The Flex-Weave<span class=\"st\"> Cover is a patented construction for longer cover life, providing extended protection to the core of the belt from oil, dirt, and heat.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,5627,NULL,''),(7617,3048,NULL,207,NULL,'Bio Jet 7 Plus, 1 Gallon Container','Qty','<p>\r\n	Bio Jet 7 Plus is a non-hazardous and non-toxic highly active liquid culture of 12 select microorganisms that accelerate the biological oxidation of slow to degrade organic matter (paper products, proteins, fats, oils and greases).</p>\r\n<p>\r\n	Bio Jet 7 Plus promotes increased biological degradation in all types and designs of biological wastewater systems - aerobic and anaerobic wastewater systems, ponds, lagoons and wastewater retention tanks.</p>\r\n<p>\r\n	Bio Jet 7 Plus resists high concentrations of inhibitory constituents, reduces system upsets and biomass kills common to industrial and municipal wastewater systems. With Bio Jet 7 Plus you can improve effluent quality and revive wastewater ecology after a vacation, a harmful hydraulic or chemical event.</p>\r\n<p>\r\n	Bio Jet 7 Plus is available in 1-gallon containers, or in a case of (6) 1-gallon containers.</p>\r\n',0,0,1,0,5691,NULL,''),(5552,3285,NULL,NULL,NULL,'Pressure Washer Gutter Cleaning Attachment',NULL,'<ul>\r\n	<li>\r\n		Attach to telescopic booms or spray gun and lance assemblies to easily clean gutters from the ground.</li>\r\n	<li>\r\n		Stainless steel construction.</li>\r\n	<li>\r\n		Complete with 1/4&quot; quick connect coupler.</li>\r\n</ul>\r\n',0,0,1,0,4517,NULL,''),(6685,3115,NULL,NULL,NULL,'Heavy Duty Construction Quality Tarps','Size','<p>\r\n	Top and bottom of tarp are coated with water resistant polyethylene. High density polyethylene weave - 10 strands vertically and horizontally per square inch. Grommets at each corner and all around them. Poly roping in hem and all around. Double-stitched and heat sealed seams. 4 pieces of poly rope included.</p>\r\n',0,0,1,0,6670,NULL,''),(5554,3285,NULL,NULL,NULL,'Quick Connect Pressure Washer Nozzle Kits','Type','<p>\r\n	1/4&quot; Quick Connect spray tips. Change tips from a 0<span class=\"st\"> high impact to a 40</span><span class=\"st\"> fan spray. Color coded nozzle guards identify the nozzle type and help protect the nozzle and the surface being sprayed from damage.</span></p>\r\n<ul>\r\n	<li>\r\n		<span class=\"st\">Each kit comes with 0</span><span class=\"st\">, 15</span><span class=\"st\">, 40</span><span class=\"st\"> and soaper nozzles.</span></li>\r\n	<li>\r\n		03.5 size nozzles are recommended for use with 4 to 7 HP (or 1000 to 3000 PSI) pressure washers.</li>\r\n	<li>\r\n		040 size nozzles are recommended for use with 8 to 13 HP (or 3100 to 5000 PSI) pressure washers.</li>\r\n</ul>\r\n',0,0,1,0,5551,NULL,''),(5555,2069,NULL,32,NULL,'Hach 5870000 Chlorine Pocket Colorimeter II (Free & Total)',NULL,'<p>\r\n	Includes Pocket Colorimeter II Analysis System for Free Chlorine and Total Chlorine.&nbsp; Reagents included: (100 tests each, low range, or 50 tests each, high range). Complete with manual, sample cells and carrying case. USEPA approved/accepted for drinking water.</p>\r\n<ul>\r\n	<li>\r\n		Low Range - 0.02 to 2.00 mg/L in 0.01 steps.</li>\r\n	<li>\r\n		High Range - 0.1 to 8.0 mg/L in 01. steps.</li>\r\n</ul>\r\n',1,0,1,0,6604,NULL,''),(6607,2072,NULL,32,NULL,'Hach 4530000 Electrode Holder Stand ',NULL,NULL,0,0,1,0,6594,NULL,''),(5558,2070,NULL,32,NULL,'Hach Alkalinity Test Kit, Model AL-AP',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">Caused by the presence of carbonates, bicarbonates, hydroxides, and other dissolved salts, alkalinity is important to food and beverage processors, boiler operators, and aquatic biologists. Kit utilizes drop count titration method and contains 100 tests.</section></div>\r\n<p>\r\n	&nbsp;</p>\r\n<ul>\r\n	<li>\r\n		Simple, economical titration method</li>\r\n	<li>\r\n		Rugged kit contains all required reagents, solutions, and glassware</li>\r\n</ul>\r\n',0,0,1,0,5084,NULL,''),(5560,2070,NULL,32,NULL,'Hach Chlorine Color Disc Test Kit, Free & Total, Model CN-66',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		This color disc test kit uses powder DPD reagent that reacts with chlorine more quickly than tablet-form DPD, giving more accurate results. Powder DPD also has a considerable advantage over orthotolidine, a hazardous substance sometimes used as a free and total chlorine test reagent. Hach Chlorine Test Kits are manufactured by Hach to ensure compliance with stringent quality control standards. Kit contains 100 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Quickly and accurately measures free and total chlorine levels in the field or in the lab</li>\r\n		<li>\r\n			Simple and fast color disc method</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5558,NULL,''),(5562,2070,NULL,32,NULL,'Hach Hypochlorite Test Kit, Model CN-HR',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Utilizing the simple, economical drop count titration method, this kit is used to determine high range hypochlorite solution concentrations (bleach solutions). Range: 5-15%, contains 100 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Simple, economical titration method</li>\r\n		<li>\r\n			Kit contains all required reagents, solutions, and glassware</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,1,5561,NULL,''),(5566,3200,NULL,32,NULL,'Hach pH Electrode Storage Solution','Size','<p>\r\n	Potassium Chloride (KCl) 3 M</p>\r\n',0,0,1,0,6796,NULL,''),(5568,3361,NULL,NULL,NULL,'Pressure Washer Pump Oil',NULL,'<p>\r\n	SAE 30 Excellent oil for any pump. A must for pumps with Viton seals. Non-foaming, non-detergent, anti-wearing. Made specifically for pressure washer pumps.</p>\r\n',0,0,1,0,4391,NULL,''),(5569,3052,NULL,NULL,NULL,'Breather Vent Silencers','Size','<p>\r\n	Applications include vacuum relief or pressure equalization on gear boxes, oil tanks or reservoirs. Nickel Plated steel insert with a bronze filter. Standard pipe thread fittings for quick assembly and removal for cleaning. Maximum operating pressure: 150 PSI. Operating temps: 35F to 300F. The filter element is rated for 40 micron filtration.</p>\r\n',0,0,1,0,5567,NULL,''),(5570,2072,NULL,32,NULL,'Hach HQ11d Portable Meter Kit with PHC101 pH Electrode',NULL,'<p>\r\n	Designed for water quality experts, the Hach HQ11d portable meter is a dedicated pH/mV meter that takes the guesswork out of measurements. The HQ11d meter connects with standard or rugged smart pH probes that automatically recognize the testing parameter, calibration history, and method settings to minimize errors and setup time. The durable portable meter and optional probes are designed to withstand years of rugged portable and field use. HQd meters feature a simple user interface that does not require manuals or training to operate.</p>\r\n<p>\r\n	This meter / probe kit will measure temperature, pH, mV, ORP / Redox</p>\r\n<p>\r\n	Meter kit includes HQ11d meter, PHC101 gel-filled pH electrode, 4 AA batteries, quick-start guide, user manual, and documentation CD.</p>\r\n',0,0,1,0,5576,NULL,''),(7123,3037,NULL,NULL,NULL,'Brass Ball Valve with Locking Handle & Bleed','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; vertical-align: baseline;\">Brass Ball valve with locking handle and bleed have locking hangles and a port that vents the downstream side of the system when the valve is closed, providing extra safety in air systems.</span></p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; vertical-align: baseline;\">600 psi water, oil, gas, 150 psi steam. Sizes 1/2 &quot; to 2&quot; are CSA approved under classes 3371-92, 3371-12, and 3371-08 for 1/2 psi natural gas.</span></p>\r\n',0,0,1,0,7107,NULL,''),(6603,3262,NULL,43,NULL,'Pyrex Glass Graduated Cylinders','Size','<p>\r\n	These Pyrex Class A graduated cylinders are calibrated &quot;to deliver&quot; (TD) in accordance with ASTM E-1272 and ASTM E-542. The double scale, numbered both up and down, is in durable enamel. Cylinders are supplied with shock absorbing polyethylene bumper guards.</p>\r\n',0,0,1,0,7568,NULL,''),(6600,3262,NULL,43,NULL,'Pyrex Griffin Low Form Glass Beaker, 1000 ml','Qty','<p>\r\n	Griffin style (low form) beakers are the industry standard for a wide variety of lab applications. Graduations are high quality screen printing. Bull nose lip and molded pour spout minimize spillage in liquid transfer. Autoclavable, non-toxic and biologically inert. Volumes and graduations are approximate.</p>\r\n<ul>\r\n	<li>\r\n		These 1000 ml beakers are sold per each or case of 6.</li>\r\n</ul>\r\n',0,0,1,0,5401,NULL,''),(6544,3045,NULL,NULL,NULL,'IDI Replacement Electronic Ballast',NULL,NULL,0,0,1,0,6531,NULL,''),(6543,3044,NULL,NULL,NULL,'Fischer & Porter Replacement Electronic AC Ballast',NULL,NULL,0,0,1,0,6530,NULL,''),(6617,3264,NULL,79,NULL,'Furgale Industrial Floor Squeegee Heads, Curved','Length','<ul>\r\n	<li>\r\n		Heavy-duty rubber squeegee with steel frame and cast connector.</li>\r\n	<li>\r\n		Curved ends enhance debris containment.</li>\r\n	<li>\r\n		For use on water, slush, snow, sludge, etc.</li>\r\n</ul>\r\n',0,0,1,0,6602,NULL,''),(6618,3264,NULL,79,NULL,'Industrial Floor Squeegee Assembly',NULL,'<p>\r\n	Heavy-duty 24&quot; rubber squeegee head with steel frame and cast connector. Effectively cleans debris on all types of surfaces. Extra strength 54&quot; handle has a lacquered finish.</p>\r\n',0,0,1,0,6603,NULL,''),(5912,2070,NULL,32,NULL,'Hach Ozone Test Kit, Model OZ-2',NULL,'<div id=\"productDescription\">\r\n	<p>\r\n		This compact and low cost ozone test kit utilizes an easy to use color disc method. Simply grab a sample, add powder and compare sample color to the color wheel to arrive on an accurate measurement.</p>\r\n	<ul>\r\n		<li>\r\n			Hach\'s most economical ozone test kit</li>\r\n		<li>\r\n			Simple, low-cost color disc method is the most accurate visual test kit method</li>\r\n		<li>\r\n			Achieve fast results with a compact, easy-to-carry test kit</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5830,NULL,''),(5586,3072,NULL,NULL,NULL,'4 Way SAE Wheel Wrench',NULL,'<p>\r\n	20&quot; overall width. 11/16&quot;, 3/4&quot;, 13/16&quot; and 7/8&quot; wheel nut sizes. Sizes embossed on each end. Chrome plated to resist rusting.</p>\r\n',0,0,1,NULL,6212,NULL,''),(7637,3040,NULL,171,NULL,'Apollo 60-900 Series Brass Needle Valves','Size','<p>\r\n	Apollo\'s brass needles valves have a maximum operating pressure of 5000 psig. Malleable iron handle for long lasting reliable service. Designed to backseat when fully opened. Backseating the valve helps take the pressure off the packing, thereby prolonging the packing life. The backseat also prevents the stem from being accidently turned out of the valve. Grafoil packing. Tested at 300 psig air. FNPT ends.</p>\r\n',0,0,1,0,7614,NULL,''),(6872,3037,NULL,182,NULL,'Colonial Stem Extensions for Industrial Full Block Ball Valves','Valve Size, Stem Length','<p>\r\n	This schedule 80 PVC stem extension extends the handle for a Full Block Industrial true union ball valve. It locks securely to the stem and stem-stops, and is offered for valve sizes from 1 to 4 inches. Useful for hard to access ball valves. Custom lengths available upon request (6&quot; to 72&quot; stem length range).</p>\r\n',0,0,1,0,7103,NULL,''),(6167,3178,NULL,148,NULL,'Premium Triple Outlet 12 Gauge Extension Cords','Length','<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<div class=\"details-add-to-cart2\">\r\n		<section class=\"product-details\">\r\n		<p>\r\n			Commercial grade 12 gauge extension cord is construced with SJTW cable, making it a hard serving, weather and water resistant outdoor-use cord. Extremely flexible from -40C to 105C. LED power indicator. 3 conductors grounded. Weather, water, and oil resistant. Flame retardent. Durable PVC jacket. Meets cUL requirments.</p>\r\n		</section></div>\r\n	</section></div>\r\n',0,0,1,0,6163,NULL,''),(5745,3111,NULL,72,NULL,'Garant Pro Series Round Blade Shovel, Short D-Grip Handle',NULL,'<p>\r\n	Industrial grade round point shovel. Hollow back tempered steel blade is very tough, designed for the most demanding work. Forward turned steps. Premium 28&quot; varnished ash handle with steel d-grip.</p>\r\n',0,0,1,0,5739,NULL,''),(5753,3112,NULL,72,NULL,'Garant Alpine 26\" Snow Pusher w/ Wear Strip',NULL,'<ul>\r\n	<li>\r\n		46&quot; stained ash handle.</li>\r\n	<li>\r\n		21&quot; yellow poly blade.</li>\r\n	<li>\r\n		Steel wear strip.</li>\r\n</ul>\r\n',0,0,1,NULL,5743,NULL,''),(5594,3208,NULL,32,NULL,'Hach 104299 Acid Powder Pillows, 25 mL, pk/100',NULL,'<p>\r\n	For determination of high range silica by the silicomolybdate method (Hach method 8185) Range: 1-100.0 mg/L SiO2. Also used in the iodometric method (Hach method 10100) for the determination of high range hypchlorite (50-150 g/L as Cl2). Pack of 100 powder pillows.</p>\r\n',0,0,1,1,5482,NULL,''),(5595,3208,NULL,32,NULL,'Hach 2059996 Potassium Iodide Powder Pillows, pk/50',NULL,'<p>\r\n	For chromate and chlorine determination by titration.</p>\r\n',0,0,1,NULL,5483,NULL,''),(5596,3208,NULL,32,NULL,'Hach 2686832 Sodium Thiosulfate Solution, 2.12N 100 mL',NULL,'<p>\r\n	For determination of high range hypochlorite (bleach) concentrations by drop-count titration.</p>\r\n',0,0,1,NULL,5484,NULL,''),(5597,3064,NULL,NULL,NULL,'Vapor Proof Incandescent Work Lights','Cord Length','<p>\r\n	Made to last with a heavy duty handle made from rubber, thick glass globe and super strong wire guard. Easy to rebuild on the jobsite.&nbsp;<span style=\"font-size: 12px;\">Globe is heat and impact resistant, threading into rubber handle.&nbsp;</span><span style=\"font-size: 12px;\">The cord entry is waterproof and won\'t pull out.&nbsp;</span><span style=\"font-size: 12px;\">The guard is constructed out of heavy gauge wire and is zinc chromate plated.&nbsp;</span><span style=\"font-size: 12px;\">120V, 60 Hz, 16/3&nbsp; SOW cord, NEMA 5-15 plug, Quik-Latch guard. UL compliant.</span></p>\r\n',0,0,1,0,7417,NULL,''),(7705,3064,NULL,NULL,NULL,'Wobblelight Self-Righting Work Lights','Description','<p>\r\n	Bright and dependable, the self righting Wobblelight delivers maximum light output in a highly durable and portable package with no hot surfaces. Ideal anywhere temporary high-output lighting is needed, such as indoor and outdoor job sites, plant maintenance, fire and rescue, and more. Floating shock system protects bulb from impact. 360 degree lighting output. No set up required - plugs into 120V AC supply.</p>\r\n',0,0,1,0,7416,NULL,''),(5601,3221,NULL,NULL,NULL,'Mini Aluminum 2AA LED Flashlight',NULL,'<p>\r\n	Lightweight aluminum construction. LED technology provides brighter light and less battery consumption than halogen flashlights. Push button on/off switch. 7&quot; wrist lanyard. Uses 2 AA batteries.</p>\r\n',0,0,1,0,5599,NULL,''),(5602,3221,NULL,NULL,NULL,'LED Head Flashlight',NULL,'<p>\r\n	4 position switch; 3 white LED\'s on, 6 white LED\'s on, 4 red LED\'s on, 4 red LED\'s flashing. 3 strap adjustable elasticized nylon head band. ABS body with plastic lens. Adjustable beam angle.</p>\r\n',0,0,1,0,6410,NULL,''),(5603,3221,NULL,NULL,NULL,'Halogen Hand-Held Spotlight',NULL,'<p>\r\n	1,000,000 (One Million) candle power. Strong ABS housing. 12V-H3-100W halogen bulb included. Cigarette lighter plug-in source. 4-1/2&quot; diamater lens. Spring loaded trigger switch with hold &quot;on&quot; feature. Coiled cord extends to 9 ft. Convenient hook for hanging.</p>\r\n',0,0,1,NULL,6775,NULL,''),(5764,3339,NULL,71,NULL,'Fire Axe with Spike, Hickory Handle','Head Weight','<p>\r\n	Fire Axe has a spike on one end and comes complete with a high grade 36&quot; hickory handle. Choose from a 4-1/2 lb or 6 lb head.</p>\r\n',0,0,1,0,5753,NULL,''),(5662,3090,NULL,22,NULL,'Multiquip QP3TH Heavy Duty Gas Engine Trash Pump, 3 Inch, 396 GPM',NULL,'<p>\r\n	This is Multiquip\'s most popular pump model. The QP3TH is perfect for many pumping applications from dewatering to water tank and water truck use. Dual discharge ports increase the productivity and practicality of this gasoline-powered trash pump.</p>\r\n<ul>\r\n	<li>\r\n		Features to tackle the demanding requirements of the Pro Contractors.</li>\r\n	<li>\r\n		Trusted 7.9HP Honda GX240 gasoline engine.</li>\r\n	<li>\r\n		Automatic low oil shutdown for the engine is a standard feature.</li>\r\n	<li>\r\n		Pumps water with solid content as&nbsp;large as 1.5-inch (37 mm)&nbsp;in diameter.</li>\r\n	<li>\r\n		Maximum lift of 25 feet (7.6 meters).</li>\r\n	<li>\r\n		Can pump up to 396 gallons (1,500 liters) per minute.</li>\r\n	<li>\r\n		Dual 3-inch discharge ports to adapt&nbsp;to different applications.</li>\r\n	<li>\r\n		Silicon/silicon mechanical seal for durability.</li>\r\n	<li>\r\n		Large cleanout cover removes in seconds without tools.</li>\r\n	<li>\r\n		Tubular Steel frame for transportation and pump protection.</li>\r\n	<li>\r\n		Cast Iron impeller and volute for abrasion resistance/long life.</li>\r\n	<li>\r\n		Aluminum body with cast-iron fittings.</li>\r\n</ul>\r\n<p>\r\n	<img alt=\"\" src=\"/resources/pages/QP3TH Curve Chart.jpg\" style=\"width: 300px; height: 333px;\" /></p>\r\n',0,0,1,0,5657,NULL,''),(7627,3090,NULL,22,NULL,'Multiquip Industrial Heavy Duty Subaru-Hatz Diesel Engine Trash Pumps','Size','<p>\r\n	Multiquip\'s diesel engine trash pumps feature easy maintenance with an easy clean out cover design. The models include a two-vane impeller that can be easily removed from the engine shaft, exposing the seal for inspection/replacement.&nbsp;</p>\r\n<p>\r\n	Both pumps feature die cast aluminum bodies that are lightweight and strong for easy handling. Double volute design - designed with cast iron materials for efficiency, abrasion resistance and minimal clogging. Silicon/Tungsten carbon mechanical seal for long life and abrasion resistance. Seal sleeve and pump shaft are made from stainless steel for corrosion resistance and long operating life.</p>\r\n<p>\r\n	<strong>2-inch model </strong>features a powerful Subaru-Hatz 1B20 4.6 HP diesel engine.&nbsp;&nbsp;Moves 1&quot; solids. 198 GPM, 95\' head.&nbsp;</p>\r\n<p>\r\n	<strong>3-inch model </strong>features a powerful Subaru-Hatz 1B30 6.8 HP diesel engine.&nbsp;&nbsp;Moves 1-1/2&quot; solids. 383 GPM, 90\' head.&nbsp;</p>\r\n',0,0,1,0,7604,NULL,''),(7628,3090,NULL,216,NULL,'Kodiak Industrial Heavy Duty Honda Engine Semi-Trash Pumps','Size','<p>\r\n	Kodiak\'s semi-trash pumps feature a super-tough design capable of handling slurry and solids up to 3/4&quot; in diameter. Features include a heavy-duty silicon carbide mechanical seal for long-lasting performance, and a cast-iron volute and impeller for heavy-duty performance. Honda GX series engines delivers everytime with hassle-free low maintenance.</p>\r\n<p>\r\n	<strong>2-Inch Pump </strong>features a 4.0 HP Honda GX120, capable of pumping 185 GPM. 28 ft suction lift, 76 ft suction head.</p>\r\n<p>\r\n	<strong>3-Inch Pump </strong>features a 5.5 HP Honda GX160, capable of pumping 264 GPM. 28 ft suction lift, 76 ft suction head.</p>\r\n',0,0,1,0,7605,NULL,''),(5664,3085,NULL,22,NULL,'Multiquip QP2H 2\" Honda Gas Engine Centrifugal Water Pump',NULL,'<p>\r\n	This versatile centrifugal pump makes fast work of moving all types of clear water applications where there are limited solids (up to 10% of solids with a maximum solid size of 1/4 of the diameter of the pump ports.)</p>\r\n<ul type=\"disc\">\r\n	<li style=\"tab-stops: list .5in\">\r\n		Perfect for construction, municipal and agricultural jobs.&nbsp;&nbsp;</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Maximum pumping capacity of&nbsp;158 gallons (598 liters) per&nbsp;minute.</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Maximum lift of 25 feet (7.6 meters).</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Powerful 3.5HP&nbsp;GX120&nbsp;Honda gasoline engine.</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Discharge port easily rotates 180<span style=\"FONT-FAMILY: Arial\"></span> for hose orientation.</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Engine oil-alert to protect the engine in the case of low engine oil.</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Aluminum body with cast-iron fittings.</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Tubular Steel frame for transportation and pump protection.</li>\r\n	<li style=\"tab-stops: list .5in\">\r\n		Cast Iron impeller and volute for abrasion resistance/long life.</li>\r\n</ul>\r\n<p>\r\n	<img alt=\"\" src=\"/resources/pages/QP2H Pump Curve Chart.jpg\" style=\"width: 330px; height: 253px;\" /></p>\r\n',0,0,1,0,5659,NULL,''),(5763,3339,NULL,71,NULL,'Fire Fighting Shovel',NULL,'<p>\r\n	This Fire Fighting Shovel has a red painted blade and handle tip for easy identification. High quality 45&quot; lacquered wood handle. Blade dimensions: 10&quot; x 7-1/2&quot;.</p>\r\n',0,0,1,0,5755,NULL,''),(7630,3085,NULL,22,NULL,'Multiquip Industrial Heavy Duty Honda Engine Ultra Pressure Centrifugal Dewatering Pumps','Size','<p>\r\n	Multiquip\'s Ultra Pressure twin-closed impeller pumps utilize twin aluminum impellers that are engineered to provide outstanding performance and easy service benefits. The design offers a maintenance advantage of longer life, and eliminates the need for adjustment (shimming) of the impellers. Both models provide a unique three-discharge port configuration: (1) 1-1/2&quot; diameter and (2) 1&quot; diameter ports. These pumps are ideal for water jetting, irrigation, dust control, water wash, and fire fighting.</p>\r\n<p>\r\n	<strong>2-Inch Suction Ultra Pressure Pump </strong>features a 7.9 HP Honda GX240 gas engine with low oil alert. This pump produces 135 PSI and 126 GPM. 312 ft max. head. Discharge ports: 1.5&quot; X 1&quot; X 1&quot;.</p>\r\n<p>\r\n	<strong>3-Inch Suction Ultra Pressure Pump&nbsp;</strong>features a 10.7 HP Honda GX340 gas engine with low oil alert. This pump produces 142 PSI and 145 GPM. 328 ft max. head. Discharge ports: 1.5&quot; X 1&quot; X 1&quot;.</p>\r\n',0,0,1,0,7607,NULL,''),(7631,3085,NULL,216,NULL,'Kodiak Industrial Heavy Duty Honda Engine High Pressure Centrifugal Dewatering Pump Package',NULL,'<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.0029983520508px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<span style=\"line-height: 16.0029983520508px;\">Kodiak\'s High Pressure centrifugal dewatering pump utilizes a special high-pressure design which lets you blast through jobs faster and more efficiently. Metal roll cage adds strength and extra protection for extended durability. High quality parts allow for uninterrupted jobsite performance. </span><span style=\"line-height: 16.0029983520508px;\">This pump is ideal for water jetting, irrigation, dust control, water wash, and fire fighting.</span></p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.0029983520508px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	This pump package comes complete with everything needed to get the job done.&nbsp;<span style=\"line-height: 16.0029983520508px;\">In addition to the pump itself, the package includea a 25 ft green EPDM suction hose assembly, round hole suction strainer assembly, 50 ft single jacket layflat discharge hose assembly, discharge nozzle, as well as all conjoining fittings.</span></p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.0029983520508px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<span style=\"line-height: 16.0029983520508px;\">Features a 5.5 HP Honda GX160 OHV gas engine with low oil alert. This pump produces 72</span><span style=\"line-height: 16.0029983520508px;\">&nbsp;PSI and 106 GPM. 165 ft max. head. 1-1/2&quot; intake and discharge.</span></p>\r\n',0,0,1,0,7608,NULL,''),(5669,2059,NULL,33,NULL,'Flotec FP0FDC 12v DC Water Removal Utility Pump ',NULL,'<p>\r\n	Compact and portable, this small utility transfer pump operates on 12v DC so it can be used away from household power.&nbsp; Use it to drain unwanted water.</p>\r\n<h5 id=\"ctl14_headingKeyFeatures\">\r\n	Key features</h5>\r\n<div class=\"keyFeatures\">\r\n	<ul>\r\n		<li>\r\n			Compact and Portable</li>\r\n		<li>\r\n			Easy setup, easy to use</li>\r\n		<li>\r\n			Includes PUD-L-SCOOP Attachment -- Pumps water down to 1/8&quot;</li>\r\n		<li>\r\n			Corrosion-Resistant -- Thermoplastic impeller housing</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,NULL,5664,NULL,''),(5670,2059,NULL,33,NULL,'Flotec FP0F360AC Cyclone Water Removal Utility Pump ',NULL,'<div class=\"abstract\">\r\n	The Cyclone pumping system is designed for every day or emergency use. Perfect for transferring or removing unwanted water from waterbeds, aquariums, or non-draining sinks.</div>\r\n<h5 id=\"ctl14_headingKeyFeatures\">\r\n	Key features</h5>\r\n<div class=\"keyFeatures\">\r\n	<ul>\r\n		<li>\r\n			Multipurpose pump designed for emergency dewatering, draining aquariums, waterbeds and clogged sinks</li>\r\n		<li>\r\n			Self-priming at 8-10 ft. vertically</li>\r\n		<li>\r\n			Corrosion-resistant, compact and portable</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5665,NULL,''),(5674,3090,NULL,22,NULL,'Multiquip MQD2H Gas Engine Diaphragm Pump, 2 Inch, 50 GPM',NULL,'<div id=\"product-summary\">\r\n	Diaphragm pumps are built for long-life and reliable service in many applications. Favored by municipalities and contractors for street repairs and other seepage applications.</div>\r\n<div class=\"double-spaced\" id=\"product-details\">\r\n	<div>\r\n		<ul type=\"disc\">\r\n			<li style=\"\">\r\n				<b>Ideal for muddy water, high solid content. </b></li>\r\n			<li style=\"\">\r\n				<b>Handles 1 5/8 solids.</b></li>\r\n			<li style=\"\">\r\n				<b>For fluids up to 180</b><b> F.</b></li>\r\n			<li style=\"\">\r\n				<b>Pumps up to&nbsp;50 gallons (189 liters)&nbsp;per minute. </b></li>\r\n			<li style=\"\">\r\n				<b>Maximum lift of 25 feet (7.6 meters). </b></li>\r\n			<li style=\"\">\r\n				<b>Powered by a Honda GX120 3.5HP gasoline engine. </b></li>\r\n			<li style=\"\">\r\n				<b>Enclosed gears with oil bath lubrication. </b></li>\r\n			<li style=\"\">\r\n				<b>Easily switches from inline to transverse flow.</b></li>\r\n		</ul>\r\n	</div>\r\n</div>\r\n<p>\r\n	<img alt=\"\" src=\"/resources/pages/Diaphragm Gas Pump Curve Chart.jpg\" style=\"width: 330px; height: 207px;\" /></p>\r\n',0,0,1,0,6049,NULL,''),(7045,3327,NULL,65,NULL,'General Pipe Cleaners R-10CS Cutter Set',NULL,'<p>\r\n	This cutter set includes spear head, hook auger, 2&quot; u-cutter, 3&quot; u-cutter, retrieving tool, and coupling key.</p>\r\n<p>\r\n	This cutter set is designed for 7/8&quot; sectional cable.</p>\r\n',0,0,1,0,7028,NULL,''),(7046,3327,NULL,65,NULL,'General Pipe Cleaners R-8CS Cutter Set',NULL,'<p>\r\n	This cutter set includes boring gimlet, 1-1/2&quot; u-cutter, small retrieving tool, arrow head, and coupling key.</p>\r\n<p>\r\n	This cutter set is designed for 5/8&quot; sectional cable.</p>\r\n',0,0,1,0,7029,NULL,''),(5675,3090,NULL,22,NULL,'Multiquip MQD3H Gas Engine Diaphragm Pump, 3 Inch, 90 GPM',NULL,'<ul type=\"disc\">\r\n	<li style=\"\">\r\n		<b>Ideal for muddy water, high solid content. </b></li>\r\n	<li style=\"\">\r\n		<b>Handles 1 5/8 solids.</b></li>\r\n	<li style=\"\">\r\n		<b>For fluids up to 180</b><b> F.</b></li>\r\n	<li style=\"\">\r\n		<b>Pumps up to&nbsp;90 gallons (342 liters)&nbsp;per minute. </b></li>\r\n	<li style=\"\">\r\n		<b>Maximum lift of 25 feet (7.6 meters). </b></li>\r\n	<li style=\"\">\r\n		<b>Powered by a Honda GX120 3.5HP gasoline engine. </b></li>\r\n	<li style=\"\">\r\n		<b>Enclosed gears with oil bath lubrication. </b></li>\r\n	<li style=\"\">\r\n		<b>Easily switches from inline to transverse flow.</b></li>\r\n</ul>\r\n<p>\r\n	<img alt=\"\" src=\"/resources/pages/Diaphragm Gas Pump Curve Chart.jpg\" style=\"width: 330px; height: 207px;\" /></p>\r\n',0,0,1,0,6050,NULL,''),(5676,3086,NULL,146,NULL,'Guzzler 1-Inch Multi-Purpose Diaphragm Pump ','Description','<p>\r\n	Smaller and lighter than a loaf of bread while being capable of pumping up to 10 gallons per minute. Sets up in seconds and finishes the job in less time than it would take to set up a powered pump. Stones, slurry, and debris can pass through this Guzzler without hampering use. Use to start a siphon, de-water pits, fire hydrants, trenches, septic tanks, holding tanks, toilet bowls and tanks, clogged sinks, and anything else you can think of. Fill overhead tanks in areas where there is no electricity. Use as a backup to your electric sump pump during a power failure. Connects to any 1 I.D. hose using just a clamp. 12 feet of suction lift and 30 feet of discharge head.</p>\r\n<p>\r\n	Choose a pump with smooth ends if you prefer to slip your hose on and tighten with a clamp. Choose a pump with threaded ends if you prefer to attach your hose using fittings.</p>\r\n',0,0,1,0,5672,NULL,''),(5677,3086,NULL,146,NULL,'Guzzler 1.5-Inch Multi-Purpose Diaphragm Pump','Description','<p>\r\n	Smaller and lighter than a loaf of bread while being capable of pumping up to 10 gallons per minute. Sets up in seconds and finishes the job in less time than it would take to set up a powered pump. Stones, slurry, and debris can pass through this Guzzler without hampering use. Use to start a siphon, de-water pits, fire hydrants, trenches, septic tanks, holding tanks, toilet bowls and tanks, clogged sinks, and anything else you can think of. Fill overhead tanks in areas where there is no electricity. Use as a backup to your electric sump pump during a power failure. Connects to any 1-1/2 I.D. hose using just a clamp. 12 feet of suction lift and 30 feet of discharge head.</p>\r\n<p>\r\n	Choose a pump with smooth ends if you prefer to slip your hose on and tighten with a clamp. Choose a pump with threaded ends if you prefer to attach your hose using fittings.</p>\r\n',0,0,1,0,5693,NULL,''),(5679,3276,NULL,61,NULL,'Xtreme Industrial Grade Disposable Nitrile Gloves, 5 Mil Thickness','Size, Qty','<p>\r\n	Xtreme industrial grade gloves are made from 100% nitrile with a micro-roughened textured grip. Powder free and latex free. Great for food service, automotive repair, painting, industrial applications and any situation where non-latex glove use is a must. 100 gloves per box, 10 boxes per case.Tough protection with an easy price.5 mil gloves are powder free.&quot;Micro-roughened&quot; grip combines dexterity with an excellent non-slip grip, wet or dry.100 gloves per box, 10 boxes per case.</p>\r\n',0,0,1,0,5673,NULL,''),(5680,3276,NULL,60,NULL,'Xtreme X3 Industrial Grade Disposable Nitrile Gloves, 3.5 Mil Thickness','Size, Qty','<p>\r\n	Xtreme X3 nitrile gloves feature thinwall technology along with a micro-roughened grip that combines dexterity with an excellent non-slip grip, wet or dry. Great for food processing, janitorial or manufacturing. 100 gloves per box, 10 boxes per case.Thinwall technology for amazing dexterity.3.5 mil gloves are powder free.Textured for a strong grip.100 gloves per box, 10 boxes per case.</p>\r\n',0,1,0,0,5209,NULL,''),(5681,3386,NULL,4,NULL,'Work King s426 Lined High Visibility 5-In-1 Jacket, Yellow','Size','<p>\r\n	Shell/liner: 100% polyester with polyurethane coating. Shell/liner: 100% polyester lining. Liner: 100% 6 oz quilted polyester insulation. 3M Scotchlite reflective material w/ 4&quot; contrast backing. Black cuffs and hemline for hiding dirt. Removable hi-vis liner (reverses to black) with zip-off sleeves. 2 microphone loops (shell/liner). Multi-pocketed (shell/liner). ID pocket with hook and loop closure (shell/liner). Quick-release hard hat hood (included, not shown in image). Embroidery zipper (shell). Meets CSA Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 3, Level 2.</p>\r\n',0,0,1,0,6084,NULL,''),(6736,3387,NULL,67,NULL,'Forcefield 4-In-1 Lined High Visibility Parka, Yellow','Size','<p>\r\n	<u><strong>Outer Shell</strong></u></p>\r\n<p>\r\n	100% fluorscent polyester oxford PU coated fabric is fully seam sealed making it windproof and waterproof. Reflective tape in 4&quot; configuration meets CSA Z96-09 Class 2 Level 2. Mesh lined. Heavy duty 2-way front zip with snap closure storm flap. 3-piece hidden hood, outer patch pockets and 2 inner pockets. Black trim hides dirt at cuffs and hem.</p>\r\n<p>\r\n	<u><strong>Inner Bomber</strong></u></p>\r\n<p>\r\n	100% fluorscent polyester oxford PU coated fabric is fully seam sealed making it windproof and waterproof. Reflective tape in 4&quot; configuration meets CSA Z96-09 Class 2 Level 2. Quilt-lined with 6 oz polyester insulation. Heavy-duty rib knit cuff and hem. Sleeves zip off for vest. Front patch pockets and 2 inner pockets. Bomber reverses to black.</p>\r\n',0,0,1,0,6101,NULL,''),(5682,3387,NULL,4,NULL,'Work King s176 Lined High Visibility Parka, Yellow','Size','<p>\r\n	Fabric: 100% polyester with polyurethane coating. Lining: quilted 6 oz polyester insulation. 3M Scotchlite reflective material w/ 4&quot; contrast backing. Black cuffs and hemline for hiding dirt. Dual microphone loops. ID pocket with loss-proof flap. Quick-release hard hat hood. Snap front fly over 2-way zipper. Storm cuffs. Meets CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 3, Level 2.</p>\r\n',0,0,1,0,6720,NULL,''),(5683,3395,NULL,4,NULL,'Work King s794 Unlined High Visibility Coveralls, Navy','Size','<p>\r\n	Fabric: 65% polyester/35% cotton twill. 3M Scotchlite reflective material w/ 4&quot; yellow backing. Upper chest pockets with velcro close flaps. 2-way Delrin zipper w/ fly front. Adjustable snap cuffs plus leg openings. Side openings for easy access to underlayers. Action back. Back elastic waist.</p>\r\n',0,0,1,0,7236,NULL,''),(7107,3129,NULL,32,NULL,'Hach Pocket Pro+ Multi-Testers','Description','<p>\r\n	The Hach Pocket Pro+ Testers are engineered to deliver accurate results. Backed up with built in performance diagnostics, you never have to guess when to clean or calibrate the sensor. You also get replaceable batteries for field use, and a large, easy-to-read LCD screen.</p>\r\n<p>\r\n	Easy calibration steps and built-in diagnostics for pH testers take the guesswork out of calibrating the sensor to keep it in optimum condition. Easy-to-replace AAA batteries and a convenient sample cup make maintenance and measurements simple.</p>\r\n',0,0,1,0,7090,NULL,''),(7605,3129,NULL,32,NULL,'Hach Pocket Pro Conductivity Testers','Description','<p>\r\n	The Hach Pocket Pro Conductivity Testers are engineered to deliver accurate results. Backed up with built in performance diagnostics, you never have to guess when to clean or calibrate the sensor. You also get replaceable batteries for field use, and a large, easy-to-read LCD screen.</p>\r\n',0,0,1,0,7582,NULL,''),(7619,3087,NULL,33,NULL,'Flotec Zinc Body Submersible High Output Sump Effluent Pumps','Description','<p>\r\n	Flotec\'s new highly engineered line of sump pumps feature a vertical switch allows that allow pumps to fit in a sump basin as small as 10 wide. Corrosion resistant zinc construction dissipates heat quickly and extends motor life. Uni-body motor housing eliminates leak points and maximizes pump life. Stainless steel fasteners and hardware ensure superior quality. Quadra Seal Technology provides superior motor protection over single seal designs.</p>\r\n<p>\r\n	All pumps have 1-1/2&quot; NPT discharge and are capable of handling 3/8&quot; solids. 115V.</p>\r\n',0,0,1,0,7596,NULL,''),(6674,3347,NULL,NULL,NULL,'Single Jacket Fire Hose Assemblies w/ Aluminum NPSH Swivel Ends','Size','<p>\r\n	Built for medium-duty industrial washdown, drainage and fire fighting applications. This is a medium-duty, all-synthetic hose with a rubber lining for indoor and outdoor use. The rubber lining also provides mildew and rot resistance. Recommended for use in stationary applications such as medium-duty washdown, pump dewatering, or hydrant applications . Not recommended for applications where the hose is repeatedly dragged.</p>\r\n<p>\r\n	These pre-fabricated assemblies come complete with hard-coat aluminum male and female swivel NPSH fittings. Has a working pressure of 150 PSI. Hose is 1-1/2&quot; and is sold in 50 or 100 foot assemblies.</p>\r\n',0,0,1,0,4241,NULL,''),(6675,3347,NULL,NULL,NULL,'Double Jacket Fire Hose Assemblies w/ Aluminum NPSH Swivel Ends','Size','<p>\r\n	Built for heavy industrial washdown and fire fighting applications. This is a heavy-duty, all-synthetic hose with a rubber lining for higher pressures and severe applications. The rubber lining also provides mildew and rot resistance. For applications that involve repeated dragging, a double jacket hose is a much better choice than a single jacket hose. The second jacket serves as a guard to protect the inner layer from abrasion.</p>\r\n<p>\r\n	These pre-fabricated assemblies come complete with hard-coat aluminum male and female swivel NPSH fittings. Has a working pressure of 300 PSI. Hose is 1-1/2&quot; and is sold in 50 or 100 foot assemblies.</p>\r\n',0,0,1,0,5995,NULL,''),(6924,2020,NULL,NULL,NULL,'Red EPDM General Purpose Air/Water Hose','Size','<p>\r\n	This Red EPDM General Purpose Water Hose is very versatile. It is both easy to handle and very flexible due to its multi-spiral layers of durable reinforcing polyester yarn. G221 is the smaller diameter, two spiral hose, while G222 is the larger diameter more robust four spiral hose. A temperature range of -40<span class=\"st\">C to 93</span><span class=\"st\">C guarantees the flexibility of the hose in all conditions. Resistant to abrasion, heat, and ozone thanks to its EPDM inner and outer. For use in transfer, washdown, air, and many other applications. Working pressure of 200 PSI. Priced per foot, cut to length and fitted with ends to meet your specifications. </span></p>\r\n',0,0,1,0,6907,NULL,''),(5699,3086,NULL,146,NULL,'Guzzler Sodium Hypochlorite Diaphragm Pump w/ 1\" Smooth Ends','Description','<p>\r\n	Smaller and lighter than a loaf of bread while being capable of pumping up to 10 gallons per minute. Sets up in seconds and finishes the job in less time than it would take to set up a powered pump. Great for use as a backup to your electric transfer pump in case of power failure. Polypropylene body, Buna diaphragm, and silicon check valves resist a wide range of chemicals, including sodium hypochlorite. 12 feet of suction lift and 30 feet of discharge head.</p>\r\n<p>\r\n	Choose a pump with smooth ends if you prefer to slip your hose on and tighten with a clamp. Choose a pump with threaded ends if you prefer to attach your hose using fittings.</p>\r\n',0,0,1,0,5669,NULL,''),(6147,3176,NULL,132,NULL,'Parts2O TC2151 30/50 Pressure Switch',NULL,'<ul>\r\n	<li>\r\n		30/50 settings: on at 30 PSI / off at 50 PSI</li>\r\n	<li>\r\n		Quality construction.</li>\r\n	<li>\r\n		1/4&quot; NPT female fitting.</li>\r\n	<li>\r\n		Works on jet pumps or with 4&quot; submersibles.</li>\r\n</ul>\r\n',0,0,1,NULL,6137,NULL,''),(6148,3176,NULL,132,NULL,'Parts2O FP217-1140 30/50 Pressure Switch with Low Pressure Cutoff',NULL,'<ul>\r\n	<li>\r\n		Preset to 30/50 (On at 30 PSI / off at 50 PSI)</li>\r\n	<li>\r\n		Includes Low Pressure Cut-Off which kills power to the pump if system pressure drops below 20 PSI.</li>\r\n	<li>\r\n		1/4&quot; NPT female threads.</li>\r\n	<li>\r\n		Includes 90 barbed fitting for use with jet pumps.</li>\r\n</ul>\r\n',0,0,1,NULL,6138,NULL,''),(5693,3294,NULL,65,NULL,'General Pipe Cleaners GR-LE Gen-Ear Water Leak Location System',NULL,'<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">Now, a smaller investment gets you a better method for tracking down water leaks. The new Gen-Ear LE is a simplified, more economical tool with stronger sound amplification than other systems. Use it to pinpoint water leaks in residential and commercial water lines, whether they are under concrete slabs, in walls, swimming pools and hot tubs.</font></p>\r\n<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">The compact amplifier fits easily in the palm of your hand. It provides noise-free amplification with built-in preset audio filters, so you dont have guess what settings to use. And the high performance headphones with noise cancellation features block out interference from surrounding ambient noise. The ground sensor listens for the gurgling or hammering of water escaping from a cracked pipe under concrete, asphalt, or tile. For soft surfaces like grass or carpet, use the probe rods. Or, for above ground pipes or hydrants, you can use both the probe rods or the magnet attachment.</font></p>\r\n<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">For especially hard to find leaks, the Sound Amplification Module adds air to the line, increasing water pressure. This amplifies the<br />\r\n	leak sounds, making them easier to locate.</font></p>\r\n<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">The Gen-Ear LE will save you a lot of guesswork and unnecessary digging. And that saves you a lot of money.</font></p>\r\n',1,0,1,0,5687,NULL,''),(7723,3321,NULL,209,NULL,'Koflo Clear PVC Mixers','Description','<p>\r\n	The Series 308 PVC Static Mixer is a clear PVC static mixer, which unlike other static mixers, allows for a visual inspection of the mixing process. All Series 308 static mixers are made in standard 6 element and 12 element configurations. Additionally, all PVC static mixers are edge sealed to the inside of the housing. The advantages of edge sealing are twofold. Not only does edge sealing increase mixing efficiency, but this bonding method also increases the structural integrity of the entire mixer. All mixers come standard with male NPT threads.<br />\r\n	<br />\r\n	One of the primary uses of the Series 308 static mixers is in the dilution of polymers and flocculants. With proper blending, it is quite common to recover the cost of a mixer in a relatively short period of time, due to the lower chemical costs associated with better mixing.</p>\r\n<p>\r\n	Other static mixer applications include admixing of water treatment chemicals, pH control, chlorination and ozonation, process control sampling. Other sizes available.</p>\r\n',0,0,1,0,7700,NULL,''),(5696,3119,NULL,65,NULL,'General Pipe Cleaners J-3000 Gas Drain Cleaner',NULL,'<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">The J-3000 is great for large lines and long runs, as well as small lines. And its much more powerful than smaller jets. A 3000 psi, 4 GPM triplex pump with Vibra-pulse on demand drives the hose easily around tight bends and down long runs. The pump is powered by a reliable 13 HP Quiet Drive Honda engine attached to a 2 to 1 gear reducer to extend the life of the pump.<br />\r\n	</font><br />\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\"> Standard safety features include a thermal relief valve to protect the pump from heat damage, along with a back-flow check valve and inlet filter. A removable 300 ft. capacity hose reel with drag brake, reel lock and brass swivel is mounted on a heavy duty frame with four pneumatic tires. A wheel brake keeps the machine solidly positioned on the job. Complete with tool box, chemical injector, and spray wand with trigger.</font></p>\r\n<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\" size=\"2\">In addition to the previously mentioned accessories, our J-3000-B model also includes 200\' of 3/8&quot; hose</font>, 15<span class=\"st\"> angle nozzle, 15</span><span class=\"st\"> angle nozzle with forward jet, 40</span><span class=\"st\"> angle nozzle, spring leader nozzle and a nozzle cleaning tool.</span></p>\r\n',0,0,1,0,5690,NULL,''),(5697,3048,NULL,169,NULL,'Avmor Torpedo Drain Cleaner and Opener, Case of 12',NULL,'<p>\r\n	Torpedo is formulated to produce an immediate action to quickly melt grease, and other obstructions in drains. For professional, commercial, and institutional use. Use in sinks, floor drains, septic tanks and cesspools. Dissolves soap, grease, sludge, paper, cloth and hair. Bottle size - 909 ml. Sold by the case of 12 to keep your costs down.</p>\r\n',0,0,1,1,7249,NULL,''),(6747,3397,NULL,4,NULL,'Work King s372 High Visibility Premium Ripstop Rain Jacket','Size','<p>\r\n	Fabric: 100% polyester rip stop with PU coating. Lining: 100% polyester sleeves and hood/mesh on body. Fully seam-sealed. 3M Scotchlite reflective material w/ 4&quot; contrast backing. Multi-pocketed design. Quick-release hard hat hood. Rear vents for breathability. Dual fly front for moisture protection. Dual waist stripes. Chest pocket with flap and lower hidden pockets. Adjustable cuffs.</p>\r\n',0,0,1,0,6732,NULL,''),(6748,3396,NULL,4,NULL,'Work King s374 High Visibility Premium Pull-On Ripstop Rain Pants','Size','<p>\r\n	Fabric: 100% polyester rip stop with PU coating. Fully seam-sealed. 3M Scotchlite reflective material w/ 4&quot; contrast backing. Moisture diversion design on pass-through pockets. Elasticized waist with drawstring. Dual leg stripes. Adjustable snap cuffs. <span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Meets CSA Z96-09, Class 3, Level 2.</span></p>\r\n',0,0,1,0,7211,NULL,''),(5703,3146,NULL,1,NULL,'Type C Polypropylene Camlock, Female Camlock X Hose Shank','Size','<p>\r\n	Polypropylene camlocks are fibreglass reinforced for extra strength. They are often used where weight is a concern; for example on portable forest fire fighting equipment. Black polypropylene is economical and stands up to a wide range of chemicals, including most acids. All sizes come complete with stainless arms.</p>\r\n<p>\r\n	Polypropylene camlocks have a working pressure of 100 PSI for sizes 3/4&quot; to 2&quot;, and a working pressure of 50 PSI for sizes 3&quot; and 4&quot;. All sizes have a working temperature range of -20<span class=\"st\"></span>C to 70<span class=\"st\"></span>C.</p>\r\n<p>\r\n	Type C Polypropylene Camlocks have a female camlock receptacle on one end, and a male hose shank on the other.</p>\r\n',0,0,1,0,5697,NULL,''),(5704,3146,NULL,1,NULL,'Type D Polypropylene Camlock, Female Camlock X FPT','Size','<p>\r\n	Polypropylene camlocks are fibreglass reinforced for extra strength. They are often used where weight is a concern; for example on portable forest fire fighting equipment. Black polypropylene is economical and stands up to a wide range of chemicals, including most acids. All sizes come complete with stainless arms.</p>\r\n<p>\r\n	Polypropylene camlocks have a working pressure of 100 PSI for sizes 3/4&quot; to 2&quot;, and a working pressure of 50 PSI for sizes 3&quot; and 4&quot;. All sizes have a working temperature range of -20<span class=\"st\"></span>C to 70<span class=\"st\"></span>C.</p>\r\n<p>\r\n	Type D Polypropylene Camlocks have a female camlock receptacle on one end, and are female NPT threaded on the other.</p>\r\n',0,0,1,0,5698,NULL,''),(5705,3146,NULL,1,NULL,'Type DC Polypropylene Camlock, Dust Cap','Size','<p>\r\n	Polypropylene camlocks are fibreglass reinforced for extra strength. They are often used where weight is a concern; for example on portable forest fire fighting equipment. Black polypropylene is economical and stands up to a wide range of chemicals, including most acids. All sizes come complete with stainless arms.</p>\r\n<p>\r\n	Polypropylene camlocks have a working pressure of 100 PSI for sizes 3/4&quot; to 2&quot;, and a working pressure of 50 PSI for sizes 3&quot; and 4&quot;. All sizes have a working temperature range of -20<span class=\"st\"></span>C to 70<span class=\"st\"></span>C.</p>\r\n<p>\r\n	Type DC (Dust Cap) Polypropylene Camlocks are used to seal a male camlock when not in use, preventing dust and other unwanted matter from entering the hose.</p>\r\n',0,0,1,0,5699,NULL,''),(5706,3146,NULL,1,NULL,'Type DP Polypropylene Camlock, Dust Plug','Size','<p>\r\n	Polypropylene camlocks are fibreglass reinforced for extra strength. They are often used where weight is a concern; for example on portable forest fire fighting equipment. Black polypropylene is economical and stands up to a wide range of chemicals, including most acids.</p>\r\n<p>\r\n	Polypropylene camlocks have a working pressure of 100 PSI for sizes 3/4&quot; to 2&quot;, and a working pressure of 50 PSI for sizes 3&quot; and 4&quot;. All sizes have a working temperature range of -20<span class=\"st\"></span>C to 70<span class=\"st\"></span>C.</p>\r\n<p>\r\n	Type DP (Dust Plug) Polypropylene Camlocks are used to seal a female camlock when not in use, preventing dust and other unwanted matter from entering the hose.</p>\r\n',0,0,1,0,5700,NULL,''),(5707,3146,NULL,1,NULL,'Type E Polypropylene Camlock, Male Camlock X Hose Shank','Size','<p>\r\n	Polypropylene camlocks are fibreglass reinforced for extra strength. They are often used where weight is a concern; for example on portable forest fire fighting equipment. Black polypropylene is economical and stands up to a wide range of chemicals, including most acids.</p>\r\n<p>\r\n	Polypropylene camlocks have a working pressure of 100 PSI for sizes 3/4&quot; to 2&quot;, and a working pressure of 50 PSI for sizes 3&quot; and 4&quot;. All sizes have a working temperature range of -20<span class=\"st\"></span>C to 70<span class=\"st\"></span>C.</p>\r\n<p>\r\n	Type E Polypropylene Camlocks have a male camlock receptacle on one end, and a male hose shank on the other.</p>\r\n',0,0,1,0,5701,NULL,''),(5708,3146,NULL,1,NULL,'Type F Polypropylene Camlock, Male Camlock X MPT','Size','<p>\r\n	Polypropylene camlocks are fibreglass reinforced for extra strength. They are often used where weight is a concern; for example on portable forest fire fighting equipment. Black polypropylene is economical and stands up to a wide range of chemicals, including most acids.</p>\r\n<p>\r\n	Polypropylene camlocks have a working pressure of 100 PSI for sizes 3/4&quot; to 2&quot;, and a working pressure of 50 PSI for sizes 3&quot; and 4&quot;. All sizes have a working temperature range of -20<span class=\"st\"></span>C to 70<span class=\"st\"></span>C.</p>\r\n<p>\r\n	Type F Polypropylene Camlocks have a male camlock insert on one end, and are male NPT threaded on the other.</p>\r\n',0,0,1,0,5702,NULL,''),(5713,2061,NULL,2,NULL,'3M Safewaze 1950/1951 Omega Plus Harness - Size S/M','Regular Price','<p>\r\n	Resists cuts and abrasions, Back D-Ring, grommet leg straps. Made of patented Omega webbing, this harness has four times more abrasion resistance than those made of standard webbing. Only available in size S/M.<br />\r\n	&nbsp;</p>\r\n<h3 style=\"color: Red;\">\r\n	<strong><span style=\"font-size: 16px;\">Only 6 left in stock! More than 30% off!</span></strong></h3>\r\n',0,1,0,0,7510,NULL,''),(5714,3390,NULL,124,NULL,'Viking 6005 Journeyman Reflective Safety T-Shirt, Yellow','Size, Qty Available','<p>\r\n	Fully compliant with CSA Z96-09 Class 2, Level 2. 2&quot; 3M Scotchlite Reflective Material in 4&quot; WCB/Worksafe/DOT configuration. Premium soft polyester mesh fabric. Left chest velcro sealed phone pocket and pen slot. ID patch/cell/radio clip on belts.</p>\r\n',0,1,0,0,7235,NULL,''),(7788,3390,NULL,NULL,NULL,'Pioneer 6979 Hi-Viz Micro Mesh T-Shirt, Orange','Size, Qty Available','<p>\r\n	Micro mesh quick-dry fabric. Raido/phone clip/strap. Chest pocket. 2&quot; 3M Scotchlite reflective tape w/ 4&quot; contrast background meets CSA Z96-09, Class 2, Level 2.</p>\r\n',0,1,0,0,7765,NULL,''),(7789,3390,NULL,NULL,NULL,'Pioneer 6989 Hi-Viz Micro Mesh T-Shirt, Orange','Size, Qty Available','<p>\r\n	Micro mesh quick-dry fabric. Raido/phone clip/strap. Chest pocket. 2&quot; 3M Scotchlite reflective tape w/ 4&quot; contrast background meets CSA Z96-09, Class 2, Level 2.</p>\r\n',0,1,0,0,7766,NULL,''),(5909,3383,NULL,232,NULL,'Tough Duck s7547 Lined High Visibility Overall, Navy','Size','<p>\r\n	Fabric: 12 oz. 100% cotton duck. Lining: quilted 6 oz. polyester insulation. 3M Scotchlite reflective material with 4&quot; yellow backing. Seam-sealed waterproof double knees and seat. Exclusive double front legs. Delrin zipper fron closure with outside fly and hidden snaps. Turned hem allows for 3&quot; leg extension. Elasticized adjustable shoulder straps. Chest pocket with pencil slot and cell phone pocket. <span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Meets CSA-Z96-2009 Class 1, Level 2 standards.</span></p>\r\n',0,0,1,0,6077,NULL,''),(6734,3388,NULL,4,NULL,'Work King s432 High Visibility Quilted Safety Freezer Jacket, Black','Size','<p>\r\n	Fabric: 100% polyester. Lining: 100% quilted polyester. Dual inner pockets. Rib-knit collar and cuffs. Drop back. Lower patch pockets. Rib-knit back armhole gussets. 3M Scotchlite reflective material w/ 4&quot; contrast backing. <span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\"><span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Meets CSA-Z96-09 Class 1, Level 2 and ANSI 107-2010 Class 1, Level 2.</span></span></p>\r\n',0,0,1,0,7228,NULL,''),(5908,3384,NULL,232,NULL,'Tough Duck s1747 Lined High Visibility Parka, Navy','Size','<p>\r\n	Fabric: 12 oz. 100% cotton duck. Lining: quilted 8 oz. polyester insulation. 3M Scotchlite 2&quot; reflective material on 4&quot; yellow backing. Quick-release hard hat hood with hidden snaps. Delrin zipper front closure with storm flaps and hidden snap closure. Inside cell pocket and patch pocket. 4 large scoop pockets. Pencil pocket on sleeve. <span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\"><span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Meets CSA-Z96-2009 Class 1, Level 2 standards.</span></span></p>\r\n',0,0,1,0,5239,NULL,''),(5715,3389,NULL,124,NULL,'Viking 6420 Reflective Safety Hoodie, Yellow','Size, Qty Available','<p>\r\n	Fully compliant with CSA Z96-09 Class 2, Level 2. 2&quot; 3M Scotchlite Reflective Material in 4&quot; WCB/Worksafe/DOT configuration. Anti pill, warm 260 gm/m polyester quick dry. Chest cell phone pocket and clip on radio phone straps. Warm full size drawstring hood. Tear away detachable hood. Taffeta lined sleeves. Two large pockets.</p>\r\n',0,1,0,0,6644,NULL,''),(7801,3052,NULL,NULL,NULL,'Ingersoll Rand 32170953 Replacement Air Filter Housing, pk/6',NULL,'<p>\r\n	Replaces Ingersoll Rand air filter housing # 32170953. 5&quot; height x 6-3/4&quot; diameter x 1&quot; NPT. Elements not included, housings only. Sold per pack of 6.</p>\r\n',0,1,0,0,7778,NULL,''),(5716,3392,NULL,124,NULL,'Viking 6010 Safety Long Sleeve Shirt, Orange','Size, Qty Available','<p>\r\n	Fully compliant with CSA Z96-09 Class 2, Level 2. 2&quot; 3M Scotchlite Reflective Material in 4&quot; WCB/Worksafe/DOT configuration. Premium soft polyester solid fabric in fluorscent CSA colours. Left chest velcro sealed cell phone pocket &amp; pen slot. ID patch/cell/radio clip on belts.</p>\r\n',0,1,0,0,7720,NULL,''),(7792,3392,NULL,124,NULL,'Viking 6010 Safety Long Sleeve Shirt, Yellow','Size, Qty Available','<p>\r\n	Fully compliant with CSA Z96-09 Class 2, Level 2. 2&quot; 3M Scotchlite Reflective Material in 4&quot; WCB/Worksafe/DOT configuration. Premium soft polyester solid fabric in fluorscent CSA colours. Left chest velcro sealed cell phone pocket &amp; pen slot. ID patch/cell/radio clip on belts.</p>\r\n',0,1,0,0,7769,NULL,''),(7793,3395,NULL,NULL,NULL,'Pioneer 5516 Navy Reflective Coveralls, Regular Sizes','Size, Qty Available','<p>\r\n	Meets CSA Z96-09 Class 1, Level 2. 2-way heavy-duty brass zipper closure. Adjustable snap wrists. 7 storage pockets: 2 back, 2 chest, 2 side, 1 tool. 2 pass-through pockets. Action back and elastic waist.</p>\r\n',0,1,0,0,7770,NULL,''),(5717,3108,NULL,70,NULL,'Manitoba Standard Regulation First Aid Kit',NULL,'<p>\r\n	This basic kit meets minimum building capacity requirements for the province of Manitoba. One kit is required per each 25 employees. Order a refill kit if you are low on materials.</p>\r\n<p>\r\n	Contents:</p>\r\n<ul>\r\n	<li>\r\n		First aid pocket guide - bilingual (1)</li>\r\n	<li>\r\n		Disposable nitrile gloves - per pair (1)</li>\r\n	<li>\r\n		CPR-Aid rescuer device, single use (1)</li>\r\n	<li>\r\n		Instant cold pack - small (1)</li>\r\n	<li>\r\n		BZK Towelletes - 25/pk (1)</li>\r\n	<li>\r\n		Gauze pads, 7.5 x 7.5 cm -16/bag (1)</li>\r\n	<li>\r\n		Bandage, plastic, 2.5 x 7.5 cm - 32/bag (1)</li>\r\n	<li>\r\n		Compress bandage, 10 x 10 cm, bulk (2)</li>\r\n	<li>\r\n		Triangular bandage, 102 x 102 x 142 cm, bulk (3)</li>\r\n	<li>\r\n		Conform bandage, 10 cm x 4.5m, bulk (2)</li>\r\n	<li>\r\n		Dressing strip, fabric, 7.5 x 0.95m, 1/bag (1)</li>\r\n	<li>\r\n		Elastic support bandage, 7.5cm x 4.5m, bulk (2)</li>\r\n	<li>\r\n		Safety pins, assorted - 12/bag (1)</li>\r\n	<li>\r\n		Forceps, economy, 9cm (1)</li>\r\n	<li>\r\n		Scissors, universal, black handles, 15cm (1)</li>\r\n	<li>\r\n		Tape, cloth, 2.5cm x 2.25m (2)</li>\r\n	<li>\r\n		Non-adherent pad, 7.5 x 10cm - 100/box (0.04)</li>\r\n	<li>\r\n		Bio-hazard red bag, 60 x 60cm (1)</li>\r\n	<li>\r\n		Waterless hand cleaner, pkts, 2000/cs (1)</li>\r\n</ul>\r\n',0,0,1,0,5012,NULL,''),(7108,2025,NULL,NULL,NULL,'Square Hole Strainer Assembly','Size','<p>\r\n	These square hole strainer assemblies include a Type D Aluminum Female Camlock, brass close nipple, and a square hole strainer.</p>\r\n',0,0,1,0,7091,NULL,''),(7109,2023,NULL,NULL,NULL,'Premium Punch Clamp Tool',NULL,'<p>\r\n	This professional punch lock clamp tool helps you save money. You can purchase your hose in bulk, cut it to length, and add the fittings of your choice. You can also make repairs to hose in the field.</p>\r\n',0,0,1,0,7167,NULL,''),(7110,3106,NULL,2,NULL,'3M Clear Polycarbonate Molded Faceshield',NULL,'<p>\r\n	Standard size molded general purpose polycarbonate faceshield offers high impact face protection. Faceshield mounts quickly to any 3M Headgear without tools, snaps or cams. To mount to a hardhat, use a 3M 82520 Universal Headgear Assembly. High quality - developed for use in metalworking and utilities. Meets the high impact requirements of ANSI Z87.1-2003.</p>\r\n',0,0,1,0,5936,NULL,''),(5719,2062,NULL,222,NULL,'Eyewash Solution, 1 Litre Bottle','Sold Per','<p>\r\n	This sterile solution is designed for the cleansing and relief of fatigued or irritated eyes caused by exposure to chlorinated water, foreign materials, dust, smog, smoke, pollen, wind, and other air pollutants. Contains 1.9% w/v boric acid. Health Canada Approved.</p>\r\n<p>\r\n	Sold individually or per case of 12.</p>\r\n',0,0,1,0,4992,NULL,''),(7101,3125,NULL,NULL,NULL,'Premium 25 Piece Inch/Metric/Torx Combo Set',NULL,'<p>\r\n	This 25 Piece Inch/Metric/Torx set includes 3 complete sets with over-molded handles for a comfortable and secure handhold. The hex keys feature polished, chamfered edges that help them fit into hex sockets.</p>\r\n<p>\r\n	Set includes SAE sizes 1/4, 7/32, 3/16, 5/32, 9/64, 1/8, 7/64, 3/32, 5/64; METRIC sizes 8mm, 6mm, 5mm, 4mm, 3mm, 2.5mm, 2mm, 1.5mm; TORX sizes T-40, T-30, T27, T-25, T-20, T-15, T-10, T-9</p>\r\n',0,0,1,0,5791,NULL,''),(7102,2063,NULL,70,NULL,'Earmuff Cleaning Towelettes, Box of 100',NULL,'<p>\r\n	These individual earmuff cleaning towelettes are saturated with a mild cleansing solution that helps kill germs and reduce the chance of cross-contamination. Each towelette is individually packaged in a foil pouch. 100 towelettes per box.</p>\r\n',0,0,1,0,6024,NULL,''),(7106,2065,NULL,NULL,NULL,'Caution Respirator Required Safety Sign','Description','<p>\r\n	Caution Respirator Required Safety Sign warns employees of possible safety risks and states that respiratory protection is necessary. Available in aluminum, plastic, or vinyl sticker.</p>\r\n',0,0,1,0,7086,NULL,''),(6031,2062,NULL,222,NULL,'Eyewash Solution, 1 Gallon Jug','Sold Per','<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		This sterile solution is designed for the cleansing and relief of fatigued or irritated eyes caused by exposure to chlorinated water, foreign materials, dust, smog, smoke, pollen, wind, and other air pollutants. Contains 1.9% w/v boric acid. Health Canada Approved.</p>\r\n	<p>\r\n		Sold individually or per case of 12.</p>\r\n	</section></div>\r\n',0,0,1,0,4994,NULL,''),(5732,2062,NULL,75,NULL,'Haws 7501 Portable Eyewash Station, 9 Gallon',NULL,'<p>\r\n	Compact portable Model 7501 is ideal for remote locations. Using gravity to supply a continuous flow of clean water to injured personnel for a full 15 minutes at .4 gpm (1.5 L), this model is a reliable source for safety. Recognizing the 7501\'s full patterned flushing feature, those working in remote areas cant help but feel confident with this piece of emergency equipment day after day.</p>\r\n<ul>\r\n	<li>\r\n		Featuring a FDA approved high-density green polyethylene tank easily activated by pulling the yellow activation arm down to the open position</li>\r\n	<li>\r\n		A wide-fill opening with threaded cap permits easy inspection, cleaning and filling</li>\r\n	<li>\r\n		Supplied with one bottle of water preservative additive</li>\r\n	<li>\r\n		Relocation is simple due to the easily mounted bracket (included) and light design of this 9 gallon (34.1 L) portable</li>\r\n	<li>\r\n		Measurements: 14-1/2&quot; high, 22&quot; wide, 10-1/8&quot; (36.8 x 55.9 x 25.7 cm) deep.</li>\r\n</ul>\r\n<p>\r\n	Model 7501 is certified by CSA to meet the ANSI Z358.1 Standard for Emergency Eyewash and Shower Equipment.</p>\r\n',0,0,1,0,5723,NULL,''),(7515,3171,NULL,2,NULL,'3M Maxim Over-The-Glass Safety Splash Goggle',NULL,'<p>\r\n	The sleek, low profile and wide, wraparound lens design of the Maxim safety splash goggle complement facial shapes. Offers soft polymeric inner seal for enhanced comfort. Indirect ventilation helps improve air flow and reduce fogging. OTG lens provides expansive coverage and fits over most prescription eyewear. Soft shroud ensures enhanced comfort at every touch point including forehead, cheeks and nose.</p>\r\n',0,0,1,0,7497,NULL,''),(7203,3345,NULL,32,NULL,'Hach CDC401 Rugged Conductivity Probe, 5 Meter Cable',NULL,'<p>\r\n	The IntelliCAL CDC401 is a digital, graphite, 4-pole conductivity probe. This rugged version comes complete with a 5 meter cable and is intended for field use. It is ideal for measuring electrical conductivity, salinity, resistivity, or total dissolved solids (TDS) in wastewater, drinking water, or general water quality applications.</p>\r\n<p>\r\n	The Rugged IntelliCal probes ensure reliable measurments in the harshest environmental conditions. IntelliCal digital probes provide traceability in measurement history. These probes also alert the user when re-calibration is needed. All IntelliCal probes can be moved between meters without the need to re-calibrate or re-enter measurement settings.Rugged IntelliCal probes are waterproof up to 30 meters for 24 hours (IP68 rating).</p>\r\n<p>\r\n	Cond.: 0.01 S/cm to 200 mS/cm<br />\r\n	TDS: 0 to 50000 mg/L as NaCl<br />\r\n	Salinity: 0 to 42 g/kg or<br />\r\n	Resist.: 2.5 cm to 49 Mcm</p>\r\n',0,0,1,0,7174,NULL,''),(5737,3410,NULL,67,NULL,'Forcefield Quilted Flannel Work Shirt w/ Hood','Size','<p>\r\n	100% cotton flannel shell, quilt-lined for warmth with 5oz. polyester insulation. Zipper front with snap closure. 300 GSM jersey polyester double hood with drawstring. 7 pockets; 4 outer, 3 inner. Pencil slot. Adjustable snap cuffs.</p>\r\n',0,0,1,0,7760,NULL,''),(6673,3371,NULL,64,NULL,'Industrial X-Strong Garbage Bags','Size, Bags/Box','<p>\r\n	EcoLogo certified oxo-biodegradable garbage bags. X-Strong garbage bags are great for medium to heavy duty jobs. Boxes have perforated tabs on the side for individual bag dispensing.</p>\r\n',0,0,1,0,4283,NULL,''),(6676,3347,NULL,NULL,NULL,'Black Dragon Rubber Industrial Fire Hose Assemblies w/ Brass NPSH Ends','Length','<p>\r\n	Black Dragon is manufactured using a unique process which incorporates the inner tube, reinforecment, and outer cover into a single &quot;solid wall&quot; hose. The reinforcement, a seamless, woven, high-tenacity polyester, is embedded in black nitrile/ PVC blend rubber. This gives the hose the same tough, abrasion, oil and weather resistant properties.</p>\r\n<p>\r\n	Temperature Range: -30<span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px;\">C to 70</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px;\">C</span></p>\r\n<p>\r\n	Hose comes assembled with Brass NPSH ends.</p>\r\n',0,0,1,0,5996,NULL,''),(5739,3171,NULL,NULL,NULL,'Anti-Fog CSA Chemical Splash Vented Safety Goggle',NULL,'<p>\r\n	Able to be worn over prescription glasses and the seal allows for increased protection. The neoprene headband provides comfort and durability. Provides chemical splash protection for the eyes. Indirect ventilation prevents fogging. CSA compliant.</p>\r\n',0,0,1,0,7498,NULL,''),(5740,3171,NULL,70,NULL,'121 Series Basic CSA Safety Glasses, Silver Mirror Lens','Qty','<p>\r\n	Adjustable ratchet temples can fit any face shape. Extremely lightweight. High impact resistance. Scratch resistant. Offers 99% protection from UV-A and UV-B rays. Compliant with CSA Z94.3 and ANSI Z87.1. Silver Mirror lens. Sold individually or per case of 12.</p>\r\n',0,0,1,0,5781,NULL,''),(5741,3111,NULL,NULL,NULL,'Premium Square Blade Shovel, Long Handle',NULL,'<p>\r\n	59&quot; ash-wood handle. Steel hollow back. 11-3/4&quot; X 9-1/2&quot; blade length.</p>\r\n',0,0,1,0,5734,NULL,''),(5742,3111,NULL,NULL,NULL,'Premium Square Blade Shovel, Short D-Grip Handle',NULL,'<p>\r\n	39-1/2&quot; ash-wood handle with steel d-grip. Steel hollow back. 11-3/4&quot; X 9-1/2&quot; blade length.</p>\r\n',0,0,1,0,5735,NULL,''),(5743,3111,NULL,NULL,NULL,'Premium Round Blade Shovel, Long Handle',NULL,'<p>\r\n	59&quot; ash-wood handle. Steel hollow back. 11-3/4&quot; X 8-3/4&quot; blade length.</p>\r\n',0,0,1,0,5736,NULL,''),(5744,3111,NULL,NULL,NULL,'Premium Round Blade Shovel, Short D-Grip Handle',NULL,'<p>\r\n	39-1/2&quot; ash-wood handle with steel d-grip. Steel hollow back. 11-3/4&quot; X 8-3/4&quot; blade length.</p>\r\n',0,0,1,0,5737,NULL,''),(5747,3111,NULL,72,NULL,'Garant Pro Series Square Blade Shovel, Short D-Grip Handle',NULL,'<p>\r\n	Industrial grade square blade shovel. Hollow back tempered steel blade is very tough, designed for the most demanding work. Forward turned steps. Premium 28&quot; varnished ash handle with steel d-grip.</p>\r\n',0,0,1,0,5998,NULL,''),(5748,3111,NULL,72,NULL,'Garant Pro Series Square Blade Shovel, Long Handle',NULL,'<p>\r\n	Industrial grade round point shovel. Hollow back tempered steel blade is very tough, designed for the most demanding work. Forward turned steps. Premium 48&quot; varnished ash handle.</p>\r\n',0,0,1,0,5740,NULL,''),(6889,3113,NULL,NULL,NULL,'Heavy-Duty Aluminum Landscaping Rake',NULL,'<p>\r\n	Commonly used for grading, this rake has a 36&quot; comb-toothed aluminum head which is both lightweight and strong. To add strength, there is a brace connecting the head to the handle. The handle itself is constructed of lightweight aluminum and has a comfortable grip.</p>\r\n',0,0,1,0,6872,NULL,''),(7650,3111,NULL,NULL,NULL,'Premium Irrigation Shovel',NULL,'<p>\r\n	Straight sides allow you to dig straight holes. Steel back. 39-1/2&quot; ash-wood handle with steel d-grip.</p>\r\n',0,0,1,0,7627,NULL,''),(5755,3112,NULL,72,NULL,'Garant Pro Series 26\" Industrial Snow Pusher','Qty','<p>\r\n	Industrial grade all-purpose snow pusher, 26&quot; polypropylene blade. 30% more resistant to wear than a standard poly blade. Premium stained ash handle with a poly D-grip. Perfect for intensive uses.</p>\r\n',0,0,1,0,5745,NULL,''),(5756,3112,NULL,72,NULL,'Garant Nordic 14\" Snow Shovel',NULL,'<ul>\r\n	<li>\r\n		14&quot; orange poly blade.</li>\r\n	<li>\r\n		40&quot; stained ash handle.</li>\r\n	<li>\r\n		Poly d-grip.</li>\r\n</ul>\r\n',0,0,1,NULL,5746,NULL,''),(5759,3114,NULL,72,NULL,'Garant Yukon Industrial Wide Blade Ice Scraper, Short D-Grip Handle','Qty','<p>\r\n	Industrial grade.&nbsp;<span style=\"font-size: 12px;\">Forged and tempered 8-1/2&quot; steel blade.&nbsp;</span><span style=\"font-size: 12px;\">Premium 35&quot; ash handle.&nbsp;</span><span style=\"font-size: 12px;\">Steel D-grip.</span></p>\r\n',0,0,1,0,5749,NULL,''),(5760,3114,NULL,72,NULL,'Garant Yukon Industrial Wide Blade Ice Scraper, Long Handle','Qty','<p>\r\n	Industrial grade.&nbsp;<span style=\"font-size: 12px;\">Forged and tempered 8-1/2&quot; steel blade.&nbsp;</span><span style=\"font-size: 12px;\">Profiled premium 48&quot; ash handle.</span></p>\r\n',0,0,1,0,5750,NULL,''),(5761,3339,NULL,71,NULL,'Pulaski Fire Axe, Hickory Handle ',NULL,'<p>\r\n	This Hickory Handle Pulaski Fire Axe comes complete with a high quality 36&quot; ivory lacquered Amercian hickory handle. Includes 2 round wedges and pin installed for greater durability. Pulaski head has a weight of 3-1/2 lbs.</p>\r\n',0,0,1,0,5751,NULL,''),(5762,3339,NULL,71,NULL,'Pulaski Fire Axe, Fiberglass Handle ',NULL,'<p>\r\n	This Fiberglass Handle Pulaski Fire Axe comes complete with a 34&quot; fiberglass handle. Extra strength and flexibility is provided by the polypropylene covered fiberglass core. Pulaski head has a weight of 3-1/2 lbs.</p>\r\n',0,0,1,0,5752,NULL,''),(5604,3365,NULL,NULL,NULL,'12V Strobe Light with Magnetic Base',NULL,'<p>\r\n	Amber lens, 100,000 candle power. Strong magnetic base. Coiled lighter plug cord, expandable to 10 feet. 12V DC. Impact resistant ABS base. Suitable for temperatures -30<span class=\"st\">C to 60</span><span class=\"st\">C (-22</span><span class=\"st\">F to 140</span><span class=\"st\">F). Flash rate 70-110/min. Operating life 300 hours. Solid-state circuitry. Dimensions: 4-3/4&quot; diamater x 4&quot; H.</span></p>\r\n',0,0,1,0,6610,NULL,''),(7022,3321,NULL,209,NULL,'Koflo PVC Long Length Chemical Injection Quills','Description','<p>\r\n	This chemical injection quill injects corrosive chemicals into your pipeline without damaging the port or pipe. Injection quill ensures even distribution of chemical in the center of the pipe.</p>\r\n<p>\r\n	Flow direction is indicated on the body to ensure proper positioning. Body is constructed of PVC. Spring is Hastelloy C. Ball is ceramic. Rated to 150 PSI and 140<span class=\"st\">F working temperature. 1/2&quot; FNPT inlet, 1/2&quot; MNPT pipe connection.</span></p>\r\n<p>\r\n	<span class=\"st\">Quills are repairable - kit containing replacement (3) ceramic balls and (3) Hastelloy C springs is available.</span></p>\r\n',0,0,1,0,7438,NULL,''),(5606,3368,NULL,NULL,NULL,'Standard Battery Terminals, 10 Pack',NULL,'<p>\r\n	Heavy duty lead bodies. Sold by the pack of 10.</p>\r\n',0,0,1,0,5354,NULL,''),(5607,3368,NULL,NULL,NULL,'Side Mount Battery Terminals, 10 Pack',NULL,'<p>\r\n	Heavy duty lead bodies. Sold by the pack of 10.</p>\r\n',0