,18,NULL,'Ridgid 20238 Pro Arc Hacksaw',NULL,'<p>\r\n	Designed to offer superior strength and maximum control in a lightweight professional hacksaw. The bow frame casting provides both greater strength and improved work piece access. Blade replacement is a snap with the large tensioning knob and the rubberized hand grips fore and aft ensure a controlled and speedy cut. In addition, this hacksaw provides two positions for mounting the blade (either 45<span class=\"st\"> or 90</span><span class=\"st\"> cut angles) to handle the job.</span></p>\r\n',0,1,0,0,6813,NULL,''),(7562,3264,NULL,NULL,NULL,'Industrial Curved Floor Squeegee Assembly',NULL,'<p>\r\n	This industrial grade curved squeegee with steel frame and cast connector makes clean ups easy, the curved ends enhance debris containment.</p>\r\n<p>\r\n	Effectively cleans debris on all types of surfaces. Head is 24 inches in length and comes complete with wooden handle.</p>\r\n',0,0,1,0,7539,NULL,''),(7558,3255,NULL,NULL,NULL,'Zep Reach Extra Heavy-Duty Hand Cleaner','Size','<p>\r\n	This deep cleaning combo is phosphate-free with emollients to protect hands. Containing pumice this heavy-duty hand cleaner has a pleasant almond fragrance. Instantly removes stubborn industrial soils, inks, resins, paints, adhesives, tar, carbon and asphalt, to name a few. Sold per gallon.</p>\r\n',0,0,1,0,5704,NULL,''),(7561,3264,NULL,72,NULL,'Garant Industrial Grade Floor Scraper','Blade Size','<p>\r\n	Comes complete with flexible steel blade and 54-inch premium varnished ash handle. Industrial construction - ideal for many uses.</p>\r\n',0,0,1,0,7538,NULL,''),(5625,2020,NULL,NULL,NULL,'Tigertail Crush Resistant Full Suction Hose Assemblies','Size','<p>\r\n	Flexible, non-kinking and crushproof. Designed for the most rugged industrial pumping service, including septic tank &amp; truck applications. Includes leak proof cuffs.<br />\r\n	25\' C x E Hose Assembly. Temperature Range: -40C to +70C.</p>\r\n',0,0,1,NULL,6552,NULL,''),(5956,3073