in equal load distribution and the absorption of bending stress without cord deterioration.</p>\r\n<p>\r\n	The Flex-Weave<span class=\"st\"> Cover is a patented construction for longer cover life, providing extended protection to the core of the belt from oil, dirt, and heat.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,4089,NULL,''),(5630,3067,NULL,NULL,161,'Quartz Sleeves','Qty','<p>\r\n	Replacement 36&quot; sleeves for Trojan 3000 systems. (Replaces Trojan part # 302207). Clear quartz, domed sleeve for 36&quot; lamps.</p>\r\n',0,0,1,NULL,5628,NULL,''),(5631,3000,NULL,147,NULL,'Gates Super HC Type 5VX Molded Notch Belts',NULL,'<p>\r\n	Constructed with Gates proprietary construction, this belt has a superior combination of flex and load carrying capacity, as well as ltransmitting more horsepower than the classical cross sections in the same amount of drive space.</p>\r\n<p>\r\n	Suitable for all industrial applications, particularly where space, weight and horsepower capacity are critical.</p>\r\n<p>\r\n	Notches molded into the belt during manufacturing make this belt well suited for drives with smaller diameter sheaves.</p>\r\n<p>\r\n	Belt Edge is machined for even sheave groove contact resulting in less slip and wear.</p>\r\n<p>\r\n	<span class=\"st\">Flex-Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,5637,NULL,''),(5632,3067,NULL,NULL,NULL,'O Rings - 4 Pack','Qty','<p>\r\n	For Trojan 3000 UV systems. Sold only by the pack of 4.</p>\r\n',0,0,1,NULL,5630,NULL,''),(5633,3000,NULL,147,NULL,'Gates Hi-Power II Type A V-Belts',NULL,'<p>\r\n	Featuring a composite, multi-purpose construction, these belts resist oil and heat, ozone, sunlight, weather, and aging.</p>\r\n<p>\r\n	Suitable for all industrial applications, including v-flat drives</p>\r\n<p>\r\n	Gates Curves provide proper cord support and full contact with the sheave-groove for uniform loading, uniform wear, and increased belt life.</p>\r\n<p>\r\n	Flex Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</p>\r\n<p>\r\n	The Flex-Weave<span class=\"st\"> Cover is a patented construction for longer cover life, providing extended protection to the core of the belt from oil, dirt, and heat.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,4090,NULL,''),(5634,3068,NULL,NULL,NULL,'GIA1002T6L UV Amalgam Lamp w/ 4 Pin Step Base','Qty','<p>\r\n	Lamp length: 36&quot;<br />\r\n	These Ultraviolet Disinfection Lamps fit Aquafine / TrojanUV Logic potable water disinfection systems that require GIA1002T6L &quot;4 pin with step base&quot; Amalgam UV lamps.<br />\r\n	Low pressure high intensity mercury vapour lamp produces 254 nanometer wavelength UV radiation.<br />\r\n	These UV lamps are manufactured in the USA and are warrantied for the OEM specified period.<br />\r\n	Replaces Trojan part # 793010</p>\r\n',0,0,1,NULL,5632,NULL,''),(5635,3068,NULL,NULL,NULL,'Quartz Sleeve','Qty','<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		<br />\r\n		Replacement 36&quot; sleeves for Trojan/Aquafine UV Logic systems. (Replaces Trojan part # 793075). Clear quartz, domed sleeve for 36&quot; lamps.</p>\r\n	</section></div>\r\n',0,0,1,NULL,5633,NULL,''),(5636,3069,NULL,215,NULL,'UV Pure Hallett C300065 UV Lamps, 2 Pack','Qty','<p>\r\n	These are Genuine OEM UV lamps for all UVPure Hallet 30 Stainless Steel UV Sterilizer Systems, and all Upstream NC30-75 and NC15-50 units.</p>\r\n<p>\r\n	Sold per pair, contains two C300064 lamps.</p>\r\n',0,0,1,0,5634,NULL,''),(5638,3000,NULL,147,NULL,'Gates Tri-Power Type BX V-Belts',NULL,'<p>\r\n	Constructed with Gates proprietary construction, this belt has a superior combination of flex and load carrying capacity, as well as less stretch resulting in less maintenance.</p>\r\n<p>\r\n	Suitable for all industrial applications, particularly where small or sub-minimal sheave diameters are required.</p>\r\n<p>\r\n	Notches molded into the belt during manufacturing make this belt well suited for drives with smaller diameter sheaves.</p>\r\n<p>\r\n	Belt Edge is machined for even sheave groove contact resulting in less slip and wear.</p>\r\n<p>\r\n	<span class=\"st\">Flex-Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,5631,NULL,''),(5639,3000,NULL,147,NULL,'Gates Tri-Power Type CX V-Belts',NULL,'<p>\r\n	Constructed with Gates proprietary construction, this belt has a superior combination of flex and load carrying capacity, as well as less stretch resulting in less maintenance.</p>\r\n<p>\r\n	Suitable for all industrial applications, particularly where small or sub-minimal sheave diameters are required.</p>\r\n<p>\r\n	Notches molded into the belt during manufacturing make this belt well suited for drives with smaller diameter sheaves.</p>\r\n<p>\r\n	Belt Edge is machined for even sheave groove contact resulting in less slip and wear.</p>\r\n<p>\r\n	<span class=\"st\">Flex-Bonded Cords are strongly bonded to the body of the belt resulting in equal load distribution and the absorption of bending stress without cord deterioration.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA oil and heat resistant standards.</span></p>\r\n<p>\r\n	<span class=\"st\">Meets RMA static conductivity requirements.</span></p>\r\n',0,0,1,0,5635,NULL,''),(5958,3293,NULL,65,NULL,'General Pipe Cleaners JM-1450-A Electric Jet',NULL,'<p>\r\n	This is the most powerful electric jet you can get. It generates 1500 PSI at 1.7 gallons per minute, yet its 1.5 HP motor pulls only 13 amps. General\'s unique Vibra-pulse system lets you work the hose around tight bends and small lines, while keeping the flow rate the same whether the Vibra-pulse is on or off.</p>\r\n<p>\r\n	The JM-1450 is compact and portable. With an overall height of 34&quot;, the machine fits easily in the limited storage space of your truck. For an even more compact fit, just remove the hose reel (it takes only seconds) and the height drops to 14&quot;. The telescoping handle makes it easier to roll the machine to and from the job site.</p>\r\n<p>\r\n	Standard safety features include a thermal relief valve to protect the pump from heat damage, along with a backflow check valve and inlet filter.</p>\r\n<p>\r\n	Unit comes complete with 150\' of 1/4&quot; and 30\' of 1/8&quot; hoses, as well as 4 nozzles for each hose size. Also includes a nozzle cleaning tool. Clears 1-1/2&quot; to 4&quot; lines of grease, sand and ice.</p>\r\n',0,0,1,0,5948,NULL,''),(7552,3367,NULL,NULL,NULL,'Brass Swivel Joints','Size','<p>\r\n	Both sizes rated for 150 PSI. For use with both air and water.</p>\r\n',0,0,1,0,7529,NULL,''),(5957,3370,NULL,NULL,NULL,'Trailer Hitch Balls','Size','<p>\r\n	Solid steel, chrome plated.</p>\r\n',0,0,1,0,6654,NULL,''),(6902,2078,NULL,NULL,NULL,'Deadblow Hammers','Size','<p>\r\n	Strong unicast urethane construction. Shockless, non-sparking and non-marring face. Head is loaded with shot to eliminate rebound and increase strike force.</p>\r\n',0,0,1,0,6885,NULL,''),(7550,3367,NULL,NULL,NULL,'Industrial Dual Foot Pressure Gauges','Description','<p>\r\n	Rated for industrial users, these dual foot pressure gauges will withstand the most demanding conditions.</p>\r\n',0,0,1,0,7525,NULL,''),(7551,3367,NULL,NULL,NULL,'Industrial Ergonomic Blow Guns','Description','<p>\r\n	Do not confuse these industrial blow guns with cheap look-a-likes. Designed for industrial users, these guns feature high blowing force, lightweight (112 gram) design, easy hanging design, insulated acetal handle, and superior construction. 1/4&quot; female threads.</p>\r\n<p>\r\n	Safety design model has a six-outlet star tip for safety venting and reduced noise. Full flow design model does not have any tip.</p>\r\n',0,0,1,0,7526,NULL,''),(5647,3216,NULL,NULL,NULL,'Expandable Cargo Net',NULL,'<p>\r\n	Size 72&quot; x 96&quot; (un-expanded). Complete with 28 non-marking ABS hooks. Strong fabric covered rubber cords.</p>\r\n',0,0,1,NULL,6653,NULL,''),(6222,3072,NULL,157,NULL,'Tire Repair Strings, 5 Piece',NULL,'<p>\r\n	Each string measures 4&quot; in length.</p>\r\n',0,1,0,0,4003,NULL,''),(5687,2079,NULL,11,NULL,'Super Ego Industrial Self Adjusting Pliers',NULL,'<p>\r\n	Spring action for rapid gripping of all pipes and nuts. Automatically sizes to the object and removes the need for manual setting. One hand operation and adjustment. Comfortable PVC coated handles. Capacity of 1-5/8&quot;.</p>\r\n',0,0,1,0,5144,NULL,''),(5648,3370,NULL,NULL,NULL,'Triple Ball Mount',NULL,'<p>\r\n	Solid steel 2&quot; bar with: 1-7/8&quot; (2000 lbs), 2&quot; (6000 lbs), and 2-5/16&quot; (10000 lbs) welded trailer balls. Black painted bar with chrome plated trailer balls. Uses 5/8&quot; pin.</p>\r\n',0,0,1,0,6520,NULL,''),(6223,3072,NULL,157,NULL,'Rubber Cement, 3 Piece',NULL,'<ul>\r\n	<li>\r\n		For all rubber repairs, especially tires.</li>\r\n	<li>\r\n		20 ml per tube.</li>\r\n	<li>\r\n		Set of 3 tubes.</li>\r\n</ul>\r\n',0,1,0,0,4002,NULL,''),(6584,3260,NULL,62,NULL,'Baffin Bully Moulded Work Boot, Steel Toe & Plate','Size, Pairs Available','<p>\r\n	Ultraflex oil &amp; acid resistant compound. Comfort crafted GelFlex fatigue resistant midsole. Sure Step First Impact heel strike design. Generous wider fit. Self-cleaning and long wearing high traction sole for sustained footing. Superior durability and comfort. Steel toe and plate. CSA/ASTM approved.</p>\r\n',0,1,0,0,6560,NULL,''),(5661,3090,NULL,22,NULL,'Multiquip QP2TH Heavy Duty Gas Engine Trash Pump, 2 Inch, 211 GPM',NULL,'<p>\r\n	This Honda-powered trash pump boasts a host of standard features for superior performance across the board. One-man operation to use in various dewatering applications when you have debris in the water.</p>\r\n<ul>\r\n	<li>\r\n		Lightest trash pump in the Multiquip fleet.</li>\r\n	<li>\r\n		Dual 2-inch discharge ports.</li>\r\n	<li>\r\n		MAX Solid discharge size: 1-inch diameter.</li>\r\n	<li>\r\n		Pumps up to&nbsp;211 gallons (800 liters)&nbsp;per minute.&nbsp;</li>\r\n	<li>\r\n		Improved mechanical (silicone/silicone) seal.</li>\r\n	<li>\r\n		Reliable 4.8HP Honda GX160 engine.</li>\r\n	<li>\r\n		Low engine oil shutdown.</li>\r\n	<li>\r\n		Aluminum body with cast-iron fittings.</li>\r\n	<li>\r\n		Easy clean-out cover.</li>\r\n	<li>\r\n		Tubular Steel frame for transportation and pump protection.</li>\r\n	<li>\r\n		Cast Iron impeller and volute for abrasion resistance/long life.<img alt=\"\" src=\"/resources/pages/QP2TH Curve Chart.jpg\" style=\"width: 300px; height: 346px;\" /></li>\r\n</ul>\r\n',0,0,1,0,4535,NULL,''),(7555,3250,NULL,NULL,NULL,'Zep Industrial Purple Cleaner & Degreaser','Size','<p>\r\n	Zep Industrial Purple Cleaner &amp; Degreaser is a super-heavy-duty concentrated cleaner that will quickly remove stubborn grease and oil stains from engines, heavy equipment, fiberglass and bilge pumps. Dissolves heavy greases and oils quickly and effectively.<br />\r\n	&nbsp;&nbsp;&nbsp;</p>\r\n<p>\r\n	1 gallon makes up to 6 gallons. Not for use on some painted surfaces, aluminum, brass, copper or galvanized metals.</p>\r\n',0,0,1,1,4295,NULL,''),(5765,3339,NULL,71,NULL,'Fire Axe with Spike, Fiberglass Handle','Head Weight','<p>\r\n	Fire Axe has a spike on one end and comes complete with a factory installed 36&quot; fiberglass handle. Choose from a 4-1/2 lb or 6 lb head.</p>\r\n',0,0,1,0,5754,NULL,''),(5766,2037,NULL,NULL,NULL,'Key Tags','Colour, Amount','<ul>\r\n	<li>\r\n		Supplied with 9/16&quot; plated split ring.</li>\r\n	<li>\r\n		Paper insert with protective cover.</li>\r\n	<li>\r\n		Tag measures 2&quot; x 7/8&quot;</li>\r\n	<li>\r\n		Ideal for key cabinets and other uses where individual colours are required.</li>\r\n	<li>\r\n		Packed 50/bag per colour.</li>\r\n</ul>\r\n',0,0,1,NULL,5756,NULL,''),(5770,3143,NULL,18,NULL,'Ridgid 41348 Kwik-Spin Hand Drain Cleaner',NULL,'<p>\r\n	The new and improved KWIK-SPIN is an excellent choice for clearing blockages from small drain lines in showers, sinks, and tubs. The patented AUTOFEED trigger automatically feeds and retracts the cable as the drum turns.</p>\r\n<ul>\r\n	<li>\r\n		Trigger lock button eliminates hand fatigue.</li>\r\n	<li>\r\n		25\' of high-strength, kink-resistant 1/4&quot; MAXCORE cable.</li>\r\n	<li>\r\n		Comfortable, reinforced hand grip.</li>\r\n	<li>\r\n		Lightweight, polyethylene drum will not dent or rust.</li>\r\n</ul>\r\n',0,1,0,0,6502,NULL,''),(5771,3143,NULL,18,NULL,'Ridgid 88387 Power Spin Hand Drain Cleaner',NULL,'<ul>\r\n	<li>\r\n		For drains to 1-1/2&quot;.</li>\r\n	<li>\r\n		Comfortable hand grip eases effort.</li>\r\n	<li>\r\n		1/4&quot; x 25\' hollow core cable.</li>\r\n	<li>\r\n		Power spin automatically advances and retrieves cable.</li>\r\n	<li>\r\n		Power spin operates by hand or by adding any variable speed drill.</li>\r\n</ul>\r\n',0,1,0,0,6503,NULL,''),(5773,3143,NULL,65,NULL,'General Pipe Cleaners T6FL-DH Teletube Toilet Auger, 6 Foot Cable',NULL,'<p>\r\n	Makes conventional six foot augers obsolete, because it has three feet telescoped into a guide tube until you need it. After you\'ve worked the first three feet into a bowl, you can go three feet farther simply by pressing a button and pulling the crank handle. Outer tube is a big 1-1/8&quot; in diamater; guide tube is extremley tough. Other features include vinyl bowl guard, vinyl grip handle, die cast aluminum turning handle, and &quot;Grip Clip&quot; for attaching cable.</p>\r\n',0,0,1,0,4271,NULL,''),(5774,3143,NULL,65,NULL,'General Pipe Cleaners Spin-Drive Model 400, 50\' X 3/8\" Cable',NULL,'<p>\r\n	The Spin Drive comes equipped with 50 feet of 3/8&quot; cable, making it strong enough to handle stoppages in drains up to 4 inches.</p>\r\n<p>\r\n	A large crank handle on the back of the drum gives you powerful leverage, and after a couple of turns, you have the speed and momentum to break through a stubborn stoppage. Drum is made of heavy-gauge steel and is treated for rust resistance. Three holes are punched in the drum for quick cleaning and drying of cable. The drum turns easily on self-aligning oilite bearings mounted front and rear. A convenient carrying handle is mounted on the drum for easier portability.</p>\r\n',0,0,1,0,5763,NULL,''),(5775,3143,NULL,65,NULL,'General Pipe Cleaners D-25 Handy Hand/Drill Operated Drain Cleaner',NULL,'<p>\r\n	The redesigned D-25 Handy hand-held drain cleaner now sports a durable new plastic container and a rugged new patented chuck for maximum performance, flexibility, and reliability. Designed to take the toughest field abuse, General\'s sturdy new plastic container has been drop tested from 8 feet - fully loaded - without damage. That\'s more than twice the height of a standard test. The patented new chuck tightens firmly on the cable with just a quarter turn. Three chuck jaws securely hold the Flexicore cable for a wide range of small-line jobs. Operate the D-25 Handy as a hand tool - or a power tool! Simply remove the turning handle and attach a 3/8&quot; or 1/2&quot; electric drill for extra muscle on tough clogs. Comes complete with 25 feet of 1/4&quot; cable.&nbsp;</p>\r\n',0,0,1,0,5761,NULL,''),(5777,3255,NULL,79,NULL,'Metal Dust Pan',NULL,'<p>\r\n	This heavy-duty metal dust pan will tackle the toughest jobs without bending or warpring. Ideal for shop use. The rolled steel handle has a convenient hang-up hole. 12&quot; in length.</p>\r\n',0,0,1,0,6538,NULL,''),(6898,2078,NULL,NULL,NULL,'Flat Pry Bars','Size','<p>\r\n	30 degree claw at one end for reaching tight spots, curved pry claw at other for supeior leverage. Used for pulling nails and prying materials.</p>\r\n',0,1,0,0,6881,NULL,''),(6909,2036,NULL,NULL,NULL,'Fiberglass Telescopic Twist N Lock Pole',NULL,'<p>\r\n	5\' to 10\' telescoping length. Used for cleaning weirs by attaching the weir cleaning brush. Twist lock for simple control - loosen the twister to extend the pole, tighten it to hold the pole\'s curent position. Fiberglass outer for durability, fiberglass inner for extra durability. Safely clean weirs without entry! Fiberglass is unaffected by moisture and temperature, it will not shrink or swell. It will not conduct electricity or be harmed by chemicals.</p>\r\n',0,0,1,0,6892,NULL,''),(6897,3115,NULL,NULL,NULL,'Polar Ice Melter, 5 Kg Jug','Qty','<p>\r\n	Starts melting quickly upon application. Melts to extreme temperatures. Excellent grip to ground in extreme conditions. Safer for vegetation and concrete. Blue colored de-icer for consistent visual application.</p>\r\n',0,0,1,0,6880,NULL,''),(6910,3284,NULL,NULL,NULL,'Contractor\'s Black Rubber Garden Hose Assemblies','OD X Length','<div>\r\n	These black rubber garden hose assemblies are the traditional contractor\'s rubber hose, intended for heavy duty applications. They are coupled with solid brass swivel garden hose threaded fittings, and are rated to 150 PSI to withstand unregulated water main pressures. Perfect for those who need a higher volume of water, for example to feed gas engine pressure washers or plant washdown. UV resistant, kink resistant, and abrasion resistant. Working temperature range of -40 degrees up to 200 degrees.</div>\r\n',0,0,1,0,6574,NULL,''),(7660,3115,NULL,NULL,NULL,'Zep Liquid Ice Melt',NULL,'<p>\r\n	Melts ice and snow instantly. It is a combination of wetting agents and freezing point depressants in a water solution. Contains a highly effective corrosion inhibitor to prevent rusting of ferrous surfaces. Non-corrosive to metals and will not harm shrubbery or grass. Will not track on floors or carpeting. Applies easily to vertical surfaces such as windows, windshields and equipment. Can be used to defrost frozen-up air conditioning and refrigeration coils. Can be added to solution of detergents so that they can be used to clean coolers and freezer lockers. Sold per 5 gallon pail.</p>\r\n',0,0,1,0,7637,NULL,''),(7659,3112,NULL,72,NULL,'Garant Yukon Steel Snow Shovel',NULL,'<p>\r\n	All-purpose shovel, industrial grade, 11.5 in. stamped and tempered steel blade, steel D grip, varnished ash handle.</p>\r\n',0,0,1,0,7636,NULL,''),(5787,3339,NULL,NULL,NULL,'Fire Fighting Broom',NULL,'<p>\r\n	This Fire Fighting Broom is for use in grass and forest fires, and fire investigation. The hardwood handle, stiff textured Palmyra fibre and metal cap are locked under pressure to prevent loose handles and fibre fallout.</p>\r\n',0,0,1,0,5777,NULL,''),(7518,2062,NULL,223,NULL,'Bio Med Wash Truck Mounts and Hip Holsters','Description','<p>\r\n	In order to provide immediate and easy treatment from hazardous substances before reaching proper emergency stations, Bio Med Wash should be accessible while in the field.</p>\r\n<p>\r\n	Choose a truck mount for use with your service vehicles. Easily attaches with either screws or built-in adhesive strip.&nbsp;</p>\r\n<p>\r\n	Choose a hip holster to keep on your person. Easily attaches to your belt. Strong velcro closure.&nbsp;</p>\r\n',0,0,1,0,7495,NULL,''),(7519,2062,NULL,223,NULL,'Bio Med Wash Twin Eye Wash Station ',NULL,'<p>\r\n	Comes complete with two 7-ounce bottles of Bio Med Wash. Bright yellow color helps affected personnel locate station. Features a mirror to make application easy and convenient. Includes self-adhering tape to attach station to any surface desired by user.</p>\r\n',0,0,1,0,7496,NULL,''),(7100,2063,NULL,70,NULL,'Orange Corded Disposable Earplugs, Box of 100 Pairs','Qty','<p>\r\n	These corded earplugs seal the ear canal with soft, slow-recovery foam for excellent noise reduction and a proper, comfortable fit. Regular size fits most ear canals. Noise Reduction Rating (NRR) 31 dB. Latex free polyurethane material. Sold 100 pairs per box, each pair is individually bagged. Meets ANSI S3.19 requirements.</p>\r\n',0,0,1,0,6023,NULL,''),(7048,3328,NULL,11,NULL,'Super Ego Ratchet Threader Dies','Size','<p>\r\n	For use with the Super Ego Series 600/601 Enclosed Ratchet. These replacement dies are sold per set of 4.</p>\r\n',0,0,1,0,5381,NULL,''),(7049,3220,NULL,77,NULL,'Magikist 5/16\" Pulse Jet De-Icer Tubing','Length','<p>\r\n	5/16&quot; red tubing for the Magikist PJDX Pulse Jet De-Icer. Used to feed a probe tip down the water line to the frozen section.</p>\r\n',0,0,1,0,6956,NULL,''),(7051,3220,NULL,77,NULL,'Magikist ELCMSHE1500W Immersion Heater, 120V, 1500W',NULL,'<p>\r\n	Replacement immersion heater for the Magikist Pulse Jet De-Icer machine. Comes wired with a 14 gauge cord. Rated at 120V, 1500W, 1 phase.</p>\r\n',0,0,1,0,7034,NULL,''),(7514,3171,NULL,2,NULL,'3M OX Over-The-Glass Safety Eyewear',NULL,'<p>\r\n	Lightweight and adjustable, OX over-the-glass protective eyewear offers an extended field of vision with its wide profile. Its seamless lens with built-in sideshields secures an uninterrupted sight range with over-the-glass coverage. OX protective eyewear increases comfort and provides custom fit and adjustability for prescription eyeglass wearers. Meets the requirements of CSA Z94.3-2007.</p>\r\n',0,0,1,0,7492,NULL,''),(5792,3167,NULL,87,NULL,'Bronze Drum Plug Wrench',NULL,'<p>\r\n	Multipurpose, non-sparking bronze alloy drum bung nut wrench not only opens and closes drum bungs or plugs, it also works as a bung wrench, ring wrench and faucet wrench all in one. Wrench is universal in that it fits all types of industrial drum plugs in metal or plastic.</p>\r\n',0,0,1,0,4041,NULL,''),(5793,3371,NULL,178,NULL,'Scott 01000 Roll Towel, 8\" X 1000\', Case of 12',NULL,'<p>\r\n	Soft, premium one-ply towels. Highest capacity towel in market. Made with &quot;Absorbency Pockets&quot; with fast drying ridges that absorb so effectivley, less towel is needed to dry hands. Good for drying hands, wiping up spills and as a general purpose towel. 1000\' towel fits Kimberley Clark dispensers model numbers 09766, 09990 &amp; 09991. Sold by the case of 12.</p>\r\n',0,0,1,0,4293,NULL,''),(5794,3150,NULL,89,NULL,'Duracell Procell Professional Alkaline Battery - D Cell',NULL,'<p>\r\n	Duracell Procell batteries are manufactured to rigid specifications to meet some of the highest standards of durability and longevity that professional users demand and expect. Procell batteries deliver outstanding performance with a 7-year freshness guarantee backed up with date coding.</p>\r\n<p>\r\n	Procell batteries are rated for reliable operation in temperature extremes from -20C to 54C and contain no added mercury.</p>\r\n<p>\r\n	12 D cell batteries per box, 6 boxes per case.</p>\r\n',0,0,1,NULL,4384,NULL,''),(5795,3150,NULL,89,NULL,'Duracell Procell Professional Alkaline Battery - C Cell',NULL,'<p>\r\n	Duracell Procell batteries are manufactured to rigid specifications to meet some of the highest standards of durability and longevity that professional users demand and expect. Procell batteries deliver outstanding performance with a 7-year freshness guarantee backed up with date coding.</p>\r\n<p>\r\n	Procell batteries are rated for reliable operation in temperature extremes from -20C to 54C and contain no added mercury.</p>\r\n<p>\r\n	12 C cell batteries per box, 6 boxes per case.</p>\r\n',0,0,1,NULL,5784,NULL,''),(5796,3150,NULL,89,NULL,'Duracell Procell Professional Alkaline Battery - AA Cell',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<div class=\"details-add-to-cart2\">\r\n		<section class=\"product-details\">\r\n		<p>\r\n			Duracell Procell batteries are manufactured to rigid specifications to meet some of the highest standards of durability and longevity that professional users demand and expect. Procell batteries deliver outstanding performance with a 7-year freshness guarantee backed up with date coding.</p>\r\n		<p>\r\n			Procell batteries are rated for reliable operation in temperature extremes from -20C to 54C and contain no added mercury.</p>\r\n		<p>\r\n			24 AA batteries per box, 6 boxes per case.</p>\r\n		</section></div>\r\n	</section></div>\r\n',0,0,1,NULL,5786,NULL,''),(5797,3150,NULL,89,NULL,'Duracell Procell Professional Alkaline Battery - AAA Cell',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<div class=\"details-add-to-cart2\">\r\n		<section class=\"product-details\">\r\n		<div class=\"details-add-to-cart2\">\r\n			<section class=\"product-details\">\r\n			<p>\r\n				Duracell Procell batteries are manufactured to rigid specifications to meet some of the highest standards of durability and longevity that professional users demand and expect. Procell batteries deliver outstanding performance with a 7-year freshness guarantee backed up with date coding.</p>\r\n			<p>\r\n				Procell batteries are rated for reliable operation in temperature extremes from -20C to 54C and contain no added mercury.</p>\r\n			<p>\r\n				24 AA batteries per box, 6 boxes per case.</p>\r\n			</section></div>\r\n		</section></div>\r\n	</section></div>\r\n',0,0,1,NULL,5787,NULL,''),(5798,2040,NULL,64,NULL,'Pur Value Institutional Aluminum Foil',NULL,'<ul>\r\n	<li>\r\n		Roll measures 18&quot; wide by 100m in length.</li>\r\n	<li>\r\n		Wide variety of uses.</li>\r\n</ul>\r\n',0,0,1,NULL,5788,NULL,''),(5799,3123,NULL,NULL,NULL,'Jiffy Lite #2 Self-Sealing Bubble Mailer',NULL,'<ul>\r\n	<li>\r\n		Fully laminated kraft and air cellular construction.</li>\r\n	<li>\r\n		3/16&quot; barrier layer of bubble wrap.</li>\r\n	<li>\r\n		8-1/2&quot; x 12&quot; outside, 8-1/2&quot; x 11&quot; inside.</li>\r\n	<li>\r\n		Seamless bottom adds additional cushioning protection and overall strength.</li>\r\n	<li>\r\n		Self-seal closure saves labor and eliminates the need for staples and tape.</li>\r\n	<li>\r\n		Forms a water-resistant secure package.</li>\r\n	<li>\r\n		100 envelopes per case.</li>\r\n</ul>\r\n',0,0,1,NULL,5789,NULL,''),(5800,3125,NULL,91,NULL,'Irwin Hanson Multi-Spline Extractor Set',NULL,'<p>\r\n	Designed to remove broken screws, studs, bolts, pipes, and alemite fittings. Hex head for use with sockets and flat wrenches. Fine knurled multi-spline grips a larger cross section versus standard extractors. Extractors are enclosed in a tough HDPE case.</p>\r\n<p>\r\n	10 extractors are as follows: 1/8&quot;, 5/32&quot;, 3/16&quot;, 7/32&quot;, 1/4&quot;, 9/32&quot;, 5/16&quot;, 11/32&quot;, 3/8&quot;, 13/32&quot;.</p>\r\n',0,0,1,0,5120,NULL,''),(6698,3167,NULL,NULL,NULL,'Drum Lift Sling',NULL,'<p>\r\n	Securely and economically lifts steel, plastic, and fibre drums from 12&quot; to 24&quot; in diameter. Compact size of sling allows it to be stored until needed. Reduces drum damage which can occur when using steel handlers. 2&quot; x 10\' endless ratchet strap tightens the reinforced polyester lifting belt around the body of the drum. 4&quot; x 6\' double ply tie down web is compatible with a variety of lifting devices. Capacity: 1000 lbs.</p>\r\n',0,0,1,0,6683,NULL,''),(5802,3125,NULL,50,NULL,'Signet 8 Piece Industrial Screwdriver Set',NULL,'<p>\r\n	Ergonomic non-slip dual composite oversized handles for strength and comfort. Hardened, blackened chrome vanadium tips for strength. Chrome vanadium blades. Bolstered handles and top eye hole work with the extra strength grip to allow users the torque needed for all jobs.</p>\r\n<ul>\r\n	<li>\r\n		Slotted: 1/4&quot; x 4&quot;, 5/16&quot; x 6&quot;</li>\r\n	<li>\r\n		Phillips: #1 x 3&quot;, #2 x 4&quot;, #3 x 6&quot;</li>\r\n	<li>\r\n		Robertson: #1 x 4&quot;, #2 x 4&quot;, #3 x 5&quot;</li>\r\n</ul>\r\n',0,0,1,NULL,5103,NULL,''),(7599,3200,NULL,32,NULL,'Hach 2965249 Electrode Cleaning Solution, 500 ml',NULL,'<p>\r\n	Used for cleaning all pH, ORP and sodium ion selective eletrodes. 500 ml bottle.</p>\r\n',0,0,1,0,7576,NULL,''),(7600,3200,NULL,32,NULL,'Hach Electrode Washing Station',NULL,'<p>\r\n	Offers a safe, convenient way to clean delicate pH electrodes in place without the risk of scratching or damage. Its 500 mL reservoir is filled with distilled water and the entire unit is set in place so that the electrode hangs down into the spray chamber. When the reservoir is squeezed, a spray of water rinses the electrode and then drains off via the section of vinyl tubing provided. The removable based is 14 cm (5.5&quot;) in diameter and the washer is 21 cm (8.25&quot;) high.</p>\r\n',0,0,1,0,7577,NULL,''),(7601,2072,NULL,32,NULL,'Hach IntelliCAL PHC101 Standard Gel Filled pH Electrode',NULL,'<p>\r\n	IntelliCAL PHC101 is a digital, combination pH probe with a non-refillable, gel-filled double junction reference and built-in temperature sensor. The standard version of this pH probe comes with a 1 meter cable and is intended for laboratory use. The PHC101 probe is ideal for measuring pH in wastewater applications.</p>\r\n<p>\r\n	IntelliCAL PHC101 provides fast, stable response in wastewater applications. Recalls traceability in measurement history.<br />\r\n	Alerts the user when re-calibration is needed. Can be moved between meters without the need to re-calibrate or re-enter measurement settings.</p>\r\n',0,0,1,0,7578,NULL,''),(6701,3287,NULL,192,NULL,'Heavy-Duty 12 Drawer Parts Cabinet',NULL,'<p>\r\n	Heavy-duty beige ABS drawers measure 6.4&quot; W x 11.3&quot; D x 2.7&quot; H. Drawers are housed in an all-welded 22-gauge galvanized steel cabinet which measures 23&quot; W x 11.4&quot; D x 13.8&quot; H. I.D. card with clear plastic shield and divider included with every drawer. Steel tabs and drawer stoppers allow for full extension without risk of spilling bin contents. Grey enamel finish.</p>\r\n',0,0,1,0,6686,NULL,''),(6700,3167,NULL,192,NULL,'Heavy-Duty Dual Handle Hand Truck',NULL,'<p>\r\n	Constructed of 1-1/4&quot; 14-gauge steel tube. 6-gauge steel nose plate. Overall height: 46&quot;. Overall width: 20&quot;. Nose plate dimensions: 14&quot; x 8&quot;. Capacity: 1000 lbs. Rubber wheel dimensions 8&quot; x 2&quot;. Durable powder coat finish.</p>\r\n',0,0,1,0,6685,NULL,''),(6655,3390,NULL,67,NULL,'Forcefield High Visibility Safety T-Shirt, Yellow','Size','<p>\r\n	V-neck, short sleeves. 100% polyester fabric provides comfort and wicking. Reflective tape w/ contrast backing in 4&quot; configuration meets CSA Z96-09 Class 2 Level 2</p>\r\n',0,0,1,0,6103,NULL,''),(6699,3167,NULL,192,NULL,'Heavy-Duty Hydraulic Pallet Truck',NULL,'<p>\r\n	Rugged construction makes this pallet truck the best value for your material handling needs. 6&quot; wide forks feature entry rollers and tapered design for easy pallet entry and are reinforced for heavy-duty loads. The 3-function hand control (raise, neutral, lower) and the spring-loaded self-righting safety loop handle enhance comfort and ease of operation. Hardened chrome piston with protective dust cover for dependable performance. Durable powder coat finish. Heavy-duty polyurethane tread bonded to cast iron core steering wheels and rollers provide superior performance. Lowered height: 2-7/8&quot;. Raised height: 7-3/4&quot;. Frame width: 20.5&quot;. Fork length: 42&quot;. Capacity: 5500 lbs.</p>\r\n',0,0,1,0,6684,NULL,''),(5813,3319,NULL,50,NULL,'Telescoping Magnetic Pick Up Tool Set, 5 Piece',NULL,'<p>\r\n	Includes magnet, light, inspection mirror and clip. Length&quot; 24-3/5&quot; (625mm). Magnetic Lift: 1/2 lb (0.25kgs).</p>\r\n',0,0,1,0,5803,NULL,''),(5814,3319,NULL,50,NULL,'Telescoping Magnetic Pick Up Tool, 10 Pound Capacity',NULL,'<p>\r\n	Length: 6-3/4&quot;. Magnetic Lift: 10 lbs. Extends from 6-3/4&quot; to 30-1/4&quot;.</p>\r\n',0,0,1,0,5804,NULL,''),(7463,3261,NULL,218,NULL,'SJE PumpMaster Plus Quick Fit Piggyback Plug Wide Angle Float Switch, 15 Amp, 120V','Cable Length','<p>\r\n	Designed for direct control of 120 volt pumps up to 3/4 HP.</p>\r\n<p>\r\n	The SJE PumpMaster Plus QuickFit is a non-mercury, wide angle float switch designed for direct control of any 120 volt pump up to 15 amps FLA. It can be used in potable water and sewage applications.</p>\r\n<p>\r\n	Not sensitive to rotation or turbulence, this float switch works well in both calm and turbulent situations. This mechanical float switch directly controls pumps in pump down/emptying applications.</p>\r\n<p>\r\n	The Quick Fit feature has the float and piggyback plug separate to allow for quick fit installation by routing the float cord through conduit and heat shrink, then attaching the piggyback plug by inserting the quick connect terminals and applying the protective heat shrink. This unique feature allows greater flexibility during the installation process.</p>\r\n<p>\r\n	UL and CSA listed. Passed NSF Standard 61 Protocol. Adjustable pump down range of 7&quot; to 36&quot;. Flexible 14 gauge cable and heavy duty switch are rated for 15A running and 85A starting current. Comes complete with mounting clamp.</p>\r\n<p>\r\n	All SJE float switches now carry a 5 year warranty.</p>\r\n',0,0,1,0,6597,NULL,''),(5815,3319,NULL,50,NULL,'Telescoping Inspection Mirror, Round',NULL,'<p>\r\n	Length 6-1/2&quot;. Extends from 6-1/2&quot; to 29-1/2&quot;. Mirror Diameter: 3-1/4&quot;.</p>\r\n',0,0,1,0,5805,NULL,''),(7024,3321,NULL,209,NULL,'Koflo Metering Pump Calibration Columns','Capacity / Connection Size','<p>\r\n	These pump calibration columns provide an easy method for determining pump flow rate using industry standard graduations of mL/min and GPH. An equal starting point for both graduated scales gives the operator both mL/min and GPH in one test.</p>\r\n<p>\r\n	High contrast blue lettering enhances readability in all light conditions, and the scales have a protective Mylar lamination to protect against chemical corrosion. Features rugged construction using industrial grade machined PVC fittings.</p>\r\n',0,0,1,0,7005,NULL,''),(5816,3319,NULL,50,NULL,'Telescoping Magnifying Glass, Round',NULL,'<p>\r\n	Length: 6-7/8&quot;. Extends from 6-7/8&quot; to 36-1/8&quot;. Glass Diameter: 2-1/4&quot;.</p>\r\n',0,0,1,0,5806,NULL,''),(7021,3365,NULL,NULL,NULL,'Road Hazard Triangle Kit, 3 Piece',NULL,'<p>\r\n	Packed 3 reflective traffic triangles per case. 17&quot; sides for enhanced visibility. Weighted base for stability. Meets DOT approvals.</p>\r\n',0,0,1,0,6609,NULL,''),(5817,3125,NULL,50,NULL,'Signet 8 Piece Folding Torx Key Set',NULL,'<p>\r\n	S2 steel with satin finish. Keys for the following sizes: T9, T10, T15, T20, T25, T27, T30, T40.</p>\r\n',0,0,1,NULL,5790,NULL,''),(7554,3065,NULL,NULL,NULL,'Industrial 110 Piece SAE/Metric Tap & Die Set',NULL,'<p>\r\n	Industrial quality tap and die set is made in Japan. High quality tungsten steel, heat treated and tempered to RHC 58<span class=\"st\"> - 61<span class=\"st\">. 3 different tap wrenches and two die wrenches included. Packed in metal case with handle. Combination of NC and NF, and metric coarse and fine. Contains one taper tap, one bottoming tap. Metric dies sizes 4 to 10 mm coarse and fine. SAE dies 1/4&quot; to 3/4&quot; coarse and fine.</span></span></p>\r\n',0,0,1,0,7531,NULL,''),(5819,3319,NULL,NULL,NULL,'Flexible Magnetic Pick-Up Tool',NULL,'<p>\r\n	Can be bent at any angle to retrieve dropped metal objects in hard to reach areas. 20&quot; in length.</p>\r\n',0,0,1,0,5809,NULL,''),(7460,3321,NULL,220,NULL,'Blue-White Flow Indicators','Size','<p>\r\n	This flow indicator is an excellent diagnostic tool for both diaphragm and peristaltic metering pumps. Installed on the suction line, flow is indicated by rhythmic rising and falling of the flow indicator ball.</p>\r\n<p>\r\n	Installs quickly and easily with compression twist ends.</p>\r\n',0,0,1,0,7007,NULL,''),(7461,3321,NULL,220,NULL,'Blue-White ProSeries Flow Indicator, 1/2\" NPT',NULL,'<p>\r\n	This ProSeries flow indicator is an excellent diagnostic tool for both diaphragm and peristaltic metering pumps. Installed on the suction line, flow is indicated by rhythmic rising and falling of the flow indicator ball.</p>\r\n<p>\r\n	Dual taper detects for maximum flow range (&lt;10,000:1 turndown). 50 ml/min to 10,100 ml/min. 0.01 GPH to 160 GPH.</p>\r\n<p>\r\n	Half union style fittings for quick disassembly - aids in cleaning and/or replacement. Annealed cast acrylic body for enhanced strength and chemical resistance. 1/2&quot; threaded ends.</p>\r\n',0,0,1,0,7437,NULL,''),(6711,2077,NULL,50,NULL,'Signet 31 Piece Micro Bit System',NULL,'<p>\r\n	The GearWrench Micro Bit System will reach into places where no other ratcheting bit driver will go. The bits are self securing and do not use a bit adapter. This allows the Micro Bit to quickly interchange in the fine tooth GearWrench head. No space is wasted on an adapter.</p>\r\n<p>\r\n	<u><strong>Includes:</strong></u></p>\r\n<ul>\r\n	<li>\r\n		(1) Double Ring GearWrench, 8 x 10mm</li>\r\n	<li>\r\n		(5) Micro Phillips Bits, #0, #1, #2, #3, #4</li>\r\n	<li>\r\n		(5) Micro Hex Bits, 4, 5, 6, 7, 8mm</li>\r\n	<li>\r\n		(4) Micro Spline Bits - 5, 6, 8, 10</li>\r\n	<li>\r\n		(8) Micro Torque Bits, T10, T15, T20, T25, T27, T30, T40, T45</li>\r\n	<li>\r\n		(8) Micro Tamper Toque Bits, T10, T15, T20, T25, T27, T30, T40, T45</li>\r\n	<li>\r\n		<em>Recplacement Washers Included</em></li>\r\n</ul>\r\n',0,0,1,0,6696,NULL,''),(5825,3127,NULL,195,NULL,'DeWalt DG5528 Closed-Top 18\" Tool Bag w/ Molded Base',NULL,'<p>\r\n	4 interior pockets including one zippered pocket for valuables, plus 10 web loops to keep smaller tools organized. 29 exterior pockets including 2 flap-covered pockets and one large zippered pocket. Adjustable, non-slip padded shoulder strap and padded, non-slip handles. Pop-open design with large interior compartment allows for easy access to tools and parts. Utility knife pocket, measuring tape clip and electrical tape web strap. Heavy-duty poly and ballistic poly fabric construction with impact-resistant, molded rubber base.</p>\r\n',0,0,1,0,5815,NULL,''),(5826,3127,NULL,195,NULL,'DeWalt DG5518 Open-Top 18\" Tool Bag w/ Molded Base',NULL,'<p>\r\n	Large interior compartment allows for easy visibility and direct access to larger tools and parts. 23 exterior pockets - includes 2 flap-covered pockets and one large zippered pocket. Adjustable, non-slip padded shoulder strap and padded, non-slip handles. 4 interior pockets including one zippered pocket for valuables, plus 10 web loops to keep smaller tools organized. Utility knife pocket, measuring tape clip and electrical tape web strap. Heavy-duty poly and ballistic poly fabric construction with impact-resistant, molded rubber base.</p>\r\n',0,0,1,0,5816,NULL,''),(7578,3127,NULL,NULL,NULL,'Industrial Stainless Steel Top Workbench',NULL,'<p>\r\n	Heavy-duty construction - 2500 lbs capacity. 72&quot; length, 30&quot; width, 34&quot; overall height.</p>\r\n<p>\r\n	Top constructed of 14-gauge stainless steel with a number 4 finish and formed edges. Top reinforced with wood core for sound reduction and added strength. 1-3/4&quot; overall top thickness.</p>\r\n',0,0,1,0,7555,NULL,''),(5828,3127,NULL,18,NULL,'Ridgid No. 606 Standard Shape Tool Box w/ Tray',NULL,'<p>\r\n	Padlock provision on catch. Heavy-duty tray with handle.</p>\r\n<p>\r\n	Heavy-duty tool box for tradesmen\'s use. Made of 18-gauge, cold-rolled prime steel. Two heavy-duty plated trunk-type catches. Plated top handle. Electrically welded construction. Continuous piano hinge. Durable baked red enamel finish, electrostatically sprayed.</p>\r\n',0,1,0,0,6234,NULL,''),(5830,3127,NULL,193,NULL,'Professional Heavy-Duty 7 Drawer Tool Cart',NULL,'<p>\r\n	Double wall steel construction. Full extension ball bearing slides on all drawers. Extruded aluminum drawer handle trim. Heavy duty 5&quot; X 1-1/4&quot; casters. Non-slip drawer liners included. High gloss powder coat scratch resistant paint. Each drawer has a 100 lb capacity. Unit measures 27&quot; x 18&quot; x 35-1/2&quot;. 5 year limited warranty.</p>\r\n',0,0,1,0,5819,NULL,''),(5831,3369,NULL,18,NULL,'Ridgid Bi-Metal Electrician\'s Hole Saw Kit',NULL,'<ul>\r\n	<li>\r\n		Contains a selection of hole saws and hole saw arbors for cutting through wood, steel, cast iron, brass and aluminum.</li>\r\n	<li>\r\n		Hole saws: 7/8&quot;, 1-1/8&quot;, 1-3/8&quot;, 1-3/4&quot;, 2&quot;, 2-1/2&quot;</li>\r\n	<li>\r\n		Arbors: R1, R2</li>\r\n</ul>\r\n',0,1,0,0,6228,NULL,''),(6919,3177,NULL,NULL,NULL,'Heavy Duty Propane Tiger Torch Kit',NULL,'<p>\r\n	All purpose propane flame tool operates off the pressure of a standard propane tank - no regulator required. 31&quot; handle. Ideal for a wide variety of all-season maintenance/repair applications. Burns weeds, seals tar, peels paint, removes road markings, melts ice, thaws pipes, etc. Includes 10\' neoprene hose, on/off valve, 500,000 BTU rating, durable cast iron and steel nozzle, striker.</p>\r\n',0,0,1,0,6902,NULL,''),(6918,3177,NULL,NULL,NULL,'Remote Thermostat for IDF Heaters',NULL,'<p>\r\n	For the Gryp and Mirage heaters. Allows for thermostatically controlled operation. Saves fuel. 25 foot cord.</p>\r\n',0,0,1,0,6901,NULL,''),(5837,3369,NULL,100,NULL,'Abmast Kompetitor Angle Grinder Cutting Wheels, 4-1/2\" and 5\", 6/pk','Size','<p>\r\n	These high quality, economically priced cutting wheels combine safety and a fast cutting speed to handle many different types of cutting applications. Able to handle all types of metals, including stainless steel. Made with aluminum oxide. Type 27. Made in Canada. <strong>Sold per pack of 6.</strong></p>\r\n',0,0,1,0,5355,NULL,''),(6893,3177,NULL,213,NULL,'Frost Fighter Gryp 90AP Indirect Diesel Fired Heater, 89,400 BTU',NULL,'<p>\r\n	Unlike a direct-fired heater, this indirect-fired heater provides clean air, free from contaminated fumes and moisture. Stainless steel, high efficiency 81.6% heat exchanger. Quiet operation. Light construction for easy mobility. 89,400 BTU/hr output. 115 volt, 60 hz fan. 475 ft3/min. 300W motor. 0.68 fuel cons. US gal/hr. Tank capacity 12.15 gal. (1) air outlet @ 12&quot; diameter. CSA and ETL compliant. Meets OSHA standards.</p>\r\n',0,0,1,0,6876,NULL,''),(6894,3177,NULL,213,NULL,'Frost Fighter Mirage M180 Indirect Diesel Fired Heater, 189,900 BTU',NULL,'<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16px;\">Unlike a direct-fired heater, this indirect-fired heater provides clean air, free from contaminated fumes and moisture. Stainless steel, high efficiency 87.1% heat exchanger. Quiet operation. Light construction for easy mobility. 180,900 BTU/hr output. 115 volt, 60 hz fan. 1475 ft3/min. 460W motor. 1.28 fuel cons. US gal/hr. Tank capacity 13.47 gal. (1) air outlet @ 12&quot; diameter. CSA and ETL compliant. Meets OSHA standards.</span></p>\r\n',0,0,1,0,6877,NULL,''),(5839,2070,NULL,32,NULL,'Hach Total Hardness Test Kit, Model HA-71A',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Water hardness is caused almost entirely by calcium and magnesium ion. Other di- and trivalent metals have a similar effect, but usually are not present in high enough concentration in potable waters to cause problems. Hardness increases soap consumption in laundries and causes scale in boilers. With the Model HA-71A test kit, simply count the number of drops required to change the solution color to determine hardness concentration. Utilizing drop count titration, this kit provides dual ranges and contains approximately 100 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Utilizes drop count titration - a simple, economical titration method</li>\r\n		<li>\r\n			Kit contains all required reagents and apparatus in a rugged carrying case for analysis in the field</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,1,5943,NULL,''),(5840,2070,NULL,32,NULL,'Hach Iron Color Disc Test Kit, Model IR-18',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Using the simple color disc method, this kit measures Iron (medium range - 0.1-5 mg/L) and contains 100 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Simple, low-cost color disc method is the most accurate visual test kit method</li>\r\n		<li>\r\n			Kit contains all required reagents and apparatus in a rugged carrying case for analysis in the field</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5563,NULL,''),(6040,3285,NULL,NULL,NULL,'Drain Cleaning Hose','Size','<ul>\r\n	<li>\r\n		3000 PSI maximum.</li>\r\n	<li>\r\n		212<span class=\"st\">F maximum.</span></li>\r\n	<li>\r\n		1-1/4&quot; bend radius.</li>\r\n	<li>\r\n		All hose is 3/16&quot; and comes complete with 1/8&quot; MNPT ends.</li>\r\n</ul>\r\n',0,0,1,0,6030,NULL,''),(5911,3277,NULL,9,NULL,'Black Acrylic Knit 3M Thinsulate Lined Toque','Qty','<p>\r\n	Acrylic knit toque is made with a double-knit construction.Thinsulate liner for added warmth. Toque can stretch for a comfortable fit.</p>\r\n',0,0,1,0,6116,NULL,''),(5910,3277,NULL,8,NULL,'Tough Duck i5016 Black Aviator Hat','Size','<p>\r\n	Fabric: 100% cotton duck. Lining: 100% cotton quilted to 200G Thinsulate. Pile trim: 100% polyester. Snap up/down visor with pile trim button. Up/down pile trimmed ear. Flaps &quot;hearing&quot; holes under ear flaps. Adjustable chin straps.</p>\r\n',0,0,1,0,5002,NULL,''),(7767,3406,NULL,8,NULL,'Tough Duck Gi9606 Pile Lined Full Grain Leather Gloves, 6/pk','Size','<p>\r\n	10 oz cotton brown twill. 100% polyester pile lining provides insulation from the cold. Premium cowhide leather. Rubberized safety cuff. Leather knuckle strap and finger tips. Sold per pack of 6.</p>\r\n',0,0,1,0,6218,NULL,''),(5853,2070,NULL,32,NULL,'Hach Manganese Test Kit, Model MN-PAN',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Manganese causes a bitter taste in water, and at concentrations above 0.1 mg/L, it causes objectionable stains on laundry and plumbing fixtures. Manganese control also is important in the beverage, paper, and textile industries, and in dye production and food processing. An economical solution, this kit uses the simple, accurate color disc method. Measures manganese (range 0.05 - 0.7 mg/L) and contains 50 tests.</p>\r\n</div>\r\n',0,0,1,1,5829,NULL,''),(6347,3202,NULL,32,NULL,'Hach 96299 UniVer 3 Hardness Reagent Powder Pillows, pk/100',NULL,'<p>\r\n	Combined indicator/buffer for total hardness determination by titration. For use with total hardness test kits. Pack of 100 Powder Pillows.</p>\r\n',0,0,1,0,6330,NULL,''),(6348,2067,NULL,NULL,NULL,'Microbiological Sample Collector, 100 ml',NULL,'<p>\r\n	Used to collect microbiological samples from lagoons and deep tanks. Threads on to Fiberglass Telescopic Push N Lock Poles. Safely collects samples up to 16\' away. Unique bottle gripper holds most 100 ml coliform sample bottles. Bottles not included. Poles not included.</p>\r\n',0,0,1,0,6335,NULL,''),(5856,3211,NULL,32,NULL,'Hach 2557000 CL17 Total Chlorine Reagent Set',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		&nbsp;</p>\r\n	<ul>\r\n		<li>\r\n			Hach Total Chlorine Reagent Set is specifically designed and produced to work with Hach CL17 Analyzers.</li>\r\n		<li>\r\n			The CL17 is designed to require replacement of reagents on a predictable schedule under typical use. Maintenance can be performed in 15 minutes, and no special tools are required.</li>\r\n		<li>\r\n			Number of tests: 450</li>\r\n		<li>\r\n			Range: 0.02 - 2.00 mg/l Cl</li>\r\n	</ul>\r\n	<p>\r\n		<u><strong>Set contains:</strong></u></p>\r\n	<ul>\r\n		<li>\r\n			DPD Free &amp; Total Chlorine Indicator Powder, 25 Grams (2297255)</li>\r\n		<li>\r\n			Total Chlorine Indicator Solution, 473 ml (# 2263411)</li>\r\n		<li>\r\n			Total Chlorine Buffer Solution, 473 ml (# 2263511)</li>\r\n	</ul>\r\n	</section></div>\r\n',0,0,1,1,6808,NULL,''),(5857,3205,NULL,32,NULL,'Hach 2439802 Dissolved Oxygen Reagent Set for OX-2P Test Kit',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		For determination of Dissolved Oxygen by Drop Count Titration</p>\r\n	<p>\r\n		<u>Set contains:</u></p>\r\n	<ul>\r\n		<li>\r\n			Dissolved Oxygen 1 Reagent Powder Pillows, 100/pk (# 98199)</li>\r\n		<li>\r\n			Dissolved Oxygen 2 Reagent Powder Pillows, 100/pk (# 98299)</li>\r\n		<li>\r\n			Dissolved Oxygen 3 Reagent Powder Pillows, 100/pk (# 98799)</li>\r\n		<li>\r\n			Sodium Thiosulfate Standard Solution, Stabilized, 0.0109 N, 100 mL MDB (# 2408932)</li>\r\n	</ul>\r\n	</section></div>\r\n',0,0,1,1,5847,NULL,''),(5858,3202,NULL,32,NULL,'Hach 2437800 Hardness (Total) Reagent Set for HA-71A Test Kit',NULL,'<p>\r\n	For determination of Total Hardness by the Drop Count EDTA Titration Method.</p>\r\n<p>\r\n	<u><strong>Set Contains:</strong></u></p>\r\n<ul>\r\n	<li>\r\n		Hardness 1 Buffer Solution, 100 ml (42432),</li>\r\n	<li>\r\n		Hardness 2 Indicator Solution, 100 ml (42532)</li>\r\n	<li>\r\n		Hardness 3 Titrant Solution, 100 ml (42632).</li>\r\n</ul>\r\n',0,0,1,1,7391,NULL,''),(7535,3297,NULL,204,NULL,'Shop Vac 960-32 Ultra Series Wet/Dry PUMP VAC, 12 Gallons, 5.0 HP',NULL,'<p>\r\n	With a Shop-Vac Pump Vac, you can pick up water from one place and pump it to another. And you can keep vacuuming while you empty the tank. Eliminates the need to lift heavy tanks full of water or murky debris.</p>\r\n<p>\r\n	Built to perform on the jobsite or in the shop. Packed with features including onboard storage compartment, heavy duty tools and filters, tank drain, convertible blower port, quiet running motor, and many others. Includes 2-1/2&quot; 9-piece accessory package and filter kit. 12 gallon tank, 5.0 HP motor.</p>\r\n',0,0,1,0,6822,NULL,''),(6839,3297,NULL,204,NULL,'Shop Vac 903-04 Wet/Dry Cartridge Filter','Qty','<p>\r\n	For both dry and wet pick up. Designed to combat your toughest challenge. Fits most Shop Vac models.</p>\r\n',0,0,1,0,7514,NULL,''),(7537,3297,NULL,224,NULL,'Shop Vac 286-00 Industrial Back Pack Vac, 6.5 HP',NULL,'<p>\r\n	The Shop Vac Back Pack Vac really packs the power with mobility and reach with this adjustable back pack harness system. The lightweight Back Pac Vac is designed to tackle large areas with minimum effort and also enables its user to clean the toughest hard-to-reach spots. Cmes with 25-foot extension cord and should be used for dry pick up only.</p>\r\n',0,0,1,0,7513,NULL,''),(7536,3297,NULL,224,NULL,'Shop Vac 999-19 Industrial Hippo Hand Held Vacuum, 1 Qt, 1.5 HP',NULL,'<p>\r\n	Dependable power meets lightweight portability. Variety of cleaning attachments, including extension wand, crevice tool and round brush. Use attachments directly on vacuum or on 6\' hose. Includes shoulder strap to free hands while working with hose. Disposable filter bag. Dry pickup only. 35\' power cord eliminates need for an extension cord. Current: 6.8 A; Voltage: 120.0 V; Power: 1.5 hp; Tank Capacity: 1.0 qt.</p>\r\n',0,0,1,0,7512,NULL,''),(6892,3113,NULL,NULL,NULL,'Swedish Steel Garden Bow Saw','Description','<p>\r\n	Oval, high frequency welded tube construction is 24&quot; in length. Supplied with 24&quot; X 3/4&quot; hard point long-lasting raker tooth blade. Painted with orange stove enamel to prevent rusting. Useful for cutting down saplings, branches, small trees, etc. Made in Sweden.</p>\r\n',0,0,1,0,6875,NULL,''),(7549,3367,NULL,NULL,NULL,'Industrial Dual Foot Chucks','Description','<p>\r\n	Rated for industrial users, these dual foot chucks will withstand the most demanding conditions in any shop.</p>\r\n',0,0,1,0,7511,NULL,''),(6917,3177,NULL,NULL,NULL,'Galvanized 90 Adjustable Exhaust Elbow, 6\"',NULL,'<p>\r\n	Used to change the direction of airflow in round exhaust pipe. Adjustable from 0<span class=\"st\"> to 90</span><span class=\"st\">. 6&quot; diameter.</span></p>\r\n',0,0,1,0,6900,NULL,''),(6916,3177,NULL,NULL,NULL,'Galvanized B-Vent Exhaust Duct, 6\" X 5\'',NULL,'<p>\r\n	6&quot; round b-vent galvanized duct is 5 feet in length. Sections can be combined to reach desired length. Fits both the Mirage and Gryp heaters, and any other heater with a 6&quot; stack.</p>\r\n',0,0,1,0,6899,NULL,''),(7594,2069,NULL,32,NULL,'Hach 5870062 Pocket Colorimeter II for Chlorine (Free & Total), Mid Range/High Range',NULL,'<p>\r\n	Includes Pocket Colorimeter II Analysis System for Free Chlorine and Total Chlorine.&nbsp; Reagents included: 100 tests free chlorine, 100 tests total chlorine. Complete with manual, sample cells and carrying case. USEPA approved/accepted for drinking water and wastewater.</p>\r\n<ul>\r\n	<li>\r\n		Mid Range - 0.05 to 4.00 mg/L</li>\r\n	<li>\r\n		High Range - 0.1 to 10.0 mg/L</li>\r\n</ul>\r\n',0,0,1,0,6711,NULL,''),(5872,3369,NULL,100,NULL,'Abmast Angle Grinder Fiberglass Backed Flap Discs, 4-1/2\" and 5\", 6/pk','Size','<p>\r\n	Flap discs combine the fast grinding characteristics of a depressed centre wheel and the finish of a resin fibre disc. This two-in-one feature is cost saving and ensures maximum productivity for many applications. Flap discs operate quieter, with reduced vibration and less dust than depressed centre wheels. Flap discs offer the perfect balance of ginding, blending and finishing in one versatile product.</p>\r\n<ul>\r\n	<li>\r\n		Type 29 (depreesed center, for &quot;regular&quot; angle grinding work, designed to make the disc operate easier for the user).</li>\r\n	<li>\r\n		Top quality zirconium grain provides superior stock removal and a fast, cool cutting action.</li>\r\n	<li>\r\n		Zirconium oxide has been shown to substantially outperform aluminum oxide.</li>\r\n	<li>\r\n		Applications include ferrous and non-ferrous materials, stainless steel, high tensile steels, aluminum, structural steel, cast iron, plastic, fiberglass, brass, etc.</li>\r\n	<li>\r\n		Made in Italy.</li>\r\n	<li>\r\n		<strong>Sold per pack of 6.</strong></li>\r\n</ul>\r\n',0,0,1,0,5379,NULL,''),(6836,3297,NULL,204,NULL,'Shop Vac 962-16 Ultra Series Wet/Dry Vac, 16.5 Gallons, 6.5 HP',NULL,'<p>\r\n	Built to perform on the jobsite or in the shop. Packed with features including onboard storage compartment, heavy duty tools and filters, tank drain, convertible blower port, quiet running motor, and many others. Includes 2-1/2&quot; 9-piece accessory package and filter kit. 16.5 gallon tank, 6.5 HP motor.</p>\r\n',0,0,1,0,6819,NULL,''),(6837,3297,NULL,204,NULL,'Shop Vac 587-24 Hawkeye Portable Contractor Wet/Dry Vac, 4 Gallon, 5.5 HP',NULL,'<p>\r\n	Small, lightweight, and very portable. Top carry handle for easy lifting. Lock-on hose for ensured suction. On board tool storage. Cord wrap system. Quiet operation. Blower feature. Includes 1-1/2&quot; 5 piece accessory kit. 4 gallon tank, 5.5 HP motor.</p>\r\n',0,0,1,0,6820,NULL,''),(5876,3369,NULL,95,NULL,'Jet Standard 29 Piece Drill Bit Set',NULL,'<p>\r\n	Available in popular 29 piece format with strong metal index box to protect and organize your bits. Self-centering 135 split points provide consistent hole sizes and accurate hole placement without a centre punch. Manufactured from high speed steel to drill faster and last longer. Fully ground flutes for consistent hole sizes and fast chip evacuation. Black oxide finish prevents chips from welding to flutes and cutting surfaces, extending cutting tool life. Top quality bits at low cost, ideal for cordless drills, portable drills and drill presses. Set contains 29 pieces, 1/16&quot; through 1/2&quot; by 64ths.</p>\r\n',0,0,1,0,7062,NULL,''),(7547,3369,NULL,207,NULL,'Jet Super Premium 29 Piece Drill Bit Set',NULL,'<p>\r\n	Heavy duty high molybdenum steel hardened above the industry standard for increased consistency and greater wear resistance. The superior bronze oxide ground flute finish reduces friction, allowing outstanding drilling performance with less operator pressure. Three ground flats on the shank provide a strong positive chuck grip, virtually eliminating the potential for the drill to slip in the chuck. The thin web permits fast feed rates which make the bits ideal for drilling work on hardened steels such as 304, 306 and 316 stainless steel. Set contains 29 pieces, 1/16&quot; through 1/2&quot; by 64ths.</p>\r\n',0,0,1,0,7523,NULL,''),(5878,3065,NULL,129,NULL,'Ultra Flex Hacksaw Blades','T.P.I., Qty','<p>\r\n	Very flexible blade. Made in France. Suitable for softer metals 1/4&quot; to 1/2&quot; thick. All blades are 12&quot; in length, sold per each or per pack of 10.</p>\r\n',0,0,1,0,6705,NULL,''),(6830,3065,NULL,129,NULL,'Ultra Professional Hacksaw Frame',NULL,'<p>\r\n	Adjustable for 10&quot; and 12&quot; blades. Heavy duty, unbreakable light alloy handle. Rectangular steel frame, chrome polished with storage compartment for spare blades. One position flush cutting angle. Supplied with (1) 12&quot; X 24T HSS blade.</p>\r\n',0,0,1,0,6706,NULL,''),(5879,3065,NULL,NULL,NULL,'HSS Hacksaw Blades - 2 Pack','T.P.I.','<ul>\r\n	<li>\r\n		Sold per 2 pack, all blades are 12&quot; in length.</li>\r\n	<li>\r\n		General purpose blade is good for a variety of tasks.</li>\r\n</ul>\r\n',0,1,0,0,6707,NULL,''),(5881,3272,NULL,NULL,NULL,'Lato-Tuf Nitrile Coated Summer Work Glove w/ Safety Cuff, 12/pk',NULL,'<ul>\r\n	<li>\r\n		Excellent resistance against punctures, abrasions, and cuts.</li>\r\n	<li>\r\n		Superior dry grip capabilites.</li>\r\n	<li>\r\n		Repels oil, grease and grime.</li>\r\n	<li>\r\n		Snug and comfortable fit.</li>\r\n	<li>\r\n		Sold per pack of 12.</li>\r\n</ul>\r\n',0,0,1,0,5211,NULL,''),(5882,3273,NULL,67,NULL,'Forcefield Black Nylon Gloves w/ Polyurethane Palm Coating, 12/pk','Size','<p>\r\n	Open back nylon liner reduces hand fatigue and provides breathability.Polyurethane coating on palm offers excellent grip in any condition.Sold by the pack of 12.</p>\r\n',0,0,1,0,5872,NULL,''),(5883,3273,NULL,67,NULL,'Forcefield Hi-Viz Latex Coated Gloves, 12/pk','Size','<p>\r\n	Hi-viz nylon liner provides comfort, breathability and dexterity. Latex palm coating allows for enhanced grip and increased resistance to puncutres and abrasion. Sold by the pack of 12.</p>\r\n',0,0,1,0,5873,NULL,''),(5884,3142,NULL,NULL,NULL,'Compression Female Adapter, Quick Joint, Bronze, CTS','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	For use with copper, PET (SDR9) or PEP. Stainless insert stiffeners must be used with PET (SDR9) or PEP to prevent crushing.</p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	Just stab the copper or plastic tubing into the fitting and tighten down the compression nut to the external stop. Thats it! The Quick Joint provides excellent pullout resistance and superior hydraulic blow-off protection.</p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<br />\r\n	<u><strong style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">How the Quick Joint Works</strong></u></p>\r\n<ol style=\"margin: 0px 0px 1.3em 2em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: baseline; color: rgb(68, 68, 68);\">\r\n	<li class=\"details-add-to-cart2\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">\r\n		The gasket and stainless steel gripper ring are drawn down together when the nut is tightened, providing the hydraulic seal and mechanical restraint.</li>\r\n	<li class=\"details-add-to-cart2\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">\r\n		A transparent fluorocarbon coating covers the interior of the nut, providing smooth torque transfer. This coating eliminates back drive, reduces tightening torque and minimizes gasket distortion..</li>\r\n	<li class=\"details-add-to-cart2\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">\r\n		A positive, external and visual stop ensures correct installation, providing maximum gasket seal.</li>\r\n</ol>\r\n',0,0,1,0,5874,NULL,''),(5885,3273,NULL,67,NULL,'Forcefield Cut Resistant Gloves, 6/pk','Size','<p>\r\n	Excellent dexterity and cut resistance. Molds naturally to the hand, reducing fatigue. Nitrile coating provides a sure grip in all applications. ANSI Cut Reistance Level 3.Sold by the pack of 6.</p>\r\n',0,0,1,0,5875,NULL,''),(5886,3272,NULL,NULL,NULL,'Nitrile Coated All-Around Glove w/ Foam Lining & Safety Cuff, 12/pk',NULL,'<p>\r\n	Foam lining provides thermal protection, absorbs perspiration and fits comfortably on hands. Offers resistance to oils, acids, caustics and alcohols. Excellent combination of puncture, abrasion, cut and tear resistance. &quot;Jack of all trades&quot; among gloves, offering an array of protection against many types of harm. Sold per pack of 12.</p>\r\n',0,0,1,0,6739,NULL,''),(5887,3048,NULL,65,NULL,'General Pipe Cleaners Snake Oil','Size','<p>\r\n	Snake Oil preserves and protects your sewer cables against rust and corrosion. It\'s better than common lubricants because its special rust inhibitor cuts through moisture and replaces it with a rust resistant coating. You\'ll significantly extend the life of your cables and your sewer mahine, including the drum, bearings, and power cable feed rollers. In addition, Snake Oil includes a deodorizer that gives your equipment a fresh, clean smell. Highly recommended for use with all types of cables, with all types of machines, manual or powered.</p>\r\n',0,0,1,0,7255,NULL,''),(7375,3358,NULL,216,NULL,'Kodiak Commercial Electric Pressure Washer, 1000 PSI, 120V',NULL,'<p>\r\n	Ceramic plungers for extended unit life and low-maintenance. Built-in soap-feed system eliminates need to carry seperate components for easy set-up. Comes with built-in unloader valve.</p>\r\n<p>\r\n	1.5 HP, 1000 PSI, 2.1 GPM, 15A. Ready to use, no assembly required unit comes complete with premium 26 foot wire braid hose, lance assembly, and detachable detergent injector. Made in Italy.</p>\r\n',0,0,1,0,7352,NULL,''),(7376,3212,NULL,32,NULL,'Hach 2107769 Sodium Periodate Powder Pillows for Manganese, 10 ml, pk/100',NULL,'<p>\r\n	For determination of manganese by the periodate oxidation method. EPA approved for reporting wastewater analyses (digestion required). Hach method 8034. Sample size: 10 mL Pack of 100 Powder Pillows.</p>\r\n',0,0,1,0,7353,NULL,''),(7381,3302,NULL,NULL,NULL,'Black Outdoor Polyethylene Food Grade Linear Low Density (LLDPE) Tubing, 1/4\" O.D.','Sold Per','<p>\r\n	<span style=\"font-size: 12px;\">Commonly used outdoors in order to quickly identify the line amongst many other lines. &nbsp;LLDPE has a slightly higher pressure rating than LDPE. Offers exceptional resistance to stress cracking, more so than LDPE. Tubing is non-corrosive, odourless and tasteless. Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements. Temperature Range: -45C to +60C.</span></p>\r\n<p>\r\n	<strong><span style=\"font-size: 12px;\">1/4&quot; O.D., 1/8&quot; I.D.</span></strong></p>\r\n',0,0,1,0,7363,NULL,''),(5890,3253,NULL,NULL,NULL,'110 Piece Grease Fitting Kit',NULL,'<p>\r\n	Includes the following NPT fittings, contained within a plastic case:</p>\r\n<ul>\r\n	<li>\r\n		x10 1/4&quot; Straight</li>\r\n	<li>\r\n		x15 1/4&quot; 45 Elbow</li>\r\n	<li>\r\n		x15 1/4&quot; 90 Elbow</li>\r\n	<li>\r\n		x20 1/8&quot; Straight</li>\r\n	<li>\r\n		x15 1/8&quot; 45 Elbow</li>\r\n	<li>\r\n		x15 1/8&quot; 90 Elbow</li>\r\n</ul>\r\n',0,1,0,0,7547,NULL,''),(5891,3123,NULL,108,NULL,'Olfa Heavy-Duty Ratchet Lock Utility Knife',NULL,'<ul>\r\n	<li>\r\n		Sure-grip heavy duty knife.</li>\r\n	<li>\r\n		Features a ratchet wheel blade lock.</li>\r\n	<li>\r\n		Includes a rubber grip insert.</li>\r\n</ul>\r\n',0,0,1,NULL,5881,NULL,''),(5892,3123,NULL,108,NULL,'Olfa Extra Heavy-Duty Ratchet Lock Utility Knife',NULL,'<ul>\r\n	<li>\r\n		Extra heavy-duty utility knife is a powerful anti-slip utility knife.</li>\r\n	<li>\r\n		Features a professional grade fiberglass rubber grip for maximum comfort and control.</li>\r\n	<li>\r\n		Heavy-gauge stainless steel blade channel protects and holds blade tight.</li>\r\n	<li>\r\n		Includes double-honed UltraSharp Black blade, made of high quality Japanese grade carbon steel and designed for unparalleled sharpness and superior edge retention.</li>\r\n</ul>\r\n',0,0,1,NULL,5882,NULL,''),(5893,3142,NULL,NULL,NULL,'Compression Male Adapter, Quick Joint, Bronze, CTS','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	For use with copper, PET (SDR9) or PEP. Stainless insert stiffeners must be used with PET (SDR9) or PEP to prevent crushing.</p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	Just stab the copper or plastic tubing into the fitting and tighten down the compression nut to the external stop. Thats it! The Quick Joint provides excellent pullout resistance and superior hydraulic blow-off protection.</p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<br />\r\n	<u><strong style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">How the Quick Joint Works</strong></u></p>\r\n<ol style=\"margin: 0px 0px 1.3em 2em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: baseline; color: rgb(68, 68, 68);\">\r\n	<li class=\"details-add-to-cart2\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">\r\n		The gasket and stainless steel gripper ring are drawn down together when the nut is tightened, providing the hydraulic seal and mechanical restraint.</li>\r\n	<li class=\"details-add-to-cart2\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">\r\n		A transparent fluorocarbon coating covers the interior of the nut, providing smooth torque transfer. This coating eliminates back drive, reduces tightening torque and minimizes gasket distortion..</li>\r\n	<li class=\"details-add-to-cart2\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">\r\n		A positive, external and visual stop ensures correct installation, providing maximum gasket seal.</li>\r\n</ol>\r\n',0,0,1,0,5883,NULL,''),(5894,3142,NULL,NULL,NULL,'Compression Curb Stop, Quick Joint, Bronze, CTS','Size','<p>\r\n	3/4&quot; and 1&quot; sizes are rated to 300 PSI. 1-1/2&quot; and 2&quot; sizes are rated at 150 to 175 PSI. Solid one piece tee-head and stem. EPDM O-rings in the stem assure permanent watertight seal at top. Sturdy stops allow 90 motion and are enclosed and protected. Molded EPDM seat(s) support the ball. Valve is watertight and is a non-directional valve. Fluorocarbon-coated brass ball provides maximum flow capacity and ease of turning. Heavy cast bronze body is engineered to withstand pipe stresses. Comforms to AWWA Standard C800.</p>\r\n<p>\r\n	For use with copper, PET (SDR9) or PEP. Stainless insert stiffeners must be used with PET (SDR9) or PEP to prevent crushing.</p>\r\n<p>\r\n	Just stab the copper or plastic tubing into the fitting and tighten down the compression nut to the external stop. Thats it! The Quick Joint provides excellent pullout resistance and superior hydraulic blow-off protection.</p>\r\n<p>\r\n	<br />\r\n	<u><strong>How the Quick Joint Works</strong></u></p>\r\n<ol>\r\n	<li class=\"details-add-to-cart2\">\r\n		The gasket and stainless steel gripper ring are drawn down together when the nut is tightened, providing the hydraulic seal and mechanical restraint.</li>\r\n	<li class=\"details-add-to-cart2\">\r\n		A transparent fluorocarbon coating covers the interior of the nut, providing smooth torque transfer. This coating eliminates back drive, reduces tightening torque and minimizes gasket distortion..</li>\r\n	<li class=\"details-add-to-cart2\">\r\n		A positive, external and visual stop ensures correct installation, providing maximum gasket seal.</li>\r\n</ol>\r\n<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:normal;\">\r\n		&nbsp;</p>\r\n	</section></div>\r\n',0,0,1,0,5884,NULL,''),(5896,3142,NULL,NULL,NULL,'Insert Stiffeners, Stainless Steel, CTS','Size','<p>\r\n	Made of solid 304 stainless steel, these insert stiffeners are dimpled and flanged to retain placement within the service line. They must be used with PET (SDR9) or PEP to prevent crushing. These insert stiffeners are copper tube size (CTS).</p>\r\n',0,0,1,0,6011,NULL,''),(7546,3369,NULL,NULL,NULL,'Premium 24-Inch 1/4 HP Drill Press',NULL,'<p>\r\n	Precision machined steel column and heavy cast iron base. Rack and pinion designed table adjustment. On/off switch with removable locking key. Reliable ball bearing induction motor. CSA certified and cUL listed.</p>\r\n<p>\r\n	JT33 spindle taper. 1/2&quot; chuck capacity. 2&quot; spindle travel. 4&quot; swing height. Total height of unit 22&quot;. 5 speed. 1/4 HP.</p>\r\n',0,0,1,0,7061,NULL,''),(5899,2042,NULL,NULL,NULL,'Gray Stainless Steel Thread Seal Tape',NULL,'<p>\r\n	Gray Stainless Steel PTFE Thread Seal Tape is a unique thread sealing tape which prevents stainless steel fittings galling or seizing during assembly or disassembly. The tape is impregnated with nickel powder, which acts like bearing plates, keeping the surface of the male and female threads apart. Further protection is provided by the thicker and denser than average composition of the tape. The added thickness and density also ensure an effective seal. 1/2&quot; X 260&quot; roll.</p>\r\n<p>\r\n	<u><strong>Applications</strong></u></p>\r\n<p>\r\n	Gray Stainless Steel PTFE Thread Seal Tape is recommended for stainless steel pipe and fittings, but is also compatible with the following piping materials:</p>\r\n<ul>\r\n	<li>\r\n		Galvanized steel</li>\r\n	<li>\r\n		Iron</li>\r\n	<li>\r\n		Brass</li>\r\n	<li>\r\n		Copper</li>\r\n	<li>\r\n		Aluminum</li>\r\n	<li>\r\n		Fiberglass</li>\r\n	<li>\r\n		Polyethylene</li>\r\n	<li>\r\n		Polypropylene</li>\r\n	<li>\r\n		PVC</li>\r\n	<li>\r\n		CPVC</li>\r\n	<li>\r\n		ABS</li>\r\n</ul>\r\n',0,0,1,0,5889,NULL,''),(5900,2042,NULL,NULL,NULL,'Pink Plumbers Thread Seal Teflon Tape, 1/2\" Width','Size, Qty','<p>\r\n	Pink tape is designed for use on all types of water lines. This is a high density tape, meaning you use less tape sealing threads than if you were to use lower density white tape. Fast positive seal for water lines, sewage lines and sprinkler systems. Effective on metal and plastic threads. High density tape is industrial grade. 1/2&quot; X 260&quot; roll.</p>\r\n',0,0,1,0,5890,NULL,''),(5901,2042,NULL,25,NULL,'Orange Thread Seal Teflon Tape, 1/2\" Width','Size, Qty','<p>\r\n	Orange tape is designed to seal all metal and plastic threaded connections against leakage at temperatures from 400F to +600F (-240C to +316C). Because it is chemically inert, Orange tape is impervious to virtually everything. It is a high density, industrial teflon tape that is also ULC listed for natural gas. Non-corrosive, non-flammable, clean, easy to use. Joints disassemble easily, even after years of service. 1/2&quot; X 540&quot; roll.</p>\r\n',0,0,1,0,5892,NULL,''),(5902,2042,NULL,NULL,NULL,'White Thread Seal Teflon Tape, 1/2\" Width','Size, Qty','<p>\r\n	Seals metal and plastic threaded joints. Non corrosive, non flammable, clean and easy to use. Joints disassemble easily even after years of use. Impervious to most fluids and gases. Lower density. These white teflon tape measures 0.003&quot; thick and 520&quot; long.</p>\r\n',0,0,1,0,7411,NULL,''),(5904,3147,NULL,NULL,NULL,'40 Watt Soldering Iron',NULL,'<p>\r\n	Basic 40W soldering iron includes an iron stand. Meets cUL requirements.</p>\r\n',0,0,1,0,5894,NULL,''),(5905,3148,NULL,NULL,NULL,'Solder Rolls, 2 Pack',NULL,'<p>\r\n	Ideal for small electrical repairs. 20 grams of solder per tube, 40 grams total.</p>\r\n',0,0,1,0,7681,NULL,''),(7593,3262,NULL,NULL,NULL,'Polypropylene Filtering Flasks','Size','<p>\r\n	Polypropylene filtering flask with side-arm at 45 angle prevents tipping. Barbed side-arm accepts 1/4-3/8 I.D. tubing for application of vacuum.</p>\r\n',0,0,1,0,7567,NULL,''),(6904,3185,NULL,84,NULL,'True Temper Black Contractor\'s Wheelbarrow',NULL,'<p>\r\n	Heavy gauge seamless steel tray. Front tray braces. H-brace. 16&quot; wheel assembly, 2-ply tire with oil lube bushing. 60&quot; hardwood handles. 5/8&quot; steel axle. 6 cubic foot, 270 lb capacity.</p>\r\n',0,0,1,0,6887,NULL,''),(6905,3185,NULL,84,NULL,'True Temper Dual Wheeled Poly Contractor\'s Wheelbarrow',NULL,'<p>\r\n	Heavy-duty wheelbarrow. Large 8 cubic foot capacity. Dual wheeled design makes moving large loads easier, with a smaller risk of tipping. Corrosion-proof poly tray with steel front braces, cross braces, and shoes. Two 16&quot; wheel assemblies with pneumatic 2-ply tires. Oil lube bushings. H-brace. 60&quot; hardwood handles.</p>\r\n',0,0,1,0,6888,NULL,''),(7583,2068,NULL,NULL,NULL,'Zep Heavy Hitter Hard Water Detergent','Qty','<p>\r\n	Zep Heavy Hitter is a highly concentrated, chelated, liquid machine dishwashing compound. A special blend of alkaline detergents, water softeners, grease cutters and soil suspenders. Formula allows for dulutions up to 14 ml per 4.5 liters of water. Generates no foam to interfere with the operation of the dishwasher. Free-rinsing. Easily dispensed - eliminated problems such as dusting, caking, clogging and overuse.&nbsp; Superior cleaning action on labware, glassware, tableware, and plastic. Not for use on aluminum.</p>\r\n<p>\r\n	Formulated for hard water performance. Reduces the formulation of scum and scale in dishwashing machines in hard water conditions.</p>\r\n',0,0,1,0,7560,NULL,''),(5918,3239,NULL,NULL,NULL,'Keyed Alike Brass Padlocks, Long Shackle','Shackle Length','<p>\r\n	Hardened steel shackle. Solid brass body. Double locking bolt. Stainless spring and pin for bolt. Pick resistant. Stainless springs for pin and shackle. Nickel plated brass key.</p>\r\n',0,0,1,0,5908,NULL,''),(7662,3375,NULL,NULL,NULL,'Febreze Air Freshener, 2 Pack',NULL,'<p>\r\n	Classic Febreze scent in 800 ml bottle. Sold 2 bottles per pack.</p>\r\n',0,0,1,0,7639,NULL,''),(6295,3162,NULL,35,7,'LMI Liquipro Injection Valve Assembly','Size','<p>\r\n	Constructed of PVDF for great durability and excellent chemical resistance. Compatible with most makes and models of chemical metering pumps<strong>.</strong></p>\r\n',0,0,1,0,5915,NULL,''),(7730,2018,NULL,NULL,NULL,'Nylon Food Grade Tubing','OD, ID, Sold Per','<p>\r\n	Nylon tubing is odorless, non-toxic and will not become brittle with age. Nylon is resistant to most chemicals, will withstand repeated flexing without fatigue, stays flexible at low temperatures, and has good abrasion resistance. Meets FDA requirements. PSI rating of 235 PSI. Temperature range of -40C to 95C.</p>\r\n',0,0,1,0,7707,NULL,''),(5927,3162,NULL,35,7,'LMI Liquipro Liquifram','For Liquid End #\'s','<p>\r\n	Fluorofilm diaphragm offers excellent chemical resistance, high pressures and long life.</p>\r\n',0,0,1,0,6287,NULL,''),(5929,3321,NULL,26,7,'LMI Milton Roy 10322 Ceramic Weight','Qty','<p>\r\n	Fits tubing sizes; 1/4&quot;, 3/8&quot; &amp; 1/2&quot;. Compatible with all common water plant chemicals. Helps hold foot valve assembly in a vertical position.</p>\r\n',0,0,1,0,6293,NULL,''),(5930,3162,NULL,35,7,'LMI Liquipro Foot Valve Assembly','Size','<p>\r\n	Constructed of PVDF for great durability and chemical resistance.</p>\r\n',0,0,1,0,6286,NULL,''),(5932,3161,NULL,14,7,'LMI Roytronic 4 Function Valve Assembly','Size, Fits Liquid Ends','<p>\r\n	The appropriate sized tubing connection kit must be ordered separately<strong>.</strong></p>\r\n<p>\r\n	The four functions:</p>\r\n<p>\r\n	<strong>Anti-Siphon</strong> - The discharge flow path goes through a port that only open on the discharge stroke of the pump. This prevents the discharge line from siphoning liquid from the supply tank in most applications.</p>\r\n<p>\r\n	<strong>Back Pressure</strong> - The diaphragm that controls anti-siphoning creates approximately 20 PSI back pressure on the pump\'s discharge valve which improves performance.</p>\r\n<p>\r\n	<strong>Pressure Relief</strong> - A second diaphragm protects the pump from overpressure by releasing fluid to a relief port in the event of excessive discharge line pressure.</p>\r\n<p>\r\n	<strong>Pressure Release</strong> - This function makes it easy and safe to depressurize the discharge line without loosening tubing or fittings.</p>\r\n',0,0,1,0,6277,NULL,''),(5933,3161,NULL,14,7,'LMI Roytronic Tubing Connection Kit','Size','<p>\r\n	Roytronic 1/4&quot; tubing connection kit includes (1) ferrule and (1) coupling nut.</p>\r\n<p>\r\n	Roytronic 3/8&quot; &amp; 1/2&quot; tubing connection kits include (1) ferrule set and (1) coupling nut.</p>\r\n',0,0,1,0,6301,NULL,''),(7728,3048,NULL,231,NULL,'Helix Labs Jetbugs 6',NULL,'<p>\r\n	Helix Labs Jetbugs&nbsp; is a biodegradable grease liquefier for cleaning sewer mains, lift stations and laterals.&nbsp; Jetbugs chemically melts grease away.&nbsp; While it is STRONG on grease, it will help prevent Sanitary Sewer Overflows.&nbsp; Dilute at 100:1 when used via high pressure jetters. Jetbugs is non-toxic, non-corrosive and non-hazardous. Jetbugs is packaged in 6-gallon pails.</p>\r\n<p>\r\n	Jetbugs is a liquid product for use in high pressure jetters that helps expedite the cleaning process of sewer mains, laterals, lift stations/wet wells, and other applications where grease buildup is problematic. Jetbugs quickly liquefies the grease, thus releasing it from the sewer pipe and walls where it builds up. Sold per 6 gallon pail.</p>\r\n',0,0,1,0,7705,NULL,''),(6267,3191,NULL,14,7,'LMI Milton Roy Roytronic Series B, B111-D90HI, 1.6 GPH, 150 PSI, Dual Dial Metering Pump',NULL,'<p>\r\n	NSF &amp; cUL approved.</p>\r\n<p>\r\n	Roytronic Series B pumps offer a new robust design with the high end performance you expect from LMI.</p>\r\n<p>\r\n	The new AutoPrime Liquid End automatically and continuously purges entrapped air from process fluid. It also eliminates air binding when used with liquids such as sodium hypochlorite.</p>\r\n<p>\r\n	The tubing line includes ferrule designed fittings that set a new standard for secure, leak-proof tubing connections.</p>\r\n<p>\r\n	These pumps have a rugged, totally enclosed, chemically resistant housing for protection in the harshest environments.</p>\r\n<p>\r\n	Encapsulated electronics and a rigid housing and stroke bracket ensure years of precise, repeatable performance.</p>\r\n<p>\r\n	Type 1 configuration. This configuration is designed for accurate chemical feed where manual control is all that is required. Dual manual control of stroke speed and stroke length are provided.</p>\r\n<p>\r\n	Pump kit includes instructions, suction and discharge valves, and tubing. Everything you need to get started!</p>\r\n<p>\r\n	<strong>Maximum output of 1.6 GPH, 38.0 GPD. Maximum PSI of 150. </strong><strong>3/8&quot; O.D. </strong><strong>tubing . </strong></p>\r\n',0,0,1,0,6257,NULL,''),(7352,3374,NULL,NULL,NULL,'Professional Foam Gun',NULL,'<p>\r\n	This high quality professional foam gun has a teflon body and sealing ball.</p>\r\n',0,0,1,0,6393,NULL,''),(6253,3190,NULL,14,7,'LMI Milton Roy Roytronic Series P, P021-D50HI, 0.13 GPH, 150 PSI, Single Dial Metering Pump',NULL,'<p>\r\n	NSF &amp; cUL approved.</p>\r\n<p>\r\n	Roytronic Series P pumps offer a new robust design with the high end performance you expect from LMI.Designed for more economical chemical injection, these pumps are equipped with a totally enclosed, chemically resistant housing, as well as encapsulated electronics.The new AutoPrime Liquid End automatically and continuously purges entrapped air from process fluid. It also eliminates air binding when used with liquids such as sodium hypochlorite.</p>\r\n<p>\r\n	The tubing line includes ferrule designed fittings that set a new standard for secure, leak-proof tubing connections.Type 0 configuration. This configuration is designed for accurate chemical feed where manual control is all that is required. Single dial manual control of stroke speed is provided.</p>\r\n<p>\r\n	Pump kit includes instructions, suction and discharge valves, and tubing. Everything you need to get started!</p>\r\n<p>\r\n	<strong>Maximum output of 0.13 GPH, 3.1 GPD. Maximum PSI of 150. </strong><strong>1/4&quot; O.D. </strong><strong>tubing . </strong></p>\r\n',0,0,1,0,6243,NULL,''),(6288,3161,NULL,14,7,'LMI Milton Roy Roytronic 1/4\" Ferrule, 50508',NULL,'<p>\r\n	Sold per individual ferrule.</p>\r\n<p>\r\n	Not re-usable.</p>\r\n<p>\r\n	Replace when replacing tubing.</p>\r\n',0,0,1,0,6302,NULL,''),(5937,3153,NULL,NULL,NULL,'Survival Guide: Public Communications for Water Professionals',NULL,'<p>\r\n	Most communities are increasingly interested in water-related issues. People need more information and reassurance about their water environment. As a water professional, you can help shape public perceptions about the water/wastewater field, biosolids, reuse and other important community issues. All you need to do is communicate effectively with the public. This guide, developed by communications experts in the water quality field, will help you overcome challenges and seize opportunities for developing positive relations with your customers, community leaders, interest groups, the media and other individuals and organizations.170 pages.</p>\r\n',0,0,1,NULL,5927,NULL,''),(5938,3153,NULL,NULL,NULL,'Safety & Health in Wastewater Systems',NULL,'<p>\r\n	Provides information on building and running a safety program to protect wastewater treatment workers and comply with regulations. Covers safety responsibilities, programs and personal protective equipment, safe work procedures, system controls, specific safety precautions, techniques for pinpointing potential operational and maintenance hazards, safety considerations in design and construction, and emergency rescue practices.</p>\r\n',0,0,1,NULL,5928,NULL,''),(5939,3153,NULL,NULL,NULL,'Recommended Standards for Wastewater Facilities',NULL,'<p>\r\n	Most operators are now being trained to a common standard that will allow them to operate facilities across North America. Find out if your community\'s wastewater collection and treatment facilities are designed and constructed to common North American standards.</p>\r\n',0,0,1,NULL,5929,NULL,''),(5940,3153,NULL,NULL,NULL,'Recommended Standards for Water Works',NULL,'<p>\r\n	These standards consist of proven technology and are intended to serve as a guide in the design and preparation of plans and specifications for public water supply systems. Plants that are designed and constructed to these standards will provide a uniformity of practice, which is a requirement for standardized operator training.</p>\r\n',0,0,1,NULL,5930,NULL,''),(7564,2078,NULL,51,NULL,'Industrial Fibreglass Handle Club Hammer',NULL,'<p>\r\n	Premium industrial grade fiberglass handle. Rubberized grip for supreme comfort. 3 lb head.</p>\r\n',0,0,1,0,7541,NULL,''),(7565,3251,NULL,NULL,NULL,'Zep 45 NC Penetrating Aerosol Lubricant','Qty','<p>\r\n	Zep 45 NC is an ideal lubricant used to loosen frozen and rusted parts due to wear, corrosion or grease buildup. Ideal for lubricating and protecting hinges, chains, sliders, linkages, and virtually all moving parts. Sold per 24 oz can or case of 12.</p>\r\n',0,0,1,1,6533,NULL,''),(5942,3106,NULL,2,NULL,'3M Peltor Cap-Mounted Earmuffs',NULL,'<p>\r\n	Features a universal mounting system that fits most hard hats. Earcup pivot points tilt for optimum comfort and efficiency.&nbsp;Ultra light with liquid/foam filled earmuff cushions. Delivers a noise reduction rating of 23 dB.</p>\r\n',0,0,1,0,6048,NULL,''),(5943,3106,NULL,2,NULL,'3M Peltor Metal Mesh Faceshield',NULL,'<p>\r\n	Brimless, lightweight nylon mesh visor helps protect from flying debris and particles, while helping provide ventilation and face protection. Must be used with hard hat. Faceshield snaps into 3M Peltor Hard Hat Adapter P3EV/2 or 3M Peltor Cap-Mounted Earmuffs.</p>\r\n',0,0,1,0,6114,NULL,''),(7112,3106,NULL,2,NULL,'3M Deluxe Ratchet Headgear',NULL,'<p>\r\n	Ratchet headgear for use with any 3M faceshield. High-strength thermoplastic crown provides impact resistance and face protection. Adjustable ratchet suspension with five position crown strap.</p>\r\n',0,0,1,0,5713,NULL,''),(7117,3339,NULL,NULL,NULL,'Ottawa Brass Collapsible Nylon Fire Backpack',NULL,'<p>\r\n	This collapsible fire backpack incorporates unique features that ensure high functionality and excellent performance in the field. Rugged double-wall tank with replaceable inner bladder provides extra protection against puncture making the unit durable, cost effective and easy to repair. Padded shoulder straps with emergency quick-release. Chest straps help distribute weight. Jet/mist spray nozzle. Pump can be lubricated without disassembly. 5 gallon capacity. Includes hose and spray lance.</p>\r\n',0,0,1,0,7099,NULL,''),(6533,3370,NULL,NULL,NULL,'Chrome Plated Tow Hook, 5-3/16\" Length x 2\" Throat',NULL,'<p>\r\n	Forged steel, chrome plated. 5-3/16&quot; in length x 2&quot; throat. 2 drilled holes.</p>\r\n',0,0,1,0,6519,NULL,''),(6532,3370,NULL,71,NULL,'2\" Nylon Tow Strap w/ Hooks',NULL,'<p>\r\n	Ideal for emergency pulling. Strong nylon webbing. Stretches to absorb shock. Two drop forged hooks. SWL of 8500 lbs.</p>\r\n',0,0,1,0,5638,NULL,''),(7544,3370,NULL,NULL,NULL,'Trailer Hitch Ball Mounts','Size','<p>\r\n	Black powder coated finish.</p>\r\n',0,0,1,0,7521,NULL,''),(5953,2070,NULL,32,NULL,'Hach Chlorine (Free & Total) and pH Test Kit, Model CN-67',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Control of chlorine and pH in pools and spas to maintain safe bathing conditions and to protect against system corrosion. Supplied with color discs and comparator for monitoring chlorine and pH, the Free &amp; Total Chlorine and pH Test Kit provides more accuracy than test kits using color cubes or step-wise comparators.</p>\r\n	<ul>\r\n		<li>\r\n			One of Hach\'s most popular test kits</li>\r\n		<li>\r\n			Includes color discs and a comparator for monitoring chlorine and pH</li>\r\n		<li>\r\n			Kit contains all required reagents and apparatus in a rugged carrying case for analysis in the field</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5559,NULL,''),(5960,2011,NULL,57,NULL,'King Electric KP Series Portable  Baseboard Heater, 1000W, 120V',NULL,'<p>\r\n	A portable baseboard heater is an easy way to add supplementary heat to any room. The nice advantage of a baseboard is that it\'s quiet and trouble free. A tip over switch is standard so that if the heater is knocked over, it will shut off automatically. It has a built-in thermostat and a 6 foot, 3 wire grounded outlet plug for additional safety. This heater is so rugged that it is approved for U.S. government contracts.</p>\r\n<ul>\r\n	<li>\r\n		Convection heat.</li>\r\n	<li>\r\n		Quiet running.</li>\r\n	<li>\r\n		3-wire cord.</li>\r\n	<li>\r\n		4 feet in length.</li>\r\n	<li>\r\n		Tip over switch.</li>\r\n	<li>\r\n		Carrying handle.</li>\r\n	<li>\r\n		Built-in thermostat.</li>\r\n	<li>\r\n		Durable baked enamel finish.</li>\r\n	<li>\r\n		Full length safety cutout.</li>\r\n	<li>\r\n		All aluminum element design.</li>\r\n</ul>\r\n',0,0,1,0,5950,NULL,''),(5961,3300,NULL,57,NULL,'King Electrical Self Regulating Heating Cable, Per Foot, 120V','Watts/Ft, Max. Run','<p>\r\n	King SR self-regulating heating cable is designed for a variety of industrial and commercial pipe trace applications including hazardous and non hazardous environments. The standard polyolefin jacket is water resistant and resistant to inorganic chemicals.</p>\r\n<p>\r\n	The cable will regulate its power output (watt/ft.) automatically in response to changes in the surrounding temperature. The self-regulating feature allows the cable to be overlapped without overheating or burning out the cable.</p>\r\n<p>\r\n	Easy to install, it can be cut to length and field spliced or terminated using various accessory kits. Self Regulating heating cable is available in 3, 5, 8 and 10 watts per foot at 120 volts. SR heating cable carries a 2 year warranty. Meets cUL requirements.</p>\r\n',0,0,1,0,5951,NULL,''),(5962,3300,NULL,57,NULL,'King Electrical SRK00 Hard Wired Power Connection Kit',NULL,'<p>\r\n	This kit includes enough material for making one hard wire power connection and one end seal. Contains labels, pipe mounting bracket, box connector, wire nuts, and heat shrink tubing to make electrical supply connection to a metal junction box. Includes one end seal. Meets cUL requirements.</p>\r\n',0,0,1,0,5954,NULL,''),(5963,3300,NULL,57,NULL,'King Electrical SRK08 Plug-In 120V Connection Kit w/ GFCI Device',NULL,'<p>\r\n	Plug in 120V, 15 Amp connection kit with GFCI device, includes end seal. Provides ground fault protection for self regulating heating cables. Meets cUL requirements.</p>\r\n',0,0,1,0,5955,NULL,''),(5964,3300,NULL,57,NULL,'King Electrical SRK10 Splice and Tee Kit',NULL,'<p>\r\n	Weatherproof splice and tee kit, includes end seal. Meets cUL requirements.</p>\r\n',0,0,1,0,5956,NULL,''),(5965,3300,NULL,57,NULL,'King Electrical SRK12 End Seal Kit',NULL,'<p>\r\n	Contains heat shrink tubing and other materials to make two complete end seals. Meets cUL requirements.</p>\r\n',0,0,1,0,5968,NULL,''),(5966,3300,NULL,57,NULL,'King Electrical SRK03 Pipe Trace Tape & Labels Kit',NULL,'<p>\r\n	Pipe trace tape (66\') &amp; labels. Meets cUL requirments.</p>\r\n',0,0,1,0,6903,NULL,''),(5967,3302,NULL,NULL,NULL,'Yellow Sodium Hypochlorite Polyethylene Food Grade Linear Low Density (LLDPE) Tubing, 1/4\" O.D.','Sold Per','<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		<span style=\"font-size: 12px;\">Commonly used with sodium hypochlorite in order to quickly identify the line amongst many other lines. &nbsp;LLDPE has a slightly higher pressure rating than LDPE. Offers exceptional resistance to stress cracking, more so than LDPE. Tubing is non-corrosive, odourless and tasteless. Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements. Commonly used with chemical metering pumps. Temperature Range: -45C to +60C.</span></p>\r\n	<p>\r\n		<strong><span style=\"font-size: 12px;\">1/4&quot; O.D., 1/8&quot; I.D.</span></strong></p>\r\n	<div>\r\n		&nbsp;</div>\r\n	</section></div>\r\n',0,0,1,0,5958,NULL,''),(6928,3302,NULL,NULL,NULL,'Yellow Sodium Hypochlorite Polyethylene Food Grade Linear Low Density (LLDPE) Tubing, 3/8\" O.D.','Sold Per','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">Commonly used with sodium hypochlorite in order to quickly identify the line amongst many other lines. &nbsp;LLDPE has a slightly higher pressure rating than LDPE. Offers exceptional resistance to stress cracking, more so than LDPE. Tubing is non-corrosive, odourless and tasteless. Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements. Commonly used with chemical metering pumps. Temperature Range: -45C to +60C. </span></p>\r\n<p>\r\n	<strong><span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">3/8&quot; O.D., 1/4&quot; I.D.</span></strong></p>\r\n',0,0,1,0,6911,NULL,''),(5968,2018,NULL,NULL,NULL,'Red Polyethylene Food Grade Low Density (LDPE) Tubing','OD, ID, Sold Per','<ul>\r\n	<li>\r\n		Free from impurities, offering excellent resistance to stress cracking.</li>\r\n	<li>\r\n		Use for instrumentation tubing or as transmission lines for various materials intended for human consumption.</li>\r\n	<li>\r\n		Tubing is non-corrosive, odourless and tasteless.</li>\r\n	<li>\r\n		Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements.</li>\r\n	<li>\r\n		Commonly used with chemical metering pumps.</li>\r\n	<li>\r\n		Temperature Range: -45C to +60C.</li>\r\n</ul>\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\