td>\r\n			<td>\r\n				240</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				1/2&quot;</td>\r\n			<td>\r\n				3/8&quot;</td>\r\n			<td>\r\n				180</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n',0,0,1,NULL,4167,NULL,''),(7763,3405,NULL,232,NULL,'Tough Duck G06816 Foam Latex Coated Glove, Yellow, 12/pk','Size','<p>\r\n	13 gauge high elastic yarn foam. Anti-slip grip palm. Improves overall visibility. Sold per pack of 12.</p>\r\n',0,0,1,0,7740,NULL,''),(7764,3405,NULL,232,NULL,'Tough Duck G06816 Foam Latex Coated Glove, Orange, 12/pk','Size','<p>\r\n	13 gauge high elastic yarn foam. Anti-slip grip palm. Improves overall visibility. Sold per pack of 12.</p>\r\n',0,0,1,0,7741,NULL,''),(5975,3391,NULL,124,NULL,'Viking 6195 Surveyor Safety Vest, Orange','Size, Qty Available','<p>\r\n	Fully compliant with CSA Z96-09 Class 2, Level 2. 2&quot; 3M Scotchlite Reflective Material in 4&quot; WCB/Worksafe/DOT configuration. Heavy duty polyester fluorscent soft texture material. Safety D-Ring slot access. ID patch/cell/radio clip on belts.Survey tape dispenser grommets on lower front pockets. Large pack zip pocket across entire back area. 8 velcro sealed pockets plus 1 cell/radio phone sealed pouch and 4 other pockets. Mesh underarm cooling ventilation panels.</p>\r\n',0,1,0,0,7274,NULL,''),(7799,3260,NULL,62,NULL,'Baffin Express Moulded Work Boot','Size, Qty Available','<p>\r\n	Self-cleaning, treaded outsole ensures sure footing. Extra thick sole for added comfort. Sure Step First Impact heel strike design. Plain toe, no plate.</p>\r\n',0,1,0,0,7776,NULL,''),(7620,3172,NULL,219,NULL,'2 HP Myers Ranger Series 4\" Submersible Well Pump and Motor','Description','<p>\r\n	Ranger 4&quot; high-flow submersible pumps are perfect for applications requiring a large volume of water. Stainless steel components and high-density composite resin impellers provide exceptional resistance to corrosion in harsh water conditions. The high-torque motor and superior pump hydraulics are carefully matched to handle virtually any job. All Ranger pumps have a 2&quot; discharge.</p>\r\n<p>\r\n	Included with the pump is a Pentek 3-wire 4&quot; XE Series motor. These motors utilize a 304 stainless steel epoxy stator design and professional-grade Class F insulation, providing longer life in harsh environments. Each motor is 100% factory pressure and run tested. The motors are equipped with surge arrestors to provide maximum protection against lightning, transient and voltage surge conditions. All motors are 3-wire, UL, CSA and NSF approved.</p>\r\n<p>\r\n	1 phase packages include a control box.</p>\r\n<p>\r\n	The pumps listed here have a 50 GPM capacity, 7 stages, 220 feet total head, and 95 PSI</p>\r\n',0,0,1,0,6845,NULL,''),(7621,3172,NULL,219,NULL,'3 HP Myers Ranger Series 4\" Submersible Well Pump and Motor','Description','<p>\r\n	Ranger 4&quot; high-flow submersible pumps are perfect for applications requiring a large volume of water. Stainless steel components and high-density composite resin impellers provide exceptional resistance to corrosion in harsh water conditions. The high-torque motor and superior pump hydraulics are carefully matched to handle virtually any job. All Ranger pumps have a 2&quot; discharge.</p>\r\n<p>\r\n	Included with the pump is a Pentek 3-wire 4&quot; XE Series motor. These motors utilize a 304 stainless steel epoxy stator design and professional-grade Class F insulation, providing longer life in harsh environments. Each motor is 100% factory pressure and run tested. The motors are equipped with surge arrestors to provide maximum protection against lightning, transient and voltage surge conditions. All motors are 3-wire, UL, CSA and NSF approved.</p>\r\n<p>\r\n	1 phase packages include a control box.</p>\r\n<p>\r\n	The pumps listed here have a 80 GPM capacity, 9 stages, 220 feet total head, and 95 PSI</p>\r\n',0,0,1,0,7415,NULL,''),(5978,3300,NULL,206,NULL,'PECO TRF115-005 Industrial Thermostat',NULL,'<p>\r\n	For use with many applications, including freeze protection cable.&nbsp;<span style=\"font-size: 12px;\">Will tolerate spraying with water, high humidity, airborne contaminates, weather, and corrosive conditions.&nbsp;</span><span style=\"font-size: 12px;\">Complies with NEMA 4X &amp; N.E.C. Article 547.&nbsp;</span><span style=\"font-size: 12px;\">Low mass, high surface area of sensors allows for rapid response to temperature change.&nbsp;</span><span style=\"font-size: 12px;\">One control for heating &amp; cooling, makes use centralized and easy.&nbsp;</span><span style=\"font-size: 12px;\">Adjustable temperature range of 0</span><span class=\"st\" style=\"font-size: 12px;\">F to 120</span><span class=\"st\" style=\"font-size: 12px;\">F. This model also supports remote sensing.&nbsp;25 amp @ 120/208/240V. 5 ft stainless remote bulb.</span></p>\r\n',0,0,1,0,6904,NULL,''),(5979,3158,NULL,32,NULL,'Hach 2755325 Ammonia (Nitrogen) Test Strips, 0 - 6.0 mg/L',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Suitable for both lab and field testing, Hach Test Strips are easy to use and easy to read. Ammonia (Nitrogen) is a product of microbiological decay of plant and animal protein. Its presence in raw surface waters usually indicates domestic or agricultural pollution. Above certain levels, it is toxic to fish. Contains 25 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Easy to use, disposable, and inexpensive</li>\r\n		<li>\r\n			A great way to obtain quick, quantitative answers in the field or in the lab</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5969,NULL,''),(5980,3158,NULL,32,NULL,'Hach 2745250 Total Hardness Test Strips, 0 - 425 mg/L',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Water hardness is caused almost entirely by calcium and magnesium ions. Other di- and trivalent metals have a similar effect, but usually are not present in high enough concentration in potable waters to cause problems. Hardness increases soap consumption in laundries and causes scale in boilers. Contains 50 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Easy to use, disposable, and inexpensive</li>\r\n		<li>\r\n			A great way to obtain quick, quantitative answers in the field or in the lab</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5970,NULL,''),(5981,3158,NULL,32,NULL,'Hach 2745425 Nitrate and Nitrite Test Strips',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Excessive amounts of nitrate or nitrite in water can cause infant death, adult illness, and can produce spontaneous abortion in cows. Some wells contain high levels of nitrate. When water contains high nitrate levels, nitrites are often present in low concentration. Contains 25 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Easy to use, disposable, and inexpensive</li>\r\n		<li>\r\n			A great way to obtain quick, quantitative answers in the field or in the lab</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5971,NULL,''),(5982,3158,NULL,32,NULL,'Hach 2755250 5 in 1 Water Quality Test Strips',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		5 in 1 test strips are great for quick, on-site evaluations of water quality with reliable results on every test. These mulit-parameter test strips test for five water quality measurements on 1 strip. Contains 50 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Free Chlorine (0-10 mg/L)</li>\r\n		<li>\r\n			Total Chlorine (0-10 mg/L)</li>\r\n		<li>\r\n			Total Hardness (as CaCO3, 0-25 gpg and 0-425 mg/L)</li>\r\n		<li>\r\n			Total Alkalinity (as CaCO3, 0-240 mg/L)</li>\r\n		<li>\r\n			pH (6.2 - 8.4)</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,5972,NULL,''),(5983,3158,NULL,32,NULL,'Hach 2745650 pH Test Strips, 4 - 9 pH',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Most natural waters range from pH 4 to pH 9, but commonly are above pH 7 because of carbonates and bicarbonates (alkalinity). The pH of water used in industry, boiler feed water, and swimming pools usually is kept within a narrow range. Contains 50 tests.&nbsp; Range: 4 to 9 pH. Smallest Increment Steps: Steps: 4,5,6,7,8,9 pH.</p>\r\n</div>\r\n',0,0,1,0,5973,NULL,''),(6547,3371,NULL,64,NULL,'Pur Value Singlefold Paper Towels, White, 250/Pkg, Case of 16',NULL,'<p>\r\n	Towels measure 9.25&quot; X 10.25&quot;. Good for drying hands, wiping up spills and as a general purpose towel. 250 towels per individual package, 16 packages per case. White color.</p>\r\n',0,0,1,0,4290,NULL,''),(6000,3373,NULL,169,NULL,'Avmor Soft Hands Lotion Hand Soap, 1 Gallon','Qty','<ul>\r\n	<li>\r\n		A creamy, high quality hand soap.</li>\r\n	<li>\r\n		Has excellent cleaning abilities, a soft texture, luxorious suds, and a refreshing cherry fragrance.</li>\r\n	<li>\r\n		1 gallon.</li>\r\n</ul>\r\n',0,0,1,0,5656,NULL,''),(6001,3373,NULL,174,NULL,'Micrell 9755 Anti-Bacterial Lotion Soap, 1 Gallon','Qty','<ul>\r\n	<li>\r\n		<font class=\"ItemSearchResults_CategoryInfoDescription1Text\">Antibacterial lotion soap contains a quick-acting antimicrobial agent to eradicate harmful germs from hands </font></li>\r\n	<li>\r\n		<font class=\"ItemSearchResults_CategoryInfoDescription1Text\">Capable of killing 99.5% of the most common germs that can cause illness. </font></li>\r\n	<li>\r\n		<font class=\"ItemSearchResults_CategoryInfoDescription1Text\">Lightly scented, containing a degreasing agent. </font></li>\r\n	<li>\r\n		Non-irritating formula.</li>\r\n	<li>\r\n		1 gallon.</li>\r\n</ul>\r\n',0,0,1,0,5975,NULL,''),(6258,3190,NULL,14,7,'LMI Milton Roy Roytronic Series P, P121-D50HI, 0.13 GPH, 150 PSI, Dual Dial Metering Pump',NULL,'<p>\r\n	NSF &amp; cUL approved.</p>\r\n<p>\r\n	Roytronic Series P pumps offer a new robust design with the high end performance you expect from LMI.Designed for more economical chemical injection, these pumps are equipped with a totally enclosed, chemically resistant housing, as well as encapsulated electronics.The new AutoPrime Liquid End automatically and continuously purges entrapped air from process fluid. It also eliminates air binding when used with liquids such as sodium hypochlorite.</p>\r\n<p>\r\n	The tubing line includes ferrule designed fittings that set a new standard for secure, leak-proof tubing connections.Type 1 configuration. This configuration is designed for accurate chemical feed where manual control is all that is required. Dual manual control of stroke speed and stroke length are provided.</p>\r\n<p>\r\n	Pump kit includes instructions, suction and discharge valves, and tubing. Everything you need to get started!</p>\r\n<p>\r\n	<strong>Maximum output of 0.13 GPH, 3.1 GPD. Maximum PSI of 150. </strong><strong>1/4&quot; O.D. </strong><strong>tubing . </strong></p>\r\n',0,0,1,0,6248,NULL,''),(6279,3194,NULL,14,7,'LMI Milton Roy Roytronic RPM Pro Pac Pump Repair Kit, RPM-910A',NULL,'<p>\r\n	A RPM Pro Pac pump repair kit contains everything needed to maintain optimum performance in LMI\'s Roytronic series of metering pumps. Containing only quality, recommended replacement parts, these kits provide an easy, economical solution to annual pump maintenance.</p>\r\n<p>\r\n	Kit includes: diaphragm, cartridge valve assemblies, check balls, valve seats, o-rings, and pump head screws.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 910AX, 910HX, 918AX, 918HX</strong></p>\r\n',0,0,1,0,6269,NULL,''),(6280,3194,NULL,14,7,'LMI Milton Roy Roytronic RPM Pro Pac Pump Repair Kit, RPM-920A',NULL,'<p>\r\n	A RPM Pro Pac pump repair kit contains everything needed to maintain optimum performance in LMI\'s Roytronic series of metering pumps. Containing only quality, recommended replacement parts, these kits provide an easy, economical solution to annual pump maintenance.</p>\r\n<p>\r\n	Kit includes: diaphragm, cartridge valve assemblies, check balls, valve seats, o-rings, and pump head screws.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 920AX, 920HX, 928AX, 928HX</strong></p>\r\n',0,0,1,0,6270,NULL,''),(6281,3194,NULL,14,7,'LMI Milton Roy Roytronic RPM Pro Pac Pump Repair Kit, RPM-930A',NULL,'<p>\r\n	A RPM Pro Pac pump repair kit contains everything needed to maintain optimum performance in LMI\'s Roytronic series of metering pumps. Containing only quality, recommended replacement parts, these kits provide an easy, economical solution to annual pump maintenance.</p>\r\n<p>\r\n	Kit includes: diaphragm, cartridge valve assemblies, check balls, valve seats, o-rings, and pump head screws.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 930AX, 930HX, 938AX, 938HX</strong></p>\r\n',0,0,1,0,6271,NULL,''),(5990,3165,NULL,119,7,'Prominent Gamma/L Spare Parts Kit, 1001660',NULL,'<p>\r\n	These spare parts kits fit Prominent gamma/L chlorine pumps with self bleeding liquid ends</p>\r\n<p>\r\n	Prominent parts kit includes:</p>\r\n<ul>\r\n	<li>\r\n		Instructions</li>\r\n	<li>\r\n		Diaphragm</li>\r\n	<li>\r\n		Suction Valve Set</li>\r\n	<li>\r\n		Discharge Valve Set</li>\r\n	<li>\r\n		Bleed Valve Set</li>\r\n	<li>\r\n		Valve Balls</li>\r\n	<li>\r\n		Seal Set</li>\r\n	<li>\r\n		Tubing Connector Set</li>\r\n</ul>\r\n<p>\r\n	<strong>Liquid end code: GALA 1601 NPE</strong></p>\r\n',0,0,1,NULL,5980,NULL,''),(5991,3197,NULL,119,7,'Prominent Gamma/L Injection Valve, 924595',NULL,'<ul>\r\n	<li>\r\n		Valve body of PVC.</li>\r\n	<li>\r\n		O Rings of Viton.</li>\r\n	<li>\r\n		Injection valve body is 1/2&quot; MNPT. It will thread into most chemical injection ports.</li>\r\n</ul>\r\n',0,0,1,NULL,5982,NULL,''),(5992,3197,NULL,119,NULL,'Prominent Gamma/L Foot Valve, 924565',NULL,'<ul>\r\n	<li>\r\n		Valve body of PVC.</li>\r\n	<li>\r\n		O rings of Viton.</li>\r\n	<li>\r\n		To be installed at the end of the suction line to improve priming and to protect the pump against coarse impurities.</li>\r\n</ul>\r\n',0,0,1,NULL,6324,NULL,''),(5993,3166,NULL,NULL,NULL,'KPSI-700 (Bioclear) Submersible Pressure Transducer',NULL,'<ul>\r\n	<li>\r\n		 1.00% FSO static accuracy, 1.0&quot; diameter submersible hydrostatic level transducer specifically designed to meet the rigorous environments encountered in liquid level measurement and control.</li>\r\n	<li>\r\n		It can be configured to perform to specifications under most adverse, reactive conditions.</li>\r\n	<li>\r\n		All MEAS KPSI Transducers utilize a highly accurate pressure sensor assembly specifically designed for hostile fluids and gases.</li>\r\n	<li>\r\n		The assembly is integrated with supporting electronics in a durable waterproof housing constructed of 316 stainless steel or titanium.</li>\r\n	<li>\r\n		The attached electrical cable is custom manufactured and includes Kevlar members to prevent errors due to cable elongation, and a unique water block feature that self-seals in the event of accidental cuts to the cable.</li>\r\n	<li>\r\n		Each transducer is shipped with a SuperDry Vent Filter that prevents moisture from entering the vent tube for at least one year without maintenance, even in the most humid environments.</li>\r\n</ul>\r\n',0,0,1,NULL,5983,NULL,''),(5995,3346,NULL,NULL,NULL,'Adjustable Fire Hydrant Wrench',NULL,'<p>\r\n	Built-in spanner for pin or rocker lug couplings. Adjustable for pentagon nuts up to 1-3/4&quot;. Plated iron head and 1/2&quot; plated steel handle. Overall length 16-1/4&quot;.</p>\r\n',0,0,1,0,6664,NULL,''),(6679,3346,NULL,NULL,NULL,'Aluminum Hydrant Spanner Wrench',NULL,'<p>\r\n	Fits up to 4&quot; pin lug or rocker lug coupling. Includes pry bar and gas shut off key. Hole for belt snap ring comes standard.</p>\r\n',0,0,1,0,6667,NULL,''),(5996,3346,NULL,NULL,NULL,'Heavy Duty Adjustable Hydrant Wrench',NULL,'<div>\r\n	Malleable iron head. 7/8&quot; plated steel handle. Used with pentagon hydrant nuts up to 1-3/4&quot; from point to flat. Spanner for pin lug and rocker lug couplings, 1-1/2&quot; thru 6&quot;. Overall length of 18&quot;.</div>\r\n',0,0,1,0,6665,NULL,''),(6678,3346,NULL,NULL,NULL,'Aluminum Hydrant Wrench',NULL,'<p>\r\n	Fits up to 4&quot; pin lug or rocker lug coupling. Used to tighten or remove fire hydrant couplings and