 pretreatment compliance, CSO studies and monitoring, industrial wastewater discharge, and WWTP process control. Program the sampler for time-based, flow-based, composite and multiple bottle sampling setups.</p>\r\n<p>\r\n	<u><strong>Portable Compact System includes:</strong></u></p>\r\n<ul>\r\n	<li>\r\n		Sigma SD900 Controller w/ cover</li>\r\n	<li>\r\n		Compact insulated base</li>\r\n	<li>\r\n		Full bottle shut-off with retainer</li>\r\n	<li>\r\n		9.5L polyethylene bottle</li>\r\n	<li>\r\n		Battery 12V</li>\r\n	<li>\r\n		Power supply</li>\r\n	<li>\r\n		Charger assembly</li>\r\n	<li>\r\n		Vinyl intake tubing (7.5 m / 25 ft.)</li>\r\n	<li>\r\n		Teflon/Stainless Steel Strainer</li>\r\n</ul>\r\n',0,0,1,NULL,6470,NULL,''),(6136,2067,NULL,NULL,NULL,'Vinyl Refrigerated Sampler System, 115V, with 9.5 Liter Bottle',NULL,'<p>\r\n	The Sigma SD900 provides results that you can count on. Samples are maintained at 4C, while an advanced sample delivery system assures the highest sample integrity. And with a NEMA 4X controller and corrosion protected refrigerator, the Sigma SD900 Refrigerated Liquid Sampler is your best choice for tought waste treatment environments.</p>\r\n<p>\r\n	<u><strong>Refrigerated Sampler System includes:</strong></u></p>\r\n<ul>\r\n	<li>\r\n		Sigma SD900 Controller with Refrigerator</li>\r\n	<li>\r\n		9.5 liter polyethylene bottle</li>\r\n	<li>\r\n		Extension tube teflon</li>\r\n	<li>\r\n		Composite support tubing</li>\r\n	<li>\r\n		Full bottle shut-off</li>\r\n	<li>\r\n		Vinyl intake tubing (7.5 m / 25 ft.)</li>\r\n	<li>\r\n		Teflon/stainless steel strainer</li>\r\n</ul>\r\n',0,0,1,NULL,7188,NULL,''),(6301,3162,NULL,35,7,'LMI Liquipro Coupling Nut','Size','<p>\r\n	Compatible with Liquipro fittings, including injection valves, foot valves and suction valves</p>\r\n<p>\r\n	Use with a stainless steel clamp ring for a tight seal.</p>\r\n',0,0,1,0,6290,NULL,''),(6303,3162,NULL,35,7,'LMI Milton Roy Liquipro 3/8\" Stainless Steel Clamp Ring, 26136',NULL,'<p>\r\n	Compatible with 3/8&quot; Liquipro fittings including injection valves, foot valves, suction valves, and discharge valves.</p>\r\n<p>\r\n	Provides a tight seal for 3/8&quot; tubing to fitting connections.</p>\r\n',0,0,1,0,6298,NULL,''),(6142,3115,NULL,NULL,NULL,'Allstar Ice Melter, 20 Kg Bucket','Qty','<p>\r\n	Starts melting quickly upon application. Safer on plants and vegetation. Safer on concrete and interlock. Highly visible pink indicator. No oily residue. Resealable bucket. Bucket is designed with reinforced rings around the top to prevent distortion when carried or being poured.</p>\r\n',0,0,1,0,6132,NULL,''),(7445,3178,NULL,NULL,NULL,'GFCI Double Outlet Box',NULL,'<p>\r\n	Two GFCI protected NEMA 5-15R outlets enclosed in an impact resistant case. Spring-loaded cover protects the duplex outlet. 6\' 12/3 SJTW cord. 120 V/15 A. Meets cUL requirements.</p>\r\n',0,0,1,0,7422,NULL,''),(7446,3178,NULL,NULL,NULL,'Wind-Up Extension Cord Unit',NULL,'<p>\r\n	Rated for 10 A, 125 V. 25\' 16/3 SJT cable. Includes 4-grounded outlets, circuit breaker and carrying handle.</p>\r\n',0,0,1,0,7423,NULL,''),(7449,3272,NULL,67,NULL,'Forcefield Dyneema Gauntlet Fully-Coated with Black Nitrile, Case of 12','Size','<p>\r\n	Outperforms standard leather and cut-resistant automatic knit liners in sharp, oily, puncturing and abrasive environments. Superior dry grip capabilities.</p>\r\n',0,0,1,0,7426,NULL,''),(7440,3064,NULL,NULL,NULL,'Intrinsically Safe Rechargable LED Work Lights','Description','<p>\r\n	No need for long runs of cords or expensive explosion-proof plugs. The XP300LED is a rechargeable LED work light that is approved for Class 1 Division 1 Groups C &amp; D locations giving you the freedom to work confidently in hazardous locations.</p>\r\n<p>\r\n	Three x 3 W LEDs, rated for 50 000 hours. Adjustable polycarbonate lens allows the light to go from work light beam to flood light beam. 4.8 V NiMH rechargeable battery lasts 7 hours on a single charge. Rugged hard plastic handle, special polycarbinate lens ( resistant to MEK and MPK), aluminum heat sinks, stainless steel hanging hook, soft bumpers to provide impact protection. Includes battery.</p>\r\n<p>\r\n	cETLus approved for Class I, Division I, Groups C &amp; D.</p>\r\n',0,0,1,0,7682,NULL,''),(7441,3064,NULL,NULL,NULL,'Incandescent Work Light Reels','Cable Length','<p>\r\n	Incandescent work light is rated for a 75 W bulb. Includes switch and circuit breaker protected outlet. Grounded metal guard with reflector protects the bulb. Cord type 18/3 SVT, rating 7 A. Meets CSA requirements.</p>\r\n',0,0,1,0,6929,NULL,''),(7439,3064,NULL,NULL,NULL,'Vapor Proof Heavy-Duty  Fluorescent Work Lights','Cord Length','<p>\r\n	Cool running and protected by a rugged, shatter-proof polycarbonate tube. Includes an enclosed starter switch, rubber end caps, full length reflector and hanging hook. Moisture and dust resistant. Yellow 18/2 SJTOW cord. Vapour-proof work lights suitable for areas where water vapour is present. cUL compliant.</p>\r\n',0,0,1,0,7418,NULL,''),(7707,3064,NULL,NULL,NULL,'Fire Vulcan LED Lantern',NULL,'<p>\r\n	Lightweight, waterproof lantern features super bright C4 LED technology and two blue taillight LEDs that provide illumination both in front of and behind the lantern. The 2 ultra-bright blue taillight LEDs can be seen through thick smoke. 8 total programmable functions - 4 functions when toggle switch in &quot;left&quot; position and 4 functions when toggle switch is in &quot;right&quot; position. Deep-dish parabolic reflector produces a tight beam with optimum peripheral illumination. IPX7 rated design - waterproof to 1 meter for 30 minutes. Raised handle and toggle &quot;on-off&quot; switch ensure ease of use with a gloved hand. Super lightweight lithium ion battery recharges in 5 hours. Serialized for positive identification.Includes shoulder strap, AC/DC charge cords and charging rack. Lumens: 145. Run Time hrs.: 3.</p>\r\n',0,0,1,0,7684,NULL,''),(6149,3176,NULL,132,NULL,'Parts2O TC2153-P2 40/60 Pressure Switch',NULL,'<ul>\r\n	<li>\r\n		40/60 settings: on at 40 PSI / off at 60 PSI</li>\r\n	<li>\r\n		Quality construction.</li>\r\n	<li>\r\n		1/4&quot; NPT female fitting.</li>\r\n	<li>\r\n		Works on jet pumps or with 4&quot; submersibles.</li>\r\n</ul>\r\n',0,0,1,NULL,6139,NULL,''),(6150,3175,NULL,33,NULL,'Flotec FP4105 1/2 HP Cast Iron Shallow Well Jet Pump ',NULL,'<p>\r\n	New cast iron shallow well jet pump is ideal for wells with pumping levels of 25\' or less. Self-priming after the pump housing is initially filled with water.</p>\r\n<ul>\r\n	<li>\r\n		Reliable performance at 25\' depth to water or less</li>\r\n	<li>\r\n		Maximum pressures of 63 PSI and maximum pumping capacities to 5.1 GPM</li>\r\n	<li>\r\n		Pump housing is constructed of heavy-duty cast iron and is ready to install</li>\r\n	<li>\r\n		115 volt, 1/2 HP</li>\r\n	<li>\r\n		Fan cooled, completely enclosed motor</li>\r\n	<li>\r\n		1&quot; suction port and 1&quot; discharge port</li>\r\n</ul>\r\n',0,0,1,0,6140,NULL,''),(6151,3175,NULL,33,NULL,'Flotec FP4107 Cast Iron Jet Pump 3/4 HP',NULL,'<p>\r\n	New cast iron shallow well jet pump is ideal for wells with pumping levels of 25\' or less. Self-priming after the pump housing is initially filled with water.</p>\r\n<ul>\r\n	<li>\r\n		Reliable performance at 25\' depth to water or less</li>\r\n	<li>\r\n		Maximum pressures of 74 PSI</li>\r\n	<li>\r\n		Pump housing is constructed of heavy-duty cast iron and is ready to install</li>\r\n	<li>\r\n		115 volt, 3/4 HP</li>\r\n	<li>\r\n		Fan cooled, completley enclosed motor</li>\r\n	<li>\r\n		1&quot; suction port and 1&quot; discharge port</li>\r\n</ul>\r\n',0,0,1,NULL,6141,NULL,''),(7429,3091,NULL,33,NULL,'Flotec FP4112 Cast Iron Shallow Well Jet Pump, 1/2 HP',NULL,'<p>\r\n	Cast iron shallow well jet pumps provide superior performance and high capacities with more pressure for shallow wells 25 ft or less. Rugged, heavy-duty cast iron pump housing. Ready to install dual voltage (115V/230V) motor. 1-1/4&quot; suction and 1&quot; discharge.</p>\r\n<p>\r\n	Max capacity 8.8 GPM. Flow at 10\' lift and 40 PSI is 7.8 GPM. Max PSI 56. Pressure switch setting 30/50. Preset to 115V, can also be set to 230V. 9.4 amp draw.</p>\r\n',0,1,0,0,7406,NULL,''),(7434,2042,NULL,NULL,NULL,'White Thread Seal Teflon Tape, 3/4\" Width','Size, Qty','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Seals metal and plastic threaded joints. Non corrosive, non flammable, clean and easy to use. Joints disassemble easily even after years of use. Impervious to most fluids and gases. Lower density. These white teflon tape measures 0.003&quot; thick and 520&quot; long</span></p>\r\n',0,0,1,0,7412,NULL,''),(7435,2042,NULL,NULL,NULL,'Orange Thread Seal Teflon Tape, 3/4\" Width','Size, Qty','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Orange tape is designed to seal all metal and plastic threaded connections against leakage at temperatures from 400F to +600F (-240C to +316C). Because it is chemically inert, Orange tape is impervious to virtually everything. It is a high density, industrial teflon tape that is also ULC listed for natural gas. Non-corrosive, non-flammable, clean, easy to use. Joints disassemble easily, even after years of service. 13/4&quot; X 540&quot; roll.</span></p>\r\n',0,0,1,0,6937,NULL,''),(7436,2042,NULL,NULL,NULL,'Pink Plumbers Thread Seal Teflon Tape, 3/4\" Width','Size, Qty','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Pink tape is designed for use on all types of water lines. This is a high density tape, meaning you use less tape sealing threads than if you were to use lower density white tape. Fast positive seal for water lines, sewage lines and sprinkler systems. Effective on metal and plastic threads. High density tape is industrial grade. 3/4&quot; X 520&quot; roll.</span></p>\r\n',0,0,1,0,5891,NULL,''),(7438,3172,NULL,219,NULL,'1-1/2 HP Myers Ranger Series 4\" Submersible Well Pump and Motor','Description','<p>\r\n	Ranger 4&quot; high-flow submersible pumps are perfect for applications requiring a large volume of water. Stainless steel components and high-density composite resin impellers provide exceptional resistance to corrosion in harsh water conditions. The high-torque motor and superior pump hydraulics are carefully matched to handle virtually any job. All Ranger pumps have a 2&quot; discharge.</p>\r\n<p>\r\n	Included with the pump is a Pentek 3-wire 4&quot; XE Series motor. These motors utilize a 304 stainless steel epoxy stator design and professional-grade Class F insulation, providing longer life in harsh environments. Each motor is 100% factory pressure and run tested. The motors are equipped with surge arrestors to provide maximum protection against lightning, transient and voltage surge conditions. All motors are 3-wire, UL, CSA and NSF approved.</p>\r\n<p>\r\n	1 phase packages include a control box.</p>\r\n<p>\r\n	The pumps listed here have a 50 GPM capacity, 6 stages, 180 feet total head, and 80 PSI</p>\r\n',0,0,1,0,6147,NULL,''),(6161,3177,NULL,NULL,NULL,'Gas Engine Deluxe 7 HP (212cc) Snow Thrower',NULL,'<p>\r\n	212cc (7 HP) winterized engine. 1-cylinder, air-cooled, 4-stroke. 26&quot; clearing width and 20&quot; height intake. 6 forward and 2 reverse speed: operate the snow blower to match the conditions. Friction disc transmission. Chute rotates beyond 180 degrees. Tall steel chute focuses concentrated blast of snow, throwing it up to 11 meters. Heated handles. Halogen headlight.</p>\r\n',0,0,1,0,6151,NULL,''),(7652,3111,NULL,72,NULL,'Garant Pro Series Excavator Shovel, Long Handle',NULL,'<p>\r\n	Sharpened blade for easy and fast penetration. Extra large forward step for secure footing and power. Industrial strength blade. Hollow back blade. Premium varnished ash handle. 48&quot; length.</p>\r\n',0,0,1,0,7629,NULL,''),(7653,3361,NULL,216,NULL,'Kodiak Industrial Gas Pressure Washer, 5000 PSI, 13 HP',NULL,'<p>\r\n	Kodiak\'s largest industrial pressure washer comes with a high quality Honda GX690 engine (690cc) with electric start, low oil alert and hour meter. Slower speed of belt drive increases the life of the pump. Water resistant battery box for protection against weathering. Large removable gas tank holds up to 6.6&nbsp; US gallons.</p>\r\n<p>\r\n	High quality triplex ceramic plunger pump, thermal overload protection and 5 year warranty. Separate unloader diverts water pressure when trigger is not in use. Easily adjustable pressure control knobs. Comes complete with high quality lance and hose.13-inch pneumatic tires with ball bearing construction with a steel rim and hub assembly&nbsp; Heavy duty cart with durable powder coat finish.</p>\r\n<p>\r\n	Quiet unit has an output of 5000 PSI. Rubber feet provide reduced vibration. Low tone muffler for quiet performance.</p>\r\n<p>\r\n	&nbsp;</p>\r\n',0,0,1,0,7630,NULL,''),(6162,3177,NULL,NULL,NULL,'Gas Engine Deluxe 13 HP (357cc) Snow Thrower',NULL,'<p>\r\n	357cc winterized engine. 30&quot; clearing width. 6 forward and 2 reverse speed: operate the snow blower to match the conditions. Electric start - no need to pull. Includes manual start as back up. Tall steel chute focuses concentrated blast of snow.&nbsp; 4-way joystick chute control allows you to direct snow up, down, left or right. Steel shoes for extra durability. 16&quot; x 6.5&quot; X-Trac tires provide maximum traction. Halogen headlight for increased visibility and safety.13</p>\r\n',0,0,1,0,6152,NULL,''),(7651,3111,NULL,72,NULL,'Garant Pro Series Excavator Shovel, Short D-Grip Handle',NULL,'<p>\r\n	Sharpened blade for easy and fast penetration. Extra large forward step for secure footing and power. Industrial strength blade. Hollow back blade. Premium ash handle. Steel d-grip for strength and comfort. 27-3/4&quot; length.</p>\r\n',0,0,1,0,7628,NULL,''),(6163,3177,NULL,NULL,NULL,'Bolton Pro Anti-Vibe Small Capacity Chainsaw',NULL,'<p>\r\n	16-inch 38 cc anti-vibration chainsaw. Cutting capacity: 32 inches in diamater. 16&quot; chain made in U.S.A. Lightweight, easy to operate and versatile saw. Provided with inertia-activated chain brake which stops rotation of the chain at kickback. Gear-driven automatic chain oiler lubricates the bar and chain continually during use. Ideal for cleanup of brush piles and small trees. 2-stroke, air cooling, single cylinder 38 cc. Automatic recoil hand starter.</p>\r\n',0,0,1,0,6153,NULL,''),(6890,3113,NULL,NULL,NULL,'Deluxe Bypass Telescopic Branch Cutter',NULL,'<p>\r\n	Cutting capacity of 50 mm. Aluminum handles. Advanced locking mechanism ensures handles stay at their desired length. Handles are extendable from 14&quot; to 22&quot;. Comfortable grip handles.</p>\r\n',0,0,1,0,6873,NULL,''),(6164,3178,NULL,148,NULL,'Premium Single Outlet 14 Gauge Extension Cords','Length','<p>\r\n	Professional grade 14 gauge extension cord is construced with SJTW cable, making it a hard serving, weather and water resistant outdoor-use cord. Extremely flexible from -40C to 105C. LED power indicator. Self locking connector. 3 conductors grounded. Oil, weather and water resistant. Flame retardent. Durable PVC jacket. Meets cUL requirements.</p>\r\n',0,0,1,0,6158,NULL,''),(6668,3216,NULL,NULL,NULL,'2 Inch Heavy-Duty Nylon Ratchet Tie-Down Strap Assemblies w/ Flat Hooks','Length','<ul>\r\n	<li>\r\n		Assembly break strength of 10,000 pounds.</li>\r\n	<li>\r\n		Working load limit of 3335 pounds.</li>\r\n	<li>\r\n		Heavy gauge steel ratchet handle includes safety lock to ensure load security.</li>\r\n	<li>\r\n		Industrial grade stitching helps prevent strap breakage.</li>\r\n	<li>\r\n		Steel black painted flat hook provides exceptional strength and ease of attachment.</li>\r\n</ul>\r\n',0,0,1,0,5643,NULL,''),(6628,3178,NULL,148,NULL,'Industrial Single Outlet 12 Gauge Extension Cords','Length','<p>\r\n	Industrial grade 12 gauge extension cord is construced with SOOW cable, making it a hard serving, weather and water resistant outdoor-use cord. Extremely flexible from -40C to 90C. Locking connector. 3 conductors grounded. Oil resistant and flame retardent. Extra durable rubber jacket. Meets cUL requirments.</p>\r\n',0,0,1,0,6157,NULL,''),(6669,3073,NULL,NULL,NULL,'3 Inch Heavy-Duty Polyester Recovery Towing Straps','Length','<p>\r\n	Polyester recovery straps are great to have in case you find yourself stuck in snow, mud or sand. Made with lightweight polyester webbing which is resistant to weather and UV rays for longer lasting use.</p>\r\n<ul>\r\n	<li>\r\n		22,500 lb working load limit. 45,000 lb break strength.</li>\r\n</ul>\r\n',0,0,1,0,5946,NULL,''),(6173,3178,NULL,NULL,NULL,'L14-30 Generator Power Cord, 12 Gauge, 10 Ft Length',NULL,'<p>\r\n	Converts L14-30 (240V) twist lock connector to four 20A (125V) outlets. Improves safety, allowing user to balance the load between 125V phases. Twist lock connection provides for safer connections. Using 240V cords and adaptors reduces harmful voltage drops. Allows up to four 125V appliances to be connected to a single extension cord. Flexible -20C to 60C. Water resistant. Meets cUL requirements.</p>\r\n',0,0,1,0,6614,NULL,''),(6929,3302,NULL,NULL,NULL,'Yellow Sodium Hypochlorite Polyethylene Food Grade Linear Low Density (LLDPE) Tubing, 1/2\" O.D.','Sold Per','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">Commonly used with sodium hypochlorite in order to quickly identify the line amongst many other lines. &nbsp;LLDPE has a slightly higher pressure rating than LDPE. Offers exceptional resistance to stress cracking, more so than LDPE. Tubing is non-corrosive, odourless and tasteless. Complies with all applicable FDA, 3A, NSF-51 and NSF-61 requirements. Commonly used with chemical metering pumps. Temperature Range: -45C to +60C. </span></p>\r\n<p>\r\n	<strong><span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px;\">1/2&quot; O.D., 3/8&quot; I.D.</span></strong></p>\r\n',0,0,1,0,6912,NULL,''),(6927,3040,NULL,NULL,NULL,'Piston Gate Valve Operating Arm',NULL,'<p>\r\n	Functions as an operating device for the RIV Piston Gate Valves. Fits both 4&quot; and 6&quot; sizes. Comes in an easy to assemble 4 piece construction with high tensile bolts. Galvanized finish.</p>\r\n',0,0,1,0,7108,NULL,''),(6182,2010,NULL,NULL,NULL,'6-Outlet Power Strips','Cord Length','<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		Lighted on/off switch. 15A fused circuit breaker for overload protection. 6 heavy-duty grounded outlets. Temperature range of -40C to + 80C. High impact ABS construction for durable long life. Easy wall-mount holes. 2 foot grounded cord. Meets cUL requirements.</p>\r\n	</section></div>\r\n',0,0,1,0,4099,NULL,''),(6183,2010,NULL,NULL,NULL,'Connector, Female, 120V, 15A','Qty','<p>\r\n	For use on extension cords and portable electrical equipment including tools and appliances. 2-pole, 3-wire grounding. Rating: 15A, 125V. Meets cUL requirements.</p>\r\n',0,0,1,0,6172,NULL,''),(6184,2010,NULL,NULL,NULL,'Plug, Male, 120V, 15A','Qty','<p>\r\n	For use on extension cords and portable electrical equipment including tools and appliances. 2-pole, 3-wire grounding. Rating: 15A, 125V. Meets cUL requirements.</p>\r\n',0,0,1,0,6173,NULL,''),(6185,2010,NULL,135,NULL,'Ericson 1510-PW6P Perma-Tite 2 Plug, 125V, 15A',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		&nbsp;Perma-Tite 2 plugs are engineered and manufactured to the highest quality standards to provide the ultimate in electrical service and protection. They are designed and proven to do their best under the worst conditions in a broad array of the most severe food processing, industrial, marine, construction and petro-chemical work environments.</p>\r\n	<ul>\r\n		<li>\r\n			UL Listed &amp; CSA Certified</li>\r\n		<li>\r\n			Tongue and groove sealing system provides environmental protection of : NEMA Type 4, 4X, 6, 6P &amp; IP67</li>\r\n		<li>\r\n			Devices resist high-pressure hose down of 1000 psi.</li>\r\n		<li>\r\n			Plug body made with PBT chosen for its high resistance to moisture absorption, high voltage arcing and carbon tracking.</li>\r\n		<li>\r\n			Keyed body and cover for easy alignment/assembly</li>\r\n		<li>\r\n			Color coded sealing bushings are provided to fit a variety of cord diameters</li>\r\n		<li>\r\n			Removable/replaceable self-retained sealing cap provided with connector to keep out contaminants when not in use.</li>\r\n		<li>\r\n			Transparent back-plate makes for quick visual wiring checks.</li>\r\n		<li>\r\n			Corrosion resistant nickel plated blades.</li>\r\n		<li>\r\n			Impact, corrosion, crushing and chemical resistant.</li>\r\n	</ul>\r\n	</section></div>\r\n',0,0,1,NULL,6175,NULL,''),(6186,2010,NULL,137,NULL,'Leviton 4976-GY Weather-Resistant Cover',NULL,'<ul>\r\n	<li>\r\n		Impact resistant thermoplastic covers and bases</li>\r\n	<li>\r\n		Easy grip self closing lids</li>\r\n	<li>\r\n		Weather-resistant gaskets</li>\r\n	<li>\r\n		Stainless steel springs</li>\r\n	<li>\r\n		Mounting screws and gasket included for easy installation</li>\r\n	<li>\r\n		Full compliance with UL, CSA and NEC section 410-57 requirements for damp and wet locations with cover closed</li>\r\n</ul>\r\n',0,0,1,NULL,6176,NULL,''),(6189,3148,NULL,NULL,NULL,'UV Black Cable Ties','Description','<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		UV resistant black cable ties are recommended for indoor or outdoor use. 50 lb tensile strength. Made of weather resistant nylon.</p>\r\n	</section></div>\r\n',0,0,1,0,4109,NULL,''),(6945,3064,NULL,NULL,NULL,'Portable LED Work Light',NULL,'<p>\r\n	Featuring high powered LED technology, this portable work light puts out up to 1440 lumens of light using only 20 watts of energy. Has a 3 position switch - low light, high light, and off. The light can swivel in its frame, moving up to 120 degrees. Aluminum enclosure is IP44 rated against water splash. 120V-60Hz. 5 foot power cord. Meets cUL requirements.</p>\r\n',0,0,1,0,6409,NULL,''),(6946,3064,NULL,NULL,NULL,'Portable Dual Head LED Tripod Work Light',NULL,'<p>\r\n	Featuring high powered LED technology, this portable tripod work light puts out up to 2880 lumens of light using only 40 watts of energy. Has a 3 position switch - low light, high light, and off. The lights can swivel in their frames, moving up to 120 degrees. Aluminum enclosure is IP44 rated against water splash. 120V-60Hz. 8 foot power cord. Meets cUL requirements.</p>\r\n',0,0,1,0,6411,NULL,''),(6198,3182,NULL,157,NULL,'36 Piece Plug-In Fuse Assortment',NULL,'<p>\r\n	<u>Contains the following:</u></p>\r\n<ul>\r\n	<li>\r\n		5A (6)</li>\r\n	<li>\r\n		10A (6)</li>\r\n	<li>\r\n		15A (6)</li>\r\n	<li>\r\n		20A (6)</li>\r\n	<li>\r\n		25A (6)</li>\r\n	<li>\r\n		30A (6)</li>\r\n</ul>\r\n',0,1,0,0,6188,NULL,''),(6199,3182,NULL,157,NULL,'120 Piece Plug-In Fuse Assortment',NULL,'<p>\r\n	<u>Contains the following:</u></p>\r\n<ul>\r\n	<li>\r\n		5A (20)</li>\r\n	<li>\r\n		10A (20)</li>\r\n	<li>\r\n		15A (20)</li>\r\n	<li>\r\n		20A (20)</li>\r\n	<li>\r\n		25A (20)</li>\r\n	<li>\r\n		30A (20)</li>\r\n</ul>\r\n',0,1,0,0,6189,NULL,''),(6200,3182,NULL,157,NULL,'84 Piece Insulated Terminal Assortment',NULL,'<p>\r\n	<u>Contains the following:</u></p>\r\n<ul>\r\n	<li>\r\n		Insulated block spades, stud size 8 - 10, wire size 22 - 18 (4)</li>\r\n	<li>\r\n		Insulated push-ons, male tab 1/4, wire size 22 - 18 (4)</li>\r\n	<li>\r\n		Insulated butt connectors, wire size 22 - 18 (4)</li>\r\n	<li>\r\n		Insulated ring terminals, stud size 10, wire size 22 - 18 (5)</li>\r\n	<li>\r\n		Insulated block spades, stud size 10, wire s