a-N material which passed ASTM Oil #1 &amp; # 3 laboratory test.</li>\r\n	<li>\r\n		419 pieces, 3mm to 50 mm Inside Diamater, 1.5mm to 3.5mm Section.</li>\r\n	<li>\r\n		Every O-Ring you are ever likely to need.</li>\r\n</ul>\r\n',0,1,0,0,6194,NULL,''),(6205,2010,NULL,214,NULL,'Scepter VSC 15/10 Waterproof Toggle Switch Cover','Qty','<p>\r\n	Keeps your switch from corroding. Provides extra isolation from the switch. Meets UL and CSA approvals. Sold per each or per case of 20.</p>\r\n',0,0,1,0,6195,NULL,''),(6206,2010,NULL,142,NULL,'Woodhead 28W48 Watertite Plug, 250V, 30A',NULL,'<ul>\r\n	<li>\r\n		Woodheat Watertite Wet-Location 28W48 plug meets NEMA L6-30P standards and is UL listed.</li>\r\n	<li>\r\n		30 Amps, 250 Volts.</li>\r\n</ul>\r\n',0,0,1,NULL,6196,NULL,''),(6207,2010,NULL,142,NULL,'Woodhead 29W48 Watertite Connector, 205V, 30A',NULL,'<ul>\r\n	<li>\r\n		Woodheat Watertite Wet-Location 29W48 connector meets NEMA L6-30R standards and is UL listed.</li>\r\n	<li>\r\n		30 Amps, 250 Volts.</li>\r\n</ul>\r\n',0,0,1,NULL,6197,NULL,''),(6208,3182,NULL,NULL,NULL,'80 Piece Insulated Ring Connector Assortment',NULL,'<ul>\r\n	<li>\r\n		Supplied in handy 3-1/2&quot; x 8-1/2&quot; plastic partitioned see through box with hang up hook.</li>\r\n</ul>\r\n<p>\r\n	<u>Contains the following:</u></p>\r\n<ul>\r\n	<li>\r\n		(15) 22/18 Gauge Red 5 mm PVC # 10 Ring Connectors</li>\r\n	<li>\r\n		(15) 16/14 Gauge Blue 5 mm PVC # 10 Ring Connectors</li>\r\n	<li>\r\n		(5) 12/10 Gauge Yellow 5 mm PVC # 10 Ring Connectors</li>\r\n	<li>\r\n		(15) 22/18 Gauge Red 8 mm PVC # 5/16&quot; Connectors</li>\r\n	<li>\r\n		(15) 16/14 Gauge Blue 8 mm PVC # 5/16&quot;Connectors</li>\r\n	<li>\r\n		(5) 12/10 Gauge Yellow 8 mm PVC # 5/16&quot; Connectors</li>\r\n	<li>\r\n		(2) 22/18 Gauge Red 5 mm Nylon # 10 Ring Connectors</li>\r\n	<li>\r\n		(2) 16/14 Gauge Blue 5 mm Nylon # 10 Ring Connectors</li>\r\n	<li>\r\n		(2) 12/10 Gauge Yellow 5 mm Nylon # 10 Ring Connectors</li>\r\n	<li>\r\n		(2) 16/14 Gauge Blu