light. Convenient carrying handle with built in cord storage. Durable scratch and rust resistant finish. Mounting bracket for wall or ceiling installations. Meets cETL requirements.</p>\r\n',0,0,1,0,7689,NULL,''),(7774,3275,NULL,8,NULL,'Tough Duck Gi7016 Waterproof Spandex Glove','Size','<p>\r\n	Spandex back. Reflective strip for overall improved visibility. PVC palm patch and thumb crotch. 5mm foam back and knuckles. Terry thumb back. TPU waterproof membrane throughout. Poly fabric fourchettes and cuff binding. Sold per pair.</p>\r\n',0,0,1,0,7589,NULL,''),(6749,3275,NULL,8,NULL,'Tough Duck G22016 Premium Goatskin Work Glove','Size','<p>\r\n	Goatskin palm with foam rubber padding. Added double fingertip protection for longer wear. Knit back and slip on cuff. Sold per pair.</p>\r\n',0,0,1,0,5216,NULL,''),(6751,3407,NULL,8,NULL,'Tough Duck Gi5516 Thinsulate Lined Precision Fit Cold Weather Glove','Size','<p>\r\n	Durable stretch nylon with 40G 3M Thinsulate insulation. Double stitched palm and finger pads. Protected knuckle area and terry cloth thumb. Pull tab with metal button snap at wrist to keep gloves together when not in use. Sold per pair.</p>\r\n',0,0,1,0,7206,NULL,''),(6642,3408,NULL,3,NULL,'Work King 1731 Hydro Parka w/ Hood, Brown','Size','<p>\r\n	Fabric: 10 oz 100% cotton duck. Lining: quilted 6 oz polyester insulation. Adjustable removable hard hat hood (included). Snap closure on top and bottom tabs. Bar tacked at stress points. Double stitched shoulder and armhole seams. 4 large front scoop pockets.</p>\r\n',0,0,1,0,5244,NULL,''),(6643,3410,NULL,8,NULL,'Tough Duck i474 Hooded Jersey Bomber, Navy','Size','<p>\r\n	Fabric: 65/35 poly/cotton jersey shell. Lining: quilted 4 oz polyester insulation. Reglan sleeves. Inside cell pocket with velcro closure. Attached double hood with drawstring.</p>\r\n',0,0,1,0,7196,NULL,''),(7772,3407,NULL,8,NULL,'Tough Duck Gi5416 Thinsulate Lined Precision Fit Grip Glove','Size','<p>\r\n	Synthetic leather palm with silicone s