lity, recommended replacement parts, these kits provide an easy, economical solution to annual pump maintenance.</p>\r\n<ul>\r\n	<li>\r\n		Kit includes: diaphragm, cartridge valve assemblies, check balls, valve seats, o-rings, and pump head screws.</li>\r\n	<li>\r\n		<strong>This kit is for Liquid End Assemblies: 312, 318, 410, 418</strong></li>\r\n</ul>\r\n',0,0,1,0,6284,NULL,''),(6298,3162,NULL,35,7,'LMI Liquipro 4-Function Bleed Valve Assembly','Size','<p>\r\n	Replaces standard 3 and 4 function valves.Designed for use with LMI\'s Liquipro Series of pumps, the B4FV is used to handle off-gassing chemical such as sodium hypochlorite. Allows gases to escape without causing the pump to lose prime. Constructed of PVDF for great durability and excellent chemical resistance. Four functions includes pressure relief, priming aid, line drain, and back pressure for anti-syphon function. The bleed screw allows an adjustable amount of solution to be pumped back to the tank with each stroke. This allows gas and air to escape without air or gas locking in the pump head.</p>\r\n',0,0,1,0,5909,NULL,''),(6304,3162,NULL,35,7,'LMI Milton Roy Liquipro 1/2\" Stainless Steel Clamp Ring, 37203',NULL,'<ul>\r\n	<li>\r\n		Compatible with 1/2&quot; Liquipro fittings including injection valves, foot valves, suction valves, and discharge valves.</li>\r\n	<li>\r\n		Provides a tight seal for 1/2&quot; tubing to fitting connections.</li>\r\n</ul>\r\n',0,0,1,NULL,7420,NULL,''),(7731,2018,NULL,NULL,NULL,'Teflon (PTFE) Food Grade Tubing','OD, PSI, Sold Per','<p>\r\n	Teflon tubing is used where external environments, particularly high temperatures, or exposure to chemicals make other tubing materials unsuitable. Teflon is chemically very inert, is UV stable, does not support combustion, and maintains its mechanical properties in severe conditions. Produced with FDA compliant resins for use in food applications. Temperature range of -200C to 260C.</p>\r\n',0,0,1,0,7708,NULL,''),(6310,3161,NULL,14,7,'LMI Roytronic Foot Valve Assembly','Size, Fits Liquid Ends','<p>\r\n	The appropriate sized tubing connection kit must be ordered separately.</p>\r\n',0,0,1,0,5922,NULL,''),(7729,3048,NULL,231,NULL,'Helix Labs HL 4900',NULL,'<p>\r\n	Helix Labs HL 4900 is a liquid digestant that rids wastewater treatment and collection systems of difficult petroleum and hydrocarbon contaminants such as diesel, gasoline, transmission fluid, antifreeze, oil and others.&nbsp; HL 4900 can be applied through sprayers, pumps and manually.&nbsp; Great for use in treatment plants, lagoons, sumps, holding tanks, soil, swampy areas, on spills and anywhere hydrocarbons are a problem. HL 4900 is non-toxic and non-hazardous. HL 4900 is packaged in 6 gallon pails.</p>\r\n',0,0,1,0,7706,NULL,''),(7724,3161,NULL,26,NULL,'LMI Roytronic Liquifram','For Liquid End #\'s','<p>\r\n	Fluorofilm diaphragm offers excellent chemical resistance, high pressures and long life.</p>\r\n',0,0,1,0,6279,NULL,''),(7725,3161,NULL,26,NULL,'LMI Roytronic Suction Valve Assembly','Size, For Liquid End #\'s','<p>\r\n	Screws into pump head.</p>\r\n<p>\r\n	The appropriate sized tubing connection kit must be ordered separately.</p>\r\n',0,0,1,0,7702,NULL,''),(7726,3048,NULL,231,NULL,'Helix Labs Grease Block','Qty','<p>\r\n	Helix Labs Grease Block is a solid, bacteria-laden block used in degrading and reducing grease in sewer lines, lift stations, wet wells and grease traps. This allows for continuous 24/7 treatment. No need for repeat trips for manual dosing. Grease Block is Non-Toxic, Non-Corrosive and Non-Hazardous. Grease Block is packaged in 2 lb blocks (6 per case) and 8 lb blocks (4 per case)</p>\r\n',0,0,1,0,7703,NULL,''),(7727,3048,NULL,231,NULL,'Helix Labs Biofresh 6','Size','<p>\r\n	Helix Labs BioFresh is a premium product that works on soils and odors commonly found in restrooms, dumpsters, drain lines and anywhere else waste and its odors are present.&nbsp; BioFresh naturally deodorizes and digests urine, grease, food and other waste found in toilets, urinals and floor surfaces, pee traps drains, carpets, garbage cans and dumpster and is often used on wastewater spills to deodorize.&nbsp; BioFresh is Non-Toxic, Non-Corrosive and Non-Hazardous. Sold per 6 gallon pail.</p>\r\n',0,0,1,0,7704,NULL,''),(6314,3164,NULL,26,7,'LMI Milton Roy Non-LiquiPro Pump Repair Kit, SP-U7',NULL,'<p>\r\n	These LMI pump repair kits contain all parts needed to maintain performance in most discontinued models of A, B and P series of LMI metering pumps. Contains quality recommened parts that provide an easy economical solution to annual pump maintenance.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 190, 190S, 191, 191S, 192, 192S, 193, 193S</strong></p>\r\n',0,0,1,NULL,6304,NULL,''),(6315,3164,NULL,26,7,'LMI Milton Roy Non-LiquiPro Pump Repair Kit, SP-U8',NULL,'<p>\r\n	These LMI pump repair kits contain all parts needed to maintain performance in most discontinued models of A, B and P series of LMI metering pumps. Contains quality recommened parts that provide an easy economical solution to annual pump maintenance.</p>\r\n<p>\r\n	<strong>This kit is for Liquid End Assemblies: 150, 150S, 151, 151P, 151S, 152, 152S, 158</strong></p>\r\n',0,0,1,NULL,6305,NULL,''),(6323,3196,NULL,36,NULL,'Pulsatron Pulsafeeder 3/8\" De-Gas Five Function Valve Assembly, L385KH01-PVD',NULL,'<p>\r\n	The DG/5FV is compatible with most PULSAtron pumps. Connected to the existing discharge valve the GG/5FV is capable of handling a large output flow as well as viscous liquids. A return port located on the side body provides flow of chemical back to the solution tank when in the degas, air bleed or drain discharge mode.</p>\r\n<ul>\r\n	<li>\r\n		<u><strong>De-Gas</strong></u> - Bypass gases and fluid during normal pump operation. Allows for the constant removal of gases that would otherwise &quot;air bind&quot; the pump.</li>\r\n	<li>\r\n		<u><strong>Air Bleed</strong></u> - Used during priming to manually remove air from the pump head.</li>\r\n	<li>\r\n		<u><strong>Back Pressure</strong></u> - Maintains output reproducability and allows metering into atmospheric discharge.</li>\r\n	<li>\r\n		<u><strong>Anti-Siphon</strong></u> - Prevents siphoning through the pump when point of injection is lower than the pump or into the suction line of another pump. Rated at total vacuum.</li>\r\n	<li>\r\n		<u><strong>Discharge Drain </strong></u>- Depressurize pump discharge line without loosening tubing or fittings. Protects the operator from chemical exposure.</li>\r\n</ul>\r\n',0,0,1,NULL,6313,NULL,''),(6317,3164,NULL,26,7,'LMI Milton Roy Non-LiquiPro Pump Repair Kit, SP-U17',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<p>\r\n		These LMI pump repair kits contain all parts needed to maintain performance in most discontinued models of A, B and P series of LMI metering pumps. Contains quality recommened parts that provide an easy economical solution to annual pump maintenance.</p>\r\n	<p>\r\n		<strong>This kit is for Liquid End Assemblies: 12, 12S, 112, 112S, 118, 118S</strong></p>\r\n	</section></div>\r\n',0,0,1,NULL,6307,NULL,''),(6318,3164,NULL,26,7,'LMI Milton Roy Non-LiquiPro Pump Repair Kit, SP-151FS',NULL,'<div class=\"details-add-to-cart2\">\r\n	<section class=\"product-details\">\r\n	<div class=\"details-add-to-cart2\">\r\n		<section class=\"product-details\">\r\n		<p>\r\n			These LMI pump repair kits contain all parts needed to maintain performance in most discontinued models of A, B and P series of LMI metering pumps. Contains quality recommened parts that provide an easy economical solution to annual pump maintenance.</p>\r\n		<p>\r\n			<strong>This kit is for Liquid End Assemblies: 151FS</strong></p>\r\n		</section></div>\r\n	</section></div>\r\n',0,0,1,NULL,6308,NULL,''),(6319,3163,NULL,36,NULL,'Pulsatron Pulsafeeder KOPkit Pump Repair Kit, K3VTC1',NULL,'<p>\r\n	A Keep On Pumping kit can help you cut downtime and put you back in busi