rproofing electrical components.</span></li>\r\n		<li>\r\n			<span class=\"st\">Plumbing, electrical, automotive or househole repairs.</span></li>\r\n		<li>\r\n			<strong><span class=\"st\">2&quot; width, 33\' length.</span></strong></li>\r\n	</ul>\r\n	</section></div>\r\n',0,0,1,0,4309,NULL,''),(7719,3079,NULL,219,NULL,'Myers 30 Gallon Chemical Storage Tank',NULL,'<p>\r\n	High rigidity cover with molded recess for mounting of chemical pump and two agitators, or a liquid level control. Cover also has holes for filling and suction tubing. Self supporting tapered sides. Suitable for most corrosive and noncorossive solutions.</p>\r\n<p>\r\n	19.7&quot; diameter at bottom tapers to 22&quot; diameter at top. 24&quot; total height. 30 US gallons total capacity.</p>\r\n',0,0,1,0,4043,NULL,''),(6360,3215,NULL,230,NULL,'Wingert Agitators with Suction Tube Shield','Size','<p>\r\n	1600 RPM, 115VAC, 50/60Hz., 1.5 AMP., 175 Watts, 1/20 H.P. Mixers come complete with an epoxy coated S.S. shaft and impeller. Attaches to the lid with suction to prevent the suction line from deforming while agitator is running.</p>\r\n',0,0,1,0,4052,NULL,''),(6362,3265,NULL,154,NULL,'Justrite 28653 EcoPolyBlend Single Drum Accumulation Center',NULL,'<ul>\r\n	<li>\r\n		Pallets Are Made Of Up to 100% Recycled Polyethylene and offer leak protection from drums, pails, batteries, or any other container of hazardous or non-hazardous liquids</li>\r\n	<li>\r\n		High value secondary containment centers are ; Sturdy, removable grates make sump cleaning easy while low profile offers convenience when loading/unloading</li>\r\n	<li>\r\n		Versatile modular design allows you to customize your workspace -- around existing structures, linear style, or over entire floor</li>\r\n	<li>\r\n		Meets or exceeds EPA, SPCC, NFP1, and int\'l Fire code</li>\r\n	<li>\r\n		<strong>Has a capacity of 12 gallons (45 liters) and measures 25&quot; L x 25&quot; W x 5.5&quot; H.</strong></li>\r\n</ul>\r\n',0,0,1,0,5782,NULL,''),(6363,32