ion resistant, and lightweight.</li>\r\n	<li>\r\n		No seams, welds, or joints to leak or rust.</li>\r\n	<li>\r\n		<strong>Container measures 27.5 inches in diameter and 32 inches in height, with a capacity of 49 gallons (223 liters).</strong></li>\r\n</ul>\r\n',0,0,1,NULL,6356,NULL,''),(6369,3079,NULL,NULL,NULL,'Open Top Cylindrical Tank, 68 Gallons, 27.5\" D x 42\" H',NULL,'<ul>\r\n	<li>\r\n		Seamless cylindrical container is ideal for handling liquids, granular material and powders.</li>\r\n	<li>\r\n		Chemical resistant tank is rated for the storage of potable water.</li>\r\n	<li>\r\n		Rugged, corrosion resistant, and lightweight.</li>\r\n	<li>\r\n		No seams, welds, or joints to leak or rust.</li>\r\n	<li>\r\n		<strong>Container measures 27.5 inches in diameter and 42 inches in height, with a capacity of 68 gallons (309 liters).</strong></li>\r\n</ul>\r\n',0,0,1,NULL,6357,NULL,''),(7667,3376,NULL,NULL,NULL,'Chromate Wire Shelving Unit w/ Storage Bins',NULL,'<p>\r\n	Shelving Size 48 W&quot; x 24 D&quot; x 74 H&quot;. 5 shelves total.&nbsp; Adjustable chromate wire shelves. Wire shelving resists corrosion and provides greater visibility to stored parts. Wire shelves prevent build up of dust and dirt. Bins are unaffected by oil, alkaline and most acids. Ideal in for parts storage. NSF certified. Assembly required. Stationary unit\'s total capacity should not exceed 2000-lb.</p>\r\n<p>\r\n	Includes the following number and sizes of bins:</p>\r\n<ul>\r\n	<li>\r\n		(4) 7-7/8&quot; X 17-11/16&quot; X 7&quot;</li>\r\n	<li>\r\n		(7) 11-13/16&quot; X 17-11/16&quot; X 7&quot;</li>\r\n	<li>\r\n		(6) 15-1/2&quot; X 25&quot; X 13&quot;</li>\r\n</ul>\r\n',0,0,1,0,7644,NULL,''),(7666,3376,NULL,NULL,NULL,'Chromate Wire Wheeled Shelves','# Of Shelves','<p>\r\n	Open-wire shelf design minimizes dust and increases air circulation and visibility. High quality chromate shelves and posts prevent corrosion. Shelves can be adjusted quickly and easily. Strong and versatile. Includes: 5&quot; resilient rubber casters (two swivel, two with brake). Capacity: 600 lbs. evenly distributed. Shipped knocked-down. NSF certified.</p>\r\n<p>\r\n	Four Shelf Unit Dimensions: 18&quot; D X 36&quot; W X 74&quot; H</p>\r\n<p>\r\n	Five Shelf Unit Dimensions: 18&quot; D X 36&quot; W X 86&quot; H</p>\r\n',0,0,1,0,7643,NULL,''),(6373,3261,NULL,155,NULL,' Non-Mercury High Water Alarm w/ Float Switch','Float Switch Cable Length','<p>\r\n	The Tulsar High Water Alarm is an all-in-one alarm package used to provide an audible and visual warning when a tank is full, or when water rises to a certain level. This alarm is ideal for septic tanks and sump pits. This alarm is equipped with a buzzer, a red alarm light, and a buzzer silence switch. The red High Water alarm light remains lit until the water level is returned to an acceptable level. A test switch allows you to ensure that the alarm is operational. Comes complete with float switch cable, a non-mercury sensor float switch, an attractive and functional plastic control panel, and a six foot 120 volt power cord. CSA Certified and UL Listed.</p>\r\n',0,1,0,0,7448,NULL,''),(6384,3261,NULL,218,NULL,'SJE PumpMaster Plus Piggyback Wide-Angle Float Switches, 15 Amp, 120V','Cable Length','<p>\r\n	Designed for direct control of 120 volt pumps up to 3/4 HP.</p>\r\n<p>\r\n	The SJE PumpMaster Plus is a non-mercury, wide-angle float switch designed for direct control of any 120 volt pump up to 15 amps FLA. It can be used in potable water and sewage applications.</p>\r\n<p>\r\n	Not sensitive to rotation or turbulence, this float switch works well in both calm and turbulent situations. This mechanical float switch directly controls pumps in pump down/emptying applications.</p>\r\n<p>\r\n	UL and CSA listed. Passed NSF Standard 61 Protocol. Adjustable pump down range of 7&quot; to 36&quot; Flexible 14 gauge cable and heavy duty switch are rated for 15A running and 85A starting current. Comes complete with mounting clamp.</p>\r\n<p>\r\n	All SJE Float Switches now carry a 5 year warranty.</p>\r\n',1,0,1,0,6365,NULL,''),(7425,3261,NULL,218,NULL,'SJE Adjustable Float Switch Cable Weight',NULL,'<p>\r\n	Provides an accurate pivot point for suspended float switches. Gripper teeth on clip and weight channel securely lock float cable into place. Cable weight can be adjusted without the use of tools.</p>\r\n<p>\r\n	Accommodates the following cable types/gauges: SJOW, SJTW, 18/2, 18/3, 16/2, 16/3, 14/2 and 14/3.</p>\r\n',0,0,1,0,7403,NULL,''),(6871,3288,NULL,171,NULL,'Apollo Double Check Valve Assembly','Size','<p>\r\n	Designed to prevent contamination of potable water supply due to back siphonage or back pressure from substances that are objectionable but non-health hazards. The modular check valve cartridges have replaceable seats and reversible silicone seat discs. Temperature range 33<span class=\"st\">F to 180</span><span class=\"st\">F. Maximum working pressure 175 PSI. CSA certified.</span></p>\r\n',0,0,1,0,6854,NULL,''),(6869,3288,NULL,171,NULL,'Apollo Reduced Pressure Backflow Preventer','Size','<p>\r\n	Designed to give maximum protection of the potable water supply against backflow caused by either back pressure or back siphonage from substances that are hazardous. Standard with Apollo full port ball valves with stainless steel handles and nuts. Modular check valve cartridges with easily replaced parts. Corrosion resistant. Bronze body and cover. Designed, cast, machined, assembled and tested in the USA. Maximum working pressure 175 PSI. Temperature range 33F to 180F. CSA certified.</p>\r\n',0,0,1,0,6852,NULL,''),(6870,3288,NULL,171,NULL,'Apollo In-Line Check Valves, Bronze','Size','<p>\r\n	Offers reliable protection against reverse flow and resistance to chemicals and corrosion. Spring actuated. Tight shut-off with liquid media. Teflon (PTFE) ball cone for exceptional chemical resistance. May be installed in both horizontal and vertical flow with upward flow. Designed to be virtually maintenance free. Made in the USA. FNPT X FNPT.</p>\r\n',0,0,1,0,6853,NULL,''),(7086,2023,NULL,NULL,NULL,'Mini Type 304 Stainless Steel Bolt Clamps','Range','<p>\r\n	Mini bolt clamps provide a sure seal on small diameter tubing and thin walled hoses. The clamp edges are rolled to prevent hose damage. These tiny clamps are made entirely with type 304 stainless material. Sold and priced per each.</p>\r\n',0,0,1,0,7069,NULL,''),(7085,2023,NULL,NULL,NULL,'Type 316 Stainless Steel Gear Clamps, 1/2\" Band, 10 Pack','Nom. Size, Range','<p>\r\n	These gear clamps are manufactured entirely with grade 316 stainless steel for the very best corrosion resistance. They were designed for use in applications where 201 and 301 stainless materials show signs of corrosion. These 316 stainless clamps are ideal for use in marine repair, water treatment plants, sewage treatment plants and other corrosive environments. They also provide extra reliability in underground installations such as sprinkler and swimming pool piping. These clamps have a 1/2&quot; wide band and are sold by the package of 10 to keep your costs down.</p>\r\n',0,0,1,0,7064,NULL,''),(6382,3261,NULL,156,NULL,'Flygt 5828812 Non-Mercury ENM-10 Level Regulator Float Switch, 40 Ft Cable',NULL,'<ul>\r\n	<li>\r\n		The Flygt ENM-10 level regulator float switch offers the simplest possible method for liquid level control.</li>\r\n	<li>\r\n		This float switch contains a mechanical switch encapsulated within a waterproof tear drop shaped plastic casing that is freely suspended at the desired height from its own cable. Impurities and deposits will not adhere to the smooth float switch casing.</li>\r\n	<li>\r\n		When the liquid level reaches the float switch, the waterproof plastic casing will tilt and the mechanical switch will close or break the circuit, thereby starting or stopping a pump or actuating an alarm circuit.</li>\r\n	<li>\r\n		The Flygt ENM-10 level regulator contains a micro switch, max rated 250 VAC/10A. This three-wire single pole double throw (SPDT) float switch can be wired normally open (NO) or normally closed (NC).</li>\r\n	<li>\r\n		The Flygt ENM-10 float switch casing is made of polypropylene and the cable is sheathed with a special PVC or Nitrile/PVC rubber compound. The plastic components are welded and screwed together, adhesive is never used.</li>\r\n	<li>\r\n		The 40\' Flygt Non-Mercury ENM-10 Float Switch can be used for either normally open or normally closed applications.</li>\r\n</ul>\r\n',0,0,1,0,6360,NULL,''),(6383,3261,NULL,156,NULL,'Flygt 5828813 Non-Mercury ENM-10 Level Regulator Float Switch, 65 Ft Cable',NULL,'<ul>\r\n	<li>\r\n		The Flygt ENM-10 level regulator float switch offers the simplest possible method for liquid level control.</li>\r\n	<li>\r\n		This float switch contains a mechanical switch encapsulated within a waterproof tear drop shaped plastic casing that is freely suspended at the desired height from its own cable. Impurities and deposits will not adhere to the smooth float switch casing.</li>\r\n	<li>\r\n		When the liquid level reaches the float switch, the waterproof plastic casing will tilt and the mechanical switch will close or break the circuit, thereby starting or stopping a pump or actuating an alarm circuit.</li>\r\n	<li>\r\n		The Flygt ENM-10 level regulator contains a micro switch, max rated 250 VAC/10A. This three-wire single pole double throw (SPDT) float switch can be wired normally open (NO) or normally closed (NC).</li>\r\n	<li>\r\n		The Flygt ENM-10 float switch casing is made of polypropylene and the cable is sheathed with a special PVC or Nitrile/PVC rubber compound. The plastic components are welded and screwed together, adhesive is never used.</li>\r\n	<li>\r\n		The 65\' Flygt Non-Mercury ENM-10 Float Switch can be used for either normally open or normally closed applications.</li>\r\n</ul>\r\n',0,0,1,0,6361,NULL,''),(6385,3261,NULL,218,NULL,'SJE Double Float Master Piggyback Plug Float Switch Assembly, 15 Amp, 120V','Cable Length','<p>\r\n	Designed for direct control of 120 volt pumps up to 3/4 HP.</p>\r\n<p>\r\n	The SJE Double Float Master uses two non-mercury float switches wired in series for direct control of any 120 volt pump up to 15 FLA, 90 LRA in non-potable water and sewage applications. It is well-suited for applications requiring an accurate pumping range in small diameter pits and vessels.</p>\r\n<p>\r\n	Not sensitive to rotation or turbulence, this float switch works well in both calm and turbulent situations. This mechanical float switch directly controls pumps in pump down/emptying applications.</p>\r\n<p>\r\n	The Double Float Master float switch assembly consists of two mechanical float switches and a waterproof splice tube. The splice tube contains a holding relay which enables the floats to function in series and eliminates pump chatter.</p>\r\n<p>\r\n	CSA listed. Adjustable pump down range of 3&quot; to 48&quot;. Cable attached to float switches is 18 gauge, 2 conductor. Cable above the splice is 14 gauge, 3 conductor. Comes complete with mounting clamps.</p>\r\n<p>\r\n	All SJE Float Switches now carry a 5 year warranty.</p>\r\n<p>\r\n	<img alt=\"\" src=\"/resources/pages/Multiquip SW2 Diagram.jpg\" style=\"width: 157px; height: 298px;\" /></p>\r\n',0,0,1,0,6368,NULL,''),(7426,3261,NULL,218,NULL,'SJE PumpMaster Quick Fit Piggyback Plug Wide Angle Float Switch, 13 Amp, 120V','Cable Length','<p>\r\n	Designed for direct control of 120 volt pumps up to 1/2 HP.</p>\r\n<p>\r\n	The SJE PumpMaster QuickFit is a non-mercury, wide angle float switch designed for direct control of any 120 volt pump up to 13 amps FLA. It can be used in potable water and sewage applications.</p>\r\n<p>\r\n	Not sensitive to rotation or turbulence, this float switch works well in both calm and turbulent situations. This mechanical float switch directly controls pumps in pump down/emptying applications.</p>\r\n<p>\r\n	The Quick Fit feature has the float and piggyback plug separate to allow for quick fit installation by routing the float cord through conduit and heat shrink, then attaching the piggyback plug by inserting the quick connect terminals and applying the protective heat shrink. This unique feature allows greater flexibility during the installation process.</p>\r\n<p>\r\n	UL and CSA listed. Passed NSF Standard 61 Protocol. Adjustable pump down range of 7&quot; to 36&quot;. Flexible 16 gauge cable and heavy duty switch are rated for 13A running and 85A starting current. Comes complete with mounting clamp.</p>\r\n<p>\r\n	All SJE float switches now carry a 5 year warranty.</p>\r\n',0,0,1,0,6374,NULL,''),(6386,3073,NULL,157,NULL,'Matrix Class I 2\" x 3\" Trailer Coupler',NULL,'<ul>\r\n	<li>\r\n		Compatible with any 2&quot; ball.</li>\r\n	<li>\r\n		3&quot; tongue.</li>\r\n	<li>\r\n		3500 lbs rated.</li>\r\n	<li>\r\n		Class 1.<br />\r\n		&nbsp;</li>\r\n</ul>\r\n',0,0,1,NULL,6655,NULL,''),(6387,3182,NULL,157,NULL,'Matrix Booster Cables, 4 Gauge, 400 Amps, 16 Ft',NULL,'<ul>\r\n	<li>\r\n		For top and side mount batteries.</li>\r\n	<li>\r\n		Engineered for warm and cold climates.</li>\r\n	<li>\r\n		4 gauge cables.</li>\r\n	<li>\r\n		400A clamps.</li>\r\n</ul>\r\n',0,1,0,0,6205,NULL,''),(7571,3253,NULL,NULL,NULL,'Grease Fitting Assortments','Type',NULL,0,0,1,0,7548,NULL,''),(7572,3253,NULL,NULL,NULL,'Lever Oil Pail Pump',NULL,'<p>\r\n	For use with motor oil, gear oil and ATF. Fits full open head pails through 6-1/2 gallons. Includes pump, pail cover and 4 ft of clear vinyl hose with curved discharge nozzle. Delivers approx. 1 gal/60 strokes.</p>\r\n',0,0,1,0,7549,NULL,''),(7570,3253,NULL,NULL,NULL,'Flex-Spout Pump Oiler','Size','<p>\r\n	Keep this can handy for all of your basic lubrication needs. Steel pump mechanism.</p>\r\n',0,0,1,0,5880,NULL,''),(7030,3324,NULL,210,NULL,'Harmsco Premium 701 Series Filter Cartridges, 2-1/2\" OD, 10\" Length, Case of 20','Micron Rating','<p>\r\n	Designed for housings that use 2-1/2&quot; O.D. X 1-1/16&quot; ID filter cartridges. Cleanable pleated polyester filter media provides high flow rates with low initial pressure drop. Color coded end caps for easy micron identification. Harmsco pleated polyester filter cartridges typically offer 3 - 5 times longer filter runs than string wound or depth filter cartridges. Certified to NSF 61. All sizes below are sold by the case of 20.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Filters listed here are 10&quot; in length. </strong></li>\r\n	<li>\r\n		<strong>All sizes below are sold and priced by the case of 20.</strong></li>\r\n</ul>\r\n',0,0,1,0,7013,NULL,''),(7530,3367,NULL,NULL,NULL,'Polyurethane Recoil Air Hose Assemblies','Length','<p>\r\n	Tired of stiff, kinking or easily damaged self-storing hoses, but dislike the bulk of rubber hose? Polyurethane recoil hose is the answer.</p>\r\n<p>\r\n	Polyurethane will bounce back again and again despite crushing or kinking. The working length of the hose is 80 to 90% of actual length, and is easier to use than conventional nylon or hytrel recoil hoses due to the superior elastic properties of urethane.</p>\r\n<p>\r\n	Temperature range of -40<span class=\"st\"></span>C to 65<span class=\"st\"></span>C. Working pressure of 130 PSI at 20<span class=\"st\"></span>C, 60 PSI at 50<span class=\"st\"></span>C. Has 1/4&quot; male pipe thread fittings on each end to fit most compressors and accessories.</p>\r\n',0,0,1,0,5609,NULL,''),(7531,3367,NULL,NULL,NULL,'Reinforced Polyurethane Reel Mounted Air Hose Assemblies ','Description','<p>\r\n	Reinforced polyurethane is a new breed of air hose. This hose is amazingly tough and puncture resistant, yet it weighs less than PVC hoses, and much less than rubber. The polyurethane compound is formulated to stay flexible down to -40<span class=\"st\">C, and it has excellent resistance to oils and solvents.</span></p>\r\n<p>\r\n	<span class=\"st\">This reel mounted hose package comes complete with reel, hose assembly with male NPT end fittings and a 3-1/2 ft whip hose to connect to the air supply.&nbsp; </span></p>\r\n',0,0,1,0,6993,NULL,''),(7532,2061,NULL,221,NULL,'MSA 10115110 Confined Space Entry Kit with Lynx Rescuer',NULL,'<p>\r\n	This confined space entry kit makes it easy to order a confined space system. Includes tripod, carry bags, Lynx rescuer with 50 ft wire rope, and all fittings/attachments. Fully meets all applicable CSA requirements.</p>\r\n<p>\r\n	Lynx hoist is rated at 310 lbs for personnel (10:1) design factor and 620 lbs for materials (5:1) design factor. All steel construction with energy absorber that operates even when usable length of line is fully extracted. Anti-backlash crank handle with lifting/lowering speed of 25 feet per minute. Load-limiting clutch prevents overloading of hoist. Emergency drive allows manual bypass of load-limiting clutch for extra lifting capacity in an emergency. Primary gear backed up by two independent secondary brakes.</p>\r\n<p>\r\n	Tripod features internal leg-locking mechanism, maximum height indicator of tripod legs, cut-resistant leg pin retention chains, and integral carry strap. Can be set up and dismantled without the use of tools. Skid-resistant feet.</p>\r\n',0,0,1,0,4974,NULL,''),(7539,3366,NULL,160,NULL,'MEGA Hydraulic Spreading Cylinder',NULL,'<p>\r\n	Used to spread of lift machinery for alingment. Jaws are fitted with spring return. Industrial quality - heavy duty. 1.1 tons of force. Lift height of 3-1/8&quot;. Measures 6-11/16&quot; in length, 9/16&quot; at its narrow end when closed, 2-3/8&quot; at its wide end.</p>\r\n',0,0,1,0,7516,NULL,''),(7540,3368,NULL,NULL,NULL,'Battery Service Kit',NULL,'<p>\r\n	Ideal service kit for utility trucks, tow trucks, etc for field service repair. Top quality tools packaged in one convenient kit. Set contains three wrench sizes required for battery service, as well as pliers, puller, cable and post cleaner - everything you will need for complete battery service.</p>\r\n',0,0,1,0,7457,NULL,''),(7542,3368,NULL,NULL,NULL,'4-Way Battery Terminal Brush',NULL,'<p>\r\n	4 functions - large and small, and internal and external cleaning capabilities.</p>\r\n',0,0,1,0,7519,NULL,''),(7543,3368,NULL,NULL,NULL,'Industrial Grade 12V, 1700A Battery Booster/Air Compressor',NULL,'<p>\r\n	Industrial quality combination battery booster and air compressor unit provides jump starting performance plus the convenience of an integrated, industrial-grade air delivery system with 12 ft air hose and built-in pressure gauge. 1700 peak amps. 425 cranking amps. 60 PSI air compressor. Hands-free screw on air chuck. Battery status indicator gauge. 68&quot; cable leads. Heavy-duty #4 cables and clamps. DC outlet powers a variety of 12 volt accessories. Built-in charger.</p>\r\n',0,0,1,0,7520,NULL,''),(7582,2068,NULL,NULL,NULL,'Zep Heavy Hitter Original Detergent','Qty','<p>\r\n	Zep Heavy Hitter is a highly concentrated, chelated, liquid machine dishwashing compound. A special blend of alkaline detergents, grease cutters and soil suspenders. Formula allows for dulutions up to 14 ml per 4.5 liters of water. Generates no foam to interfere with the operation of the dishwasher. Free-rinsing. Easily dispensed - eliminated problems such as dusting, caking, clogging and overuse.&nbsp; Superior cleaning action on labware, glassware, tableware, and plastic. Not for use on aluminum.</p>\r\n',0,0,1,1,7559,NULL,''),(6404,3374,NULL,NULL,NULL,'Heavy-Duty Caulking Gun',NULL,'<p>\r\n	Smooth application. 9&quot; heavy-duty. Ergonomic handle. Rotating barrel. Ladder hook. Built-in spout cutter and seal punch on handle.</p>\r\n',0,0,1,0,7331,NULL,''),(6654,3390,NULL,4,NULL,'Work King s392 High Visibility Safety T-Shirt with Pocket, Orange','Size','<p>\r\n	Fabric: 3.67 oz 100% Polyester micro-mesh w/ wicking treatment. Excellent breathability and comfort. Chest pocket. 3M Scotchlite reflective material w/ 4&quot; contrast backing.</p>\r\n',0,0,1,0,5964,NULL,''),(6573,3260,NULL,62,NULL,'Baffin Express Moulded Work Boot, Steel Toe & Plate','Size','<p>\r\n	Self-cleaning, treaded outsole ensures sure footing. Extra thick sole for added comfort. Sure Step First Impact heel strike design. Steel toe and plate. CSA/ASTM approved.</p>\r\n',0,0,1,0,6092,NULL,''),(6636,2062,NULL,70,NULL,'Water Treatment Additive for Portable Eyewash Stations','Qty','<p>\r\n	One bottle of this Water Treatment Additive for Portable Eyewash Stations will preserve 5 to 20 gallons of potable water for up to three months. Protects against the growth of bacteria, fungi, algae, staph and other impurities. For use in self-contained emergency eyewash stations. Shelf life of 3 years. Sold per 236 ml bottle or case of 4.</p>\r\n',0,0,1,0,5180,NULL,''),(6572,3171,NULL,70,NULL,'121 Series Basic CSA Safety Glasses, Grey Lens','Qty','<p>\r\n	Adjustable ratchet temples can fit any face shape. Extremely lightweight. High impact resistance. Scratch resistant. Offers 99% protection from UV-A and UV-B rays. Compliant with CSA Z94.3 and ANSI Z87.1. Grey lens. Sold individually or per case of 12.</p>\r\n',0,0,1,0,5730,NULL,''),(6570,3171,NULL,70,NULL,'121 Series Basic CSA Safety Glasses, Clear Lens','Qty','<p>\r\n	Adjustable ratchet temples can fit any face shape. Extremely lightweight. High impact resistance. Scratch resistant. Offers 99% protection from UV-A and UV-B rays. Compliant with CSA Z94.3 and ANSI Z87.1 Clear lens. Sold individually or per case of 12.</p>\r\n',1,0,1,0,5170,NULL,''),(6571,3171,NULL,70,NULL,'121 Series Basic CSA Safety Glasses, Amber Lens','Qty','<p>\r\n	Adjustable ratchet temples can fit any face shape. Extremely lightweight. High impact resistance. Scratch resistant. Offers 99% protection from UV-A and UV-B rays. Compliant with CSA Z94.3 and ANSI Z87.1. Amber lens. Sold individually or per case of 12.</p>\r\n',0,0,1,0,5728,NULL,''),(6653,3391,NULL,4,NULL,'Work King s9i0 High Visibility 5-Point Tearaway Vest, Yellow','Size','<p>\r\n	100% Polyester birdseye mesh. 3M Scotchlite reflective material w/ 4&quot; contrast backing. Safety harness hole in back. 2 lower patch pockets.</p>\r\n',0,0,1,0,5707,NULL,''),(6641,3272,NULL,NULL,NULL,'Green 18\" PVC Double-Dipped Gloves, 12/pk',NULL,'<p>\r\n	PVC coating remains soft when cold. Excellent insulation against cold temperatures. Offers resistance to oils, acids, caustics and alcohols. 18 inches in length. Sold by the pack of 12.</p>\r\n',0,0,1,0,5204,NULL,''),(6640,3272,NULL,NULL,NULL,'Green 12\" PVC Double-Dipped Gloves, 12/pk',NULL,'<p>\r\n	PVC coating remains soft when cold. Excellent insulation against cold temperatures. Offers resistance to oils, acids, caustics and alcohols. 12 inches in length. Sold by the pack of 12.</p>\r\n',0,0,1,0,5200,NULL,''),(6756,3279,NULL,70,NULL,'Large Industrial Kneeling Mat','Qty','<p>\r\n	This Large Industrial Kneeling Mat is constructed of resilient closed cell 1-inch thick foam rubber and has a built-in handle. Self extinguishing and non-conductive. Does not compress set. Helps to reduce knee trauma and low back pain. Provides comfortable support and cushioning. Fully washable. Designed for severe kneeling conditions in cold/hard, steel, concrete, grating, gravel, wet surfaces, dirt/mud. Impervious to petroleum products. Ideal for any job that involves kneeling.</p>\r\n<p>\r\n	Measures 21&quot;L x 14&quot;W.</p>\r\n',0,0,1,0,6740,NULL,''),(6415,2011,NULL,57,NULL,'King Electric Portable Utility Heater, 120V',NULL,'<p>\r\n	The King Electric portable utility heater is a durable heater designed for use in garage/shop applications where supplemental heat is needed.</p>\r\n<p>\r\n	It features a rugged and durable powder coated steel hosuing. The easy-to-use thermostat lets you adjust heat to the perfect level for your space. For safety, an internal switch automatically cuts off power if heater accidently tips, falls or overheats.</p>\r\n<p>\r\n	Two heat settings: 1300/1500 watts. Ni-chrome heating element. Durable powder coated steel housing. 4 position switch - Fan/Low/High/Off. Power indicator light. Adjustable thermostat. Safety tip-over switch. Convenient carrying handle. 6 ft, 120V power cord with grounded plug. Meets cETL requirements.</p>\r\n',0,0,1,0,6581,NULL,''),(7050,3220,NULL,77,NULL,'Magikist MACC100 Crankcase Oil, Type-A, 1 Litre','Qty','<p>\r\n	Excellent anti-wear properties. Corrosion protection. Non-foaming, non-detergent. Oxidation resistance. Sold per 1 litre bottle or per case of 12.</p>\r\n<p>\r\n	Consult pump operating manual for proper lubrication schedule.</p>\r\n',0,0,1,0,7033,NULL,''),(6829,2081,NULL,11,NULL,'Super Ego ROCUT 42 PVC Pipe Cutters','Capacity','<p>\r\n	Suitable for PVC, PP, PB, PEX. Ergonomic design with rubber grip on handle. Lightweight alloy body assures extra strength. Designed with minimum gap between handles to allow one hand operation. V-shaped edge allows easy start for cutting.</p>\r\n',0,0,1,0,5378,NULL,''),(6417,3220,NULL,77,NULL,'Magikist PJD45B 5/16\" De-Icer Probe Tip','Qty','<p>\r\n	Replacement probe tip for Magikist PJDX-C Jet De-Icer. Fits 5/16&quot; tubing size. Sold per each or per pack of six.</p>\r\n',0,0,1,0,6407,NULL,''),(6418,3220,NULL,77,NULL,'Magikist PJD135 5/16\" X 100\' Reel Assembly',NULL,'<p>\r\n	Replacement 5/16&quot; X 100\' reel assembly for Magikist PJDX-C Jet De-Icer.</p>\r\n',0,0,1,0,6408,NULL,''),(6419,3220,NULL,77,NULL,'Magikist PJD140 5/16\" X 200\' Reel Assembly',NULL,'<ul>\r\n	<li>\r\n		Replacement 5/16&quot; X 200\' reel assembly for Magikist PJDX-C Jet De-Icer.</li>\r\n</ul>\r\n',0,0,1,0,6955,NULL,''),(7709,3149,NULL,49,NULL,'Greenlee TK30GFI Basic Electrical Test Kit w/ GFI Test',NULL,'<p>\r\n	Basic manual ranging multimeter measures AC voltage, DC voltage, resistance, checks continuity, test diodes and 1.5V and 9V batteries. CAT III 600V.</p>\r\n<p>\r\n	Non-Contact voltage detector detects AC voltage in outlets, lighting fixtures, circuit breakers and cables, and finds a break in an energized wire. Cat IV 1000V.</p>\r\n<p>\r\n	GFI outlet circuit checks outlet for proper wiring and tests GFCI devices. 125V.</p>\r\n',0,0,1,0,4120,NULL,''),(6947,3221,NULL,NULL,NULL,'Magnetic Flexible Telescopic LED Pickup Tool',NULL,'<p>\r\n	Extendable length from 6.5&quot; to 21.5&quot;. Magnetic head and base each allow 5 lbs of pickup power. Aluminum alloy body for strength. 3 ultra bright LED lights. Batteries installed, includes a bonus set of spares.</p>\r\n',0,0,1,0,6930,NULL,''),(6424,3223,NULL,NULL,NULL,'Clear Vinyl Food Grade Tubing','Description','<p>\r\n	Our Clear Vinyl Food Grade Tubing is soft, easy to handle, and crystal clear to allow full view of the materials being conveyed. It is non-toxic to handle drinking water. It is also popular for handling chemicals and acids.</p>\r\n<p>\r\n	Constructed of PVC, clear with a blue tint. Smooth, flexible, weather resistant PVC tubing complies with all applicable FDA, 3A, USDA and NSF requirements. Temperature Range: -4C to +60C. Use with compression or insert fittings.</p>\r\n<p>\r\n	Clear Vinyl Food Grade Tubing is priced and sold per foot.</p>\r\n',0,0,1,0,6413,NULL,''),(7125,3037,NULL,NULL,NULL,'Three Way Brass Ball Valve','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">400 psi water, oil, gas. 150 psi steam. Flow can be directed from centre port to either side port.</span></p>\r\n',0,0,1,0,7111,NULL,''),(7126,3040,NULL,NULL,NULL,'Large Diameter Brass Gate Valves','Size','<p>\r\n	200 psi water, oil, gas. 125 psi steam.</p>\r\n',0,0,1,0,6856,NULL,''),(7127,3039,NULL,NULL,NULL,'Brass Swing Check Valve','Size','<p>\r\n	200 psi water, gas. 125 psi steam.</p>\r\n',0,0,1,0,7109,NULL,''),(7124,3037,NULL,NULL,NULL,'Brass Ball Valve with Locking Handle','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">600 psi water, oil, gas, 150 psi steam. Sizes 1/2 &quot; to 2&quot; are CSA approved under classes 3371-92, 3371-12, and 3371-08 for 1/2 psi natural gas.</span></p>\r\n',0,0,1,0,7106,NULL,''),(7114,3106,NULL,2,NULL,'3M Peltor Hard Hat Visor Adapters',NULL,'<p>\r\n	Hard hat adapter for 3M Peltor visors. Snaps easily into most hard hats with universal accessory slots to help provide face protection.</p>\r\n',0,0,1,0,6232,NULL,''),(7120,3108,NULL,NULL,NULL,'First Aid Kit Inspection Tags','Qty','<p>\r\n	Attach these tags to first aid kits to ensure content is current, inspected and ready to go when needed. Make your own record keeping earlier. Printed one side only. 5-1/4&quot; x 2-5/8&quot;.</p>\r\n',0,0,1,0,5179,NULL,''),(7113,3106,NULL,2,NULL,'3M Dark Green Polycarbonate Molded Faceshield',NULL,'<p>\r\n	Standard size molded polycarbonate faceshield helps provide good heat resistance and high impact face protections. Faceshield mounts quickly to any 3M Headgear without tools, snaps or cams. Dark green faceshield helps reduce glare and brightness. High quality - developed for use in metalworking and utilities. Meets the high impact requirements of ANSI Z87.1-2003.</p>\r\n',0,0,1,0,5937,NULL,''),(7111,3106,NULL,2,NULL,'3M Universal Headgear Hard Hat Assembly',NULL,'<p>\r\n	Cap-mounted headgear assembly can be used with any 3M faceshield to help provide face protection while wearing a hard hat. Designed to fit most cap style hard hats. Does not interfere with most cap-mounted ear muffs.&nbsp; Two position system locks shield up and out of place when not in use. Quick change system with no snaps, bands or cams offers easy window replacement. Meets the requirements of ANSI Z87.1-2003.</p>\r\n',0,0,1,0,6231,NULL,''),(7507,3362,NULL,162,NULL,'Ramfan UB20 8-Inch M.E.D Manhole Entry Device',NULL,'<p>\r\n	The M.E.D. allows workers to enter and exit small man-size opening while maintaining continuous ventilation. Without such a device, duct fills the manhole opening, preventing rapid entry and exit. Quick to assemble, and the swiveling elbow makes duct alignment easy.</p>\r\n<p>\r\n	Changing its cross-section from circular to elliptical and back to circular minimizes loss and optimizes airflow into a confined space, while providing adequate room for the worker to enter and exit unimpeded. The rugged polyethylene construction endures heavy, negligent use and will last for years.</p>\r\n<p>\r\n	Comprised of three sections, the M.E.D. itself, swiveling elbow, and universal mount, this system increases safety by maintaining continuous airflow. Blower and ducting sold separately.</p>\r\n',0,0,1,0,7484,NULL,''),(6433,3362,NULL,162,NULL,'Ramfan UB20 8-Inch In-Line Heating System','Duct Length','<p>\r\n	Ramfan\'s UB20 In-Line Heating System with its propane-fired, heat-exchanger provides safe, warm breathing air during cold conditions. System comes complete with blower, heater with regulator, and quick couple revsersible canister duct.</p>\r\n<p>\r\n	For confined space heating applications. Airflow can cycle with heat or run continuous for confined space ventilation. Up to 10 hours of continuous operation with standard propane cylinder tank. Heater attaches quickly and easily to UB20 blower.</p>\r\n<p>\r\n	Includes propane regulator and connection assembly. Easy access to mounted heater control panel. 15 foot (4.6M) power cord w/ IP65 rain tested switch enclosure. 70,000 BTU heater output, 110VAC, 60Hz, 1 Phase, 2.9A Max. 947 CFM blower. CSA and UL compliant.</p>\r\n',0,0,1,0,6422,NULL,''),(7506,3362,NULL,162,NULL,'Ramfan UB20 8-Inch Turbo-Coupler Blower Joiner',NULL,'<p>\r\n	Quick-connecting two or more Ramfan UB20 blowers in series increases airflow up to 50% when blowing through long and winding duct runs.</p>\r\n<p>\r\n	One UB20 blower by itself experiences significant airflow drop-off when blowing through more than 75 feet of duct, or when confronted with multiple turns in the duct.</p>\r\n<p>\r\n	Long, winding duct runs need more power and pressure to deliver sufficient airflow, a costly proposition. The Turbo-Couple delivers what is needed by quickly joining two or more UB20\'s in series, each adding pressure and power to deliver a dramatic airflow increase through the duct. Ventilate through 250 feet.</p>\r\n',0,0,1,0,7483,NULL,''),(6944,3221,NULL,NULL,NULL,'Telescopic LED Inspection Mirrors','Type','<p>\r\n	Classis extension inspection mirror - improved with super-bright LED\'s for dark areas. Easy-to-hold textured soft grip handle provides firm hold even with wet hands. Strong lightweight stainless steel tube shaft extendsn to 34&quot;. The handle itself is non-magnetic and won\'t rust. 3&quot; distortion-free glass is surrounded with a protective bumper. Glass is attached to tube with a double ball joint that swivels and rotates. Batteries included.</p>\r\n',0,0,1,0,6927,NULL,''),(6741,3395,NULL,4,NULL,'Work King s769 Unlined High Visibility Bib Overalls, Navy','Size','<p>\r\n	Fabric: 65% polyester, 35% cotton twill. Bellowed cell phone pocket with flap. Ruler pocket and hammer loop. Front and rear pockets. Adjustable shoulder straps. 3M Scotchlite reflective material w/ 4&quot; yellow backing. Double needle stitching on reflective tape.</p>\r\n',0,0,1,0,7237,NULL,''),(6437,3226,NULL,199,NULL,'Stalworth Premium Navy Work Coveralls, Tall Sizes','Size','<p>\r\n	These pre-shrunk coveralls are made of 7.1 oz. 65% polyester and 35% cotton twill, creating a durable, affordable garment. This blend of fabric is less prone to pilling and static than 100% cotton, while also keeping it\'s shape and color longer. Durable brass 2-way zipper. Front swing pockets. Side vent openings. Reinforced back pockets, Bi-fold back. Crown cuff detailing. Ruler pocket. Elasticized waistband.</p>\r\n',0,0,1,0,6427,NULL,''),(6438,3350,NULL,3,NULL,'Work King 7760 Deluxe Insulated Coverall, Brown','Size','<p>\r\n	Fabric: 10 oz 100% cotton duck. Lining: quilted 6 oz polyester insulation. Waterproof seat and knees. Double knees with knee pad pockets. Detachable hard hat hood (included). Inside pocket and cell pocket. Storm cuffs. Full front zipper: neck to ankle for easy access. Multi-pocket design.</p>\r\n',0,0,1,0,7203,NULL,''),(6439,3400,NULL,229,NULL,'Tough Duck F7740 Unlined Hi-Vis Flame Resistant Nomex IIIA Coverall, Regular Sizes','Size','<p>\r\n	Fabric: 6 oz 93% Nomex, 5% Kevlar, 2% Carbon. 3M Scotchlite FR reflective material with 2&quot; contrast backing. YKK brass FR zippers. Full front zipper. Adjustable snap cuffs and leg bottoms. Action back. Back elastic waist. Multi-pocket design.</p>\r\n<p>\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 5.7 cal/cm2. Hazard Risk Category (HRC) = 1.</p>\r\n',0,0,1,0,6428,NULL,''),(6440,3400,NULL,229,NULL,'Tough Duck F7740 Unlined Hi-Vis Flame Resistant Nomex IIIA Coverall, Tall Sizes','Size','<p>\r\n	Fabric: 6 oz 93% Nomex, 5% Kevlar, 2% Carbon. 3M Scotchlite FR reflective material with 2&quot; contrast backing. YKK brass FR zippers. Full front zipper. Adjustable snap cuffs and leg bottoms. Action back. Back elastic waist. Multi-pocket design.</p>\r\n<p>\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 5.7 cal/cm2. Hazard Risk Category (HRC) = 1.</p>\r\n',0,0,1,0,6429,NULL,''),(6441,3409,NULL,3,NULL,'Work King 7940 Deluxe Lined Bib Overalls, Brown','Size','<p>\r\n	Fabric: 10 oz 100% cotton duck. Lining: quilted 6 oz polyester insulation. Waterproof seat and knees. Double knees with knee pad pockets. 2-way front and leg zippers from ankle to hip with storm flaps and snap closures. Elasticized comfort fit waist. Riveted at stress points. Elasticized adjustable shoulder straps. Hammer loop and ruler pockets. Multi-pocket design.</p>\r\n',0,0,1,0,5243,NULL,''),(6442,3401,NULL,229,NULL,'Tough Duck F7760 Lined Hi-Vis Flame Resistant Nomex IIIA Bib Overall, Royal Blue','Size','<p>\r\n	Fabric: 6 oz 93% Nomex, 5% Kevlar, 2% Carbon. Lining: 100% FR cotton quilted to 7 oz Modacrylic insulation. 3M Scotchlite FR reflective material with 2&quot; contrast backing. YKK brass FR 2-way zippers. 2-way front zipper with storm fly closure. 2-way leg zippers from ankle to hip with protective storm fly closures. Adjustable Nomex IIIA covered elastic shoulder straps. Multi-pocket design. Made in Canada.</p>\r\n<p>\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 28 cal/cm2. Hazard Risk Category (HRC) = 3.</p>\r\n',0,0,1,0,6431,NULL,''),(7676,3402,NULL,229,NULL,'Tough Duck F7750 Lined Hi-Vis Flame Resistant Nomex IIIA Parka, Royal Blue','Size','<p>\r\n	Fabric: 6 oz 93% Nomex, 5% Kevlar, 2% Carbon. Lining: 100% FR cotton quilted to 7 oz Modacrylic insulation. 3M Scotchlite FR reflective material with 2&quot; contrast backing. YKK brass FR zippers. Quick release hard hat hood. 2-way front zipper with protective storm fly closure. Adjustable waist with Nomex drawstring. FR knit storm cuffs. Multi-pocket design. Made in Canada.<br />\r\n	<br />\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 28 cal/cm2. Hazard Risk Category (HRC) = 3.</p>\r\n',0,0,1,0,7653,NULL,''),(6443,3400,NULL,67,NULL,'Forcefield Flame Resistant Bib Overall, Brown','Size','<p>\r\n	12 oz. FR treated 100% cotton duck, 350 GSM. Covered snap fly front. Elastic in straps. One large front bib pocket w/ pencil slot. 2 side pockets &amp; watch pocket. 2 back hip pockets. Ruler pocket and hammer loop. Side vent openings with brass button closures. Riveted at stress points for durability. Meets CGSB standard 155.20.2000 for flame resistance.</p>\r\n',0,0,1,0,6432,NULL,''),(6444,3229,NULL,8,NULL,'Tough Duck 7637 Unlined Bib Overall, Brown','Size','<p>\r\n	Fabric: 12 oz 100% cotton Tough Duck. Elasticized adjustable shoulder straps. Hammer loop and ruler pocket. Brass zipper front closure. Chest pocket with pencil slot. Loss-proof chest pocket for cell phone. Exclusive double front legs.</p>\r\n',0,0,1,0,6709,NULL,''),(6446,3229,NULL,8,NULL,'Tough Duck 7637 Unlined Bib Overall, Black','Size','<p>\r\n	Fabric: 12 oz 100% cotton Tough Duck. Elasticized adjustable shoulder straps. Hammer loop and ruler pocket. Brass zipper front closure. Chest pocket with pencil slot. Loss-proof chest pocket for cell phone. Exclusive double front legs.</p>\r\n',0,0,1,0,7197,NULL,''),(6648,3400,NULL,NULL,NULL,'Neoslick Flame Retardent Neoprene Rubber Bib Overall','Size, Qty Available','<p>\r\n	100% flame retardent neoprene rubber on polyester textile material. Meets and exceeds CGSB Standards C**/CGSB-155.20 for 2 second flame out. Double lapped seam work with industrial adhesives and fully vulcanized seams for maximum durability against most industrial chemicals. Industrial grade rustproof fasteners. Excellent puncture and tear resistance and protection from acids, mildew, fertilizers and industrial chemicals. Pants have heavy-duty suspenders and metal fasteners.</p>\r\n',0,1,0,0,7654,NULL,''),(6956,2048,NULL,NULL,NULL,'Stainless Steel Flange Bolt Sets','Flange Size, Sets Required, Bolt Size X Length','<p>\r\n	Flange bolt sets are packaged for use with PVC, CPVC, PP, and PVDF Schedule 80 IPS pipe systems. Each flange bolt set consists of (1) bolt, (2) flat washers and (1) hex nut. 316 Stainless Steel flange bolt sets are normally used in damp indoor locations that are subject to minor moisture or chemical vapors. These flange bolt sets are the recommended diameter, length and strength for a 150 PSI ANSI flange x flange connection.</p>\r\n',0,0,1,0,4477,NULL,''),(6954,2042,NULL,NULL,NULL,'Galvanized Steel Strapping, 3/4\" X 25 Ft',NULL,'<p>\r\n	Has a wavy design for easy bending. Galvanized steel measures  x 25. Multitude of uses.</p>\r\n',0,0,1,0,7413,NULL,''),(6955,3142,NULL,NULL,NULL,'SDR9 HDPE Pipe, CTS, Coiled','Size','<p>\r\n	200 PSI water service line tubing is available in a convenient, easy to handle coil. Meets NSF specifications. Longer lengths are available.</p>\r\n',0,0,1,0,6938,NULL,''),(7053,2011,NULL,57,NULL,'King Electric PSH1215T Yellow Jacket Mini Portable Heater, 120V',NULL,'<p>\r\n	This King Yellow Jacket Mini Portable Electric Heater is a powerful, portable, durable heat source for garages, shops, construction sites and more.</p>\r\n<p>\r\n	120 volt, 1500 watt portable utility heater has a built-in thermostat (60F to 170F) and an On/Off rocker switch with power indicator. 216 CFM fan. Adjustable tilt control with locking hand nut helps to point the heat exactly where you want it. 6 foot cord with 15A grounded plug. Durable scratch and rust resistant finish. Comfort grip handle for carrying the heater. Auto-reset safety limit ensures the heater shuts off if an unsafe condition occurs. Stainless steel heating element. Permanently lubricated motor ensures long life. Meets cETL requirements.</p>\r\n',1,0,1,0,7036,NULL,''),(7504,3351,NULL,NULL,NULL,'Universal 20 Gallon Emergency Spill Kit',NULL,'<p>\r\n	For all types of spills, including chemical and oil. Polyethylene container measures 23&quot; x 18&quot; x 19&quot;.</p>\r\n<p>\r\n	Includes the following (50) 15&quot; x 17&quot; heavy weight spill pads, (4) 3&quot; x 4 ft spill socks, (2) 8&quot; x 18&quot; spill pillows (1) disposal bag, (1) pair nitrile gloves, (1) pair safety goggles.</p>\r\n',0,0,1,0,7481,NULL,''),(6458,3273,NULL,8,NULL,'Tough Duck G05716 Nitrile All Purpose Glove, 12/pk','Size','<p>\r\n	Textured nitrile palm over seamless nylon knitBreathable stretch knit wrist and back for comfortContour fit for dexterity and gripping powerNitrile palm for puncture, wear and liquid protectionMachine washableSold by the pack of 12</p>\r\n',0,0,1,0,6447,NULL,''),(7612,3275,NULL,8,NULL,'Tough Duck Gi6516 Sure Light Precision Glove','Size','<p>\r\n	Shell: 60% nylon, 40% polyurethane. LED light on both hands. Magnet on back of both hands. Touch pad thumb and finger for use with touch screen devices. Sure grip palm. Sold per pair.</p>\r\n',0,0,1,0,7590,NULL,''),(6460,3255,NULL,165,NULL,'Heavy Duty Aluminum Foil Tape','Length, Qty','<p>\r\n	A long-lasting tape that is resistant to heat, flames, moisture, and most chemicals. Resistant to UV degradation, it is good for harsh, long term indoor or outdoor applications. Use on duct work and fans for a permanent seal.</p>\r\n',0,0,1,0,6490,NULL,''),(6462,3234,NULL,166,NULL,'Dixon 114/2D-TK Trigger Kit for 112D & 114D Nozzles',NULL,'<p>\r\n	Trigger kit for Dixon 112D &amp; 114D nozzles. Includes trigger, pin, cotter pin, and bushing</p>\r\n',0,0,1,0,6451,NULL,''),(6464,3233,NULL,166,NULL,'Dixon SWMF150 Heavy Duty Hose Swivel, 1-1/2\" MNPT X 1-1/2\" FNPT',NULL,'<p>\r\n	Heavy duty internal thrust bearing and anti-friction seal design ensures swiveling at -40F. Swivel can be lubricated without disassembly. Prevents twisting or kinking of hose.</p>\r\n<ul>\r\n	<li>\r\n		<strong>1-1/2&quot; MNPT x 1-1/2&quot; FNPT.</strong></li>\r\n</ul>\r\n',0,0,1,0,6452,NULL,''),(6465,3234,NULL,167,NULL,'Norwesco 60545 Bolted Polypropylene Ball Valve, Standard Port, 2\" FNPT X 1-1/2\" Nozzle',NULL,'<ul>\r\n	<li>\r\n		Manufactured from glass re-inforced, chemically resistant polypropylene for strength and durability - will never rust or corrode.</li>\r\n	<li>\r\n		Self-aligning ball rotates freely against Teflon seats.</li>\r\n	<li>\r\n		Unique body-to-flange design allows for low torque on/off operation.</li>\r\n	<li>\r\n		Viton O-ring stem seal and EPDM O-ring body seal.</li>\r\n	<li>\r\n		Pressure rated at 125 PSI @ 70F.</li>\r\n	<li>\r\n		Tested by air pressure under water.</li>\r\n	<li>\r\n		304 Stainless Steel nuts and bolts.</li>\r\n	<li>\r\n		FDA approved material.</li>\r\n	<li>\r\n		<strong>Standard Port, 2&quot; Female NPT x 1-1/2&quot; Nozzle.</strong></li>\r\n</ul>\r\n',0,0,1,NULL,6453,NULL,''),(6466,3234,NULL,167,NULL,'Norwesco 60544 Bolted Polypropylene Ball Valve, Full Port, 1-1/2\" FNPT X 1-1/2\" Nozzle',NULL,'<ul>\r\n	<li>\r\n		Manufactured from glass re-inforced, chemically resistant polypropylene for strength and durability - will never rust or corrode.</li>\r\n	<li>\r\n		Self-aligning ball rotates freely against Teflon seats.</li>\r\n	<li>\r\n		Unique body-to-flange design allows for low torque on/off operation.</li>\r\n	<li>\r\n		Viton O-ring stem seal and EPDM O-ring body seal.</li>\r\n	<li>\r\n		Pressure rated at 125 PSI @ 70F.</li>\r\n	<li>\r\n		Tested by air pressure under water.</li>\r\n	<li>\r\n		304 Stainless Steel nuts and bolts.</li>\r\n	<li>\r\n		FDA approved material.</li>\r\n	<li>\r\n		<strong>Full Port, 1-1/2&quot; Female NPT x 1-1/2&quot; Nozzle.</strong></li>\r\n</ul>\r\n',0,0,1,NULL,6454,NULL,''),(6467,3234,NULL,167,NULL,'Norwesco 60546 Bolted Polypropylene Ball Valve, Full Port, 2\" FNPT X 2\" Nozzle',NULL,'<ul>\r\n	<li>\r\n		Manufactured from glass re-inforced, chemically resistant polypropylene for strength and durability - will never rust or corrode.</li>\r\n	<li>\r\n		Self-aligning ball rotates freely against Teflon seats.</li>\r\n	<li>\r\n		Unique body-to-flange design allows for low torque on/off operation.</li>\r\n	<li>\r\n		Viton O-ring stem seal and EPDM O-ring body seal.</li>\r\n	<li>\r\n		Pressure rated at 125 PSI @ 70F.</li>\r\n	<li>\r\n		Tested by air pressure under water.</li>\r\n	<li>\r\n		304 Stainless Steel nuts and bolts.</li>\r\n	<li>\r\n		FDA approved material.</li>\r\n	<li>\r\n		<strong>Full Port, 2&quot; Female NPT x 2&quot; Nozzle.</strong></li>\r\n</ul>\r\n',0,0,1,NULL,6455,NULL,''),(6469,3235,NULL,168,NULL,'Tough Guard Commercial Keyed Entry Knob Set',NULL,'<ul>\r\n	<li>\r\n		Satin chrome finish.</li>\r\n	<li>\r\n		Anti-pry shield.</li>\r\n	<li>\r\n		Steel mounting plate provides strength.</li>\r\n	<li>\r\n		5-pin pick-resistant cylinder.</li>\r\n	<li>\r\n		All steel rack and cam mechanism provides long lifetime.</li>\r\n	<li>\r\n		1 hr UL listing.</li>\r\n	<li>\r\n		Meets ANSI/BHMA A156.2, Grade 2 Standards.</li>\r\n	<li>\r\n		For exterior locking applications, Entry door.</li>\r\n</ul>\r\n',0,0,1,NULL,6457,NULL,''),(6471,3236,NULL,168,NULL,'Commercial Satin Chrome Deadbolt',NULL,'<p>\r\n	This heavy duty commercial quality deadbolt provides a maximum deterrent to forced entry. The cylinder rececces into the door to resist blows attempting to move the lock. Satin chrome finish. Extra thick steel mounting plate.</p>\r\n<p>\r\n	High precision pick resistant brass 6-pin tumbler plug &quot;C&quot; meets ANSI Grade 1 Security to prevent key cylinder from being knocked out. Solid steel one-piece security ring insert exceeds ANSI Grade 1 Security against hammer and prying attacks. 1-inch deadbolt with hardened steel core exceeds ANSI Grade 1 Security against kick-in and saw attacks. 1 hour UL listing.</p>\r\n',0,0,1,0,6459,NULL,''),(6472,2038,NULL,24,NULL,'Masterlock 1D Laminated Steelcase Padlock, 1-3/4\" Body Width','Qty','<ul>\r\n	<li>\r\n		Laminated steel body for superior strength.</li>\r\n	<li>\r\n		Hardened steel shackle for extra cut resistance.</li>\r\n	<li>\r\n		4-pin cylinder helps prevent picking.</li>\r\n	<li>\r\n		Dual locking levers provide extra pry resistance.</li>\r\n	<li>\r\n		Proprietary rust proofing for longer life.</li>\r\n	<li>\r\n		<strong>1-3/4&quot; body width.</strong></li>\r\n</ul>\r\n',0,0,1,NULL,6460,NULL,''),(6473,2038,NULL,24,NULL,'Masterlock 3D Laminated Steelcase Padlock, 1-1/2\" Body Width','Qty','<ul>\r\n	<li>\r\n		Laminated steel body for superior strength.</li>\r\n	<li>\r\n		Hardened steel shackle for extra cut resistance.</li>\r\n	<li>\r\n		4-pin cylinder helps prevent picking.</li>\r\n	<li>\r\n		Dual locking levers provide extra pry resistance.</li>\r\n	<li>\r\n		Proprietary rust proofing for longer life.</li>\r\n	<li>\r\n		<strong>1-1/2&quot; body width.</strong></li>\r\n</ul>\r\n',0,0,1,NULL,4378,NULL,''),(6474,2038,NULL,24,NULL,'Masterlock 5D Laminated Steelcase Padlock, 2\" Body Width','Qty','<ul>\r\n	<li>\r\n		Laminated steel body for superior strength.</li>\r\n	<li>\r\n		Hardened steel shackle for extra cut resistance.</li>\r\n	<li>\r\n		4-pin cylinder helps prevent picking.</li>\r\n	<li>\r\n		Dual locking levers provide extra pry resistance.</li>\r\n	<li>\r\n		Proprietary rust proofing for longer life.</li>\r\n	<li>\r\n		<strong>2&quot; body width.</strong></li>\r\n</ul>\r\n',0,0,1,NULL,6461,NULL,''),(6477,3158,NULL,32,NULL,'Hach 2745325 Iron Test Strips (Total Dissolved Iron), 0 - 5 mg/L',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		In domestic water supplies, iron can do great economic damage by staining laundry and porcelain fixtures and by producing an off taste in beverages. In water supplies used for commercial beverage production, low levels of iron are critical. Hach\'s test strips provide the most easily-used method for determining low to mid-range iron concentrations. Technicians in the field can test many samples in only a few minutes and make immediate evaluations on-site. No measuring, set-up, clean-up, or chemical handling are necessary. Hach test strips are also used in laboratories all over the world for pre-test screening-to detect the presence of materials that might interfere with lab testing. Contains 25 tests.</p>\r\n	<ul>\r\n		<li>\r\n			Easy to use, disposable, and inexpensive</li>\r\n		<li>\r\n			A great way to obtain quick, quantitative answers in the field or in the lab</li>\r\n	</ul>\r\n</div>\r\n',0,0,1,0,6465,NULL,''),(6478,3158,NULL,32,NULL,'Hach 2890200 Free Chlorine Test Strips',NULL,'<div id=\"productDescription\">\r\n	<p itemprop=\"description\">\r\n		Hach test strips are manufactured with a unique reagent pad at the tip, using proven chemistries based on standard reference methods. Just dip the strip, wait until color development occurs, and compare the color of the reacted pad to the chart printed on the bottle.&nbsp; Range: 0 to 600 mg/L Cl2. Smallest Increment Steps: Steps: 0, 25, 50, 100, 200, 400, 600</p>\r\n</div>\r\n',0,0,1,0,6466,NULL,''),(7607,3276,NULL,67,NULL,'Forcefield Tactical Black Nitrile Disposable Gloves, 5 mil Thickness','Size, Qty','<p>\r\n	Powder-free. Great strength 5-mil glove. Easy to pull on rolled cuff. Enhanced tensile strength versus latex or vinyl. Textured fingertips for superb gripping ability. Sold 100 gloves per box, or 10 boxes per case.</p>\r\n',0,0,1,0,7584,NULL,''),(6479,2067,NULL,NULL,NULL,'The Sludge Judge Cleaning Brush',NULL,'<p>\r\n	After prolonged use, residue and filmy deposits may build up inside the Sludge Judge. The cleaning brush used with a mild detergent and warm water will help break up these materials and keep the unit clear so accurate sludge readings can be taken. It is made of galvanized steel wire and polyester bristles. Disassemble the unit and clean each section separately. Use for Sludge Judge and Sludge Judge Ultra. 6 ft. x 1&quot; (1.83 m x 2.54 cm) diameter bristle.</p>\r\n',0,0,1,0,5027,NULL,''),(6480,2067,NULL,NULL,NULL,'The Sludge Judge Carrying Case',NULL,'<p>\r\n	Use or carrying the the Sludge Judge, the Sludge Judge II, or the Sludge Judge Ultra. Keeps all the parts together. Holds four 5 foot sentions of any Sludge Judge. Made of cotton canvas.</p>\r\n',0,0,1,0,5029,NULL,''),(6482,2067,NULL,NULL,NULL,'High Density Polyethylene Dipper, 6 Ft',NULL,'<p>\r\n	High-density polyethylene dipper for removing samples from large tanks. Lightweight, easy to use and portable. Has two pour spouts and graduations, PVC grip handle. Polypropylene cup has threaded fittings that screw onto the handle. Two pouring spouts on the 1000 ml dipper make it useful for left or right handed people to pour from either side. Ends are sealed for easy cleaning. Includes a hook for hanging. Dipper is not autoclavable.</p>\r\n',0,0,1,0,6468,NULL,''),(6486,3307,NULL,NULL,NULL,'Clearpac, 23 Kg Pail','Qty','<p>\r\n	Clearpac is NSF certified under NSF/ANSI Standard 60 for coagulation and flocculation at a maximum dosage of 250 mg/L.</p>\r\n<ul>\r\n	<li>\r\n		Sold per 23 kg pail.</li>\r\n</ul>\r\n',0,0,1,1,5427,NULL,''),(6487,3307,NULL,NULL,NULL,'Clearpac, 25 Kg Carboy','Qty','<p>\r\n	Clearpac is NSF certified under NSF/ANSI Standard 60 for coagulation and flocculation at a maximum dosage of 250 mg/L.</p>\r\n<ul>\r\n	<li>\r\n		Sold per 25 kg carboy.</li>\r\n</ul>\r\n',0,0,1,1,5428,NULL,''),(6488,3307,NULL,NULL,NULL,'Clearpac, 255 Kg Drum','Qty','<p>\r\n	Clearpac is NSF certified under NSF/ANSI Standard 60 for coagulation and flocculation at a maximum dosage of 250 mg/L.</p>\r\n<ul>\r\n	<li>\r\n		Sold per 255 kg drum.</li>\r\n</ul>\r\n',0,0,1,1,5429,NULL,''),(6490,3308,NULL,102,NULL,'Nalco PC191T Permatreat , 210L Drum','Qty','<p>\r\n	Permatreat PC-191T is a highly effective scale inhibitor whose active components were developed to treat reverse osmosis (RO) systems. Permatreat PC-191 has shown for over 20 years excellent performance against the following scalants: calcium carbonate, calcium sulfate, barium sulfate, strontium sulfate, calcium fluoride, silica and iron.</p>\r\n',0,0,1,0,5437,NULL,''),(6491,3038,NULL,171,NULL,'Apollo 141 Series Lug Style Butterfly Valves','Size','<p>\r\n	Valves are full lug with tapped lugs, to ANSI 125/150 drilling. Equipped with a stretch-resistant, non-collapsible blowout-proof seat. Design of the seat eliminates the need to use flange gaskets with the valve. 10 position handle. Through shaft assures positive disc positioning and dependable performance. Equipped with a shaft weather seal that prevents external media from entering the shaft bore. Square shaft-to-disc connection provides a robust connection without pins or bolts. Easy maintenance. Three bushings support shaft at three locations to enhance shaft alignment and absorb actuator side thrusts. Precision disc assures bubble-tight shut-off with minimal torque and longer seat life. The shaft diameter is greater than the diameter of the seat\'s shaft hole creating a robust shaft seal. The stiffening ring molded into the seat guards against distortion.</p>\r\n',0,0,1,0,6479,NULL,''),(6767,3292,NULL,65,NULL,'General Pipe Cleaners 75EM2 Flexicore Cable, 3/8\" x 75\'',NULL,'<p>\r\n	3/8&quot; x 75\' Flexicore cable with male &amp; female connectors. For use with the Mini-Rooter Pro &amp; XP and Sewerooter T-3</p>\r\n<p>\r\n	Heavy-gauge wire coiled tightly around 49-strand aircraft-type wire rope and heat treated. Has unequalled strength and the right amount of flexibility.</p>\r\n',0,0,1,0,6750,NULL,''),(6768,3298,NULL,200,NULL,'Leather Welding Chaps, Brown',NULL,'<p>\r\n	Designed to allow even weight distribution on the user to reduce fatigue. Heat and flame resistant leather is made from durable side split cowhide. Straps allow adjustment to fit waist sizes 32&quot; to 44&quot;.</p>\r\n',0,0,1,0,6752,NULL,''),(6769,3292,NULL,65,NULL,'General Pipe Cleaners MRCS Mini-Rooter Cutter Set',NULL,'<p>\r\n	Replacement cutter set for the Mini-Rooter. All heads are made of hardened steel. Includes arrow head, U-cutter head, side cutter blade, and boring gimlet.</p>\r\n',0,0,1,0,6753,NULL,''),(6770,3292,NULL,65,NULL,'General Pipe Cleaners J50 J-Drum with 50HE1 Installed (1/4\" x 50\' cable)',NULL,'<p>\r\n	Make the most out of your exisitng Mini-Rooter by quickly changing your drum to handle smaller line problems. Quickly swap this totally assembled J-drum onto your existing machine to clear 1&quot; to 1-1/2&quot; lines. Flexicore cable is 1/4&quot; diameter x 50\' length. Basin plug head is attached to end of cable.</p>\r\n',0,0,1,0,6754,NULL,''),(6771,3292,NULL,65,NULL,'General Pipe Cleaners J50A J-Drum with 50HE1-A Installed (5/16\" x 50\' cable)',NULL,'<p>\r\n	Make the most out of your exisitng Mini-Rooter by quickly changing your drum to handle smaller line problems. Quickly swap this totally assembled J-drum onto your existing machine to clear 1-1/2&quot; to 2&quot; lines. Flexicore cable is 5/16&quot; diameter x 50\' length. Basin plug head is attached to end of cable.</p>\r\n',0,0,1,0,6755,NULL,''),(6772,3293,NULL,65,NULL,'General Pipe Cleaners 75JH00 Electric Jet Hose, 75\' x 1/8\" ID w/ NPT Male Fittings',NULL,'<p>\r\n	This 1/8&quot; ID Super-Flex hose has the flexibility to get through 1-1/2&quot; and 2&quot; lines and bends up to 75 feet down the line. Has NPT male fittings.</p>\r\n',0,0,1,0,6756,NULL,''),(6773,3293,NULL,65,NULL,'General Pipe Cleaners 150JH1 Electric Jet Hose, 150\' x 1/4\" ID w/ NPT Male Fittings',NULL,'<p>\r\n	This 1/4&quot; ID hose allows you to clean lines 2&quot; through 4&quot; in diameter up to 150 feet away. Has NPT male fittings.</p>\r\n',0,0,1,0,6757,NULL,''),(6774,3293,NULL,65,NULL,'General Pipe Cleaners 200JH2 Electric Jet Hose, 200\' x 3/8\" ID w/ NPT Male Fittings',NULL,'<p>\r\n	This 3/8&quot; ID hose is ideal for clean outs, 4&quot; through 8&quot; floor drains, and septic lines at distances up to 200 feet away. Has NPT male fittings.</p>\r\n',0,0,1,0,6758,NULL,''),(6775,3293,NULL,65,NULL,'General Pipe Cleaners 15 Degree Angle Nozzles for JM-1450','Size','<p>\r\n	Made of hardened stainless steel, these nozzles are designed to pull themselves along the pipe while cleaning the walls along the way, while also handling blockages. Available in 3 different sizes to match your hose. Female NPT threads.</p>\r\n',0,0,1,0,6759,NULL,''),(6776,3293,NULL,65,NULL,'General Pipe Cleaners 15 Degree Angle Nozzles w/ Forward Jet for JM-1450','Size','<p>\r\n	Made of hardened stainless steel, these nozzles are designed to pull themselves along the pipe while cleaning the walls along the way, while also handling blockages. Forward facing nozzle clears lines of grease, sand and ice. Available in 3 different sizes to match your hose. Female NPT threads.</p>\r\n',0,0,1,0,6760,NULL,''),(6777,3293,NULL,65,NULL,'General Pipe Cleaners 30 and 40 Degree Angle Nozzles for JM-1450','Size','<p>\r\n	Made of hardened stainless steel, these nozzles are designed to pull themselves along the pipe while cleaning the walls along the way, while also handling blockages. 1/8&quot; nozzle has 30 degree angle. 1/4&quot; and 3/8&quot; nozzles have 40 degree angle. Available in 3 different sizes to match your hose. Female NPT threads.</p>\r\n',0,0,1,0,6761,NULL,''),(6499,3038,NULL,171,NULL,'Apollo 141 Series Wafer Style Butterfly Valves','Size','<p>\r\n	Valves are full lug with tapped lugs, to ANSI 125/150 drilling.Valves are equipped with a stretch-resistant, non-collapsible blowout-proof seat. Design of the seat eliminates the need to use flange gaskets with the valve. 10 position handle. Through shaft assures positive disc positioning and dependable performance. Equipped with a shaft weather seal that prevents external media from entering the shaft bore. Square shaft-to-disc connection provides a robust connection without pins or bolts. Easy maintenance. Three bushings support shaft at three locations to enhance shaft alignment and absorb actuator side thrusts. Precision disc assures bubble-tight shut-off with minimal torque and longer seat life. The shaft diameter is greater than the diameter of the seat\'s shaft hole creating a robust shaft seal. The stiffening ring molded into the seat guards against distortion.</p>\r\n',0,0,1,0,6486,NULL,''),(7636,3039,NULL,171,NULL,'Apollo 910WE Series Cast Iron Wafer Check Valves','Size','<p>\r\n	The Apollo cast iron wafer check valves provides full flow capabilities. It provides reliable protection against reverse flow. Compatible with ANSI 125# and 150# flanges. Full port. Minimal pressure drop. Spring assisted closing for quicker response. Cold working pressure 200 PSI.</p>\r\n',0,0,1,0,7613,NULL,''),(7346,3272,NULL,67,NULL,'Forcefield Black Nitrile Coated Gloves 12/pk','Size','<p>\r\n	Lightweight and sensitive supported nitrile finish. Seamless nylon interlock liner for ergonomic fit. High degree of flexibility and durability with optimum dexterity. Ventilated back to keep hands col in warm conditions, and ideal alternative to PVC gloves.</p>\r\n',0,0,1,0,7323,NULL,''),(7341,3276,NULL,67,NULL,'Forcefield Rocket Science Heavy-Duty Blue Nitrile Gloves, 8 mil Thickness','Size, Qty','<p>\r\n	Powder-free. Heavy duty 8 mill nitrile for extra durability. Rolled cuff. 12&quot; length. Latex-free. Industrial grade. Sold 50 gloves per box, or 10 boxes per case.</p>\r\n',0,0,1,0,7318,NULL,''),(7342,3273,NULL,67,NULL,'Forcefield Lightweight Knitwrist Palm-Coated with Black Nitrile Gloves, 6/pk','Size','<p>\r\n	Cut-resistant stretch Aramid fibre lined provides a comfortable fit. Excellent protection from nuisance nicls amd abrasion. Excellent choice when working with sharp edged materials and tools. Sure grip in light oil applications. Soil-hiding black palm coating. More economical than Dyneema. Lightweight to minimize hand fatigue.</p>\r\n',0,0,1,0,7319,NULL,''),(7343,3273,NULL,67,NULL,'Forcefield Lightweight Knitwrist Palm-Coated with Blue Latex, 6/pk','Size','<p>\r\n	Cut-resistant stretch Aramid fibre liner provides a comfortable fit. Excelent protection from nuisance nicks and abrasions. Excellent choice when working with sharp edged materials and tools. More economical than Dyneema. Lightweight to minimize hand fatigue.</p>\r\n',0,0,1,0,7320,NULL,''),(7344,3272,NULL,67,NULL,'Forcefield Palm Coated Dot-Grip Gloves, 12/pk','Size','<p>\r\n	100% white polyester, palm coated with black pcs dots. PVC-dotted grip for extra grip and slip resistance.</p>\r\n',0,0,1,0,7321,NULL,''),(7345,3272,NULL,67,NULL,'Forcefield Blue Latex- Palm-Coat, Polyester Knit 12/pk','Size','<p>\r\n	Poly/cotton knit liner fits comfortably and allows air to circulate around the back of the hand. Crinkle latex palm coat allows for great grip capabilities in bith wet and dry work environments. Combines benefits of cut abrasion and puncture resistance at a great price. Best value alternative to premium brands.</p>\r\n',0,0,1,0,7322,NULL,''),(6730,3288,NULL,171,NULL,'Apollo 3/4\" Brass Hose Connection Vacuum Breaker',NULL,'<p>\r\n	Designed to prevent cross connection caused by back siphonage, consisting of a single check valve with atmospheric vacuum breaker vent. Features include: tamper-proof protection, corrosion resistance, and manual drain feature. Maximum working pressure: 125 PSI. Maximum temperature: 180F. ASSE 1011/CSA B64.2 certified.  garden hose threads.</p>\r\n',0,0,1,0,6715,NULL,''),(6731,3288,NULL,171,NULL,'Apollo 3/4\" Brass Hose Connection Vacuum Breaker with Anti-Freeze Drain',NULL,'<p>\r\n	Designed to prevent cross connection caused by back siphonage, consisting of a single check valve with atmospheric vacuum breaker vent. For wall and yard hydrant applications. Features include: tamper-proof protection, corrosion resistance, and anti-freeze automatic drain feature. Maximum working pressure: 125 PSI. Maximum temperature: 180F. ASSE 1011/CSA B64.2 certified.  garden hose threads.</p>\r\n',0,0,1,0,6716,NULL,''),(6504,3144,NULL,NULL,NULL,'Valve Box Key, 1\" Square',NULL,'<p>\r\n	Designed to turn water on or off at a mainline valve. The key has a one inch socket to allow operation of a one inch operating nut. T-handle for torque. 6 feet in length.</p>\r\n',0,0,1,0,6491,NULL,''),(6505,3309,NULL,169,NULL,'EP60 Stainless Steel Cleaner','Qty','<p>\r\n	Triple action cleaner, polisher, and protector. Protects against tarnish and corrosion, leaving behind a protective film to help prevent re-soling. Formulated to remove water spots, smears, and grime. Cleans without streaking, leaving no residue. Works with stainless steel, chrome, copper, brass, aluminum, backed enamel and porcelain.</p>\r\n',0,0,1,0,6492,NULL,''),(6975,3309,NULL,NULL,NULL,'Scale Tamer','Qty','<p>\r\n	A powerful hydrochlorice acid cleaner with unique ingredients to &quot;tame&quot; the potential harm to both product users and surfaces. Safe and odorless product effective for descaling and cleaning. Approved for air transportation.</p>\r\n',0,0,1,1,6958,NULL,''),(6506,3250,NULL,NULL,NULL,'Colored Fleece Shirt Wipers, Compressed Bale, 5 Lbs',NULL,'<ul>\r\n	<li>\r\n		Economical wipers cut from cotton blend sweatshirts.</li>\r\n	<li>\r\n		Thick, soft, and absorbent.</li>\r\n	<li>\r\n		Ideal for heavy duty jobs.</li>\r\n	<li>\r\n		Great for greasy applications.</li>\r\n	<li>\r\n		Excellent for use as a general shop rag.</li>\r\n	<li>\r\n		Sold per 5 pound bale.</li>\r\n</ul>\r\n',0,0,1,0,7533,NULL,''),(6507,3250,NULL,NULL,NULL,'Colored Fleece Shirt Wipers, Compressed Bale, 10 Lbs',NULL,'<ul>\r\n	<li>\r\n		Economical wipers cut from cotton blend sweatshirts.</li>\r\n	<li>\r\n		Thick, soft, and absorbent.</li>\r\n	<li>\r\n		Ideal for heavy duty jobs.</li>\r\n	<li>\r\n		Great for greasy applications.</li>\r\n	<li>\r\n		Excellent for use as a general shop rag.</li>\r\n	<li>\r\n		Sold per 10 pound bale.</li>\r\n</ul>\r\n',0,0,1,0,7534,NULL,''),(7043,3327,NULL,65,NULL,'General Pipe Cleaners I-95 Sectional Cable Machine',NULL,'<p>\r\n	This machine drives 7/8&quot; and 5/8&quot; sections for larger drain work, and even 5/16&quot; cables for smaller drain work. You can switch from 7/8&quot; to 5/8&quot; and back by repositioning the chuck cone. No adapter required. Attach a small drum to the back of the machine to drive smaller cables. Power and convenience are key with the 1/3 HP capacitor type motor. Plenty of torque is provided, but the cable stops rotating when you lift the drive handle to eliminate torque build up. This same drive handle is used to carry the machine. When in use, the four point base ensures rock solid stability.</p>\r\n<p>\r\n	Included with this model is a cutter holder, GFCI cord, cable carrier, six 5/8 X 7-1/2 sections of cable, rear guide hose, and a cutter set.</p>\r\n',1,0,1,0,7026,NULL,''),(6513,3143,NULL,65,NULL,'General Pipe Cleaners Drain Flushers','Size','<p>\r\n	Just attach to garden hose and slide Drain Flusher into drain. Water expands Flusher to size of pipe. Then water pressure pushes stoppage down the line.</p>\r\n<p>\r\n	Equipped with back-flow preventer on the inlet side. Made of tough reinforced nylon to resist punctures. Far more durable than rubber. Narrow profile and internal flat spring help work Drain Flusher around bends.</p>\r\n<ul>\r\n	<li>\r\n		<strong>The 1-1/2 inch model works great with shower or bathtub drains, washer drains, and sink drains.</strong></li>\r\n	<li>\r\n		<strong>The 3 inch model works great with shower or bathtub drains, washer drains, and sink drains.</strong></li>\r\n	<li>\r\n		<strong>The 4 inch model works great with main drains, surface drains and basement drains.</strong></li>\r\n</ul>\r\n',0,0,1,0,6496,NULL,''),(6517,3143,NULL,18,NULL,'Ridgid 62565 One-Piece Flat Sewer Tape, 100 Ft Length, 3/4\" Width, 1/16\" Thick',NULL,'<ul>\r\n	<li>\r\n		For use on drains from 2&quot; to 4&quot;.</li>\r\n	<li>\r\n		Includes carrier for easy transportation.</li>\r\n	<li>\r\n		Has a hand grip, as well as a spear point at one end and roller ball at the other.</li>\r\n	<li>\r\n		100 feet in length, 3/4&quot; in width, 1/16&quot; thick.</li>\r\n</ul>\r\n',0,1,0,0,6507,NULL,''),(6518,3143,NULL,18,NULL,'Ridgid 62595 One-Piece Flat Sewer Tape, 50 Ft Length, 3/4\" Width, 1/8\" Thick',NULL,'<ul>\r\n	<li>\r\n		For use on drains from 4&quot; to 6&quot;.</li>\r\n	<li>\r\n		Includes carrier for easy transportation.</li>\r\n	<li>\r\n		Has a hand grip, as well as a spear point at one end and roller ball at the other.</li>\r\n	<li>\r\n		50 feet in length, 3/4&quot; in width, 1/8&quot; thick.</li>\r\n</ul>\r\n',0,1,0,0,6513,NULL,''),(6519,3143,NULL,18,NULL,'Ridgid 62625 One-Piece Flat Sewer Tape, 100 Ft Length, 1\" Width, 1/8\" Thick',NULL,'<ul>\r\n	<li>\r\n		For use on drains from 4&quot; to 8&quot;.</li>\r\n	<li>\r\n		Includes carrier for easy transportation.</li>\r\n	<li>\r\n		Has a hand grip, as well as a spear point at one end and roller ball at the other.</li>\r\n	<li>\r\n		100 feet in length, 1&quot; in width, 1/8&quot; thick.</li>\r\n</ul>\r\n',0,1,0,0,6954,NULL,''),(6682,3346,NULL,NULL,NULL,'Combination Coupling Spanner Wrench',NULL,'<p>\r\n	Cast aluminum construction. Fits 1-1/2&quot; (38mm) and 2-1/2&quot; (65mm) couplings.</p>\r\n',0,0,1,0,6663,NULL,''),(7695,3340,NULL,NULL,NULL,'Hardcoat Aluminum Fire Hydrant Adapters, Male Fire X Male NPT','Hydrant Connection X Outlet Connection','<p>\r\n	Extruded hardcoated aluminum. Configurations shown are most typical to our local area. Please call for information on all other confirguations.</p>\r\n',0,0,1,0,6659,NULL,''),(7121,3037,NULL,NULL,NULL,'Standard Brass Ball Valve','Size','<p>\r\n	Standard brass ball valves are economical general service valves. They feature chrome plated balls with teflon seats, adjustable packing glands and blowout-proof stems.&nbsp;</p>\r\n<p>\r\n	600 psi water, oil, gas, 150 psi steam. Sizes 1/2 &quot; to 2&quot; are CSA approved under classes 3371-92, 3371-12, and 3371-08 for 1/2 psi natural gas.</p>\r\n',0,0,1,0,7104,NULL,''),(6526,3143,NULL,65,NULL,'General Pipe Cleaners TU4 Telescoping Urinal Auger',NULL,'<p>\r\n	Gets through urinals where other snakes can\'t. A specially designed spring has the toughness and flexibility to negotiate tight urinal bends. Telescoping augers features a 48&quot; spring for clearing stoppages beyond the urinal. Has a rust resistant steel tube and rubber bumper to protect urinal bowls.</p>\r\n',0,0,1,0,5760,NULL,''),(6528,3063,NULL,NULL,NULL,'Watermain Foam Pipe Swabs','Description','<p>\r\n	Used for drying and sweeping of loose debris inside of pipes. Constructed of a dense foam.</p>\r\n',0,0,1,0,6515,NULL,''),(6545,3251,NULL,40,NULL,'Lubriplate SAE20W-20 Non-Detergent Motor Oil','Qty','<p>\r\n	A pure, top quality non-detergent motor oil for use where additive oils are not required or desired. Lubricates bearings and gears in blowers, compressors and sewage pumps. Flows easier than most standard gear oils. Will not foam when agitated by gear and bearing rotation. SAE20W-20. Sold per bottle or by case.</p>\r\n',0,0,1,0,4392,NULL,''),(6546,3251,NULL,40,NULL,'Lubriplate SAE30W Non-Detergent Motor Oil','Qty','<p>\r\n	A pure, top quality non-detergent motor oil for use where additive oils are not required or desired. Lubricates bearings and gears in blowers, compressors and sewage pumps. Flows easier than most standard gear oils. Will not foam when agitated by gear and bearing rotation. SAE30W. Sold per bottle or by case.</p>\r\n',0,0,1,0,5566,NULL,''),(6550,3372,NULL,79,NULL,'Contractor\'s Power Sweep Broom Assembly, Rough Bristles',NULL,'<p>\r\n	Great for heavy debris, stones, etc. For indoor/outdoor use under wet/dry conditions.Assembled broom comes with 60&quot; handle and steel brace. Fiber: stiff synthetic 4-1/2&quot; trim.</p>\r\n',0,0,1,0,4244,NULL,''),(6555,2021,NULL,NULL,NULL,'Blue PVC Layflat Discharge Hose Assemblies w/ Male X Female Camlocks','Size','<p>\r\n	These blue PVC layflat hose assemblies are lightweight and economical hoses that flatten and roll up tightly when not in use. The process used to manufacture these hoses creates a &quot;single wall&quot; construction, where the tube and cover are bonded together through the reinforcement. They are designed for applications where external abuse is limited. These blue PVC layflat hose assemblies are used widely for irrigation, construction, flood protection, and municipal applications.</p>\r\n<p>\r\n	Blue PVC layflat hose has a temperature range of&nbsp; -21C to +51C. These pre-fabricated blue PVC layflat hose assemblies comes complete with aluminum type C (female) and E (male) connectors.</p>\r\n',0,0,1,0,6542,NULL,''),(6564,2020,NULL,66,NULL,'Kanaflex 300 EPDM Suction Hose Assemblies','Size','<p>\r\n	Heavy duty liquid suction hose for use in construction dewatering, liquid wastes, septic hauling, septic tank cleaning, etc. Lightweight &amp; flexible w/ abrasion resistant cover for septic service &amp; general industrial use. Suitable for full vacuum. Temperature Range: -40C to +70C.</p>\r\n',0,0,1,0,6321,NULL,''),(6566,2020,NULL,180,NULL,'Tigerflex Blue Water Low Temperature PVC Hose Assemblies','Size','<p>\r\n	Designed to stay flexible at sub-zero temperatures. Transparent construction allows for visual confirmation of material flow. Suitable for various industrial applications such as construction pumps and septic tanks. Suitable for full vacuum. Temperature Range: -40C to +65C.</p>\r\n',0,0,1,0,4180,NULL,''),(7657,3299,NULL,NULL,NULL,'6 Mil Vapour Barrier',NULL,'<p>\r\n	This is a special purpose construction film to be used as a long lasting vapour barrier within wall cavities and is designed to exceed the criteria specified in C.G.S.B. Standard CAN/CGSB-51.34-M86. 120&quot; X 100\' roll.</p>\r\n',0,0,1,0,7634,NULL,''),(6885,3111,NULL,NULL,NULL,'Small Utility Round Blade Shovel',NULL,'<p>\r\n	Only 28&quot; inches from tip of blade to end of handle, this small shovel is great for use in tight spaces. Cushion comfort grip at end of handle. Fiberglass handle is unaffected by moisture and temperature, it will not shrink or swell. It will not conduct electricity or be harmed by chemicals.</p>\r\n',0,0,1,0,6868,NULL,''),(6688,3057,NULL,191,NULL,'Komelon Closed Reel Fiberglass Measuring Tapes','Length','<p>\r\n	Metric and standard. Tough, flexible, electrically safe, non-conducting tape. ABS resin case with hand strap. Flush holding handle, steel claw included.</p>\r\n',0,0,1,0,5813,NULL,''),(6592,3284,NULL,120,NULL,'Gilmour Flexogen 8 Ply Garden Hose','Size','<p>\r\n	8 ply construction. Over 500 PSI burst strength. Lightweight, coils and handles easily in all weather. Flow Guard Plus protective collar on 5/8&quot; hoses resists kinks at faucet. Heavy duty, crush resistant, Full-Flo brass couplings in 5/8&quot; and 3/4&quot; with built-in washers for tight sealing. Maximum hose kink resistance. Polished surface resists abrasions, stains and mildew.</p>\r\n',0,0,1,0,6123,NULL,''),(6911,3284,NULL,NULL,NULL,'Garden Hose Fog Nozzle',NULL,'<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13.333333969116211px; line-height: 15.989583969116211px;\">Garden hose threaded thermoplastic combination fog nozzle with bumper. Adjustable from straight stream to fog to shutoff. Rated for up to 150 PSI and for uses in most industrial applications, including washdown and other similar usages.</span></p>\r\n',0,0,1,0,6894,NULL,''),(6912,3284,NULL,NULL,NULL,'Garden Hose Y-Connector with Valves',NULL,'<p>\r\n	Great for converting a single head faucet into a dual head faucet for multiple uses. All brass construction with brass valve handles.</p>\r\n',0,0,1,0,6895,NULL,''),(6913,3284,NULL,NULL,NULL,'Brass Garden Hose Shut-Off Coupling',NULL,'<p>\r\n	Adjusts water flow from off to full flow. Solid brass construction.&nbsp;</p>\r\n',0,0,1,0,6896,NULL,''),(6914,3284,NULL,NULL,NULL,'Garden Hose Mender',NULL,'<p>\r\n	Fits 5/8&quot; or 3/4&quot; garden hoses. Ideal for making quick repairs.</p>\r\n',0,0,1,0,6897,NULL,''),(6915,3177,NULL,NULL,NULL,'12\" X 12\' Canvas Ducting for Portable Indirect Heaters',NULL,'<p>\r\n	Designed to deliver indirect-fired preheated air from heaters to various temporary and permanent shelters. Withstands temperatures from -60F to 300F. Canvas is treated to resist mildew, rot, water, and flames. Duct is wire reinforced to prevent collapsing and to support bending. Multiple lengths can be combined to reach desired length.</p>\r\n',0,0,1,0,6898,NULL,''),(6594,3330,NULL,57,NULL,'King Electric Radiant Pump House Heaters, U-Series, Stainless Steel','Volts, Watts','<p>\r\n	120 Volts, 500 Watts. These heaters are designed to keep mechanical equipment such as pumps, valves, and other machinery from freezing. Having the radiant heat absorbed by the metal equipment makes this heater more effective than convection heaters. The built-in thermostat turns off when the ambient temperature is safely above freezing. 304 Stainless Steel construction helps prevent corrosion associated with high moisture locations like pump houses. A steel guard helps keep foreign objects away from the element. This heater is simple and reliable with no moving parts to wear out or maintain, making it an inexpensive choice for freeze protection. Able to mount horizontally or vertically! Meets cETL requirements.</p>\r\n',0,0,1,0,6404,NULL,''),(7054,2011,NULL,57,NULL,'King Electric PSH2440TB Yellow Jacket Junior Portable Heater, 240V',NULL,'<p>\r\n	This King Yellow Jacket Junior Portable Electric Heater is a powerful, portable, durable heat source for garages, shops, construction sites and more.</p>\r\n<p>\r\n	240 Volt, 1 Phase, 4000W portable utility heater has a built-in thermostat (60F to 170F) and an On/Off rocker switch. Auto Fan Delay increases efficiency. 460 CFM fan. SureStop high-limit temperature control with manual reset provides overheat protection. 6 foot cord with 20A 250 VAC NEMA #6 plug. Comfort grip handle for carrying the heater; can also be used as a reel for the power cord. Durable scratch and rust resistant finish. Stainless Steel heating element. Permanently lubricated motor ensures long life. Includes mounting bracket for wall or ceiling installation. Mounting bracket allows 360 rotation of the unit. Meets cETL requirements.</p>\r\n',0,0,1,0,7037,NULL,''),(6605,3262,NULL,44,NULL,'Polypropylene Graduated Cylinders','Size','<p>\r\n	Polypropylene construction of both cylinder and base. All sizes have generous pour spout, large molded-in, and easy-to-read graduations. Can be chemically sterilized without affecting accuracy. Autoclavable, but accuracy will be adversely affected. Cylinders meet accuracy requirements of ASTM Class B, E1272, ISO Standard 6706, and CFR 21, Part 177.1520.</p>\r\n',0,0,1,0,7569,NULL,''),(7588,3262,NULL,43,NULL,'Pyrex Glass Erlenmeyer Flasks, 1000 ml','Qty','<p>\r\n	Graduated glass flask with narrow mouth and heavy-duty rim. Durable graduations indicate approx. volume.</p>\r\n<p>\r\n	These 1000 ml flasks are sold per each or case of 2.</p>\r\n',0,0,1,0,6593,NULL,''),(7589,3262,NULL,NULL,NULL,'Polypropylene Erlenmeyer Flasks, 125 ml','Qty','<p>\r\n	Polypropylene flask for general laboratory use. Rugged, excellent chemical resistance, and autoclavable.</p>\r\n<p>\r\n	These 125 ml flasks are sold per each or case of 12.</p>\r\n',0,0,1,0,7563,NULL,''),(6612,3261,NULL,155,NULL,'Non-Mercury Wide Angle Float Switch, Piggyback Plug','Float Switch Cable Length','<p>\r\n	The Tulsar Piggyback Wide Angle Float Switch is used to directly control fractional horsepower sump, sewage and effluent pumps under 13 amps. Converts any 120 Volt pump to fully automatic operation. Simply plug the pump power cord into the back end of the float switch plug, then plug this coupled plug into any 120 Volt outlet.&nbsp; When the float switch tilts up, the pump operates. When the water level is lowered, the float switch tilts downwards and the pump shuts off. This float switch contains a non-mercury mechanical switch encapsulated within a waterproof plastic casing that is freely suspended at the desired height from its own cable. CSA Certified and UL Listed.</p>\r\n',0,1,0,0,7450,NULL,''),(6613,2043,NULL,NULL,NULL,'Schedule 80 PVC Blind Flange','Size','<ul>\r\n	<li>\r\n		Sch 80 PVC blind flanges are NSF Listed for potable water services.</li>\r\n</ul>\r\n',0,0,1,0,4440,NULL,''),(6614,2043,NULL,NULL,NULL,'Schedule 80 PVC Reducer Coupling, Socket','Size','<ul>\r\n	<li>\r\n		These schedule 80 PVC reducer couplings are socketed for solvent welding on each end.</li>\r\n	<li>\r\n		Sch 80 PVC reducer couplings are NSF Listed for potable water services.</li>\r\n</ul>\r\n',0,0,1,0,4432,NULL,''),(6615,3037,NULL,182,NULL,'Colonial Commercial NSF-61 True Union Ball Valve','Size','<p>\r\n	The Commercial Series answers the need for a high quality, economically priced, true union ball valve. Thermoplastic design eliminates process and atmospheric corrosion. Certified to NSF-61. Pressure rating: 235 PSI, non-shock water at 73F. Includes both socket and threaded end connectors. O-rings are EPDM.</p>\r\n',1,0,1,0,4456,NULL,''),(6616,3037,NULL,182,NULL,'Colonial Vented Full Block True Union Ball Valve for Sodium Hypochlorite','Size','<p>\r\n	For Sodium Hypochlorite (Bleach) and other chemical process applications where entrapped fluids may cause plating, and may form a build up of gasses in the ball and body of the valve in the closed position, the vented ball valve provides a solution for the application (see illustration). Premium quality valves are suited for the most demanding environments. Includes socket &amp; threaded end connectors. Has the same features as the normal Full Block Industrial valves. Pressure rated up to 235 PSI, non-shock water at 73<span class=\"st\"></span> F. Rated for vacuum service to 26 in Hg with less than 1 in Hg loss. Ball is vented to the pressure (upstream) port allowing the interior of the ball and body to remain wetted to prevent the occurence of decomposition and plating.</p>\r\n<p>\r\n	<img alt=\"\" src=\"/resources/pages/Colonial Vented Full Block True Union Ball Valve.jpg\" style=\"width: 250px; height: 363px;\" /></p>\r\n',0,0,1,0,6600,NULL,''),(6624,3365,NULL,NULL,NULL,'Orange Traffic Safety Cones with Reflective Collars','Description','<p>\r\n	Reflective collar provides increased visibility of cone at night. Stackable design for easy transport and storage. Durable PVC construction withstands bad weather and bad drivers. Weighted base.</p>\r\n',0,0,1,0,5602,NULL,''),(6625,3365,NULL,NULL,NULL,'Orange Traffic Safety Cones','Description','<p>\r\n	Stackable design for easy transport and storage. Durable PVC construction withstands bad weather and bad drivers. Weighted base.</p>\r\n',0,0,1,0,5607,NULL,''),(7011,3366,NULL,160,NULL,'MEGA Industrial Hydraulic Bottle Jacks','Description','<p>\r\n	Designed for industrial users. Fitted with safety valve to prevent overloading - allows up to 50% over rated capacity. The base, pressure cylinder and oil reservoir form one integral part to provide greater strength and safety. Will withstand tilting of load as piston does not have contact with the cylinder. Can be used in vertical or horizontal position (in horizontal position the handle must be positioned below the cylinder).</p>\r\n',0,0,1,0,4004,NULL,''),(6656,3390,NULL,67,NULL,'Forcefield High Visibility Safety T-Shirt, Orange','Size','<p>\r\n	V-neck, short sleeves. 100% polyester fabric provides comfort and wicking. Reflective tape w/ contrast backing in 4&quot; configuration meets CSA Z96-09 Class 2 Level 2</p>\r\n',0,0,1,0,6104,NULL,''),(6657,3392,NULL,67,NULL,'Forcefield High Visibility Long-Sleeve Safety Shirt, Orange','Size','<p>\r\n	V-neck, long sleeves. 100% polyester fabric provides comfort and wicking. Reflective tape w/ contrast backing in 4&quot; configuration meets CSA Z96-09 Class 2 Level 2</p>\r\n',0,0,1,0,7719,NULL,''),(6659,3389,NULL,67,NULL,'Forcefield High Visibility Safety Hoodie, Orange','Size','<p>\r\n	Full front zip hoodie. Deluxe 320G heavy-duty polyester jersey knit. Reflective tape in 4&quot; contrast configuration meets CSA Z96-09 Class 2 Level 2. Front kangaroo pockets. Rib-knit cuffs and heavy-duty knit covered elastic hem</p>\r\n',0,0,1,0,7722,NULL,''),(7713,3292,NULL,65,NULL,'General Pipe Cleaners P-MX-A Maxi-Rooter',NULL,'<p>\r\n	The Maxi-Rooter combines root cutting power and big stoppage capacity in a surprisingly portable machine. A heavy-duty  HP motor with capacitor start and over-load protection drives a drum that can hold 125 ft of  cable for 4 to 10 lines, or 150 ft of 5/8 cable for 3 to 6 lines. Runs on power from any standard 120V wall outlet.</p>\r\n<p>\r\n	<br />\r\n	Rolls on 10 ball-bearing semi-pneumatic wheels and has V-belt stair climbers. Only 23 inches wide - fits through most doorways. Truck loading wheel on handle allows for one person loading. Removable drum for even easier loading.</p>\r\n<p>\r\n	<br />\r\n	Power cable feed both feeds and retracts the cable from the line. Without reversing cable rotation you can instantly alter feeding speed to match the resistance in the line. Chew into stoppages as slowly as one inch per minute and retract the cable as quickly as twenty feet per minute.</p>\r\n<p>\r\n	<br />\r\n	Comes complete with a guide tube, 100 of  cable, and a cutter set.</p>\r\n',0,0,1,0,7690,NULL,''),(6663,3279,NULL,189,NULL,'Impacto Eliminator Premium Gel Knee/Shin Protector',NULL,'<p>\r\n	Knee and shin combination is padded with injected gel and PU foam. Pressure dispersing all terrain cover provides maximum lower leg protection for serious kneeling jobs. Innovative sliding lower strap easily adjusts to fit different calf sizes. Unique calf muscle fastening design eliminates uncomfortable straps from behind the knee. Straps are positioned above and below the calf muscle to hold kneepads securely in place. One size fits all.</p>\r\n',0,0,1,0,6648,NULL,''),(6664,3279,NULL,189,NULL,'Impacto Premium Gel Comfort Knee Pads',NULL,'<p>\r\n	All-terrain gel kneepads. Donut shaped gel filled padding provides cushioning and shock absorption to the patella bone. Sewn-on cover helps prevent debris from entering. Elevated face for improved stability and traction. Extended feet absorb pressure around the perimeter of the knee. Extended heel supports the shin and helps distribute body weight and reduce stress on the ankles. Dual straps, breathable mesh lower strap and upper elastic strap for added stability. Hook and loop closures. One size fits all.</p>\r\n',0,0,1,0,6649,NULL,''),(7615,3268,NULL,217,NULL,'Dunlop Purofort Thermo+ Black Full Safety Winter Work Boot','Size','<p>\r\n	The Dunlop Purofort Thermo+ is the ideal boot for challenging low temperature work environments.</p>\r\n<p>\r\n	Insulated down to -50<span class=\"st\">C, this boot is a superior choice for workers in winter. The extra thick sole retains heat better than other boots, while also displaying the highest certified slip resistance. The heat retaining sole keeps workers comfortable while the shock absorbing heel and flexible upper allow for ease of movement. Purofort material technology gives the boot its lightweight and durability. </span></p>\r\n<p>\r\n	<span class=\"st\">Has a steel sole and midsole to meet CSA requirements. Also meets electric shock resistance (ESR).</span></p>\r\n',0,0,1,0,7592,NULL,''),(6670,3073,NULL,NULL,NULL,'Galvanized Screw Pin Anchor Shackles','Nom. Size, WLL (Tons)','<p>\r\n	Powder coated alloy pin. 6:1 WLL safety factor. Forged - quenched &amp; tempered. Size stamped on shackle. Exceeds ASME B30.26 requirements.</p>\r\n',0,0,1,0,5947,NULL,''),(7778,3409,NULL,8,NULL,'Tough Duck 7537 Insulated Bib Overall, Navy','Size','<p>\r\n	Fabric 12 oz 100% cotton Tough Duck. Lining: quilted 6 oz polyester insulation. Seam-sealed waterproof seat. Wateproof double knees. Exclusive double front legs. Heavy-duty 2-way leg zippers from ankle to hip. Elasticized adjustable shoulder straps. Chest pocket with pencil slot. Loss-proof chest pocket for cell phone. Elasticized back waist. Turned under hem allows for 3&quot; tall extension. Made in Canada.</p>\r\n',0,0,1,0,7198,NULL,''),(7692,3347,NULL,NULL,NULL,'Black Dragon Rubber Industrial Fire Hose Assemblies w/ Instantaneous Ends','Size','<p>\r\n	Black Dragon is manufactured using a unique process which incorporates the inner tube, reinforecment, and outer cover into a single &quot;solid wall&quot; hose. The reinforcement, a seamless, woven, high-tenacity polyester, is embedded in black nitrile/ PVC blend rubber. This gives the hose the same tough, abrasion, oil and weather resistant properties. Temperature Range: -30C to 70C. Hose comes assembled with aluminum instantaneous forestry ends.</p>\r\n',0,0,1,0,6669,NULL,''),(7693,3347,NULL,NULL,NULL,'Pureflex High Purity Potable Water By-Pass Hose','Sold Per','<p>\r\n	Pureflex is designed for use where water main service is disrupted and temporary bypass hoses are used to supply drinking water to homes and businesses. The tube compound meets the toughest standards for potable water applications and will not transfer an odor or taste to the water. In addition, the tube is less porous than rubber, and therefore is easier to flush and clean after use and prior to re-use. The heavy-duty construction limits kinking in hot weater and provides extra resistance to external wear and abuse.</p>\r\n<p>\r\n	Tube is constructed of smooth, white, silicone-free PVC compound that complies with FDA (CFR title 21, parts 170-199) and NSF-61. Reinforced with spiral layers of high tensile yarn. Smooth, blue abrasion and weather resistant PVC compound. Temperature range of -25C to 65C. 250 PSI at 20C, 110 PSI at 50C. 3/4&quot; inside diameter. Sold per foot or per 500 foot roll.</p>\r\n',0,0,1,0,7181,NULL,''),(6684,3363,NULL,NULL,NULL,'Semi-Automatic Hose Rack Assemblies','Size','<p>\r\n	UL/ULC Listed and FM Approved red swing rack assembled with 1.5&quot; x 3&quot; black nipple, locknut, 1.5&quot; rack hose with brass couplings and 1.5&quot; cast brass combination fog nozzle. All fittings are NPSH threaded. The hose rack assembly is a Class II Service and is an immediate and readily available means of controlling and suppressing fire by one person. The semi-automatic swing rack with 25 moveable pins feature an automatic release mechanism, keeping water out of the hose (when valve is open) until the last fold is released.</p>\r\n',0,0,1,0,4239,NULL,''),(6689,3267,NULL,186,NULL,'Cofra Franklin Black Breathable Safety Shoe, Non-Metallic Toe & Plate','Size','<p>\r\n	Air Freedom upper is breathable and abrasion resistant, providing maximum ventilation. Also has a soft, breathable textile lining and a soft footbed for maximum comfort. Non-marking outsole. Gel insert guarantees stability and comfort even on the most difficult surfaces. CSA/ASTM approved.</p>\r\n',0,0,1,0,5389,NULL,''),(6761,3298,NULL,NULL,NULL,'Leather Welding Jacket, Brown','Size','<p>\r\n	Sidesplit cowhide. Riveted Kevlar-sewn seams. Reinforced snap front. Inside chest pocket. Adjustable snap cuffs.</p>\r\n',0,0,1,0,6745,NULL,''),(6690,3167,NULL,192,NULL,'Drum Hand Truck for Loading/Unloading Pallets',NULL,'<p>\r\n	Rear wheels make this truck ideal for loading drums on and off of pallets, or for going over curbs or other uneven obstacles. Truck stands upright both loaded and unloaded. 1 inch diameter handle provides control and leverage and is double welded to the husky 1-1/4 frame. Durable blue enamel finish. Handles drums from as small as 18&quot; to 25&quot; in diameter. Capacity: 1000 lbs. Solid rubber 10 inch front and 6 inch rear wheels.<span id=\"cke_bm_85E\" style=\"display: none;\">&nbsp;</span></p>\r\n',1,0,1,0,6675,NULL,''),(6691,3167,NULL,192,NULL,'5 Gallon Pail Tipper',NULL,'<p>\r\n	Handles 5 gallon round pails. Safety lock holds container securely. Dispensing height of 10 inches. Folds for easy storage. Capacity of 75 lbs.</p>\r\n',0,0,1,0,6676,NULL,''),(6692,3167,NULL,NULL,NULL,'5 Gallon Pail Heater',NULL,'<p>\r\n	5 gallon heater is suitable for use with plastic and metal pails. For light duty applications like increasing the flow of viscous liquids or heating water. Aluminised construction. Adjustable strap clamp allows heater to fit pails with straight or tapered sides from 9-1/2&quot; to 12&quot; in diameter. 120 volts, 100 watts. 6 ft power cord with three pin grounded plug. Meets CSA approvals.</p>\r\n',0,0,1,0,6677,NULL,''),(6693,3167,NULL,NULL,NULL,'45 Gallon Drum Heater',NULL,'<p>\r\n	Specifically designed to heat materials contained in polyethylene (plastic) drums. Pre-set bimetal thermostat is mounted directly on 9&quot; heating band, activated with on/off switch. Heat delivered to drum does not exceed 165F. On/off indicator light. 120 volts, 800 watts. Drum diameter: 22-1/2&quot;. Meets CSA approvals.</p>\r\n',0,0,1,0,6678,NULL,''),(6694,3167,NULL,NULL,NULL,'Multi-Purpose Overhead Drum Lifter',NULL,'<p>\r\n	Simple three-arm design allows for safe lifting of closed head 30 to 55 gallon steel, plastic, and fibre drums with top lips. Each removable arm also functions as a wrench for use on different drum plugs, faucets, and rim ring bolts. Lifts drums up to 800 lb capacity. Powder coated finish for durability.</p>\r\n',0,0,1,0,6679,NULL,''),(6695,3167,NULL,NULL,NULL,'2 Ton Quick Lift Shop Crane',NULL,'<p>\r\n	Boom extends from 37-1/2 to 56 in. Ram capacity is 8 tons. Max boom height: 1/2 ton - 93 in, 1 ton - 89 in, 1-1/2 ton - 85 in, 2 ton - 81-1/4 in. Combine with a Multi Purpose Overhead Drum Lifter or Polyester Drum Sling to create a simple, yet economical drum lifting device.</p>\r\n',0,0,1,0,6680,NULL,''),(6696,3127,NULL,193,NULL,'Professional Heavy-Duty 6 Drawer Tool Chest',NULL,'<p>\r\n	Double wall steel construction. Full extension ball bearing slides on all drawers. Extruded aluminum drawer handle trim. Non-slip drawer liners included. High gloss powder coat scratch resistant paint. Each drawer has a 75 lb capacity. Unit measures 26&quot; x 18&quot; x 19&quot;. Fits on top of Aurora 7 Drawer Tool Cart. 5 year limited warranty.</p>\r\n',0,0,1,0,5818,NULL,''),(6716,3124,NULL,71,NULL,'10 Piece Jumbo Metric Combination Wrench Set',NULL,'<p>\r\n	Wrenches constructed of chrome vanadium steel. Nylon-backed vinyl roll. Contains the following sizes:</p>\r\n<ul>\r\n	<li>\r\n		33, 34, 36, 38, 41, 42, 44, 46, 48, 50mm.</li>\r\n</ul>\r\n',0,0,1,0,5802,NULL,''),(6717,3124,NULL,71,NULL,'24 Piece SAE/Metric Combination Wrench Set',NULL,'<p>\r\n	Drop forged steel, hardened, tempered, and chrome plated. Supplied in fabric backed vinyl roll. Includes the following sizes:</p>\r\n<p>\r\n	<u><strong>SAE</strong></u></p>\r\n<ul>\r\n	<li>\r\n		1/4, 5/16, 3/8, 7/16, 1/2, 9/16, 5/8, 11/16, 3/4, 13/16, 7/8, 1&quot;</li>\r\n</ul>\r\n<p>\r\n	<u><strong>Metric</strong></u></p>\r\n<ul>\r\n	<li>\r\n		6, 7, 8, 9, 10, 11, 12, 13, 14, 17, 19, 22mm</li>\r\n</ul>\r\n',0,0,1,0,5118,NULL,''),(6718,3065,NULL,196,NULL,'ALLPRO Left Cut Aviation Tin Snips',NULL,'<p>\r\n	Laborsaving design for easier cutting. High tensile strength center fastener for longer life. High torsional strength spring for longer life. Solid and comfortable handle with non-slip design. Stable bite prevents slipping. Chrome-Molybdenum alloy steel forged blades for greater strength and longer durability. Hang up hole for convenient storage. Quick and simple spring-free automatic latch design (one hand release) provides safety and convenience.</p>\r\n',0,0,1,0,5134,NULL,''),(6719,3065,NULL,196,NULL,'ALLPRO Right Cut Aviation Tin Snips',NULL,'<p>\r\n	Laborsaving design for easier cutting. High tensile strength center fastener for longer life. High torsional strength spring for longer life. Solid and comfortable handle with non-slip design. Stable bite prevents slipping. Chrome-Molybdenum alloy steel forged blades for greater strength and longer durability. Hang up hole for convenient storage. Quick and simple spring-free automatic latch design (one hand release) provides safety and convenience.</p>\r\n',0,0,1,0,5136,NULL,''),(7214,3408,NULL,8,NULL,'Tough Duck 1737 Hydro Parka, Navy','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Fabric: 12 oz 100% cotton Tough Duck</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px; vertical-align: baseline; color: rgb(84, 84, 84);\"> Lining: quilted 8 oz polyester insulation. Laydown corduroy collar. Detachable and adjustable hard hat hood. Knit storm cuffs. 4 large scoop pockets. Inside drawstring waist. Inside pocket and cell pocket. Made in Canada.</span></p>\r\n',0,0,1,0,6096,NULL,''),(7213,3408,NULL,8,NULL,'Tough Duck 1737 Hydro Parka, Black','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Fabric: 12 oz 100% cotton Tough Duck</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px; vertical-align: baseline; color: rgb(84, 84, 84);\"> Lining: quilted 8 oz polyester insulation. Laydown corduroy collar. Detachable and adjustable hard hat hood. Knit storm cuffs. 4 large scoop pockets. Inside drawstring waist. Inside pocket and cell pocket. Made in Canada.</span></p>\r\n',0,0,1,0,6093,NULL,''),(6725,3226,NULL,199,NULL,'Stalworth Premium Navy Shop Coats','Size','<p>\r\n	These generously sized shop coats offer protective coverage over your clothing while on the job. Quality textile 10.5 oz polycotton twill material will withstand industrial laundering. Features 4 pockets on front, snap front closures, and quality reinforced seam work on all stress points.</p>\r\n',0,0,1,0,6710,NULL,''),(6727,2068,NULL,32,NULL,'Hach Deionized Water, 500 ml 27248','Qty','<p>\r\n	Much preferred over tap water when cleaning glassware as its purity ensures glassware will not stain. Used to confirm turbidimeter function. Also used to create pH buffer solution when combined with pH powder buffer solution. Four times as pure as distilled water. Sold individually or per case of 6.</p>\r\n',0,0,1,0,5031,NULL,''),(6728,2068,NULL,32,NULL,'Hach Deionized Water, 100 ml 27242','Qty','<p>\r\n	Much preferred over tap water when cleaning glassware as its purity ensures glassware will not stain. Used to confirm turbidimeter function. Also used to create pH buffer solution when combined with pH powder buffer solution. Four times as pure as distilled water. Sold individually or per case of 8.</p>\r\n',0,0,1,0,5026,NULL,''),(6729,3049,NULL,65,NULL,'General Pipe Cleaners SV-A-WC Super-Vee',NULL,'<p>\r\n	The Super-Vee offers you a complete system for cleaning drain lines through 3&quot; in diameter. Dyna-Thrust bearing system helps carry the weight of the drum, signifigantly reducing wear on the motor shaft bearing and extending the life of the tool, up to a decade or more.</p>\r\n<p>\r\n	Slide Action Grip Shield allows you to release or engage the cable without the need for a chuck, and with automatic adjustment for different cable diameters. As a result, you get your cable into the line faster, pull it out faster, and have full control at all times. Handling is easy and comfortable.</p>\r\n<p>\r\n	To switch to a different diameter cable, you just loosen three screws, pull the front of the drum off the cable, and load another cartridge. Changing takes less than a minute, and turns what could be a messy job into a clean one.</p>\r\n<p>\r\n	Includes a carrying case, 25 feet of 1/4&quot; cable, 25 feet of 3/8&quot; cable, various cutters, and an extra cartridge.</p>\r\n',0,0,1,0,6714,NULL,''),(6778,3293,NULL,65,NULL,'General Pipe Cleaners Spring Leader Nozzles for JM-1450','Size','<p>\r\n	Made of hardened stainless steel, these nozzles are designed to pull themselves along the pipe while cleaning the walls along the way, while also handling blockages. They are able to go around sharp bends. Available in 3 different sizes to match your hose. Female NPT threads.</p>\r\n',0,0,1,0,6762,NULL,''),(6779,3293,NULL,65,NULL,'General Pipe Cleaners Rotary Nozzles for JM-1450','Size','<p>\r\n	Made of hardened stainless steel, the heavy duty JN-RB nozzles have two 90 degree jets to scour the walls of the pipe, and two 35 degree jets to drive the hose down the line. The less expensive JN-RA nozzles have two 45 degree jets for combined thrust and cleaning action.&nbsp; Available in 1/4&quot; only. Female NPT threads.</p>\r\n',0,0,1,0,6763,NULL,''),(6780,3293,NULL,65,NULL,'General Pipe Cleaners SWA-1500 Spray Wand Assembly for JM-1450',NULL,'<p>\r\n	Get a spray wand and use your jet for high pressure washing and cleaning applications. Spray wands are made from durable components. The triggers have a light touch, yet can withstand tough usage. The wands are insulated and can be used with a down stream soap injector. Assembly includes 30 feet of high pressure spray hose, trigger &amp; lance, and a 25 degree adjustable nozzle.</p>\r\n',0,0,1,0,6764,NULL,''),(6781,3295,NULL,65,NULL,'General Pipe Cleaners 100EM3A Flexicore Cable, 9/16\" x 100\'',NULL,'<p>\r\n	9/16&quot; x 100\' Flexicore cable with male &amp; female connectors. For use with the Metro-Rooter.</p>\r\n<p>\r\n	Heavy-gauge wire coiled tightly around 49-strand aircraft-type wire rope and heat treated. Has unequalled strength and the right amount of flexibility.</p>\r\n',0,0,1,0,6765,NULL,''),(6782,3295,NULL,65,NULL,'General Pipe Cleaners 75EM4 Flexicore Cable, 5/8\" x 75\'',NULL,'<p>\r\n	5/8&quot; x 75\' Flexicore cable with male &amp; female connectors. For use with the Metro-Rooter, Speedrooter 92, and the Maxi-Rooter.</p>\r\n<p>\r\n	Heavy-gauge wire coiled tightly around 49-strand aircraft-type wire rope and heat treated. Has unequalled strength and the right amount of flexibility.</p>\r\n',0,0,1,0,6766,NULL,''),(6783,3295,NULL,65,NULL,'General Pipe Cleaners 50EM5 Flexicore Cable, 3/4\" x 50\'',NULL,'<p>\r\n	3/4&quot; x 50\' Flexicore cable with male &amp; female connectors. For use with the Metro-Rooter, Speedrooter 92, and the Maxi-Rooter.</p>\r\n<p>\r\n	Heavy-gauge wire coiled tightly around 49-strand aircraft-type wire rope and heat treated. Has unequalled strength and the right amount of flexibility.</p>\r\n',0,0,1,0,6767,NULL,''),(6784,3290,NULL,189,NULL,'Impacto Metatarsal Protectors','Description','<p>\r\n	Protects the metatarsal area of the foot by deflecting and dispering the impact of falling loads. Designed and tested to compliment safety cap footwear, the lip sits on top of the cap at load point. Extremely durable, non-conductive lightweight polycarbonate material. Secured to footwear with existing laces. Optional straps are available to secure protectors to non-lace up footwear such as rubber boots. Comfortable, easy to fit and simple to use. Meets minimum impact resistance of 75 lbs as specified in ASTM F2413/F2412. Both the metatarsal protectors and the optional straps are sold per pair.</p>\r\n',0,0,1,0,6768,NULL,''),(7614,3268,NULL,62,NULL,'Baffin James Bay Extreme Cold Winter Work Boots','Size','<p>\r\n	Provides maximum protection from cold weather applications, as well as acids and oils. Durable 1000 denier nylon upper. Leather reinforced, rust resistant d-ring lacing system. Rated to -100<span class=\"st\">C.</span></p>\r\n<p>\r\n	Microcellular waffle foot-bed traps air and moisture, increasing foot warmth. GelFlex fatigue resistant midsole. Agressive long wearing, self cleaning outsole. <span itemprop=\"summary\">Protective Safety Toe and Plate</span>.<span itemprop=\"summary\"> CSA/ASTM approved</span>.<span itemprop=\"summary\"> ESR/EH rated.</span></p>\r\n',0,0,1,0,7591,NULL,''),(6786,3294,NULL,65,NULL,'General Pipe Cleaners GM-C Gen-Eye Micro-Scope Pipe Inspection/Location System',NULL,'<p>\r\n	The Gen-Eye Micro-Scope handheld inspection tool has a bright, easy-to-see 3.5&quot; LCD screen for crisp, clear pictures. You can record photos or videos on the built-in SD card reader with one-touch record button for playback on the internal screen, TV, or laptop computer through a USB port.</p>\r\n<p>\r\n	The included reel comes with 30 feet (100\' capacity) of micro push rod with a color camera, giving you the ability to inspect 1-1/2&quot; to 3&quot; drain lines, and many toilet traps. Open reel with adjustable monitor mount gives you the best possible viewing angle.</p>\r\n<p>\r\n	A 3 ft. probe rod with color camera lets you inspect in hard to reach places. Three adapters are included to improve your viewing angle or to retrieve objects.</p>\r\n<p>\r\n	The Micro-Scope Command Module is loaded with many great features, including a digital zoom, rotatable picture, voice over recording capability, and LED brightness control. On-screen status indicators include date and time, SD card capacity, and battery strength. The rechargeable battery drives the unit for up to four hours.</p>\r\n',0,0,1,0,6770,NULL,''),(6795,3201,NULL,32,NULL,'Hach 1895000 Lamp Assembly for 1720D and 1720E Low-Range Turbidimeters',NULL,'<p>\r\n	Under normal use, Hach recommends replacing the 1720D/1720E Low-Range Turbidimeter lamp annually to maintain optimal performance. Replacements bulbs are burned-in at the factory to stabilize light output, and are ready for immediate installation and use.</p>\r\n',0,0,1,0,5539,NULL,''),(6796,3201,NULL,32,NULL,'Hach 5222500 ICE-PIC Calibration/Verification Module, 0.5 NTU',NULL,'<p>\r\n	Can be used with the 1720C and D instruments. Verify calibration is less than 60 seconds. No loss of sample flow to complete a verification. No sample cell to recondition after verification. 0.5 NTU.</p>\r\n',0,0,1,0,6780,NULL,''),(6797,3201,NULL,32,NULL,'Hach 5221500 ICE-PIC Calibration/Verification Module, 1 NTU',NULL,'<p>\r\n	Can be used with the 1720C and D instruments. Verify calibration is less than 60 seconds. No loss of sample flow to complete a verification. No sample cell to recondition after verification. 1 NTU.</p>\r\n',0,0,1,0,6781,NULL,''),(6798,3201,NULL,32,NULL,'Hach 5225000 ICE-PIC Calibration/Verification Module, 20 NTU',NULL,'<p>\r\n	Can be used with the 1720C and D instruments. Verify calibration is less than 60 seconds. No loss of sample flow to complete a verification. No sample cell to recondition after verification. 20 NTU.</p>\r\n',0,0,1,0,6782,NULL,''),(6799,2072,NULL,32,NULL,'Hach sensION+ pH3 Laboratory pH Kit',NULL,'<p>\r\n	A guided navigation menu allows you to follow simple prompts to set up your measurements, reducing the time necessary to start testing and improving the accuracy of measurements. Several calibration modes are provided with automatic recognition of 3 buffer groups at a determined pH value, etc. Automatic buffer recognition: technical DIN 19267, DIN 19266 and up to 3 custom buffers chosen by the user. Kit includes benchtop meter, probe, integrated magnetic stirrer, electrode stand, standards, calibration flasks, and all required accessories, making it simple to grab the kit and begin testing immediately. &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n	&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;