Test dispenser. Contains enough reagent for approximately 250 tests, 10 ml sample size. Total chlorine.</p>\r\n',0,0,1,0,7573,NULL,''),(6822,3209,NULL,32,NULL,'Hach 2105660 SwifTest Total Chlorine Dispenser Refill Vial, 250 Tests',NULL,'<p>\r\n	For use with the SwifTest dispenser. Contains enough reagent for approximately 250 tests, 10 ml sample size. Free chlorine.</p>\r\n',0,0,1,0,7574,NULL,''),(6824,3211,NULL,32,NULL,'Hach 2263511 Total Chlorine CL17 Buffer Solution, 473 ml',NULL,'<p>\r\n	CL17 Total Chlorine Buffer Solution. Use with Total Chlorine Indicator Solution (2263411) and DPD Compound (2297255) for testing Total Chlorine using the CL17 Analyzer or bulk analytical methods.</p>\r\n',0,0,1,1,5495,NULL,''),(6825,3211,NULL,32,NULL,'Hach 2263411 Total Chlorine CL17 Indicator Solution, 473 ml',NULL,'<p>\r\n	CL17 Total Chlorine Indicator Solution. Use with Total Chlorine Buffer Solution (2263511) and DPD Compound (2297255) for testing Total Chlorine using the CL17 Analyzer or bulk analytical methods.</p>\r\n',0,0,1,1,5497,NULL,''),(7597,3209,NULL,32,NULL,'Hach 2105603 DPD Total Chlorine Powder Pillows, 10 ml, pk/300',NULL,'<p>\r\n	For total chlorine determination by the DPD Method.<br />\r\n	USEPA accepted for reporting for drinking and wastewater analysis using Hach Method 8167.<br />\r\n	Range: 0.02 - 2.00 mg/L. Sample Size: 10 mL.<br />\r\n	Pack of 300 powder pillows.</p>\r\n',0,0,1,0,5490,NULL,''),(7596,3209,NULL,32,NULL,'Hach 2105503 DPD Free Chlorine Powder Pillows, 10 ml, pk/300',NULL,'<p>\r\n	For free chlorine determination by the DPD Free Chlorine method. USEPA accepted for reporting for drinking water analysis using Hach Method 8021.<br />\r\n	Range: 0.02 to 2.00 mg/L Cl2. Sample Size: 10 mL.<br />\r\n	Pack of 300 powder pillows</p>\r\n',0,0,1,0,5489,NULL,''),(6920,3300,NULL,57,NULL,'King Electrical Self Regulating Heating Cable, Per Foot, 240V','Watts/Ft, Max. Run','<p>\r\n	King SR self-regulating heating cable is designed for a variety of industrial and commercial pipe trace applications including hazardous and non hazardous environments. The standard polyolefin jacket is water resistant and resistant to inorganic chemicals.</p>\r\n<p>\r\n	The cable will regulate its power output (watt/ft.) automatically in response to changes in the surrounding temperature. The self-regulating feature allows the cable to be overlapped without overheating or burning out the cable.</p>\r\n<p>\r\n	Easy to install, it can be cut to length and field spliced or terminated using various accessory kits. Self Regulating heating cable is available in 3, 5, 8 and 10 watts per foot at 240 volts. SR heating cable carries a 2 year warranty. Meets cUL requirements.</p>\r\n',0,0,1,0,5952,NULL,''),(6921,3300,NULL,57,NULL,'King Electrical Pre-Assembled Self Regulating Heating Cable, 120V','Assembly Length','<p>\r\n	Self-regulating pre-assembled heating cables are designed for a a variety of pipe freeze protection and roof &amp; gutter de-icing applications. The heat output (wattage) increases and decreases automatically based on changes in the climate conditions. This unique feature ensures maximum energy efficiency because the cable regulates heat output on it\'s own, increasing energy output only when it is needed to prevent pipe freezing and ice build up on roofs &amp; gutters. No thermostat is required.</p>\r\n<p>\r\n	Rated 6 watts/foot at 40<span class=\"st\">F for pipe freeze protection. Rated 8 watts/foot at 32</span><span class=\"st\">F for roof &amp; gutter de-icing. Pre-terminated with 30 inch grounded plug and end splice. Suitable for use on metal and plastic pipes. Suitable for use on metallic and non-metallic gutters and downspouts. Cable will not overheat or burnout when overlapped. ETL Listed.</span></p>\r\n',0,0,1,0,5953,NULL,''),(6922,3300,NULL,NULL,NULL,'Self-Sealing Pipe Insulation, 6 Ft Lengths, CTS','Size','<p>\r\n	Flexible and easy-to-apply polyethylene pipe insulation. Has a yellow self-seal release line that is both easy to see and peel. This chemically inert pipe insulation has a closed-cell structure that allows it to function as an efficient insulator. Best applications where temperature does not exceed 82<span class=\"st\">C or below -68</span><span class=\"st\">C. Reduces heat lose, resists freezing, reduces condensation, and reduces plumbing noise. Can be used on hot and cold water lines, refrigerator lines, air conditioner lines, and underground lines. Boasts a broad range of other insulating applications and can be used as a protective cover where necessary. All sizes are 6 feet in length and have 1/2&quot; wall thickness. Insulation is in copper tube size (CTS).</span></p>\r\n',0,0,1,0,6905,NULL,''),(6923,3300,NULL,NULL,NULL,'Self-Sealing Pipe Insulation, 6 Ft Lengths, IPS','Size','<p>\r\n	Flexible and easy-to-apply polyethylene pipe insulation. Has a yellow self-seal release line that is both easy to see and peel. This chemically inert pipe insulation has a closed-cell structure that allows it to function as an efficient insulator. Best applications where temperature does not exceed 82<span class=\"st\">C or below -68</span><span class=\"st\">C. Reduces heat lose, resists freezing, reduces condensation, and reduces plumbing noise. Can be used on hot and cold water lines, refrigerator lines, air conditioner lines, and underground lines. Boasts a broad range of other insulating applications and can be used as a protective cover where necessary. All sizes are 6 feet in length and have 1/2&quot; wall thickness. Insulation is in iron pipe size (IPS).</span></p>\r\n',0,0,1,0,6906,NULL,''),(6931,3304,NULL,NULL,NULL,'High Density Polyethylene (HDPE) Tubing, 1/2\" O.D.','Sold Per','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	Less flexible than LDPE tubing, but has a 50% greater working pressure.&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: 12px; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Much more resistant to chemicals (such as sodium hypochlorite) than LDPE tubing.&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: 12px; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Withstands sterilization by boiling.&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: 12px; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Produced from raw materials which meet FDA requirements.&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: 12px; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Commonly used on the injection (discharge) side of high pressure chemical metering pumps.</span></p>\r\n<p>\r\n	<strong style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">1/2&quot; O.D., 3/8&quot; I.D. Working pressure of 150 PSI @ 20<span class=\"st\">C.</span></strong></p>\r\n',0,0,1,0,6914,NULL,''),(6932,3381,NULL,NULL,NULL,'Kynar (PVDF) 90 Union Elbow, OD Tube X OD Tube','Size','<p>\r\n	Kynar (PVDF) has outstanding chemical resistance for highly corrosive fluids. It meets FDA standards and is NSF listed. Kynar is UV resistant, and will withstand 220 PSI. Working temperature range of -80F to 275F. Highly recommended for use with sodium hypochlorite (chlorine).</p>\r\n<ul>\r\n	<li>\r\n		<strong>These Kynar (PVDF) compression 90 union elbow connector fittings are OD tube on both ends.</strong></li>\r\n</ul>\r\n',0,0,1,0,6915,NULL,''),(6933,3380,NULL,NULL,NULL,'Nylon 90 Union Elbow, OD Tube X OD Tube','Size','<p>\r\n	Nylon is recommended for general purpose air, water and other low pressure applications. It meets FDA standards and is NSF listed. Nylon is not UV resistant. Nylon fittings are good for working pressures under 50 PSI. Working temperature range of -30F to 200F. Should not be used with sodium hypochlorite (chlorine).</p>\r\n<ul>\r\n	<li>\r\n		<strong>These Nylon compression 90 union elbow connector fittings are OD tube on both ends.</strong></li>\r\n</ul>\r\n',0,0,1,0,6916,NULL,''),(6934,3380,NULL,NULL,NULL,'Nylon 90 Male Elbow, OD Tube X MPT','Size','<p>\r\n	Nylon is recommended for general purpose air, water and other low pressure applications. It meets FDA standards and is NSF listed. Nylon is not UV resistant. Nylon fittings are good for working pressures under 50 PSI. Working temperature range of -30F to 200F. Should not be used with sodium hypochlorite (chlorine).</p>\r\n<ul>\r\n	<li>\r\n		<strong>These Nylon compression 90 union elbow connector fittings are OD tube on one end, male threads on the other.</strong></li>\r\n</ul>\r\n',0,0,1,0,6917,NULL,''),(6935,3381,NULL,NULL,NULL,'Kynar (PVDF) 90 Male Elbow, OD Tube X MPT','Size','<p>\r\n	Kynar (PVDF) has outstanding chemical resistance for highly corrosive fluids. It meets FDA standards and is NSF listed. Kynar is UV resistant, and will withstand 220 PSI. Working temperature range of -80F to 275F. Highly recommended for use with sodium hypochlorite (chlorine).</p>\r\n<ul>\r\n	<li>\r\n		<strong>These Kynar (PVDF) compression 90 union elbow connector fittings are OD tube on one end, male threads on the other.</strong></li>\r\n</ul>\r\n',0,0,1,0,6918,NULL,''),(7718,3214,NULL,NULL,NULL,'Electric Acid/Alkali Drum Pump Package',NULL,'<p>\r\n	Engineered to transfer corrosive chemicals associated with the water treatment industry. Common applications include sodium hypochlorite, calcium chloride, potassium hydroxide, calcium hydroxide, chlorinated water, sodium bromide, among others.</p>\r\n<p>\r\n	Package includes motor, pump, hose, storage bracket barrel adapter, and hand nozzle. Motor is 110V open drip proof (IP44). Pump tube measures 47&quot; in length. Discharge hose is 6 feet in length, 1&quot; diameter. Max. flow is 15 GPM. Max viscosity is 1500 cps (mPas).</p>\r\n',0,0,1,0,7695,NULL,''),(7722,3321,NULL,209,NULL,'Koflo Kynar (PVDF) Long Length Chemical Injection Quills','Description','<p>\r\n	This chemical injection quill injects corrosive chemicals into your pipeline without damaging the port or pipe. Injection quill ensures even distribution of chemical in the center of the pipe.</p>\r\n<p>\r\n	Flow direction is indicated on the body to ensure proper positioning. Body is constructed of Kynar (PVDF). Spring is Hastelloy C. Ball is ceramic. Rated to 150 PSI and 280<span class=\"st\">F working temperature. 1/2&quot; FNPT inlet, 1/2&quot; MNPT pipe connection.</span></p>\r\n<p>\r\n	<span class=\"st\">Quills are repairable - kit containing replacement (3) ceramic balls and (3) Hastelloy C springs is available</span></p>\r\n',0,0,1,0,7697,NULL,''),(7716,3167,NULL,NULL,NULL,'Heavy-Duty Spade Truck',NULL,'<p>\r\n	Constructed of double-welded 1-1/4&quot; round 14-gauge steel tubing. Oversized nose plate and easy grip frame helps with the balancing of larger items. Tapered 22 x 1/4&quot; x 1/3&quot; deep thick nose plate. Two 10&quot; mould-on rubber wheels. Durable blue enamel finish.</p>\r\n',0,0,1,0,7693,NULL,''),(7717,3167,NULL,NULL,NULL,'Flat-Free Wheel Heavy-Duty P-Handle Hand Truck',NULL,'<p>\r\n	Constructed of 1&quot;, 16-gauge steel tubing. Nose plate measures 14&quot; x 9&quot; and is made of 8-gauge steel. Overall width 22&quot;. Flat-free wheel dimensions 10&quot; x 3.5&quot;. Powder coated. 600 lbs capacity.</p>\r\n',0,0,1,0,7694,NULL,''),(6938,3077,NULL,65,NULL,'General Pipe Cleaners SuperSlice Plastic Tubing Cutter',NULL,'<p>\r\n	A patented V-point blade pierces hard or soft plastic tubing, then slices through to give a clean, easy cut with no tube deformation. The blade is offset to give you powerful, penetrating action with a minimum of force. Use it on PVC, CPVC, irrigation pipe, plastic or rubber garden hose, plastic electric conduit, and any other plastic tubing material. One squeeze does the job. Ergonomically designed handles give you a sure grip with lots of leverage. Easily cuts tubing as large as one inch in diameter.</p>\r\n',0,0,1,0,6921,NULL,''),(6940,3098,NULL,NULL,NULL,'Stainless Steel Industrial Liquid Filled Pressure Gauges, Stainless Steel Mount, 4\" Dial','PSI/kPa Range','<p>\r\n	<span style=\"margin: 0px; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: baseline; color: rgb(68, 68, 68);\">These stainless steel liquid filled gauges are ideal where vibration, corrosion, and pulsating conditions exist. Window is heavy glass crystal. Glycerine filled, 4&quot; dial provides exceptional vibration resistance. Stainless steel wetted parts and stainless steel case f</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: baseline; color: rgb(68, 68, 68);\">or the very best corrosion resistance</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13.333333969116211px; line-height: 17.77777862548828px; vertical-align: baseline; color: rgb(68, 68, 68);\">. All gauges have  NPT threaded bottoms.</span></p>\r\n',0,0,1,0,6923,NULL,''),(6957,2048,NULL,NULL,NULL,'Cast Iron Companion Flanges','Pipe Size, Flange Outside , # Holes','<p>\r\n	Threaded internally to receive a pipe length. Has bolt holes that will align with another equal sized flange. For flange x flange connections, a 1/16 full face red rubber gasket is recommended. For flange x component connections, a 1/8 full face red rubber gasket is recommended.</p>\r\n',0,0,1,0,4473,NULL,''),(6958,2048,NULL,NULL,NULL,'Cast Iron Reducing Companion Flanges','Pipe Size, Flange Outside , # Holes','<p>\r\n	Threaded internally to receive a pipe length. Has bolt holes that will align with another equal sized flange. For flange x flange connections, a 1/16 full face red rubber gasket is recommended. For flange x component connections, a 1/8 full face red rubber gasket is recommended. Flanges can be bushed to reach desired size if not listed.</p>\r\n',0,0,1,0,4475,NULL,''),(6959,3305,NULL,NULL,NULL,'Single Section All Stainless Repair Clamps, 12.5\" Length','Nom. Pipe Size, Pipe O.D. Range In.','<p>\r\n	Provides a simple and economical method of repairing holes or breaks in water mains, particularly where corrosion is not a factor.&nbsp; Offers heavy-duty lug construction for maximum strength and a drop-in bolt design that does not require bolt removal when installing the clamp. There are never any loose parts to lose in the ditch. All clamps listed are normally stocked in our warehouse. Other lengths and sizes are available. UL listed as satisfying the requirements of NSF-61. Sizes 2 through 12 satisfy AWWA C230.</p>\r\n',0,0,1,0,6942,NULL,''),(6960,3305,NULL,NULL,NULL,'Double Section All Stainless Repair Clamps, 12.5\" Length','Nom. Pipe Size, Pipe O.D. Range In.','<p>\r\n	Provides a simple and economical method of repairing holes or breaks in water mains, particularly where corrosion is not a factor.&nbsp; Offers heavy-duty lug construction for maximum strength and a drop-in bolt design that does not require bolt removal when installing the clamp. There are never any loose parts to lose in the ditch. All clamps listed are normally stocked in our warehouse. Other lengths and sizes are available. UL listed as satisfying the requirements of NSF-61. Sizes 2 through 12 satisfy AWWA C230.</p>\r\n',0,0,1,0,6943,NULL,''),(6961,3305,NULL,NULL,NULL,'Single Section All Stainless Tapped Repair Clamps, CC Threads, 12.5\" Length','Nom. Pipe Size, Pipe O.D. Range In., Tap Size','<p>\r\n	Provides a simple and economical method of adding an outlet tap for a corporation stop to water mains. The tapped outlet is made of stainless steel and is fused to the clamp band by a fully passivated TIG weld. Taps are CC threads. Offers heavy-duty lug construction for maximum strength and a drop-in bolt design that does not require bolt removal when installing the clamp. There are never any loose parts to lose in the ditch. All clamps listed are normally stocked in our warehouse. Other lengths and sizes are available. Taps can also be bushed to achieve desired tap size if tap size is not shown. UL listed as satisfying the requirements of NSF-61. Sizes 2 through 12 satisfy AWWA C230.</p>\r\n',0,0,1,0,6944,NULL,''),(6962,3305,NULL,NULL,NULL,'Double Section All Stainless Tapped Repair Clamps, CC Threads, 12.5\" Length','Nom. Pipe Size, Pipe O.D. Range In., Tap Size','<p>\r\n	Provides a simple and economical method of adding an outlet tap for a corporation stop to water mains. The tapped outlet is made of stainless steel and is fused to the clamp band by a fully passivated TIG weld. Taps are CC threads. Offers heavy-duty lug construction for maximum strength and a drop-in bolt design that does not require bolt removal when installing the clamp. There are never any loose parts to lose in the ditch. All clamps listed are normally stocked in our warehouse. Other lengths and sizes are available. Taps can also be bushed to achieve desired tap size if tap size is not shown. UL listed as satisfying the requirements of NSF-61. Sizes 2 through 12 satisfy AWWA C230.</p>\r\n',0,0,1,0,6945,NULL,''),(6963,3305,NULL,NULL,NULL,'Mechanical Repair Couplings','Nom. Pipe Size, Pipe O.D. Range In.','<p>\r\n	Suggested uses for these couplings include water main repair, joining of plain end pipe, connecting misaligned pipe, valve and hydrant installation, and flexible joint installation at critical areas of water main stress. Constructed entirely of epoxy coated ductile iron components with stainless steel hardware, permitting a strong, durable connection. All couplings listed are normally stocked in our warehouse. Other variations are available, including extended length couplings, transition couplings, etc. Parts are also available. UL listed as satisfying the requirements of NSF-61. Must be used with stainless steel inserts when installing on plastic/HDPE pipe.</p>\r\n',0,0,1,0,6946,NULL,''),(6964,3305,NULL,NULL,NULL,'DR17 HDPE Pipe End Stiffeners','Size','<p>\r\n	Provides circumferential inside support of DR17 HDPE pipe ends. Constructed of stainless steel, the inserts reinforce the pipe without disturbing the flow characterisitc of the medium. Three inch insert is a solid one-piece, sizes 4, 6 and 8 inches are split. For insert into DR17 HDPE only - inserts for other types are available.</p>\r\n',0,0,1,0,6947,NULL,''),(6965,3305,NULL,NULL,NULL,'CC Thread Brass Reducer Bushings, MCC X FCC','Size','<p>\r\n	For use with CC tapped saddles to reduce the size of the tap to match the size of your corporation stop.</p>\r\n',0,0,1,0,6948,NULL,''),(6966,3093,NULL,NULL,NULL,'Hinged Brass Saddles for Standard PVC Pipe','PVC Pipe Size, Actual Pipe O.D., Tap Size','<p>\r\n	These hinged brass saddles are cast from certified waterworks brass and are machined to rigid specifications. Their ample width and pre-formed radius provide greater distribution of clamping pressures to avoid crushing the pipe.</p>\r\n<p>\r\n	Hinged saddles install as a single unit with no loose parts to lose in the ditch. The upper and lower castings are permanently hinged together with a silicon bronze pin and the silicon bronze bolt has a retainer on it to prevent loss. The lower casting is tapped to accept the bolt so that nuts are not required.&nbsp; Saddles are for iron pipe size (standard) PVC pipe and are tapped with iron pipe threads. If your size is not listed, a bushing is reccommended.</p>\r\n',0,0,1,0,6949,NULL,''),(6967,3093,NULL,NULL,NULL,'Single Section All Stainless Saddles, IPT Tap','Nom. Pipe Size, Pipe O.D. Range In., Tap Size','<p>\r\n	Provides a simple and economical method for adding a water line off of a main line. Designed for all pipe types, the stainless steel construction allows the saddle to conform, reducing stress on the pipe. The tapped outlet is made of stainless steel and is fused to the clamp band by a fully passivated TIG weld. Taps are common female Iron Pipe Thread. Rated for 250 PSI. Stainless steel band and bolts for use where corrosive conditions exist. All clamps listed are normally stocked in our warehouse. Other sizes are available. Taps can also be bushed to achieve desired tap size if tap size is not shown. Satisfies the requirements of NSF-61.</p>\r\n',0,0,1,0,6950,NULL,''),(6968,3288,NULL,NULL,NULL,'Apollo Basic Backflow Preventer Test Kit',NULL,'<p>\r\n	This test kit is suitable for testing all makes and models of reduced-pressure principle, double check, spill-resistant vacuum breaker, and pressure-type vacuum breaker backflow preventers.</p>\r\n<p>\r\n	Features include (3) soft needle valves with replaceable seats, differential pressure gauge, color-coded hoses with integral filters, a line-pressure gauge, all required adapter fittings, flexible strap, laminated test procedures, and a durable carrying case with foam inserts and external storage compartments Suitable for pressures up to 200 PSI.</p>\r\n',0,0,1,0,6951,NULL,''),(6969,3288,NULL,NULL,NULL,'Apollo Deluxe Backflow Preventer Test Kit',NULL,'<p>\r\n	This test kit is suitable for testing all makes and models of reduced-pressure principle, double check, spill-resistant vacuum breaker, and pressure-type vacuum breaker backflow preventers.</p>\r\n<p>\r\n	Features include (5) soft needle valves with replaceable seats, differential pressure gauge, color-coded hoses with integral filters, a line-pressure gauge, all required adapter fittings, flexible strap, laminated test procedures, and a durable carrying case with foam inserts and external storage compartments Suitable for pressures up to 200 PSI. Also includes a bleed tube that makes it possible to bleed lines without disconnecting hoses.</p>\r\n',0,0,1,0,6952,NULL,''),(6970,3144,NULL,NULL,NULL,'Service Box Uppers','Length','<p>\r\n	Replacement upper for use with country style service boxes. Fits over existing lower portion. Other lengths available.</p>\r\n',0,0,1,0,6953,NULL,''),(6971,3143,NULL,65,NULL,'General Pipe Cleaners Revolving Roller Heads','Head Diameter, Fits Rod Size','<p>\r\n	Replacement revolving roller head for flat sewer rods.&nbsp;</p>\r\n',0,0,1,0,6495,NULL,''),(7714,3327,NULL,65,NULL,'General Pipe Cleaners Root 66 Sectional Cable Machine',NULL,'<p>\r\n	The Root 66 is a real advance in sectional cable machine design. No mid-range machine has its versatility and power.</p>\r\n<p>\r\n	Look at its versatility. You can drive 5/8&quot; cables for lines up to 3&quot; and 7/8&quot; cables for 4&quot; lines  and you can switch from one to the other in seconds, without touching the jaws, without an adapter, without tools. And for sink drain work, slip on a<br />\r\n	drum that holds smaller cables.</p>\r\n<p>\r\n	To operate, just feed a cable into the line and slide the back end into the machine. The excess cable goes into a guide tube. Turn on the sealed motor, press down on the handle, and the Root 66 starts spinning the cable at 400 RPM.</p>\r\n<p>\r\n	The cable stops rotating as soon as you lift the handle, so theres no additional torque buildup. When using a drum for<br />\r\n	small drain work, the drum stops turning when you lift the handle to the neutral position.</p>\r\n<p>\r\n	The Root 66 has a wide four point base for greater stability. Its interlocking tubular construction also gives it excellent<br />\r\n	durability. To protect the gears from dirt and for easier cleaning, the machine has two internal plastic shields. A Ground Fault Circuit Interrupter is standard equipment.</p>\r\n<p>\r\n	This fully featured machine includes six sections of 5/8&quot; x 7-1/2 ft of cable for 3&quot; lines, five sections of 7/8&quot; x 15 ft cable for 4&quot; lines, carriers for 5/8&quot; and 7/8&quot; cable sizes, a steel drum with 25 feet of 5/16&quot; cable for smaller drain work, rear guide hose, cutter sets for each cable size, and a convenient tool box. Everything and more needed to get the job done.</p>\r\n',0,0,1,0,7691,NULL,''),(6973,3220,NULL,NULL,NULL,'Arctic Blaster Steam Thawing Device ',NULL,'<div>\r\n	The Arctic Blaster is the perfect machine for thawing sewer or plumbing lines, septic tanks, engine blocks, culverts, stock tank valves and many more. For above or below ground pipes. Can be used on plastic, copper, ABC, PVC or steel. Can even be used for removing decals and adhesives. No electricity is required.&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Produces a dry steam that quickly and efficiently thaws frozen lines. Tank holds 2 gallons of water which is heated by your LP torch (torches are available but are not included). Portable and easily moved as needed. 50\' x 1/4&quot; hose for water lines and 50\' x 3/8&quot; hose for sewer lines are included. Develops up to 230 F output temperature. 2 Gallon water tank will produce about 15 minutes of operation which will thaw most frozen lines up to 100 feet or more.&nbsp;</div>\r\n',0,0,1,0,7058,NULL,''),(6974,3048,NULL,NULL,NULL,'Root Away, 2 Lb Bottle','Qty','<p>\r\n	Zep 2 lb. Root Kill is an effective solution for ridding your sewer pipes, drain and septic field lines of shrub and tree roots. Plant roots can penetrate through small cracks and poorly sealed joints of sewer lines. If not controlled, these small roots will continue to grow larger causing breakage, reduced flow, and eventually flow stoppage. Root Kill\'s powerful granular formula dissolves these pipe-clogging elements on contact without harming the target tree or bush.</p>\r\n',0,0,1,1,7594,NULL,''),(6977,3308,NULL,NULL,NULL,'Neutra 7 Acid Water Neutralizer','Qty','<p>\r\n	Neutra 7 is a proprietary alkaline blend which neutralizes acid water and keeps the injection point clean. This helps to eliminate corrosion of piping, pressure tanks, water heaters and fixtures without the hassle of constant cleaning of calcium build-up</p>\r\n',0,0,1,0,6960,NULL,''),(6978,3308,NULL,NULL,NULL,'Ban T Alkaline Water Neutralizer, 1.5 Lb Bottle, CS/12',NULL,'<p>\r\n	Ban T is specifically formulated to effectively lower pH and remove iron and other contaminants from fouled water softeners. Ban T should be used as preventative maintenance on all water softeners in areas with moderate iron content to clean, restore and maintain the life of the softeners. Ban T is an environmentally friendly cleaning agent that removes hard water deposits and moderate iron staining from household fixtures. These 1.5 lb bottles are sold by the case of 12 to help keep your costs down.</p>\r\n',0,0,1,0,6961,NULL,''),(6979,3308,NULL,NULL,NULL,'Sani-System Liquid Sanitizer Concentrate','Type','<p>\r\n	Sani-System is the only EPA &amp; NSF approved sanitizer for use in water softeners and reverse osmosis units. It\'s proven to kill 99.9% of harmful bacteria without the use of chlorine, oxidizers or acids that can harm system equipment parts and resin. The exact pre-measured doses of concentrated formula are contained in ready-to-use packets and sanitize equipment in just 60 seconds!</p>\r\n<p>\r\n	Simple to use. For water softeners, it is as simple as pouring into the brine well or brine tank and manually regenerating the unit. For reverse osmosis units, simply remove the cartridges and place the packet contents in the first housing and flush.</p>\r\n',0,0,1,0,6962,NULL,''),(6980,3308,NULL,NULL,NULL,'Rust Out Water Softener Cleaner/Iron Remover','Qty','<p>\r\n	Rust Out chemically removes iron and rust build-up that coats the resin bead and fouls the water softener. Rust Out changes rust and iron into a clear solution the easily rinses away and does not contain harsh or abrasive chemicals that damage fiberglass, porcelain or acrylic finishes. The advanced formula contains more than five chemicals that are formulated to clean, restore and maintain the life of water softeners. Rust Out can also be used to clean tough rust stains from any number of other surfaces, interior and exterior.</p>\r\n',0,0,1,0,6963,NULL,''),(6981,3308,NULL,NULL,NULL,'Res Care Liquid Resin Cleaning Solution','Qty','<p>\r\n	Res Care is a specially formulated liquid cleaner designed to remove limited iron, manganese, silt, metal particles and organic compounds that cause softener inefficiencies. Regular use of Res Care will restore the softener back to peak efficiency and maintain the life of the unit. For best results use a Res Care Automatic Feeder or manually add during regeneration to prevent mineral build-up.</p>\r\n',0,0,1,0,6964,NULL,''),(6983,3310,NULL,NULL,NULL,'Commercial Duty Back Pack Sprayer',NULL,'<p>\r\n	Three stage filtration system - strainer basket, filter in piston cylinder and filter in shut-off. Six inch wide mouth opening for easy filling and access to internal components. Dual displacement pump virtually eliminates leakage from the pump. Self cleaning pump - each downstroke of the pump handle sends a powerful burst to keep the filter from clogging. Comes complete with Viton seals for optimum chemical resistance. Also includes multiple nozzles to distinguish spray pattern or volume of spray.</p>\r\n',0,0,1,0,6966,NULL,''),(6982,3308,NULL,NULL,NULL,'Res Care Feeder','Type','<p>\r\n	Res Care Feeder meters the appropriate volume of Res Care Cleaner each time the bed is regenerated. It can be selected for the size of resin bed and the quantity of iron or other impurities in the untreated water.</p>\r\n',0,0,1,0,6965,NULL,''),(6984,3310,NULL,NULL,NULL,'Commercial Duty Handheld Sprayers','Size','<p>\r\n	Nitrile seals for chemical resistance. Ergonomic poly handle for fatigue free pumping. Poly tank. Anti-clog filter - keeps debris from entering the hose, shut-off and nozzle.</p>\r\n',0,0,1,0,6967,NULL,''),(6985,3167,NULL,NULL,NULL,'Anti-Splash Funnels','Capacity','<p>\r\n	Made of flexible, durable polyethylene. Ideal for use in acid transfer applications. Spark, dent and rust proof. Made with built-in hang up tab. Natural color. Made to resist colder temperatures. Includes removable 100 mesh filter. 24 oz capacity funnel is 5.75&quot; wide X 6.5&quot; tall. 144 oz capacity funnel is 9&quot; wide X10.5&quot; tall.</p>\r\n',0,0,1,0,6968,NULL,''),(6988,3308,NULL,NULL,NULL,'ClearHib 5 Liquid Corrosion Inhibitor, 27 Kg',NULL,'<p>\r\n	ClearHib 5 is a liquid polyphosphate inhibitor formulated to control corrosion and scale build-up in municipal water systems.</p>\r\n<p>\r\n	The product reduces build-up of deposits caused by the precipitation of water-soluble calcium and magnesium salts. It also prevents the precipitation of dissolved iron and manganese. The product\'s dispersing properties also aid in the removal of existing deposits.</p>\r\n',0,0,1,0,6971,NULL,''),(6989,3308,NULL,NULL,NULL,'Genesol 38 Acidic Membrane Cleaner, 25 Kg Pail',NULL,'<p>\r\n	Genesol 38 has been developed as an inorganic scale cleaner and iron deposit remover for use in Reverse Osmosis and Nano-Filtration membrane systems. Used at the right concentration, its self-adjusting pH ensures highest solubility of iron salts is achieved. NSF approved.</p>\r\n',0,0,1,0,6972,NULL,''),(6990,3308,NULL,NULL,NULL,'FilterClean F and A Water Treatment Plant Surface Cleaner',NULL,'<p>\r\n	Over time the wetted surfaces in a water treatment plant can build up scale, mineral deposits and biofilm. These surface deposits are more than unsightly as they may be a source of declining water quality, increased chlorine demand, increased disinfection by-products, shorten coating life and increased corrosion. FilterClean acts to remove deposits, scale and biofilm in water treatment plant infrastructure, as well as reservoirs.</p>\r\n<p>\r\n	FilterClean F and FilterClean A work together to effectively clean and remove surface deposits with a minimum of effort. The FilterClean family of products are certified to NSF/ANSI Standard 60 ensuring they are acceptable for use in potable water treatment systems. Comes with one 20 Kg pail of FilterClean F and one 3 Kg pail of FilterClean A.</p>\r\n',0,0,1,0,6974,NULL,''),(6991,3308,NULL,NULL,NULL,'Genesol 703 Alkaline Powder Membrane Cleaner, 25 Kg',NULL,'<p>\r\n	Genesol 703 has been developed as a general-purpose membrane cleaner for an extensive range of organic based foulants found in Reverse Osmosis and Nano-filtration membrane systems.</p>\r\n<p>\r\n	Genesol 703 is particularly effective against aluminum silicate, which can be difficult to remove with conventional cleaners.</p>\r\n',0,0,1,0,6973,NULL,''),(6993,3307,NULL,NULL,NULL,'Sodium Metabisulphite, 22.7 Kg Bag','Qty','<p>\r\n	Sodium metabisulphite can be used as a cleaning agent for potable water reverse osmosis membranes in desalination systems. Can also be used in dechlorination - use 3.0 mg of sodium metabisulphite to remove 1.0 mg of free chlorine.</p>\r\n',0,0,1,0,6976,NULL,''),(6994,3311,NULL,NULL,NULL,'Universal Silencer 81-0471 Replacement Filter, Pleated Paper, 5.8\" O.D., 4.3\" I.D., 2.5\" Height',NULL,'<p>\r\n	End retainers are plastisol molds. Outer retainer is galvanized expanded metal. Inner retainer is galvanized wire screen. Media is paper. Replaces Universal Silencer part no. 81-0471.</p>\r\n<ul>\r\n	<li>\r\n		Dimensions: 5.8&quot; O.D., 4.3&quot; I.D., 2.5&quot; Height.</li>\r\n</ul>\r\n',0,0,1,0,6977,NULL,''),(6995,3311,NULL,NULL,NULL,'Universal Silencer 81-0472 Replacement Filter, Pleated Paper, 9.7\" O.D., 7.2\" I.D., 4.0\" Height',NULL,'<p>\r\n	End retainers are plastisol molds. Outer retainer is galvanized expanded metal. Inner retainer is galvanized wire screen. Media is paper. Replaces Universal Silencer part no. 81-0471.</p>\r\n<ul>\r\n	<li>\r\n		Dimensions: 9.7&quot; O.D., 7.2&quot; I.D., 4.0&quot; Height.</li>\r\n</ul>\r\n',0,0,1,0,6978,NULL,''