rricane Pleated Polyester Filter Cartridges, 7-3/4\" OD, 30\" Length','Micron Rating','<p>\r\n	Designed for housings that use 7-3/4&quot; OD X 3&quot; ID filter cartridges. Fits Harmsco Hurricane and Water Better housings. Also fits Watts Flow-Max and Waterite Jumbo-Flo housings. Cleanable pleated polyester filter media provides high flow rates with low initial pressure drop. Certified to NSF 61.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Filters listed here are 30&quot; in length. </strong></li>\r\n	<li>\r\n		<strong>All sizes below are sold and priced individually.</strong></li>\r\n</ul>\r\n',0,0,1,0,7023,NULL,''),(7042,3129,NULL,32,NULL,'Hach 9531700 Pocket Pro Temperature Tester',NULL,'<p>\r\n	The Hach Pocket Pro Temperature Tester delivers accurate results with built in diagnostics, replaceable batteries, and a large, easy-to-read LCD screen.</p>\r\n<ul>\r\n	<li>\r\n		Easy-to-replace AAA batteries and a convenient sample cup make maintenance and measurements simple.</li>\r\n	<li>\r\n		Operating temperature range: 0 to 50<span class=\"value\">C.</span></li>\r\n</ul>\r\n',0,0,1,0,7025,NULL,''),(7052,3367,NULL,95,NULL,'Industrial Air Line Inflator with Tire Gauge',NULL,'<p>\r\n	This air line inflator is ideal for inflating, deflating and reading tire pressure. Heavy duty construction provides long serivce life and is backed by a 1 year limited warranty. Perfect for use in demanding work environments. Includes a 1/4&quot; x 5 foot air hose rated at W.P. 300 PSI, completed with a 360 swivel straight safety clip-on air chuck. Range 10 - 170 PSI in 2 lb increments, 70 - 1200 Kpa in 10 lb increments.</p>\r\n',0,0,1,0,7508,NULL,''),(7055,3330,NULL,57,NULL,'King Electric EKB Series Garage-Shop Heater','Volts, Watts','<p>\r\n	These heaters are designed for the garage/shop area that needs occasional temporary comfort level heating. Designed for lower initial cost and minimal control options, these heaters bring you simple heating at an affordable price point. Thermostat will control from 40 to 80 degrees. Bracket can be wall or ceiling mounted at a minimum of 6 feet above the floor. Good air&nbsp;&nbsp; &nbsp; distribution and comfort is achieved by swivelling the bracket to your specific work area. Heating Elements: Rigid Muscovite Mica construction with 80-20 Ni-Chrome heating wire provides quick heating without cold air start ups, heat is wiped from elements as fan slows to a stop. Manual reset safety sensor on each element. Meets cUL requirements.</p>\r\n',0,0,1,0,7038,NULL,''),(7058,3284,NULL,NULL,NULL,'Garden Hose Quick Connect Male Plug, Brass, Heavy-Duty',NULL,'<p>\r\n	This garden hose male plug is the heavy-duty answer to cheaply made, residential grade plastic and brass plugs. Straight-through design features solid brass bodies with garden hose threads.</p>\r\n',0,0,1,0,7041,NULL,''),(7059,3284,NULL,NULL,NULL,'Garden Hose Quick Connect Female Coupler, Brass, Heavy-Duty',NULL,'<p>\r\n	This garden hose female coupler is the heavy-duty answer to cheaply made, residential grade plastic and brass plugs. Straight-through design features solid brass bodies with garden hose threads.</p>\r\n',0,0,1,0,7042,NULL,''),(7060,3332,NULL,NULL,NULL,'Quick Connect Female Pipe Couplers, Brass','Size','<p>\r\n	These quick disconnect female pipe couplers are commonly used in fluid transfer applications where unrestricted flow and high operating pressures are desired, such as pressure washers. These couplers are machined from solid brass. Stainless steel balls, retaining ring, and spring provide maximum service life.</p>\r\n',0,0,1,0,7043,NULL,''),(7061,3332,NULL,NULL,NULL,'Quick Connect Male Pipe Couplers, Brass','Size','<p>\r\n	These quick disconnect male pipe couplers are commonly used in fluid transfer applications where unrestricted flow and high operating pressures are desired, such as pressure washers. These couplers are machined from solid brass. Stainless steel balls, retaining ring, and spring provide maximum service life.</p>\r\n',0,0,1,0,7044,NULL,''),(7062,3333,NULL,NULL,NULL,'Quick Connect Female Plug, Brass','Size','<p>\r\n	These quick disconnect female pipe plugs are commonly used in fluid transfer applications where unrestricted flow and high operating pressures are desired, such as pressure washers. These plugs are machined from solid brass.</p>\r\n',0,0,1,0,7045,NULL,''),(7063,3333,NULL,NULL,NULL,'Quick Connect Male Plug, Brass','Size','<p>\r\n	These quick disconnect male pipe plugs are commonly used in fluid transfer applications where unrestricted flow and high operating pressures are desired, such as pressure washers. These plugs are machined from solid brass.</p>\r\n',0,0,1,0,7046,NULL,''),(7064,3334,NULL,NULL,NULL,'Pressure Washer Gun Swivel, Stainless Steel',NULL,'<p>\r\n	To be installed at gun inlet. 4000 PSI maximum. 3/8&quot; FNPT inlet, 3/8&quot; MNPT outlet. Constructed of stainless steel for superior corrosion resistance and longer life.</p>\r\n',0,0,1,0,7047,NULL,''),(7065,3334,NULL,NULL,NULL,'Pressure Washer Gun Swivel, Brass',NULL,'<p>\r\n	To be installed at gun inlet. 4000 PSI maximum. 3/8&quot; FNPT inlet, 3/8&quot; MNPT outlet. Constructed of solid brass for good corrosion resistance and long life.</p>\r\n',0,0,1,0,7048,NULL,''),(7066,3335,NULL,NULL,NULL,'High-Pressure Plated Steel Ball Valves','Size','<p>\r\n	Plated steel body. Poly-oxy-methylene seals. Temperature range -20<span class=\"st\">C to 100<span class=\"st\">C. NPT female threads. Working pressure of 7250 PSI. </span></span></p>\r\n',0,0,1,0,7049,NULL,''),(7067,3335,NULL,NULL,NULL,'Brass Female Hex Coupling','Size','<p>\r\n	Hex coupling for connecting and extending pipes or hose going in the same direction. Female NPT threads on both ends for connecting male NPT fittings. Made from brass, offering a higher corrosion resistance than steel.</p>\r\n',0,0,1,0,7050,NULL,''),(7069,3335,NULL,NULL,NULL,'Brass Reducing Hex Adapter','Size','<p>\r\n	Hexagonal reducing adapter for connecting pipes or hoses of different sizes. Female NPT threads on one end and male NPT threads on the other for connecting different sizes of hose or pipe. Made from brass for higher corrosion resistance than steel.</p>\r\n',0,0,1,0,7052,NULL,''),(7070,3335,NULL,NULL,NULL,'Brass Hex Nipple','Size','<p>\r\n	Hex nipple for connecting two threaded pipes or fittings. Male NPT threads on both ends for connecting to female threaded pipe or fittings. Made from brass for higher corrosion resistance than steel.</p>\r\n',0,0,1,0,7053,NULL,''),(7071,3335,NULL,NULL,NULL,'Brass Barstock Female 90 Elbow','Size','<p>\r\n	90 degree elbow for connecting two pipes or fittings at an angle. Female NPT threads for connecting to male threaded pipes or fittings. Made from brass for higher corrosion resistance than steel.</p>\r\n',0,0,1,0,7054,NULL,''),(7072,3335,NULL,NULL,NULL,'Brass Barstock Female Cross','Size','<p>\r\n	Cross for connecting and branching four pipes or fittings. Female NPT threads for connecting to male threaded pipes or fittings. Made from brass for higher corrosion resistance than steel.</p>\r\n',0,0,1,0,7055,NULL,''),(7073,3335,NULL,NULL,NULL,'Brass Barstock Female Tee','Size','<p>\r\n	Tee for connecting and branching three pipes or fittings. Female NPT threads for connecting to male threaded pipes or fittings. Made from brass for higher corrosion resistance than steel.</p>\r\n',0,0,1,0,7056,NULL,''),(7074,3220,NULL,77,NULL,'Magikist 1/4\" Pulse Jet De-Icer Tubing','Length','<p>\r\n	1/4&quot; opaque tubing for the Magikist PJDX Pulse Jet De-Icer. Used to feed a probe tip down the water line to the frozen section.</p>\r\n<p>\r\n	Recommended for use with water lines.</p>\r\n',0,0,1,0,7032,NULL,''),(7075,3220,NULL,77,NULL,'Magikist PJD45A 1/4\" De-Icer Probe Tip','Qty','<p>\r\n	Replacement probe tip for Magikist PJDX-C Jet De-Icer. Fits 1/4&quot; tubing size. Sold per each or per pack of six.</p>\r\n',0,0,1,0,6406,NULL,''),(7076,3335,NULL,NULL,NULL,'Brass Barstock Male Branch Tee','Size','<p>\r\n	Tee for connecting and branching three pipes or fittings. Two female and one male NPT threads for connecting to one female and two male threaded pipes or fittings. Made from brass for higher corrosion resistance than steel.</p>\r\n',0,0,1,0,7059,NULL,''),(7077,3336,NULL,NULL,NULL,'Blue Storm Pressure Wash Hose Assembly w/ Quick-Connects, 4000 PSI','Length','<p>\r\n	Made to order assemblies come complete with brass quick couplers and bend restrictors on each end, with a swivel on one end to prevent hose twisting. Hose and couplings are both 3/8&quot; in diameter.</p>\r\n<p>\r\n	Smooth blue hose covering stays clean and repels dirt. Rated for use with water up to 4000 PSI and 248<span class=\"st\">F temperature.</span></p>\r\n',0,0,1,0,7060,NULL,''),(7082,2023,NULL,NULL,NULL,'Micro Type 300 Stainless Steel Gear Clamps, 5/16\" Band, 10 Pack','Nom. Size, Range','<p>\r\n	These totally stainless gear clamps have a 5/16&quot; wide type 300 stainless steel band, housing and screw. Stainless steel offers improved corrosion resistance over carbon steel. For use in a wide variety of applications. Sold by the package of 10 to keep your costs down.</p>\r\n',0,0,1,0,7066,NULL,''),(7083,2023,NULL,NULL,NULL,'Micro Type 316 Stainless Steel Gear Clamps, 1/4\" Band, 10 Pack','Nom. Size, Range','<p>\r\n	These gear clamps are manufactured entirely with grade 316 stainless steel for the very best corrosion resistance. They were designed for use in applications where 201 and 301 stainless materials show signs of corrosion. These 316 stainless clamps are ideal for use in marine repair, water treatment plants, sewage treatment plants and other corrosive environments. They also provide extra reliability in underground installations such as sprinkler and swimming pool piping. These micro sized clamps have a 1/4&quot; wide band and are sold by the package of 10 to keep your costs down.</p>\r\n',0,0,1,0,7068,NULL,''),(7084,3220,NULL,NULL,NULL,'Arctic Blaster 3/8\" Sewer Line Steam Hose Assembly','Length','<p>\r\n	This 3/8&quot; sewer line steam hose for the Arctic Blaster is rated to 2600 PSI, with a minimum burst pressure of 10,400 PSI. Reinforced with a single wire braid and covered by seamless nitrile rubber. One end comes complete with a 3/8&quot; female quick connect coupling to quickly and easily connect to your Arctic Blaster.</p>\r\n',0,0,1,0,7067,NULL,''),(7088,3337,NULL,NULL,NULL,'Heavy Duty Black Rubber Fingertip Door Mats','Size','<p>\r\n	Thousands of rubber scraping &quot;fingers&quot; remove dirt and snow and hide it from sight. Sweeps boots clean. Provides superior traction.&nbsp; Beveled edges on all four sides prevent trips and falls. Manufactured from high quality rubber. The ideal mat for heavily traveled or frequently soiled indoor-outdoor entrances. 7/8&quot; thickness. Dump it outside when it gets full of dirt or water.</p>\r\n',0,0,1,0,7071,NULL,''),(7089,2023,NULL,NULL,NULL,'Type 304 Stainless Steel Heavy Duty Bolt Clamps','Range, Band Width','<p>\r\n	These bolt clamps are constructed entirely of type 304 stainless steel components. They are ideal for a variety of applications including hydraulic suction lines, truck and bus radiator hoses, and water suction and discharge serivce. Easy and fast tightening - a conventional t-bolt clamp requires a deep socket as the nut is tightened on the bolt, but for these clamps, the wrench is used on the bolt head itself, so a deep socket is not required. Bevelled band edges prevent damage to the hose. Priced and sold per each.</p>\r\n',0,0,1,0,7072,NULL,''),(7090,2023,NULL,NULL,NULL,'Type 201 Stainless Steel Centre Punch Clamps, 10 Pack','Clamp I.D., Band Width','<p>\r\n	These stainless steel centre punch clamps feature a stainless steel band that offers good strength and corrosion resistance to mild chemicals and water. Can be locked with impact from a hammer using a conical punch, or any one of our punch lock tools. Sold by the pack of 10 to keep your costs down.</p>\r\n',0,0,1,0,7092,NULL,''),(7091,2020,NULL,NULL,NULL,'Green PVC Water Suction Hose Assemblies w/ Male X Female Camlocks','Size','<p>\r\n	These green PVC water suction hose assemblies are our standard, general purpose suction and discharge hose. They are flexible, lightweight, non-marking, and resistant to mild chemical solutions. These features make these green PVC assemblies ideal for many applications, including general pump suction, washdown, and many more. This is a standard duty product used in the rental, construction, municipal, and marine industries.</p>\r\n<p>\r\n	Green PVC water suction hose has a smooth, abrasion and mild chemical resistant PVC interior, and an abrasion, weather and chemical resistant PVC exterior. Green PVC suction hose has a temperature range of -20C to 55C.</p>\r\n<p>\r\n	These pre-fabricated suction hose assemblies are 20 feet in length, and come complete with aluminum Type C (female) and Type E (male) connectors installed.</p>\r\n',0,0,1,0,0,NULL,''),(7092,3145,NULL,NULL,NULL,'Type AA Aluminum Camlock, Male Camlock X Male Camlock (Double Male)','Size','<p>\r\n	Aluminum camlocks are manufactured from aluminum alloy 384. Aluminum camlocks are among the most widely used camlocks as their light weight and durability are advantageous to many users needs. They have a wide working temperature range of -150<span class=\"st\"></span>F to 250<span class=\"st\"></span>F.</p>\r\n<p>\r\n	Type AA (or double male) Aluminum Camlocks have a male camlock insert on both ends.</p>\r\n',0,0,1,0,43,NULL,''),(7093,3145,NULL,NULL,NULL,'Type DD Aluminum Camlock, Female Camlock X Female Camlock (Double Female)','Size','<p>\r\n	Aluminum camlocks are manufactured from aluminum alloy 384 and feature type 316 stainless steel pins, forged brass handles, and plated steel finger rings. Aluminum camlocks are among the most widely used camlocks as their light weight and durability are advantageous to many users needs. They have a wide working temperature range of -150<span class=\"st\"></span>F to 250<span class=\"st\"></span>F.</p>\r\n<p>\r\n	Type DD Aluminum Camlocks have female camlock receptacles on both ends.</p>\r\n',0,0,1,0,4324,NULL,''),(7094,3145,NULL,NULL,NULL,'Type CR Aluminum Camlock, Female Camlock X Reducer Hose Shank','Female X Male','<p>\r\n	Aluminum camlocks are manufactured from aluminum alloy 384 and feature type 316 stainless steel pins, forged brass handles, and plated steel finger rings. Aluminum camlocks are among the most widely used camlocks as their light weight and durability are advantageous to many users needs. They have a wide working temperature range of -150<span class=\"st\"></span>F to 250<span class=\"st\"></span>F.</p>\r\n<p>\r\n	Type CR Aluminum Camlocks have a female camlock receptacle on one end, and a male hose shank on the other.</p>\r\n',0,0,1,0,4218,NULL,''),(7095,2025,NULL,NULL,NULL,'Round Hole Strainer Assembly','Size','<p>\r\n	These round hole strainer assemblies include a Type D Aluminum Female Camlock, brass close nipple, and a round hole strainer.</p>\r\n',0,0,1,0,7078,NULL,''),(7096,2021,NULL,NULL,NULL,'Black Rubber Contractor\'s Discharge Hose Assemblies w/ Male X Female Camlocks','Size','<p>\r\n	The Black Rubber Contractor\'s Discharge Hose is a collapsible, foldable, heavy duty hose that is commonly used in water applications where more economical PVC hoses will not provide long enough service life. The rubber construction of these suction hose assemblies provides excellent resistance to cuts, gouges, and weathering.</p>\r\n<p>\r\n	This Contractors Rubber Discharge Hose is constructed with a smooth, black rubber tube embedded between layers of synthetic textile cords. It is covered by a black, abrasion resistant wrapped finish.&nbsp; Black rubber suction hose has a temperature range of -40C to +70C.</p>\r\n<p>\r\n	These pre-fabricated discharge hose assemblies are 50 feet in length, and come complete with aluminum Type C (female) and Type E (male) connectors installed.</p>\r\n',0,0,1,0,7657,NULL,''),(7097,2020,NULL,NULL,NULL,'Clear Reinforced PVC Hose','Size','<p>\r\n	Though similar to our Premium Reinforced PVC Food Grade Hose, the Clear Reinforced PVC Hose does not have the additional certifications to make it Food Grade. This makes the Clear Reinforced PVC Hose suitable for industrial applications, while also providing substantial savings compared to our Premium Reinforced Food Grade Hose.</p>\r\n<p>\r\n	This Clear Reinforced PVC Hose is extremely versatile. It\'s reinforced tube makes it an excellent choice for all types of industrial applications. Crystal-clear hose allows operators to detect flow or blockages. Also resistant to mild acid and alkali solutions.</p>\r\n<p>\r\n	Clear Reinforced PVC Hose is sized by I.D. (inside diameter), and priced and sold per foot.</p>\r\n',0,0,1,0,7080,NULL,''),(7099,2020,NULL,NULL,NULL,'Black EPDM Industrial Water Hose','Size','<p>\r\n	This Black EPDM Industrial Water Hose is rugged and capable of handling most washdown and water conveying applications. G311 is a smaller diameter hose of two-sprial construction, while G322 is a larger diameter four-spiral hose for extra kink resistance and working pressure. A temperature range of -40<span class=\"st\">C to 93</span><span class=\"st\">C guarantees the flexibility of the hose in all conditions. Resistant to abrasion, heat, and ozone thanks to its EPDM inner and outer. G311 has a working pressure of 150 PSI, G322 has a working pressure of 200 PSI. Priced per foot, cut to length and fitted with ends to meet your specifications.</span></p>\r\n',0,0,1,0,7082,NULL,''),(7152,3341,NULL,NULL,NULL,'Stainless Steel Part D Female NPT Coupler','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	Our stainless couplings are manufactured from type 316 stainless for maximum corrosion resistance. Care is taken at the factory to ensure a smooth finish on wetted surfac