 border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; vertical-align: baseline;\">C</span></p>\r\n<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Type DP (Dust Plug) Aluminum Camlocks are used to seal a female camlock when not in use, preventing dust and other unwanted matter from entering the hose.</span></p>\r\n',0,0,1,0,7137,NULL,''),(7157,3342,NULL,NULL,NULL,'Brass NPSH Male Shank Couplings','Size','<p>\r\n	Brass NPSH male shank coupling has hose shank one end, male NPSH threads other end.</p>\r\n',0,0,1,0,7138,NULL,''),(7158,3342,NULL,NULL,NULL,'Brass NPSH Female Shank Couplings','Size','<p>\r\n	Brass NPSH female shank coupling has hose shank one end, female NPSH threads other end.</p>\r\n',0,0,1,0,7139,NULL,''),(7159,2025,NULL,NULL,NULL,'Long Round Hole Suction Strainer','Size','<p>\r\n	Long plated steel strainers are slim and long for use in narrow or confined openings. The design is generally no wider than the hose itself. The long plated steel strainers are popular when pumping from ice covered water supplies.</p>\r\n',0,0,1,0,7140,NULL,''),(7160,2025,NULL,NULL,NULL,'Polyethylene Basket Strainer','Size','<p>\r\n	Ployethylene strainers are used where weight or corrosion resistance are important. They are particularly popular in marine applications.</p>\r\n',0,0,1,0,7141,NULL,''),(7161,3342,NULL,NULL,NULL,'Male Hose Shank Ball- Lock Irrigation Coupling C/W Locking Lever','Size','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Ball-lock couplings were originally developed by Bauer in Germany for irrigation piping systems.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">These galvanized steel couplings are economical and are quick and simple to connect.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">The ball and socket design allows for couplings to be connected even when the parts are mis-aligned, and connections can flex up to 30% in all directions.</span><span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Extra long hose shanks allow lots of room for multiple clamps.</span><span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Always use safety clips to prevent accidental disconnection while in service.</span></p>\r\n',0,0,1,0,7142,NULL,''),(7162,3342,NULL,NULL,NULL,'Female Hose Shank Ball-Lock Irrigation Coupling C/W EPDM gasket','Size','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Ball-lock couplings were originally developed by Bauer in Germany for irrigation piping systems.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">These galvanized steel couplings are economical and are quick and simple to connect.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">The ball and socket design allows for couplings to be connected even when the parts are mis-aligned, and connections can flex up to 30% in all directions.</span><span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Extra long hose shanks allow lots of room for multiple clamps.</span><span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Always use safety clips to prevent accidental disconnection while in service.</span></p>\r\n',0,0,1,0,7143,NULL,''),(7163,3342,NULL,NULL,NULL,'Male Coupling to Male NPT Adapter C/W Locking Lever','Size','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Ball-lock couplings were originally developed by Bauer in Germany for irrigation piping systems.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">These galvanized steel couplings are economical and are quick and simple to connect.</span><span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">The ball and socket design allows for couplings to be connected even when the parts are mis-aligned, and connections can flex up to 30% in all directions.</span><span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Extra long hose shanks allow lots of room for multiple clamps.</span><span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Always use safety clips to prevent accidental disconnection while in service.</span></p>\r\n',0,0,1,0,7144,NULL,''),(7164,3342,NULL,NULL,NULL,'Female Coupling C/W EPDM Gasket To Male NPT Adapter','Size','<p>\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\">Ball-lock couplings were originally developed by Bauer in Germany for irrigation piping systems.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-size: 14px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: verdana, arial, helvetica, sans-serif; font-siz