piral in a clockwise direction (similar to a right hand thread).</span></p>\r\n',0,0,1,0,7658,NULL,''),(7188,2045,NULL,NULL,NULL,'Polycarbonate Sight Gauge Nipple','Pipe Size X Length','<p>\r\n	Polycarbonate sight gauges allow users to see what is flowing throught heat-treaters, separators, and storage tank drain lines at all times. This tought, shatter-resistant polycarbonate plastic has more than 30 times the impact resistance of safety glass, withstands prolonged exposure to ultraviolet raysm and can be used in temperatures ranging from -100<span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px;\">C to 75</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px;\">C.</span></p>\r\n',0,0,1,0,7169,NULL,''),(7189,2023,NULL,NULL,NULL,'Plated Carbon Steel Centre Punch Clamps, 10 Pack','Clamp I.D, Band Width','<p>\r\n	These plated steel centre punch clamps feature a plated steel band that offers good strength in low moisture/corrosion applications. Can be locked with impact from a hammer using a conical punch, or any one of our punch lock tools. Sold by the pack of 10 to keep your costs down.</p>\r\n',0,0,1,0,7073,NULL,''),(7190,3062,NULL,32,NULL,'Hach 4864302 Sample Cell, 1\" Round Plastic, 10 ml w/ 1cm Pathlength, 2/pk',NULL,'<p>\r\n	Comes as a set of 2 with caps.</p>\r\n',0,0,1,0,7171,NULL,''),(7191,3345,NULL,32,NULL,'Hach HQ14d Portable Meter Kit with CDC401 Conductivity Cell',NULL,'<p>\r\n	The Hach HQ14d is a dedicated portable conductivity meter. HQd meters connect with smart probes that automatically recognize the testing parameter, calibration history, and method settings to minmize errors and setup time. The durable meter and rugged probes are designed to withstand years of rugged portable and field use. HQd meters feature a simple user interface that does not require manuals or training to operate.</p>\r\n<p>\r\n	The CDC401 conductivity probe alerts the user when re-calibration is needed, and can be moved between meters without the need to re-calibrate or re-enter measurement settings. This probe is waterproof up to 30 meters for 24 hours.</p>\r\n<p>\r\n	Conductivity accuracy  0.5% from (1S/cm - 200 mS/cm). Conductivity measurement of 5 different stability modes. Conductivity measurement range of 0.01 S/cm to 400 S/cm. Conductivity resolution of 0.01 S/cm.</p>\r\n',0,0,1,0,7172,NULL,''),(7192,3345,NULL,32,NULL,'Hach sensION+ EC5 Portable Conductivity Meter Kit',NULL,'<p>\r\n	All-in-one portable field kit with guided menu navigation for fast and simple testing, while also reducing the time necessary to start testing. One hand operation. IP67 design for field use. Kit includes meter, conductivity cell 5060, carrying case, conductivity calibration standards, calibration tubes, sample and measurement containers, and user documentation.</p>\r\n<p>\r\n	Conductivity accuracy  0.5% from ( 1 digit) of measurement range. Conductivity measurement 0.2 S/cm. Conductivity measurment range of 1 S/cm to 200 mS/cm (probe range). Conductivity resolution dependant on measurment range.</p>\r\n',0,0,1,0,7175,NULL,''),(7193,3345,NULL,32,NULL,'Hach sensION+ 5060 Platinum Conductivity Cell',NULL,'<p>\r\n	The Hach sensION+ 5060 is a three-pole platinum conductivity cell with a polycarbonate body and built-in temperature sensor. The 5060 has a fixed 1 meter cable and MP5 connector dedicated for use with Hach sensION+ Portable Conductivity Meters. Ideal for measurements in general aqueous applications.</p>\r\n',0,0,1,0,7177,NULL,''),(7194,3345,NULL,32,NULL,'Hach Sodium Chloride Standard Solution, 50 ml Pour Top','Description','<p>\r\n	Sodium Chloride Standard Solution in a 50 ml bottle with pour top. Used for calibration and accuracy checks in conductivity measurements. Choose from the table below.</p>\r\n',0,0,1,0,7178,NULL,''),(7195,3340,NULL,NULL,NULL,'Hardcoat Aluminium Fire Hydrant Adapters, Female Fire X Male NPT','Hydrant Connection X Outlet Connection','<p>\r\n	Extruded hardcoated aluminum. Configurations shown are most typical to our local area. Please call for information on all other confirguations.</p>\r\n',0,0,1,0,6578,NULL,''),(7196,3345,NULL,32,NULL,'Hach Sodium Chloride Standard Solution, 100 ml ','Description','<p>\r\n	Sodium Chloride Standard Solution in a 100 ml bottle. Used for calibration and accuracy checks in conductivity measurements. Choose from the table below.</p>\r\n',0,0,1,0,7182,NULL,''),(7197,3345,NULL,32,NULL,'Hach Sodium Chloride Standard Solution, 500 ml','Description','<p>\r\n	Sodium Chloride Standard Solution in a 500 ml bottle. Used for calibration and accuracy checks in conductivity measurements. Choose from the table below.</p>\r\n',0,0,1,0,7183,NULL,''),(7198,3346,NULL,NULL,NULL,'Premium Adjustable Fire Hydrant Wrench',NULL,'<p>\r\n	Why take a chance that your hydrant wrench won\'t work at a critical moment. Our Premium G84U universal adjustable wrench has a double spanner head and handles pentagonal hydrant heads to 1-7/8&quot; and square heads to 1-1/2&quot;. The spanner head works with both rocker and pin lug couplings, and the tough manganese-bronze jaw is replaceable. The chrome plated steel handle is 18&quot; long for extra torque.</p>\r\n',0,0,1,0,7179,NULL,''),(7199,3347,NULL,NULL,NULL,'Thermoplastic 1-1/2\" NPSH Industrial Tapered Nozzle',NULL,'<p>\r\n	Tapered fire nozzle has 1-1/2&quot; female NPSH threads.</p>\r\n',0,0,1,0,7671,NULL,''),(7200,3347,NULL,NULL,NULL,'Garden Hose Thread Single Jacket Fire Hose Assemblies','Dia X Length','<p>\r\n	Small hoses are typically used with backpack and small portable pumps to clean up spot fires. These 5/8&quot; and 3/4&quot; hoses are rated to 200 psi working pressure with a 600 psi burst.</p>\r\n',0,0,1,0,4242,NULL,''),(7201,3345,NULL,32,NULL,'Hach Sodium Chloride Standard Solution, 1 L','Description','<p>\r\n	Sodium Chloride Standard Solution in a 1 L bottle. Used for calibration and accuracy checks in conductivity measurements. Choose from the table below.</p>\r\n',0,0,1,0,7184,NULL,''),(7202,3345,NULL,32,NULL,'Hach IntelliCAL CDC401 Standard Conductivity Probe, 1 Meter Cable',NULL,'<p>\r\n	The IntelliCAL CDC401 is a digital, graphite, 4-pole conductivity probe. This standard version comes complete with a 1 meter cable and is intended for laboratory use. It is ideal for measuring electrical conductivity, salinity, resistivity, or total dissolved solids (TDS) in wastewater, drinking water, or general water quality applications.</p>\r\n<p>\r\n	IntelliCal digital probes provide traceability in measurement history. These probes also alert the user when re-calibration is needed. All IntelliCal probes can be moved between meters without the need to re-calibrate or re-enter measurement settings.</p>\r\n<p>\r\n	Cond.: 0.01 S/cm to 200 mS/cm<br />\r\n	TDS: 0 to 50000 mg/L as NaCl<br />\r\n	Salinity: 0 to 42 g/kg or<br />\r\n	Resist.: 2.5 cm to 49 Mcm</p>\r\n',0,0,1,0,7173,NULL,''),(7204,2068,NULL,32,NULL,'Hach 5189900 LIS Chamber',NULL,'<p>\r\n	LIS Sample Chamber for sensION instruments (NOT FOR USE WITH HQd). For low ionic strength samples. Isolates samples from atmosphere.</p>\r\n',0,0,1,0,7189,NULL,''),(7205,3345,NULL,32,NULL,'Hach 88449 Hydrochloric Acid Standard Solution, 6.0 N (1:1), 500 ml',NULL,'<p>\r\n	Multi-purpose hydrochloric acid standard solution, 6.0 N (1:1)</p>\r\n',0,0,1,0,7186,NULL,''),(7206,3345,NULL,32,NULL,'Hach 1442326 Gallic Acid Solution, 50 ml SCDB',NULL,'<p>\r\n	Gallic Acid Solution for conductivity testing. Used to neutralize hydroxide ion interference.</p>\r\n',0,0,1,0,7187,NULL,''),(7207,2067,NULL,NULL,NULL,'The Telescoping Ultra Sampler',NULL,'<p>\r\n	The Telescoping Ultra Sampler features a 1000 ml graduated polypropylene pitcher mounted on a telescoping aluminum tube handle. Premium spring buttons with adjusting steps join the three telescoping sections together and let you choose your exact length. Lower section is 36&quot; in length, middle section is 44&quot; in length, upper section is 36&quot;. Minimum length is 36&quot;, maximum length is 108&quot;.</p>\r\n',0,0,1,0,6469,NULL,''),(7208,2068,NULL,NULL,NULL,'Digital Three-Channel Timer',NULL,'<p>\r\n	Audible and visual alarm, manual and automatic off. All three timer channels visible at same time. Measurement range of 1 second to 10 hours.</p>\r\n',0,0,1,0,7556,NULL,''),(7209,3153,NULL,NULL,NULL,'Handbook of Wastewater Organisms: A Color Atlas',NULL,'<p>\r\n	Hard cover atlas contains 210 high-quality full-color micrographs to help you identify organisms found in sewage and sludge. These photos provide the maximum level of detail and will help you better understand the form and dimension of the organisms. Subjects depicted in the micrographs inlcude bacteria, eggs, amoeba, parasitic protozoa, tardigrada (water bears), rotifers, ciliates, parasitic helminths, pollen grain, free-living nematodes, algae, flagellates, and more. The chapter on enumeration provides literature and techniques for fixing and staining, techniques often required for identification to the speicies level. Also contains a valuable glossary and index to make the book even easier to use.</p>\r\n',0,0,1,0,7190,NULL,''),(7210,3153,NULL,NULL,NULL,'Standard Methods for the Examination of Water and Wastewater',NULL,'<p>\r\n	Standard Methods is the worldwide standard text for water analysis since 1905. Standard Methods provides hundreds of EPA-approved laboratory tests of water quality and properties. These methods represent the best current practice of water and wastewater analysis. Includes hundreds of tables, figures, and color plates of aquatic organisms. Copublished by American Public Health Association, Water Environment Federation, and American Water Works Association (AWWA).</p>\r\n',0,0,1,0,7191,NULL,''),(7211,3153,NULL,NULL,NULL,'Microbiology of Well Biofouling ',NULL,'<p>\r\n	A useful reference guide written with a direct, straight forward approach based upon the advances technology over the last twenty years. With this guide, you will understand the phenomena of biofouling, corrosivity, biodegradation, and shifts in hydraulic transmissivity that can be linked to microbial events. Practical approaches to the evaluation of these effects are introduced, including standard and novel methodologies.</p>\r\n',0,0,1,0,7192,NULL,''),(7212,3408,NULL,8,NULL,'Tough Duck 1737 Hydro Parka, Brown','Size','<p>\r\n	Fabric: 12 oz 100% cotton Tough Duck<span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px;\"> Lining: quilted 8 oz polyester insulation. Laydown corduroy collar. Detachable and adjustable hard hat hood. Knit storm cuffs. 4 large scoop pockets. Inside drawstring waist. Inside pocket and cell pocket. Made in Canada.</span></p>\r\n',0,0,1,0,6094,NULL,''),(7215,3410,NULL,8,NULL,'Tough Duck i474 Hooded Jersey Bomber, Charcoal','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Fabric: 65/35 poly/cotton jersey shell. Lining: quilted 4 oz polyester insulation. Reglan sleeves. Inside cell pocket with velcro closure. Attached double hood with drawstring.</span></p>\r\n',0,0,1,0,7200,NULL,''),(7216,3409,NULL,8,NULL,'Tough Duck 7537 Insulated Bib Overall, Brown','Size','<p>\r\n	Fabric 12 oz 100% cotton Tough Duck. Lining: quilted 6 oz polyester insulation. Seam-sealed waterproof seat. Wateproof double knees. Exclusive double front legs. Heavy-duty 2-way leg zippers from ankle to hip. Elasticized adjustable shoulder straps. Chest pocket with pencil slot. Loss-proof chest pocket for cell phone. Elasticized back waist. Turned under hem allows for 3&quot; tall extension. Made in Canada.</p>\r\n',0,0,1,0,6708,NULL,''),(7217,3409,NULL,8,NULL,'Tough Duck 7537 Insulated Bib Overall, Black','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-hei