68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Fabric: 100% polyester rip stop with PU coating. Fully seam-sealed. 3M Scotchlite reflective material w/ 4&quot; contrast backing. Moisture diversion design on pass-through pockets. Elasticized waist with drawstring. Dual leg stripes. Adjustable snap cuffs. Meets CSA Z96-09, Class 3, Level 2.</span></p>\r\n',0,0,1,0,7212,NULL,''),(7618,3294,NULL,65,NULL,'General Pipe Cleaners SL-GV-A Gen-Eye Vista Video Inspection System',NULL,'<p>\r\n	The Gen-Eye Vista has everything you need for video inspection in a compact, portable package. It includes both a DVD recorder and an SD card reader, all in one. Record crisp video or still images at the jobsite on both devices simultaneously. Keep one copy for your records and give a copy to your supervisor. Or use the USB port to transfer a file of the inspection to a laptop on the spot.<br />\r\n	<br />\r\n	In a remote location? The Vista includes a built-in rechargeable battery that lets you operate in the field on battery power alone for up to 4 hours. With the built-in AC/DC converter, you can recharge the battery while driving from one job to another.<br />\r\n	<br />\r\n	The Gen-Eye Vista includes an 8 LCD color monitor, a full keyboard for on-screen titling, on-screen distance counter, built- in voice over unit, date and time stamp, LED dimmer control, camera test port, and both AC and DC power cords. All are safely contained in a padded 24 lbs. case that can stand alone or be mounted on a reel.<br />\r\n	<br />\r\n	The self-leveling color camera automatically keeps your picture right side up as the camera glides through the line. You always have an upright picture on the monitor, making it easier for you to follow the action.<br />\r\n	<br />\r\n	The fully adjustable docking arm mounts onto a big capacity reel loaded with 200 feet of Gel-Rod push rod and a color self-leveling camera. With this easily maneuverable, all-in-one package y