opulations and functions in wastewater treatment plants, lift stations, septic tanks, sand filters, drain lines, commercial grease traps and lagoons. It contains patented bacteria strain to quickly degrade detergents, tissue, fats, oil and greases as they digest starches, cellulose, protein and vegetable gum. Helps to overcome related problems such as odor and excessive solids accumulation.</p>\r\n<p>\r\n	By improving the oxidation of fats, oils, grease, and detergents, Bio Jet 7 can reduce the required aeration capacity. It can also reduce your need to use chemical settling acids (polymers), cut your energy costs, save defoamer expenses, cut down on routine maintenance, and lower your overall labor costs.</p>\r\n<p>\r\n	No dangerous chemicals to worry about - Bio Jet 7 is approved for waste related applications by the USDA. It is non-toxic, and will not damage equipment or harm the environment.</p>\r\n',1,0,1,0,5550,NULL,''),(7247,3048,NULL,207,NULL,'Bio Jet 7 Sludge Away, 1 Gallon Container','Qty','<p>\r\n	Bio Jet 7 Sludge Away is a non-hazardous and non-toxic organic and microbial based liquid that has shown to speed the microbial response of difficult to degrade organic matter resulting in significant reduction of sludge volumes via the rapid oxidation of many non biodegradable and slow to degrade organic compounds.</p>\r\n<p>\r\n	Bio Jet 7 Sludge Away begins digesting solids on contact resulting in sludge reduction and odor control. Bio Jet 7 Sludge Away produces exceptional sludge reduction - less sludge means less sludge clogging, wasting, and removal - which means more money saved.</p>\r\n<p>\r\n	For optimum and stable long term performance, use it in conjunction with Bio Jet 7 Bacterial Supplement. Due to accelerating waste digestion in all wastewater processes it is for professional use only.</p>\r\n<p>\r\n	Bio Jet 7 Sludge Away is available in 1-gallon containers, or in a case of (6) 1-gallon containers.</p>\r\n',1,0,1,0,5877,NULL,''),(7248,3392,NULL,4,NU