L,'Bio Jet 7 Ammonia Away, 1 Gallon Container','Qty','<p>\r\n	Bio Jet 7 Ammonia Away is a blend of 100% nitrifying bacteria specially formulated to reduce ammonia and nitrite in wastewater. Bio Jet-7 Ammonia Away\'s select microorganisms are autotrophic able to use carbon dioxide as the sole source of carbon, and are relatively slow growing. They are also highly oxygen sensitive, requiring relatively high aerobic condition to achieve maximum growth rates.</p>\r\n<p>\r\n	Use Bio Jet 7 Ammonia Away to quickly achieve and maintain nitrification and to reduce ammonia levels in waste treatment processes. Bio Jet 7 Ammonia Away may be used in any wastewater system to establish stabilized nitrifying ecology.</p>\r\n<p>\r\n	Bio Jet 7 Ammonia Away performs best when the wastewater system is slightly basic in pH, capable of high buffering capacity and highly aerated. For optimal and efficient ammonia reduction use in combination with Bio Jet 7 pH Fix Up</p>\r\n<p>\r\n	Bio Jet 7 Ammonia Away is available in 1-gallon containers, or in a case of (6) 1-gallon containers.</p>\r\n',1,0,1,0,6957,NULL,''),(7272,3409,NULL,8,NULL,'Tough Duck 7936 Deluxe Antarctica Bib Overall, Black','Size','<p>\r\n	Fabic: 12oz 100% Cotton Tough Duck. Lining: Quilted 8oz Polyester insulation. Seam-sealed Waterproof Seat. Waterproof double knee. Heavy-Duty 2-Way leg zippers from ankle to hip with protective storm fly closure and snaps. Chest pocket/Pen Pocket reinforced with Tough Duck embossed rivets. Two lower pockets and back pockets reinforced with Tough Duck embossed rivets. Elasticized adjustable shoulder straps. Elasticized back waist. The Turn Under Hem allows for a 3&quot; Tall Extension. Made in Canada.</p>\r\n',0,0,1,0,7250,NULL,''),(7273,3348,NULL,8,NULL,'Tough Duck 21371B Washed Work Jacket, Brown','Size','<p>\r\n	Fabric: 100% Cotton washed Tough Duck. Lining: quilted 6oz polyester insulation. 2 adjustable waist tabs. Brass zipper closure on chest pocket. 2 lower welt pockets. Inside pocket and cell pocket. Adjustable shank button closure on cuff.</p>\r\n',0,0,1,0,6729,NULL,''),(7274,3348,NULL,8,NULL,'Tough Duck 51231B Washed Hooded Bomber, Brown','Size','<p>\r\n	Fabric: 100% cotton washd Tough Duck. Lining: quilted 5oz polyester insulation. 2 chest pockets. 2 front scoop pockets. Knit waist and cuffs. Attached hood with drawstring. Inside pocket and cell pocket.</p>\r\n',0,0,1,0,7246,NULL,''),(7275,3229,NULL,8,NULL,'Tough Duck 76371B Washed Unlined Bib Overall, Chestnut','Size','<p>\r\n	Fabric: 100% cotton washed Tough Duck. Elasticized adjustable shoulder straps. Hammer loop and ruler pocket. Brass zipper front closure. Chest pocket with pencil slot. Loss-proof chest pocket for cell phone. Made in Canada.</p>\r\n',0,0,1,0,7253,NULL,''),(7276,3408,NULL,8,NULL,'Work King 1731 Hydro Parka w/ Hood, Navy','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Fabric: 10 oz 100% cotton duck. Lining: quilted 6 oz polyester insulation. Adjustable removable hard hat hood (included). Snap closure on top and bottom tabs. Bar tacked at stress points. Double stitched shoulder and armhole seams. 4 large front scoop pockets.</span></p>\r\n',0,0,1,0,5245,NULL,''),(7277,3048,NULL,207,NULL,'Bio Jet 7 pH Fix Up, 50 Lb Bucket',NULL,'<p>\r\n	Bio Jet 7 pH Fix Up is composed of alkalinity increasing materials that are found naturally in water.</p>\r\n<p>\r\n	Bio Jet 7 pH Fix Up should be used for problematic systems due to acidic conditions. Bio Jet 7 pH Fix Up can be used in sesidential &amp; commercial applications to maximize biological oxidation, help sustain system ecology, and improve system performance.</p>\r\n<p>\r\n	Bio Jet 7 pH Fix Up is effective on contact and will help your system to achieve a higher quality effluent to help meet effluent permit requirements.</p>\r\n<p>\r\n	Use Bio Jet 7 pH Fix Up to adjust pH levels for optimum plant performance. When used as directed, Bio Jet 7 pH Fix Up will keep the pH in the range of 7.0 - 8.0. For maximum stabilization use in combination with Bio Jet 7 Bactertial Supplement.</p>\r\n<p>\r\n	Bio Jet 7 pH Fix Up is available in 50 lb. buckets.</p>\r\n',0,0,1,0,7227,NULL,''),(7279,3387,NULL,67,NULL,'Forcefield 4-In-1 Lined High Visibility Parka, Orange','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<u><strong style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Outer Shell</strong></u></p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	100% fluorscent polyester oxford PU coated fabric is fully seam sealed making it windproof and waterproof. Reflective tape in 4&quot; configuration meets CSA Z96-09 Class 2 Level 2. Mesh lined. Heavy duty 2-way front zip with snap closure storm flap. 3-piece hidden hood, outer patch pockets and 2 inner pockets. Black trim hides dirt at cuffs and hem.</p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	<u><strong style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Inner Bomber</strong></u></p>\r\n<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	100% fluorscent polyester oxford PU coated fabric is fully seam sealed making it windproof and waterproof. Reflective tape in 4&quot; configuration meets CSA Z96-09 Class 2 Level 2. Quilt-lined with 6 oz polyester insulation. Heavy-duty rib knit cuff and hem. Sleeves zip off for vest. Front patch pockets and 2 inner pockets. Bomber reverses to black.</p>\r\n',0,0,1,0,6717,NULL,''),(7748,3388,NULL,4,NULL,'Work King s241 Duck/Safety Reversible Freezer Jacket, Orange','Size','<p>\r\n	Fabric: 100% 230T polyester reverses to 8 oz 100% cotton duck.</p>\r\n<p>\r\n	<strong>Safety Side: </strong>lower patch pockets. Rib knit collar and cuffs. 17&quot; embroidery zipper on drop back. 3M Scotchlite Reflective Material w/ 4&quot; contrast backing. Meets CSA Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 3, Level 2.</p>\r\n<p>\r\n	<strong>Duck Side:&nbsp; </strong>Lower welt pockets. Chest pocket. Rib knit collar and cuffs.</p>\r\n',0,0,1,0,7725,NULL,''),(7747,3388,NULL,4,NULL,'Work King s241 Duck/Safety Reversible Freezer Jacket, Yellow','Size','<p>\r\n	Fabric: 100% 230T polyester reverses to 8 oz 100% cotton duck.</p>\r\n<p>\r\n	<strong>Safety Side: </strong>lower patch pockets. Rib knit collar and cuffs. 17&quot; embroidery zipper on drop back. 3M Scotchlite Reflective Material w/ 4&quot; contrast backing. Meets CSA Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 3, Level 2.</p>\r\n<p>\r\n	<strong>Duck Side:&nbsp; </strong>Lower welt pockets. Chest pocket. Rib knit collar and cuffs.</p>\r\n',0,0,1,0,7724,NULL,''),(7282,3394,NULL,67,NULL,'Forcefield High Visibility Safety Overall, Yellow','Size','<p>\r\n	Matches all safety parkas/jackets. Features tape in CSA configuration across back and chest, improving visibility.Side entry pocket, 2 front slash pockets and 2 back patch pockets. Tool loop. Heavy duty adjustable straps, riveted for durability, and elastic back waist. Knee height side leg zips.</p>\r\n',0,0,1,0,7242,NULL,''),(7283,3394,NULL,67,NULL,'Forcefield High Visibility Safety Overall, Orange','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Matches all safety parkas/jackets. Features tape in CSA configuration across back and chest, improving visibility.Side entry pocket, 2 front slash pockets and 2 back patch pockets. Tool loop. Heavy duty adjustable straps, riveted for durability, and elastic back waist. Knee height side leg zips.</span></p>\r\n',0,0,1,0,7259,NULL,''),(7286,3384,NULL,67,NULL,'Forcefield Lined High Visibility Cotton Canvas Parka, Black','Size','<p>\r\n	2&quot; silver reflective tape. Heavy duty 12 oz 100% cotton canvas. Quilt lined with 8 oz polyfill insulation, body lined with faux-shearling. 3-piece snap-off quilted hood. Two-way zip front with snap storm flap closure. Two lower front patch pockets with snap closure. Side zips to hip, inner drawstring at waist. Two inner zip closure pockets. Left arm pen pocket. CSA Z96 Class 1, Level 2.</p>\r\n',0,0,1,0,6083,NULL,''),(7287,3398,NULL,67,NULL,'Forcefield High Visibility Insulated Black Cotton Canvas Coverall','Size','<p>\r\n	2&quot; silver reflective tape. Heavy duty 12oz 100% cotton canvas. Quilt lined with 8oz polyfill insulation. Flannel lining in body and hood. Heavy duty brass front zipper. Knee-height leg zips. Elastic back waist. Two chest &amp; two lower pockets. Two back pockets and tool loop. Rib knit storm cuffs. Elastic strap at leg cuff. Meets CSA Z96 Class 1, Level 2.</p>\r\n',0,0,1,0,7265,NULL,''),(7288,3383,NULL,67,NULL,'Forcefield High Visibility Black Cotton Canvas Lined Overall','Size','<p>\r\n	2&quot; silver reflective tape. Heavy duty 12oz 100% cotton canvas. Quilt lined with 8oz polyfill insulation. Flannel lining. Heavy duty elastic adjustable straps. Heavy duty brass front zipper. Knee-height leg zips. Elastic back waist. Two lower front pockets &amp; two back pockets. Tool loop. Rib knit storm cuffs. Elastic strap at leg cuff. Meets CSA Z96 Class 1, Level 2 requirements.</p>\r\n',0,0,1,0,7220,NULL,''),(7289,3397,NULL,67,NULL,'Forcefield High Visibility Safety Softshell Rain Jacket, Yellow','Size','<p>\r\n	100% polyester Soft Shell fabric, bonded to a soft fleece lining, 220 GSM. Water resistant &amp; breathable. Full length, heavy duty front zip, with inside storm flap and chafe-free chin guard. Adjustable Velcro at cuffs and hem cinch. Two lower loss-proof pockets, snaps added. Detachable snap-off shaped hood. Meets CSA Z96-09, Class 2, Level 2.</p>\r\n',0,0,1,0,7269,NULL,''),(7290,3397,NULL,67,NULL,'Forcefield High Visibility Safety Softshell Rain Jacket, Orange','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	100% polyester Soft Shell fabric, bonded to a soft fleece lining, 220 GSM. Water resistant &amp; breathable. Full length, heavy duty front zip, with inside storm flap and chafe-free chin guard. Adjustable Velcro at cuffs and hem cinch. Two lower loss-proof pockets, snaps added. Detachable snap-off shaped hood. Meets CSA Z96-09, Class 2, Level 2.</p>\r\n',0,0,1,0,7270,NULL,''),(7291,3397,NULL,67,NULL,'Forcefield High Visibility Safety Softshell Rain Jacket, Black','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	100% polyester Soft Shell fabric, bonded to a soft fleece lining, 220 GSM. Water resistant &amp; breathable. Full length, heavy duty front zip, with inside storm flap and chafe-free chin guard. Adjustable Velcro at cuffs and hem cinch. Two lower loss-proof pockets, snaps added. Detachable snap-off shaped hood. Meets CSA Z96 Class 1, Level 2.</p>\r\n',0,0,1,0,7271,NULL,''),(7374,3358,NULL,216,NULL,'Kodiak Professional Electric Pressure Washer, 1300 PSI, 120V',NULL,'<p>\r\n	Detergent bottle attachment and quick-connect garden hose coupling for easy set-up anywhere. Quality General Pump design and induction electric motor for easy starts and hassle-free performance. Rotoclean spinning jet nozzle simulates the action of up to 2300 PSI (boosts cleaning nearly 2 to 1 over spray nozzles).</p>\r\n<p>\r\n	1.5 HP, 1300 PSI, 1.85 GPM, 15A. Ready to use, no assembly required unit comes complete with Rotoclean spinning nozzle, premium 26 foot wire braid hose, and detachable detergent injector cup. Made in Italy.</p>\r\n',0,0,1,0,7351,NULL,''),(7292,3388,NULL,67,NULL,'Forcefield High Visibility Safety Freezer Jacket, Orange','Size','<p>\r\n	100% polyester shell fabric, qilted with 3oz poly-fil lining. Two inner pockets. Rib-knit collar and cuffs. Lower front pockets. Meets CSA Z96-09, Class 2, Level 2.</p>\r\n',0,0,1,0,7267,NULL,''),(7373,3084,NULL,216,NULL,'Kodiak PSP200SSK 2\" Stainless Steel Submersible Dewatering Pump, 120V, 67 GPM',NULL,'<p>\r\n	Unique design with double silicon carbide mechanical seals offers added protection for extended life. Cast-iron volute and impeller combine to add weight and performance to submersible design. Specially-treated components extend rust protection for longer service time and low-maintenance needs.</p>\r\n<p>\r\n	Low power (7.6A) demands for cost-effective performance in long-term installations. CSA-certified for guaranteed safe performance under tough conditions. Handles solids up to 1/8&quot; diameter.</p>\r\n<p>\r\n	Maximum capacity of 67 GPM. Maximum head of 37 ft. 2&quot; NPT. 115 V, 7.6A.</p>\r\n',1,0,1,0,4526,NULL,''),(7520,3171,NULL,70,NULL,'130 Series Premium CSA Safety Glasses, Clear Lens','Qty','<p>\r\n	Adjustable ratchet temples can fit any face shape. Integral brow guard offers additional protection against flying debris. Extremely lightweight. High impact resistance. Scratch resistant. Offers 99% protection from UV-A and UV-B rays. Compliant with CSA Z94.3 and ANSI Z87.1 Clear lens. Sold individually or per case of 12.</p>\r\n',0,0,1,0,5933,NULL,''),(7293,3388,NULL,67,NULL,'Forcefield High Visibility Safety Freezer Jacket, Yellow','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	100% polyester shell fabric, qilted with 3oz poly-fil lining. Two inner pockets. Rib-knit collar and cuffs. Lower front pockets. Meets CSA Z96-90, Class 2, Level 2.</p>\r\n',0,0,1,0,7266,NULL,''),(7294,3388,NULL,67,NULL,'Forcefield High Visibility Safety Freezer Jacket, Black','Size','<p style=\"margin: 0px 0px 1.3em; padding: 0px; border: 0px; font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px; vertical-align: top; color: rgb(68, 68, 68);\">\r\n	100% polyester shell fabric, qilted with 3oz poly-fil lining. Two inner pockets. Rib-knit collar and cuffs. Lower front pockets. Meets CSA Z96, Class 1, Level 2.</p>\r\n',0,0,1,0,7268,NULL,''),(7757,3405,NULL,232,NULL,'Tough Duck G79616 Safety Precision Glove, Orange',NULL,'<p>\r\n	Synthetic suede palm with anti-slip polyurethane double palm. Enprotex water proof breathable liner. Reflective striping on back for improved overall visibility. Poly spandex safety back. Adjustable wrist strap. Sold individually.</p>\r\n',0,0,1,0,7734,NULL,''),(7759,3405,NULL,232,NULL,'Tough Duck GI7116 Hi Vis Bladex Glove','Size','<p>\r\n	13 gauge hi vis Bladex 5 liner with black sandy finish coating on the palm. TPR protection on the back. Hook and loop on wrist for easy closure. Padded palm. Comfortable and long wearing. Fluorescent yellow color for improved overall visibility. Sold individually.</p>\r\n',0,0,1,0,7736,NULL,''),(7760,3405,NULL,232,NULL,'Tough Duck G06416 Hi-Vis Thermal Knit Latex Glove, 12/pk','Size','<p>\r\n	Textured latex grip. Contour fit hand. Ideal for cold weather. Helps improve overall visibility. Machine washable. Sold per pack of 12.</p>\r\n',0,0,1,0,7737,NULL,''),(7761,3405,NULL,232,NULL,'Tough Duck GI6216 Basic Hi-Vis Unlined Precision Glove, Yellow, 6/pk','Size','<p>\r\n	Spandex back. Polyurethane palm. Improves overall visibility. Sold per pack of 6.</p>\r\n',0,0,1,0,7738,NULL,''),(7754,3405,NULL,232,NULL,'Tough Duck i15516 Safety Aviator Hat, Yellow','Size','<p>\r\n	100% polyester shell with 100% polyester lining. Reflective stripe for improved overall visibility. Built-in chin strap with closure. Sold individually.</p>\r\n',0,0,1,0,7731,NULL,''),(7755,3405,NULL,232,NULL,'Tough Duck i15516 Safety Aviator Hat, Orange','Size','<p>\r\n	100% polyester shell with 100% polyester lining. Reflective stripe for improved overall visibility. Built-in chin strap with closure. Sold individually.</p>\r\n',0,0,1,0,7732,NULL,''),(7756,3405,NULL,232,NULL,'Tough Duck G79616 Safety Precision Glove, Yellow','Size','<p>\r\n	Synthetic suede palm with anti-slip polyurethane double palm. Enprotex water proof breathable liner. Reflective striping on back for improved overall visibility. Poly spandex safety back. Adjustable wrist strap. Sold individually.</p>\r\n',0,0,1,0,7733,NULL,''),(7783,3410,NULL,8,NULL,'Tough Duck 4701 Zip Front Hoodie','Size','<p>\r\n	Fabric: 65% polyester, 35% cotton. Attached hood with drawstring. Lower pouch pockets. Zip front closure.</p>\r\n',0,0,1,0,7201,NULL,'');
INSERT INTO `products_pri` VALUES (7784,3411,NULL,67,NULL,'Forcefield Premium Hooded Quilted Freezer Jacket, Navy','Size','<p>\r\n	Quilt-lined 100% polyester with 160 GSM insulation. 300 GSM polyester jersey double hood with drawstring. Heavy duty plastic front zip under spring-loaded snap front storm flap. Two front lower pockets. Double storm cuffs for improved comfort and warmth: outer cuff is heavy rib knit, inner cuff is spandex blend. Back kidney-warmer extension</p>\r\n',0,0,1,0,7761,NULL,''),(7732,3396,NULL,199,NULL,'Stalworth 182 Waterproof Pull-On Pant, Black','Size','<p>\r\n	Waterproof shell is made of 9 oz 100% cotton. Premium polyester tricot lining is quite breathable. Elasticized waist<br />\r\n	with drawstring for easy pull-on. Belt loop. Welt back pocket. Leg zippers. CSA compliant.</p>\r\n',0,0,1,0,7217,NULL,''),(7733,3394,NULL,199,NULL,'Stalworth 192 Waterproof Insulated Pull-On Pant, Black','Size','<p>\r\n	Stalworth pants are premium quality. They feature a 10 oz Oxford waterproof shell with 6 oz Holofil insulation. Elastic waistband with drawstring for easy pull-on. Welded waterproof seams. 3M Scotchlite 2 reflective material on 4 backing meets CSA requirements.</p>\r\n',0,0,1,0,7710,NULL,''),(7301,3397,NULL,67,NULL,'Forcefield High Visibility Dirt-Block Premium Rain Jacket, Orange','Size','<p>\r\n	100% Polyester oxford PU coated. 100% polyester mesh lining. Water &amp; wind proof fabric fully seam sealed. Full length, heavy duty front zip, with storm flap. Adjustable Velcro at cuffs and hem cinch. Two lower loss-proof pockets. Detachable snap off hood, storm cuffs. Black Dirt-Block cuffs and hemline reduce the appearance of dirt on garments. Meets CSA Z96-09, Class 2, Level 2.</p>\r\n',0,0,1,0,7278,NULL,''),(7302,3397,NULL,67,NULL,'Forcefield High Visibility Dirt-Block Premium Rain Jacket, Yellow','Size','<p>\r\n	100% Polyester oxford PU coated. 100% polyester mesh lining. Water &amp; wind proof fabric fully seam sealed. Full length, heavy duty front zip, with storm flap. Adjustable Velcro at cuffs and hem cinch. Two lower loss-proof pockets. Detachable snap off hood, storm cuffs. Black Dirt-Block cuffs and hemline reduce the appearance of dirt on garments. Meets CSA Z96-09, Class 2, Level 2.</p>\r\n',0,0,1,0,7279,NULL,''),(7509,3117,NULL,221,NULL,'MSA Altair 4X Multigas Detector',NULL,'<p>\r\n	The MSA Altair 4X multigas detector for LEL, CO, H2S and O2 is as tough and functional as it looks. A rugged housing provides unsurpassed durability, including the ability to survive a 20-foot drop. And with large, glove-friendly buttons and a high-contrast display, the Altair 4X is easy to operate in any work environment, even low-light conditions. It features MSA XCell sensors which have a typical life of more than four years, double the industry average, and are engineered using MSA\'s proprietary application-specific integrated circuit (ASIC) design. By miniaturizing the sensors\' controlling electronics and placing them inside the sensor itself, MSA XCell sensors offer superior stability, accuracy and repeatability.<br />\r\n	<br />\r\n	Exclusive MotionAlert and InstantAlert features make the Altair 4X ideal for applications such as confined space monitoring. The MotionAlert feature activates when a user becomes disabled and motionless, quickly alerting others to the disabled users location. And with a simple push of a button, the InstantAlert feature enables users to manually alert others to potentially hazardous situations. Glow in the dark housing also available.</p>\r\n<p>\r\n	Includes the pre-installed new XCell sensor for H2S-LC (low concentration) . It provides 0.1 ppm H2S resolution with up to 100 ppm range. This sensor was specifically designed for better performance at lower H2S concentrations and allows users to set low alarms at 1 ppm.</p>\r\n',0,0,1,0,7486,NULL,''),(7303,3396,NULL,67,NULL,'Forcefield High Visibility Dirt-Block Premium Rain Overall, Orange','Size','<p>\r\n	100% polyester oxford PU COATED. 100% polyester mesh lining. Water &amp; wind proof fabric, fully seam sealed. Multiple pockets. Heavy duty adjustable elastic straps. Riveted stress points. Cut for comfort and ease. Black Dirt-Block leg bottoms reduce the appearance of dirt on garments. Meets CSA Z96-09, Class 3, Level 2 when worn with a Class 2, Level 2 upper garment.</p>\r\n',0,0,1,0,7280,NULL,''),(7502,3351,NULL,NULL,NULL,'Drain Seal Mats w/ Storage Holder','Mat Size','<p>\r\n	Drain seal mats are constructed of 100% solid tacky polyurethane. Reversible and easy to use. Cost effective reusable solution for emergency chemical spills. Ideal to seal around drains, storm sewer inlets, curb culverts, etc.</p>\r\n<p>\r\n	Storage holder in made of polypropylene with velcro straps for quick and easy access. Includes wall mounts for optional wall mount storage.</p>\r\n',0,0,1,0,7479,NULL,''),(7503,3351,NULL,NULL,NULL,'Universal 20 Liter Emergency Spill Kit',NULL,'<p>\r\n	For all types of spills, including chemical and oil.</p>\r\n<p>\r\n	Includes the following (1), yellow spill kit bag, (1) emergency spill kit decal, (10) 15&quot; x 18&quot; heavy weight spill pads, (2) 3&quot; x 4 ft spill socks, (1) disposal bag, (1) pair nitrile gloves, (1) 2 lb container granular absorbent, (1) instruction sheet, (1) contents sheet</p>\r\n',0,0,1,0,7480,NULL,''),(7308,3351,NULL,NULL,NULL,'Drain Plug Kit',NULL,'<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Prevents leaks and spills from entering circular drains from 2&quot;, 3&quot; and 4&quot; in diameter. Tapered design wedges securely into standard drains to form a tight seal. Eyebolts are removable, allowing easy installation of grating with drain plug in place. Non-absorbing and easily cleaned for repeated use. Resists oils and most aggressive chemicals.</span></p>\r\n',0,0,1,0,7285,NULL,''),(7309,3351,NULL,NULL,NULL,'Roof Leak Diverters','Size','<p>\r\n	Fast &amp; efficient response to overhead leaks. Flow rate of over 3 gallons per minute. Convenient hose connector with cap. Fits standard garden hose, not included. Hose can then be directed to proper drainage point. High chemical resistance. Lightweight, reusable and easy to store. Material: PVC. Attach with four bungee cords or rubber tie downs (not included).</p>\r\n',0,0,1,0,7286,NULL,''),(7310,3351,NULL,NULL,NULL,'Pipe Leak Diverter',NULL,'<p>\r\n	Fast and efficent response to leaks, eliminating slip hazards. High chemical resistance. 7-gallon fluid capacity. Convienient garden hose connector with cap. Hose can then be directed to proper drainage point. Fits standard garden hose, not included. Lightweight, reusable and easy to store. Materal: PVC. Dimensions 18&quot; x 18&quot;. Includes four bungee cords.</p>\r\n',0,0,1,0,7287,NULL,''),(7311,3352,NULL,NULL,NULL,'Circuit Breaker Lockouts','Description','<p>\r\n	Exclusive design accommodates virtually all styles of breaker toggles. Fits all American Lock and Master Lock safety padlocks and hasps. Grips tight with a simple thumb turn and clamping handle. Narrow profile permits side-by-side breaker lockout. Made of power coated steel and reinforced polymer to operate in harsh conditions.</p>\r\n',0,0,1,0,7288,NULL,''),(7511,3117,NULL,221,NULL,'MSA Galaxy GX2 Multi-Unit Charger for Altair 4X',NULL,'<p>\r\n	The multi-unit tray charger provides charging for 1-4 Altair 4X Detectors. Additional units may be purchased and added on simply by connecting to the other charging module.</p>\r\n',0,0,1,0,7488,NULL,''),(7512,2061,NULL,67,NULL,'Forcefield CSA Fall Protection Kit',NULL,'<p>\r\n	Simplifies fall protection with an easy price. Includes (1) universal fall arrest harness, (1) 5/8&quot; X 50 ft vertical lifeline, (1) self trailing rope grab w/ 2 ft lanyard, (1) anchor device, and (1) bucket container. Made and packaged in Canada, contents are CSA compliant.</p>\r\n',0,0,1,0,4977,NULL,''),(7510,3117,NULL,221,NULL,'MSA Calibration Gas, 34 Litre, Quad Mixed',NULL,'<p>\r\n	Calibration gas instrument cylinder, 1.45% CH4, 15% 02, 60 ppm CO, 20 ppm H2S. 34 liter volume.</p>\r\n',0,0,1,1,7487,NULL,''),(7315,3352,NULL,NULL,NULL,'Universal Wall Switch Lockout',NULL,'<p>\r\n	Prevent unintentional toggling of wall switch to &quot;ON&quot; position. One-time installation uses the existing wall plate screws. Hinges open for unobstructed normal operation switch. Lock the switch in either the &quot;ON&quot; or &quot;OFF&quot; position by closing the cover over the switch, then applying padlock. Locks out both toggle and Decor Paddle wall switches.</p>\r\n',0,0,1,0,7292,NULL,''),(7497,3352,NULL,NULL,NULL,'Wall Mount Lockout Station',NULL,'<p>\r\n	Wall mount lockout station measures 11&quot; x 14&quot;. Includes pre-drilled mounting holes and metal hooks. Comes complete with four padlocks, 25 lockout tags, and three lockout hasps.</p>\r\n',0,0,1,0,7474,NULL,''),(7498,3352,NULL,NULL,NULL,'Lockout Tool Box Kit',NULL,'<p>\r\n	Includes what you need to lock and mark equipment, preventing its use until repairs have been completed. Includes (1) tool box, (1) 1&quot; to 2.5&quot;&nbsp; gate valve handle lockout, (1) small ball valve lockout, (1) 3/4&quot; padlock, (1) 2&quot; padlock, (1) wall switch lockout, (1) labeled lockout hasp, (5) lockout tags, (1) universal multi-pole lockout, (1) 277V &quot;No Hole&quot; breaker lockout, (1) 480/600V &quot;No Hole&quot; breaker lockout, (1) small plug lockout.</p>\r\n',0,0,1,0,7475,NULL,''),(7499,3352,NULL,NULL,NULL,'Electrical & Valve Deluxe Lockout Kit',NULL,'<p>\r\n	All parts are contained within a lightweight safety lockout carrying case with modular compartments for effective grouping of padlocks and hasps.</p>\r\n<p>\r\n	Includes (6) 9/32&quot; padlocks, (2) breaker switch padlocks, (1) hasp, (1) snap-on hasp, (1) adjustable cable lockout, (2) plug cover lockouts, (3) gate valve lockouts, (2) ball valve lockouts, (9) circuit breaker lockouts, (2) wall switch covers, (24) do not operate tags.</p>\r\n',0,0,1,0,7476,NULL,''),(7500,3352,NULL,24,NULL,'Masterlock Red Safety Lockout Padlock','Qty','<p>\r\n	Designed exclusively for lockout applications. Durable, lightweight, non-conductive Xenoy lock body. Compliance with OSHA &quot;one employee, one lock, one key&quot; directive. 1-1/2&quot; wide X 1-3/4&quot; tall body, shackle with 1-1/2&quot; clearance. 1/4&quot; shackle diameter. Sold individually or per package of 6.</p>\r\n',0,0,1,0,7477,NULL,''),(7501,3352,NULL,NULL,NULL,'Lockout Hasps','Type','<p>\r\n	Lockout hasps offer locking control for machinery or electrical power sources while maintenance or repairs are being done. Accomodates padlock shackles up to 3/8&quot; diameter.</p>\r\n',0,0,1,0,7478,NULL,''),(7321,3352,NULL,NULL,NULL,'Gate Valve Handle Lockouts ','Fits Handle Dia.','<p>\r\n	Surrounds the gate valve operating handle, protecting against accidental or purposeful valve opening. Unique, patent-pending outward rotation allows for easier installation in confined space applications.</p>\r\n<p>\r\n	Tough, lightweight, dielectric Zenex thermoplastic bodies withstand chemicals; performing effectively in extreme conditions (temperature range -46C to 177C). Up to four workers can apply their personal safety locks.</p>\r\n',0,0,1,0,7299,NULL,''),(7322,3352,NULL,NULL,NULL,'Ball Valve Wrap-Around Lockouts',NULL,'<p>\r\n	Compact, lightweight, flexible and easy to use. Eliminates the risk of accidentally moving a handle by removing it and concealing the stem. Effectively locks out all valves from 3/8&quot; to 4&quot;.</p>\r\n<p>\r\n	Simple to apply, with an intuitive wrapping strap and locking mechanism. Works on virtually all valves; metal and PVC, insulated pipes and hard to reach valves. Made of PVC polyester fabric and HDPE plastic, able to withstand corrosive environments. Easy to follow instructions printed on lockout.</p>\r\n',0,0,1,0,7298,NULL,''),(7328,2064,NULL,NULL,NULL,'WHMIS MSDS Binders','Ring Size','<p>\r\n	Keep your Material Safety Data Sheets organized with a durable MSDS Binder (3-rings with triggers). Printed in bright red, these binders will be highly visible in your workplace. They are available in 1&quot;, 2&quot; and 4&quot; size. Each binder holds standard 8-1/2&quot; x 11&quot; paper. Large 4&quot; binders have 3 1/2&quot; slant D-rings for extra capacity.</p>\r\n',0,0,1,0,5984,NULL,''),(7329,3351,NULL,NULL,NULL,'Acid Neutralizer, 2lb Dry Shaker',NULL,'<p>\r\n	Neutralizes and absoribs aggressive alkaline spills. Colour changing indicators to signify when neutralization has occurred.</p>\r\n',0,0,1,0,7306,NULL,''),(7330,3351,NULL,NULL,NULL,'Acid Neutralizer, 5-Gallon Dry Pail',NULL,'<p>\r\n	Neutralizes and absorbs aggressive alkaline spills. Colour changing indicators to signify when neutralization has occurred.</p>\r\n',0,0,1,0,7308,NULL,''),(7331,3351,NULL,NULL,NULL,'Acid Neutralizer, 4-kg Dry Pail',NULL,'<p>\r\n	Neutralizes and absorbs aggressive alkaline spills. Colour changing indicators to signify when neutralization has occurred.</p>\r\n',0,0,1,0,7307,NULL,''),(7333,3351,NULL,NULL,NULL,'Caustic (Base) Neutralizer, 2lb Dry Shaker',NULL,'<p>\r\n	Neutralizes and absoribs aggressive caustic spills. Colour changing indicators to signify when neutralization has occurred.</p>\r\n',0,0,1,0,7310,NULL,''),(7334,3351,NULL,NULL,NULL,'Caustic (Base) Neutralizer, 5-Gallon Dry Pail',NULL,'<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Neutralizes and absoribs aggressive caustic spills. Colour changing indicators to signify when neutralization has occurred.</span></p>\r\n',0,0,1,0,7312,NULL,''),(7335,3351,NULL,NULL,NULL,'Caustic (Base) Neutralizer, 4kg Dry Pail',NULL,'<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Neutralizes and absoribs aggressive caustic spills. Colour changing indicators to signify when neutralization has occurred.</span></p>\r\n',0,0,1,0,7311,NULL,''),(7337,3171,NULL,NULL,NULL,'Zenith Premium Indirect Vent Safety Goggle',NULL,'<p>\r\n	Wraparound style provides excellent 180<span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small; line-height: 18.200000762939453px;\">&nbsp;</span>panoramic vision. Extremely flexible soft PVC goggle body for greater comfort. Impact resistant polycarbonate lens. Anti-fog lens is ideal for high humidity applications. Indirect vent increases air flow and protects aginst dust, fumes, and chemical splash. Adjustable elastic headband. Compliant with CSA standard Z94.3</p>\r\n',0,0,1,0,7499,NULL,''),(7338,2065,NULL,NULL,NULL,'North 7900 Emergency Escape Respirators',NULL,'<p>\r\n	Easy to use, emergency escape mouthpiece respirator. Disposable, no need for a maintenace program. NIOSH Approved for (Escape only): Chlorine, Chlorine Dioxide, Sulfur Dioxide, Hydrogen Sulfide</p>\r\n',0,0,1,0,5016,NULL,''),(7765,3406,NULL,8,NULL,'Tough Duck Gi6606 100G Thinsulate Lined Cow Split Leather Fitted Gloves, 6/pk','Size','<p>\r\n	10 oz cotton brown twill. 100 g Thinsulate Insulation. Premium cow split. Rubberized safety cuff. Leather knuckle strap and finger tips. Sold per pack of 6.</p>\r\n',0,0,1,0,7744,NULL,''),(7766,3406,NULL,8,NULL,'Tough Duck Gi5506 Pile Lined Cow Split Leather Fitted Gloves, 6/pk','Size','<p>\r\n	10 oz cotton brown twill. 100% polyester pile lining provides insulation from the cold. Premium cow split leather. Rubberized safety cuff. Leather knuckle strap and finger tips. Sold per pack of 6.</p>\r\n',0,0,1,0,5215,NULL,''),(7340,3272,NULL,184,NULL,'Premium Blue PVC Ultra Flexible Gloves, 12/pk','Size','<p>\r\n	Premium ultra flexible PVC coating. Seamless 13-gauge liner. Pre-formed shape for ultimate dexterity and comfort. Double dipped for added durability. 12&quot; length. Rough finish provides superior grip. Sold by the pack of 12.</p>\r\n',0,0,1,0,7317,NULL,''),(7350,3274,NULL,NULL,NULL,'Superior Quality Hi-Visibility Split Cowhide Fitters Gloves 12/pk',NULL,'<p>\r\n	Good abrasion resistance. Absorbent cotton lined palm. Full leather tipped fingers and knuckle strap. Fluorescent yellow back and two grey reflective stripes offer maximum visibility. Rubberized safety cuff. Sold by pack of 12.</p>\r\n',0,0,1,0,7327,NULL,''),(7351,3274,NULL,NULL,NULL,'Superior Quality Hi-Visibility Split Cowhide Fitters Thinsulate Lined Gloves, 6/pk',NULL,'<p>\r\n	Good abrasion resistance. 100-g Thinsulate Liner provides superior warmth. Full leather tipped fingers and knuckle strap. Fluorescent yellow back and two grey reflective stripes offer maximum visibility. Rubberized safety cuff. Sold by pack of 6.</p>\r\n',0,0,1,0,7328,NULL,''),(7356,3374,NULL,NULL,NULL,'Watertight Roof Sealant','Size, Qty','<p>\r\n	<span id=\"ctl00_ContentPlaceHolder1_lblProductDesc\">High performance, asphalt-based sealant for sealing roof gaps and joints, spotting shingles and repairing minor roof leaks. Forms a durable, flexible, weather-resistant and watertight seal. Can be used for both wet and dry applications. Will not run or bubble. Exterior use.</span></p>\r\n',0,0,1,1,7536,NULL,''),(7357,3356,NULL,192,NULL,'Rolling Step Ladder, 24\" Width, 2-Step ',NULL,'<p>\r\n	Frame is welded 1&quot; round steel tubing. For use in record storage rooms, offices, warehouses and confined spaces. Rolls into position and locks firmly to the floor. Casters retract&nbsp; under operator\'s weight while rubber feet drop down. Non-clogging slip-resistant steel steps. Durable KLETON blue enamel finish. CSA certified to the ANSI standard A14.7</p>\r\n<p>\r\n	Two steps. Each step measures 22&quot; W x 8&quot; D. Total height is 19&quot;. Top platofrm measures 22&quot; W&nbsp; x 16&quot; D. Base Measures 24&quot; W x 26&quot; D.</p>\r\n',0,0,1,0,7334,NULL,''),(7358,3356,NULL,192,NULL,'Rolling Step Ladder, 24\" Width, 3-Step',NULL,'<p>\r\n	Frame is welded 1&quot; round steel tubing. For use in record storage rooms, offices, warehouses and confined spaces. Rolls into position and locks firmly to the floor. Casters retract under operator\'s weight while rubber feet drop down. Non-clogging slip-resistant steel steps. Durable KLETON blue enamel finish. CSA certified to the ANSI standard A14.7</p>\r\n<p>\r\n	Three steps. Each step measures 22&quot; W x 8&quot; D. Total height is 28&quot;. Top platform measures 22&quot; W x 16&quot;D. Base measures 24&quot; W x 30&quot; D.</p>\r\n',0,0,1,0,7335,NULL,''),(7359,3356,NULL,192,NULL,'Rolling Step Ladder, 24\" Width, 4-Step ',NULL,'<p>\r\n	Frame is welded 1&quot; round steel tubing. For use in record storage rooms, offices, warehouses and confined spaces. Rolls into position and locks firmly to the floor. Casters retract under operator\'s weight while rubber feet drop down. Non-clogging, slip-resistant steel steps. Durable KLETON blue enamel finish.&nbsp; CSA certified to the ANSi standard A14.7</p>\r\n<p>\r\n	Four steps. Each step measures 22&quot; W x 8&quot; D. Total height is 37&quot;. Top platform measures 22&quot; W x 16&quot; D. Base measures 24&quot; W x 37&quot; D.</p>\r\n',0,0,1,0,7336,NULL,''),(7485,2081,NULL,11,NULL,'Super Ego 725 Tubing Cutter, 1/8\" to 1-1/8\" Capacity',NULL,'<p>\r\n	Zamak body and cutter-slide. Monoblock guide. Close-to-flare cut grooved rollers. Spare cutter wheel in knob housing. Special knob design for better grip. Folding reamer. For use with copper, stainless steel, and all types of plastic tubing. Cutting capacity of 1/8&quot; to 1-1/8&quot;.</p>\r\n',0,0,1,0,7462,NULL,''),(7486,2081,NULL,11,NULL,'Super Ego 726 Tubing Cutter, 1/2\" to 2\" Capacity',NULL,'<p>\r\n	Zamak body and cutter-slide. Monoblock guide. Close-to-flare cut grooved rollers. Spare cutter wheel in knob housing. Special knob design for better grip. Roller stops for cutter wheel protection. Produces a sharp, clean cut. For use with copper, stainless steel, and all types of plastic tubing. Cutting capacity of 1/2&quot; to 2&quot;.</p>\r\n',0,0,1,0,7463,NULL,''),(7487,2081,NULL,11,NULL,'Super Ego Top Screw Pipe Chain Vise',NULL,'<p>\r\n	Special V shaped forged steel jaws, H connected for centred pipe support. Cast iron base with V shape support. Base designed for fastening to work bench or portable pipe vise stand. Quick pipe grip through the chain, knurled nut screw and lateral lever with cam. Capacity of 1/4&quot; to 6&quot; pipe or tubing.</p>\r\n',0,0,1,0,7464,NULL,''),(7488,2081,NULL,11,NULL,'Super Ego Bench Yoke Pipe Vise',NULL,'<p>\r\n	Nodular cast iron yoke and base. Floating upper jaw allows for perfect matching of the piece. Fine thread pitch for firm grip with minimum effort. Easy to attach to work bench or portable pipe stand. Capacity of 1/8&quot; to 2&quot; pipe or tubing.</p>\r\n',0,0,1,0,7465,NULL,''),(7489,2081,NULL,11,NULL,'Super Ego Portable Pipe Vise Stand',NULL,'<p>\r\n	Collapsible stand is constructed of lightweight aluminum alloy. Includes fold-in tray for easy carrying and setup. Has slots for hanging tools.</p>\r\n<p>\r\n	Able to accept Super Ego Bench Yoke and Top Screw pipe chain vises.</p>\r\n',0,0,1,0,7466,NULL,''),(7490,2081,NULL,160,NULL,'MEGA CVT-2 Hydraulic Pipe Bender',NULL,'<p>\r\n	Capable of bending black iron and galvanized pipes in excess of 90 degrees. Maximum ram power is 16.5 tons. Built-in safety valve prevents overloading. Bends pipes in sizes 1/2&quot;, 3/4&quot;, 1&quot;, 1-1/4&quot;, 1-1/2&quot; and 2&quot;. Supplied with tripod stand and selection of 6 bending shoes.</p>\r\n',0,0,1,0,7467,NULL,''),(7491,2081,NULL,NULL,NULL,'Vertical Pipe Stand w/ Parts Shelves',NULL,'<p>\r\n	Steel construction, powder coated blue. Capacity of 3000 lbs. Dimensions 36&quot; x 24&quot; x 84&quot;. Vertically stores pipe, strut, threaded rod, etc up to 12 feet in length. 3 shelves for extra storage of small parts. 8&quot; deep arms divided into 3 sections.</p>\r\n',0,0,1,0,7468,NULL,''),(7493,3358,NULL,77,NULL,'Magikist SPEX Series Industrial Electric Pressure Washers','Description','<p>\r\n	The Magikist SPEX Series of pressure washers are industrial rated for heavy duty use. Uses an industrial rated TEFC Baldor electric motor.<br />\r\n	<br />\r\n	Belt driven triplex ceramic plunger pump operates at slow speeds for reduced pump wear and vibration when compared to direct drive pumps. This significantly extends the life of the pump.<br />\r\n	<br />\r\n	Stainless steel water reservoir with brass level control. Pressure regulating unloader valve for easy pressure adjustment.<br />\r\n	<br />\r\n	Glycerine filled pressure gauge, prime valve, and safety pressure relief valve. Durable powder coated components for resistance to moisture. Pneumatic wheels for easy movement.<br />\r\n	<br />\r\n	High pressure soap provides superior cleaning when compared with soap injector systems. Soap control allows for easy on and off operation of soap, as well as adjustment for desired soap concentration.<br />\r\n	<br />\r\n	Supplied with 35 feet of wire braid high pressure hose, quick couplers, easy-open trigger gun, high pressure swivel, insulated wand and stainless steel nozzle.</p>\r\n',0,0,1,0,7470,NULL,''),(7365,3356,NULL,192,NULL,'Rolling Ladder, Spring Loaded Front Casters, 4-Step',NULL,'<p>\r\n	Frame is 1&quot; welded round steel tubing. Ideal wherever there is a need to reach materials. Rolls easily into position and locks firmly to the floor formaximum safety. 2 to 6-step ladders operate on spring-loaded casters. Casters retract under operators weight while rubber feet drop down. Non-clogging slip-resistant steel steps. Durable KLETON blue enamel finish. CSA certified to the ANSI standard A14.7</p>\r\n<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Four steps. Each measures 22&quot; W x 8&quot; D. Total height is 37&quot;. Top platform measures 22&quot;W x 16&quot; D. Base measures 30&quot; W x 36&quot;D x 78&quot; H.</span></p>\r\n',0,0,1,0,7342,NULL,''),(7366,3356,NULL,192,NULL,'Ro