unicipalities, and homeowners.</p>\r\n<p>\r\n	Further, the ST3020BCUL incorporates a rugged cast aluminum housing, internal thermal overload protection, dual shaft seals, sealed ball bearings impeller, carrying handle, and molded 50\' Power Cable with strain relief. Dewaters flat surfaces down to 1/2&quot;.</p>\r\n<p>\r\n	3 inch discharge, 230V/9.8A, single phase, 2.0 HP, Max 170 GPM, Max 72 ft head. Meets UL/cUL requirements.</p>\r\n',0,0,1,0,7600,NULL,''),(7406,3085,NULL,NULL,NULL,'Gas Engine Centrifugal Dewatering Pump Packages','Size','<p>\r\n	These dewatering pump packages come complete with everything needed to get the job done. In addition to the pump itself, the packages include a 25 ft green PVC suction hose assembly, round hole suction strainer assembly, and a 50 ft blue layflat discharge hose assembly, as well as all conjoining fittings.</p>\r\n<p>\r\n	<strong>2-Inch Pump Package</strong>&nbsp;features a 5.5 HP OHV engine pump with low oil alert, made of die cast aluminum alloy with a ceramic seal. 16 ft suction height, 85 ft max head, 100 GPM. 2&quot; inlet and outlet. Includes all hoses and fittings as described above.</p>\r\n<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.0029983520508px;\"><strong>3-Inch Pump Package</strong> features a 6.5 HP OHV engine pump with low oil alert, made of die cast aluminum alloy with a ceramic seal. 19 ft suction height, 98 ft max head, 216 GPM. 3&quot; inlet and outlet. I</span>ncludes all hoses and fittings as described above.</p>\r\n',1,0,1,0,7383,NULL,''),(7408,3085,NULL,216,NULL,'Kodiak PWP1H Honda Gas Engine Centrifugal Dewatering Pump, 1\", 1.0 HP, 33 GPM',NULL,'<p>\r\n	Ideal for small jobs with no access to electricity. Cast-aluminum pump housing offers protection and lightweight portability. Extra-strength carbon-ceramic mechanical seals for heavy-duty jobsite use. Convenient carrying handle adds to the convenience this pump offers.</p>\r\n<p>\r\n	Able to 