h the Hach Phenols method 8047. 1 liter bottle.</span></p>\r\n',0,0,1,0,6336,NULL,''),(7420,3202,NULL,32,NULL,'Hach 42653 Hardness 3 Titrant Solution, 1 L',NULL,'<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif;\">EDTA titrant solution for hardness determination by drop-count titration. 0.03 N (0.015 M) 1 liter bottle</span></p>\r\n',0,0,1,0,7390,NULL,''),(7422,3129,NULL,32,NULL,'Hach 9532000 Pocket Pro+ pH Tester with Replaceable Sensor','Description','<p>\r\n	The Hach Pocket Pro+ pH Tester is engineered to deliver accurate results. Backed up with built in performance diagnostics, you never have to guess when to clean or calibrate the sensor. You also get replaceable batteries for field use, and a large, easy-to-read LCD screen.</p>\r\n<p>\r\n	Easy calibration steps and built-in diagnostics for this pH tester takes the guesswork out of calibrating the sensor to keep it in optimum condition. Easy-to-replace AAA batteries and a convenient sample cup make maintenance and measurements simple. Measures pH in 0.01 increments, as well as temperature.</p>\r\n',0,0,1,0,7398,NULL,''),(7423,3212,NULL,32,NULL,'Hach 2107669 Citrate Buffer Powder Pillows for Manganese, 10 ml, pk/100',NULL,'<p>\r\n	For determination of manganese by the periodate oxidation method. EPA approved for reporting wastewater analyses (digestion required). Hach method 8034. Sample size: 10 ml.</p>\r\n',0,0,1,0,7400,NULL,''),(7424,3037,NULL,182,NULL,'Colonial Economy True Union Ball Valve','Size','<p>\r\n	Max pressure 150 PSI for 1-1/2&quot;, 2&quot; and 3&quot;, 100 PSI for 4&quot;. Lightweight, thermoplastic design resists process and atmospheric corrosion. EPDM O-rings and TPE seats. Blue ABS impact resistant molded handle.</p>\r\n<p>\r\n	1-1/2&quot; and 2&quot; valves include both socket and threaded end connectors. 2&quot; and 3&quot; valves include socket connectors only.</p>\r\n<p>\r\n	Designed for general purpose applications with low concentrations of chlorine or other additives. Not for use in heavy industrial or chemical applications.</p>\r\n',0,0,1,0,4455,NULL,''),(7450,3272,NULL,67,NULL,'Forcefield PVC Coated, Foam And Fleece Lining Glove, 12/pk','Size','<p>\r\n	Stays soft when cold. Keeps hands warm and dry. Chemical resistant. Resist abrasion and oils. Comfortable and long wearing.</p>\r\n',0,0,1,0,7427,NULL,''),(7451,3272,NULL,67,NULL,'Forcefield PVC Coated, Safety Cuff Gloves, 12/Pk','Size','<p>\r\n	Stays soft when cold. Keeps hands warm and dry. Chemical resistant. Resists abrasion and oils. Comfortable and long wearing.</p>\r\n',0,0,1,0,7428,NULL,''),(7452,3272,NULL,NULL,NULL,'Orange Knit Wrist PVC Coated Insulated Gloves, 12/Pk',NULL,'<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Stays soft when cold. Keeps hands warm and dry. Chemical resistant. Resists abrasion and oils. Comfortable and long wearing.</span></p>\r\n',0,0,1,0,7429,NULL,''),(7453,3272,NULL,67,NULL,'Forcefield PVC Coated, Red Knit Wrist 12/Pk','Size','<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Stays soft when cold. Keeps hands warm and dry. Chemical resistant. Resists abrasion and oils. Comfortable and long wearing.</span></p>\r\n',0,0,1,0,7430,NULL,''),(7454,3272,NULL,NULL,NULL,'Yellow Knit Wrist PVC Coated Single Dipped Gloves, 12/Pk',NULL,'<p>\r\n	<span style=\"color: rgb(68, 68, 68); font-family: sans-serif; font-size: 13px; line-height: 16.003000259399414px;\">Stays soft when cold. Keeps hands warm and dry. Chemical resistant. Resists abrasion and oils. Comfortable and long wearing.</span></p>\r\n',0,0,1,0,7431,NULL,''),(7455,3272,NULL,NULL,NULL,'Green Knit Wrist PVC Double Dipped Gloves, 12/Pk',NULL,'<p>\r\n	PVC Coating remains soft when cold. Excellent insulation against cold temperatures. Offers resistance to oils, acids, caustics and alcohols.</p>\r\n',0,0,1,0,7432,NULL,''),(7456,3272,NULL,67,NULL,'Forcefield Winter Series Black Nitrile Coated Gloves, 12/Pk','Size','<p>\r\n	Excellent insulation for cold environment. Strong combination of abrasion, liquid repellance, and dry grip. Superior flexibility and dexterity. Uncoated back allows for air circulation to keep hands drier. Ergonomically designed for unmatched fit and comfort. Sold by the pack of 12.</p>\r\n',0,0,1,0,7433,NULL,''),(7457,3272,NULL,67,NULL,'Forcefield Hi-Viz Winter Series Latex Coated Gloves, 12/Pk','Size','<p>\r\n	Excellent insulation for cold environment. Strong combination of abrasionm liquid repellence, and dry grip. Superior flexibility and dexterity. Uncoated back allows for air circulation to keep hands drier. Ergonomically designed for unmatched fit and comfort. Sold by the pack of 12.</p>\r\n',0,0,1,0,7434,NULL,''),(7458,3272,NULL,67,NULL,'Forcefield Samurai Winter Series Nitrile Coated Gloves, 12/Pk','Size','<p>\r\n	Provides excellent thermal protection. Superior flexibility and dexterity. Uncoated back allows for air circulation to keep hands drier. Ergonomically designed for unmatched fit and comfort.</p>\r\n',0,0,1,0,7435,NULL,''),(7459,3162,NULL,35,NULL,'LMI Milton Roy Liquipro PVC Pump Heads','Description','<p>\r\n	These PVC pump heads are for use with LMI\'s Liquipro series of metering pumps.</p>\r\n',0,0,1,0,7436,NULL,''),(7464,3261,NULL,218,NULL,'SJE PumpMaster Piggyback Wide-Angle Float Switches, 13 Amp, 120V','Cable Length','<p>\r\n	Designed for direct control of 120 volt pumps up to 1/2 HP.</p>\r\n<p>\r\n	The SJE PumpMaster is a non-mercury, wide-angle float switch designed for direct control of any 120 volt pump up to 13 amps FLA. It can be used in potable water and sewage applications.</p>\r\n<p>\r\n	Not sensitive to rotation or turbulence, this float switch works well in both calm and turbulent situations. This mechanical float switch directly controls pumps in pump down/emptying applications.</p>\r\n<p>\r\n	UL and CSA listed. Passed NSF Standard 61 Protocol. Adjustable pump down range of 7&quot; to 36&quot; Flexible 16 gauge cable and heavy duty switch are rated for 13A running and 85A starting current. Comes complete with mounting clamp.</p>\r\n<p>\r\n	All SJE Float Switches now carry a 5 year warranty.</p>\r\n',0,0,1,0,6362,NULL,''),(7465,3360,NULL,NULL,NULL,'Cast Brass Female Coupling','Size','\r\n',0,0,1,0,7442,NULL,''),(7466,3360,NULL,NULL,NULL,'Cast Brass 45 Female Elbow','Size','\r\n',0,0,1,0,7443,NULL,''),(7467,3360,NULL,NULL,NULL,'Cast Brass 90 Female Elbow','Size',NULL,0,0,1,0,7444,NULL,''),(7468,3360,NULL,NULL,NULL,'Cast Brass 45 Street Elbow','Size','\r\n',0,0,1,0,7445,NULL,''),(7469,3360,NULL,NULL,NULL,'Cast Brass 90 Street Elbow','Size','\r\n',0,0,1,0,7446,NULL,''),(7470,3360,NULL,NULL,NULL,'Cast Brass Female Tee','Size',NULL,0,0,1,0,7447,NULL,''),(7471,3261,NULL,218,NULL,'SJE PumpMaster SPDT Wide Angle Float Switch, 13 Amp, 120V/240V','Cable Length','<p>\r\n	Designed for direct control of 120 volt pumps up to 1/2 HP and 240 volt pumps up to 1 HP.</p>\r\n<p>\r\n	The SJE PumpMaster Single Pole Double Throw is a non-mercury, wide angle float switch designed for direct control of any 120 or 240 volt pump up to 13 amps FLA. It can be used in potable water and sewage applications.</p>\r\n<p>\r\n	Not sensitive to rotation or turbulence, this mechanical 3 wire float switch works well in both calm and turbulent applications. This versatile float switch can be used for either pump down/emptying applications or pump up/fill applications.</p>\r\n<p>\r\n	The SJE PumpMaster SDPT float switch is provided with an external weight that provides an accurate pivot point for the suspended float switch. This cable weight can be adjusted without the use of tools.</p>\r\n<p>\r\n	UL and CSA listed. Passed NSF Standard 61 Protocol. Adjustable pumping range of 7&quot; to 36&quot;. Flexible 16 gauge cable and heavy duty switch are rated for 13A running and 85A starting current.</p>\r\n<p>\r\n	All SJE float switches now carry a 5 year warranty.</p>\r\n',0,0,1,0,6849,NULL,''),(7472,3367,NULL,NULL,NULL,'Modular Air Lubricator','Pipe Size X Flow Capacity','<p>\r\n	Modular air lubricators are rated to 150 PSI. 1&quot; size is high flow, non-modular design. Gauge ports are 1/4&quot; NPT.</p>\r\n',0,0,1,0,7410,NULL,''),(7473,3261,NULL,218,NULL,'SJE VerticalMaster Piggyback Plug Pump Switch Assembly, 13 Amp, 120V',NULL,'<p>\r\n	Designed for direct control of 120 volt pumps up to 1/2 HP.</p>\r\n<p>\r\n	The SJE VerticalMaster is a mechanically activated pump switch designed for direct control of any 120 volt pump up to 13 amps FLA in non-potable water applications. It is well-suited for applications requiring direct pump control in small diameter sump and effluent pits.</p>\r\n<p>\r\n	Not sensitive to rotation or turbulence, this mechanical pump switch works well in both calm and turbulent situations. This mechanical pump switch directly controls pumps in pump down/emptying applications.</p>\r\n<p>\r\n	The overall dimensions of the VerticalMaster Pump Switch are 12&quot; high X 5&quot; tall X 3&quot; wide.</p>\r\n<p>\r\n	CSA listed. Pumping range of 0.75&quot; to 6.5&quot;. Flexible 16 gauge 2 conductor cable and heavy duty switch are rated for 13 amps running and 60 amps starting current. Comes complete with stainless steel mounting bracket clamps.</p>\r\n<p>\r\n	All SJE float switches now carry a 5 year warranty.</p>\r\n',0,0,1,0,6850,NULL,''),(7474,3261,NULL,218,NULL,'SJE Stainless Steel Four Float Bracket',NULL,'<p>\r\n	Provides convenient installation of float switches. Supports 1 to 4 float switches. Can be directly mounted to wall, or used with included wall mounting device. Provides convenient location to stow excess float cord. Supplied with four cord strain relief connectors. Stainless steel construction provides exceptional corrosion resistance.</p>\r\n',0,0,1,0,7452,NULL,''),(7476,3261,NULL,218,NULL,'SJE Mushroom Anchor, 10 Lb',NULL,'<p>\r\n	This mushroom anchor is used in conjunction with stainless steel chain for suspended float switch installations. Yellow mushroom-style anchor weighs 10 pounds and has a vinyl coating to ensure long life.</p>\r\n',0,0,1,0,7454,NULL,''),(7477,3261,NULL,218,NULL,'SJE 316 Stainless Steel Chain, 1/8\" ','Length','<p>\r\n	This stainless steel chain is used in conjunction with mushroom anchors for suspended float switch installations. Chain is grade 316 stainless steel for optimum corrosion resistance. 1/8&quot; chain thickness.</p>\r\n',0,0,1,0,7455,NULL,''),(7478,3261,NULL,218,NULL,'SJE Cord Seals','Description','<p>\r\n	Cord seals provide stain relief and a liquid-tight seal in terminal adapters. Includes PVC Plugs for unused cable positions. Ground wire attached.</p>\r\n<p>\r\n	Seals: neoprene. Washers, nuts and bolts: stainless steel. Wire/cable accommodated: SJOW, SJTW, 18/2, 18/3, 16/2, 16/3, 14/2 and 14/3. Two models available:</p>\r\n<p>\r\n	4-Hole Cord Seal - Seals 1 to 4 cables in 2 inch terminal adapters.</p>\r\n<p>\r\n	6-Hole Cord Seal - Seals 1 to 6 cables in 2.5 inch terminal adapters.</p>\r\n',0,0,1,0,7456,NULL,''),(7496,3293,NULL,NULL,NULL,'Drain Cleaning Mole Nozzles','Connection Size','<p>\r\n	These Drain Cleaning Nozzles are for use with pressure washers or electric jetter machines. Hose is fed into plugged drain while attached to machine and nozzle is pushed into blockage. When machine is activated, water is forced through nozzle orifice and through extra holes in back of nozzle, propelling the nozzle forward and blowing the clog apart.</p>\r\n',0,0,1,0,7473,NULL,''),(7633,3360,NULL,NULL,NULL,'Cast Brass Female Union','Size',NULL,0,0,1,0,7610,NULL,''),(7634,3360,NULL,NULL,NULL,'Cast Brass Female Reducing Coupling','Size',NULL,0,0,1,0,7611,NULL,''),(7639,2047,NULL,NULL,NULL,'Vinyl Coated Support Clamps, 10 Pack','Inside Diameter','<p>\r\n	These support clamps are galvanized steel dipped in vinyl to prevent tube/hose chafing. They have a 3/4&quot; wide strap and 13/32&quot; bolt hole. Sold by the pack of 10 to keep your costs down.</p>\r\n',0,0,1,0,7616,NULL,''),(7640,2042,NULL,NULL,NULL,'White Stuff PTFE Thread Sealant','Size','<p>\r\n	White Stuff is a slow drying, soft setting, non-hardening PTFE pipe thread compound. It will not transfer taste or odor to the system being sealed. Excellent for food and water systems. It is lead free, anti-galling, non-corrosive, non-toxic, and will not harden in can. NSF Certified to NSF-14, NSF-61, and NSF-372. Sold by the tube or can.</p>\r\n',0,0,1,0,7617,NULL,''),(7655,3372,NULL,79,NULL,'Commercial Angle Broom with Dust Pan',NULL,'<p>\r\n	This heavy fill large angle broom is designed for commercial use. This broom has a 12&quot; sweep face making clean ups quick and easy. Powder coated 48&quot; metal handle. Comes complete with dust pan.</p>\r\n',0,0,1,0,7632,NULL,''),(7656,3372,NULL,79,NULL,'Commercial Sponge Roller Mop',NULL,'<p>\r\n	This high quality commercial sponge roller mop has a metal rod for great durability.</p>\r\n',0,0,1,0,7633,NULL,''),(7668,3376,NULL,NULL,NULL,'Chromate Wire Wall Mount Shelving Kits','# Of Shelves','<p>\r\n	Shelf dimensions: 30&quot; x 14&quot;. Kits includes shelves and supports</p>\r\n',0,0,1,0,7645,NULL,''),(7669,3376,NULL,NULL,NULL,'Chromate Stationary Wire Shelving Units','# Of Shelves','<p>\r\n	Heavy-gauge shelves with open wire design minimize dust, improve air circulation and provide greater visibility of stored items. Posts circular grooves combined with tapered plastic split sleeves allow for assembly in minutes with no special tools. Shelf ribs run front to back allowing items to slide on and off shelves smoothly. Shelves can be adjusted at precise 1&quot; intervals. Adjustable feet compensate for surface irregularities. Stationary unit\'s total capacity should not exceed 2000-lb. Assembly required. NSF certified.</p>\r\n<p>\r\n	Four Shelf Unit Dimensions: 18&quot; D X 36&quot; W X 63&quot; H</p>\r\n<p>\r\n	Five Shelf Unit Dimensions: 18&quot; D X 36&quot; W X 74&quot; H</p>\r\n',0,0,1,0,7646,NULL,''),(7670,3376,NULL,NULL,NULL,'Quick Assembly Storage Cabinets','Dimensions','<p>\r\n	Designed for an easy assembly with fewer fasteners. Shelves are easily adjustable on 2&quot; centres. One-piece base serves as an additional shelf increasing storage capacity. Three-point locking system, with locking chrome handle and two keys, adds security. Capacity per shelf: 100 lbs. Tough grey or tan powder coat finish for durability. Shipped knocked down.</p>\r\n',0,0,1,0,7647,NULL,''),(7671,3376,NULL,NULL,NULL,'All-Welded Standard Steel Lockers','Tiers and Dimensions','<p>\r\n	Rugged, all-welded steel lockers will provide years of maintenance free service. Designed for industrial, commercial, mining, institutional, sports, educational and government facilities. Locker components are welded together, eliminating nuts, bolts and rivets. Includes hat shelf and three hooks. Baked enamel grey paint finish.</p>\r\n',0,0,1,0,7648,NULL,''),(7672,3376,NULL,NULL,NULL,'Welded Gear Locker',NULL,'<p>\r\n	Ideal for any application where easy access to uniforms and/or equipment is required. Open face and perforated sides make these lockers fully accessible and ventilated. Lockable safety box and foot locker allows for safely storing of valuable goods. Lower shelf functions as a bench which eliminates the need for locker room benches. Includes: safety box, upper shelf and coat bar. Measures 24&quot; X 21&quot; X 72&quot;.</p>\r\n',0,0,1,0,7649,NULL,''),(7673,3177,NULL,22,NULL,'Multiquip Industrial Honda Engine Portable Generators','Description','<p>\r\n	Multiquip\'s line of industrial generators feature rugged components and construction to endure years of hard service. Control panel disigned with rough jobsite conditions in mind for long lasting performance. Twist-lock receptacles for operator convenience. Honda GX-Series industrial grade engines are standard on all units. Brushless design ensures low maintenance for years of dependable service. Superior voltage regulation helps to keep tools and equipment running at optimal levels; helps them last longer.</p>\r\n<p>\r\n	Other features include an on-board voltmeter, silent type muffler to reduce noise levels, and a two-year parts and labor warranty.</p>\r\n',0,0,1,0,7650,NULL,''),(7674,3177,NULL,NULL,NULL,'Commercial Self Propelled Honda Engine Push Mower',NULL,'<p>\r\n	This high quality self-propelled commercial grade push mower has many premium features including a heavy duty cast aluminum deck, steel wheels with grease fittings, flywheel brakes and one piece ergonomic heavy duty steel handle. Units are easy to adjust cutting height, no tools necessary. Wheels are attached with an axle bolt handle. Simply turn handle, lift or lower to desired cutting height and tighten by hand<strong>. </strong>High profile mower<strong> </strong>has a cutting height adjustment of 3/4&quot; to 3&quot;. 21-inch cutting diameter, 5.5 HP Honda GXV160 Series engine.</p>\r\n',0,0,1,0,7651,NULL,''),(7675,3177,NULL,22,NULL,'Multiquip Industrial Honda Engine Plate Compactor',NULL,'<p>\r\n	Multiquip\'s plate compactors are recognized as the industry standard for compacting granular soils and asphalt. Reliable Honda GX-160 offers easy starting and low oil shutdown for durability. Protective frame protects components and provides central lifting point. Anti-vibration handle dramatically reduces operator fatigue - up to 50% less vibration than competitive models. Sealed belt cover keeps dirt and rocks out of and extends belt life. Removable water tank allows easy refilling and removable without tools (largest in its class). Open base plate design makes for easier removal of dirt and rock build up. Cast iron construction for durability. Plate measures 13.8&quot; X 21.3&quot;. Larger models available.</p>\r\n',0,0,1,0,7652,NULL,''),(7679,3404,NULL,229,NULL,'Tough Duck F12741 Flame Resistant Base Layer Pant','Size','<p>\r\n	Fabric: 59% Modacrylic, 38% FR cotton, 3% elastic. Anti-bacterial and moisture wicking. Fully elasticized wiast. Knitted cuffs. Machine washable.</p>\r\n<p>\r\n	Meets performance requirements of NFPA 70E and ASTM F1506. Energy Breakopen Threshold Rating: Ebt= 5.9 cal/cm2. Hazard Risk Category (HRC) = 1.</p>\r\n',0,0,1,0,7656,NULL,''),(7680,2021,NULL,NULL,NULL,'Black Dragon Discharge Hose Assemblies w/ Male X Female Camlocks','Size','<p>\r\n	Black Dragon hose is a unique product which combines the &quot;single wall&quot; features of the PVC discharge hoses (lightweight, easy to coil, compact construction) with the abrasion resistance and temperature range of rubber. In addition, it incorporates an oil and chemical resistant nitrile rubber compound. The ribbed cover reduces dragging friction to make handling easier and further reduce wear. Excellent value when both durability and easily handling are considered.</p>\r\n<p>\r\n	Black Dragon is manufacturer using a unique process which incorporates the inner tube, reinforcement, and outer cover into a single &quot;solid wall&quot; hose. The reinforcement, a seamless high-tenacity polyester is embedded in black nitrile/PVC blend rubber. This gives the hose the same tough abrasion, oil and weather resistant properties inside and out. Black Dragon discharge hose has a temperature range of -30C to +70C.</p>\r\n<p>\r\n	These pre-fabricated discharge hose assemblies are 50 feet in length, and come complete with aluminum Type C (female) and Type E (male) connectors installed.</p>\r\n',0,0,1,0,7079,NULL,''),(7681,2023,NULL,NULL,NULL,'Spring Loaded (Silicone Hose) Clamps','Range','<p>\r\n	Spring loaded hose clamps are designed specifically for use with silicone coolant and turbo-charger hoses. Silicone is excellent for very high temperature service, however, it tends to soften and extrude easily when hot. Conventional clamps will seal adequately when cold, but may allow leakage or hose blow-off when hot. Spring loaded hose clamps feature a spring that maintains a constant tension regardless of temperature. These clamps feature a stainless band and plated steel fastener and spring.</p>\r\n',0,0,1,0,7659,NULL,''),(7682,2023,NULL,NULL,NULL,'Quick Release Gear Clamp','Nom. Size, Range','<p>\r\n	Quick release gear clamps employ a hinged housing on the clamp screw to allow instant release and fast installation. They are useful in applications where the clamp is often disconnected, such as in filter bag systems. Quick release gear clamps are all stainless and have a very wide range of adjustment.</p>\r\n',0,0,1,0,7660,NULL,''),(7683,2023,NULL,NULL,NULL,'Steel Pinch Clamp Assortment Kit',NULL,'<p>\r\n	This pinch clamp assortment kit offers clamps over a size range of 5/16&quot; to 1&quot; and includes a pinch clamp tool.</p>\r\n',0,0,1,0,7661,NULL,''),(7684,2023,NULL,NULL,NULL,'Basic Punch Clamp Tool',NULL,'<p>\r\n	Gets the job done, allowing you to create your own hose assemblies and make repairs in the field.</p>\r\n',0,0,1,0,7166,NULL,''),(7685,3017,NULL,NULL,NULL,'Long Plated Steel Hose Mender, Insert X Insert','Size','<p>\r\n	These long plated steel hose menders are made of zinc plated steel and are suitable for repairing a broken hose. This hose mender has barbed ends to create a tight seal on a hose when used with a hose clamp. Extra long length offers additional support versus conventional length hose menders. Zinc plated steel offers higher corrosion resistance than unplated steel.</p>\r\n<p>\r\n	These long plated steel hose mender fittings are barbed on each end and are used for joining two lengths of same diameter hose or tubing.</p>\r\n',0,0,1,0,7662,NULL,''),(7686,3017,NULL,NULL,NULL,'Type 304 Stainless Steel Combination Nipple, Insert X MPT','Size','<p>\r\n	These type 304 stainless steel combination nipples are suitable for use in attaching a fitting to a hose. The combination nipple has a barbed insert on one end, which will create a tight seal on hose when used with a hose clamp. Type 304 stainless steel offers higher corrosion resistance than plain steel or plated steel.</p>\r\n',0,0,1,0,7663,NULL,''),(7687,3378,NULL,NULL,NULL,'Storz Brass Nozzle Adapter','Size',NULL,0,0,1,0,7664,NULL,''),(7688,3378,NULL,NULL,NULL,'Storz Brass Hose Shank','Size',NULL,0,0,1,0,7665,NULL,''),(7689,3378,NULL,NULL,NULL,'Storz Coupling Wrench',NULL,NULL,0,0,1,0,7666,NULL,''),(7690,3378,NULL,NULL,NULL,'Storz Brass 3 Position Nozzle','Size','<p>\r\n	Three position nozzles combine the features of straight stream and fog nozzles. The lever can be moved from a shut off position to a choice of straight stream or fog spray. When the lever is in the fog position, the spray is adjusted by twisting the heavy rubber bumper.</p>\r\n',0,0,1,0,7667,NULL,''),(7691,3378,NULL,NULL,NULL,'Storz Brass Jet Nozzle','Size','<p>\r\n	Storz brass jet nozzles are designed to provide a straight stream flow, with tip diameters of 13mm in 1-1/2&quot; nozzles, 15mm for 2&quot;, and 20mm for 2-1/2&quot;.</p>\r\n',0,0,1,0,7668,NULL,''),(7694,3347,NULL,NULL,NULL,'Double Jacket Potable Water Fire Hose w/ Aluminum NPSH Swivel Ends','Size','<p>\r\n	Wherever fire hose is used as a municipal water main by-pass during water main repairs, a potable water quality hose should be used. Double jacket potable water fire hose is often used in conjunction with our Pureflex High Purity Potable Water By-Pass Hose to connect municipal water customers during water main replacement. Potable water hoses should also be specified for water tanker fill and delivery lines.</p>\r\n<p>\r\n	Tube is constructed of food grade polyurethane. Product meets MIL-H-24606B standards for potable water use. Cover is made up of two layers of polyester yarn with blue polymer impregnation for increased abrasion resistance. Working pressure of 300 PSI, test pressure of 600 PSI. Hose comes assembled with hardcoat aluminum NPSH swivel ends.</p>\r\n',0,0,1,0,7180,NULL,''),(7697,3379,NULL,NULL,NULL,'Instantaneous Forestry Fire Garden Hose Thread Adapters','Size','<p>\r\n	Instantaneous forestry fire fittings are designed for use in forest fire fighting. Since ends are interchangeable (there are no male or female hose ends) and connections are made with a simple quarter-turn, multiple hoses can be laid out and joined quickly. Aluminum forestry fittings have the advantage of light weight.</p>\r\n<p>\r\n	These fittings feature garden hose threads.</p>\r\n',0,0,1,0,7674,NULL,''),(7698,3379,NULL,NULL,NULL,'Instantaneous Forestry Fire Hose Shank','Size','<p>\r\n	Instantaneous forestry fire fittings are designed for use in forest fire fighting. Since ends are interchangeable (there are no male or female hose ends) and connections are made with a simple quarter-turn, multiple hoses can be laid out and joined quickly. Aluminum forestry fittings have the advantage of light weight.</p>\r\n',0,0,1,0,7675,NULL,''),(7699,3379,NULL,NULL,NULL,'Instantaneous Forestry Pipe Adapters','Size','<p>\r\n	Instantaneous forestry fire fittings are designed for use in forest fire fighting. Since ends are interchangeable (there are no male or female hose ends) and connections are made with a simple quarter-turn, multiple hoses can be laid out and joined quickly. Aluminum forestry fittings have the advantage of light weight.</p>\r\n',0,0,1,0,7676,NULL,''),(7700,3379,NULL,NULL,NULL,'Instantaneous Forestry Y Valve',NULL,'<p>\r\n	Valve is designed to turn easily while under pressure. 1-1/2&quot; forestry connections each end.</p>\r\n',0,0,1,0,7677,NULL,''),(7701,3347,NULL,NULL,NULL,'Brass Garden Hose Thread Fire Fighting Twist Nozzle',NULL,'<p>\r\n	This very compact nozzle is typically used for forest fire mop-up along with our small diameter garden hose threaded fire hoses.</p>\r\n',0,0,1,0,7678,NULL,''),(7708,3178,NULL,NULL,NULL,'Circuit Breaker Extension Cords','Description','<p>\r\n	The only extension cord with a circuit breaker that can be reset right at the outlet end. Protects cordset from equipment overload, which can cause electrical fires. Safety yellow 14/3 SJTW cord. All cords are 125V and 15A rated. Meets cUL requirements.</p>\r\n',0,0,1,0,7685,NULL,''),(7734,3343,NULL,NULL,NULL,'316 Stainless Steel Square Head Plug','Size',NULL,0,0,1,0,7711,NULL,''),(7735,3268,NULL,17,NULL,'Acton Dominator Premium Winter Work Boot','Size','<p>\r\n	Lightweight, premium PU boot has a sturdy, adherent, stable, anti-skid sole. Even during the coldest temperatures, your traction remains strong. Hydrophobic insulated 1000 denier nylon upper. Composite toe protector and plate for lightweight comfort. High performance removable 6 density liner offers superb warmth, designed to protect against extreme cold and potential frostbite. A warm, comfortable, waterproof boot. CSA and ESR compliant.</p>\r\n<p>\r\n	<strong>Ships direct from manufacturer.</strong></p>\r\n',0,0,1,0,7712,NULL,''),(7736,3394,NULL,4,NULL,'Work King S614 Hi-Vis Insulated Pull-On Snow Pant, Yellow','Size','<p>\r\n	Fabric, lining and insulation are 100% polyester. Pull-on pant with side pockets. Snaps on the lower legs to allow for boots. 4&quot; contrast striping with 3M reflective tape. Meets CSA-Z96-09 Class 3, Level 2 when worn with Class 2 top with armbands. When worn without armbands, meets CSA-Z96-09 Class 1, Level 2&nbsp; Meets ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,0,1,0,7713,NULL,''),(7737,3394,NULL,4,NULL,'Work King S614 Hi-Vis Insulated Pull-On Snow Pant, Orange','Size','<p>\r\n	Fabric, lining and insulation are 100% polyester. Pull-on pant with side pockets. Snaps on the lower legs to allow for boots. 4&quot; contrast striping with 3M reflective tape. Meets CSA-Z96-09 Class 3, Level 2 when worn with Class 2 top with armbands. When worn without armbands, meets CSA-Z96-09 Class 2, Level 2. Meets ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,0,1,0,7714,NULL,''),(7738,3394,NULL,4,NULL,'Work King S614 Hi-Vis Insulated Pull-On Snow Pant, Black','Size','<p>\r\n	Fabric, lining and insulation are 100% polyester. Pull-on pant with side pockets. Snaps on the lower legs to allow for boots. 4&quot; contrast striping with 3M reflective tape. Meets CSA-Z96-09 Class 3, Level 2 when worn with Class 2 top with armbands. When worn without armbands, meets CSA-Z96-09 Class 1, Level 2. Meets ANSI 107-2010 Class 1, Level 2.</p>\r\n',0,0,1,0,7715,NULL,''),(7739,3398,NULL,4,NULL,'Work King S787 Cotton Duck Lined Safety Coverall, Navy','Size','<p>\r\n	Shell: 100% cotton 10 oz. duck. Lining: 100% 6 oz. polyester insulation. Center front 2 way zipper for easy entry and exit. Side leg zippers from ankle to hips. Front storm fly with snap closure. Two top pockets, two large lower pockets, two rear pockets, pen pocket on sleeve. 4&quot; contrast tape with 2&quot; 3M reflective tape on upper body, back and lower legs. Meets CSA Z96-09 Class 1, Level 2 and ANSI 107-2010 Class 1, Level 2.</p>\r\n',0,0,1,0,7716,NULL,''),(7740,3398,NULL,4,NULL,'Work King S787 Cotton Duck Lined Safety Coverall, Orange','Size','<p>\r\n	Shell: 100% cotton 10 oz. duck. Lining: 100% 6 oz. polyester insulation. Center front 2 way zipper for easy entry and exit. Side leg zippers from ankle to hips. Front storm fly with snap closure. Two top pockets, two large lower pockets, two rear pockets, pen pocket on sleeve. 4&quot; contrast tape with 2&quot; 3M reflective tape on upper body, back and lower legs. Meets CSA Z96-09 Class 3, Level 2 and ANSI 107-2010 Class 3, Level 2.</p>\r\n',0,0,1,0,7717,NULL,''),(7741,3392,NULL,4,NULL,'Work King S473 Hi-Vis Crewneck Sweatshirt, Yellow','Size','<p>\r\n	Fabric: 240 gram 100% polyester fleece. Contrast trim at neck, hem and sleeve cuffs. 4&quot; contrast stripe with 3M reflective tape. Roomy, warm and comfortable. Meets CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,0,1,0,6105,NULL,''),(7742,3392,NULL,4,NULL,'Work King S473 Hi-Vis Crewneck Sweatshirt, Orange','Size','<p>\r\n	Fabric: 240 gram 100% polyester fleece. Contrast trim at neck, hem and sleeve cuffs. 4&quot; contrast stripe with 3M reflective tape. Roomy, warm and comfortable. Meets CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,0,1,0,6217,NULL,''),(7743,3392,NULL,4,NULL,'Work King S473 Hi-Vis Crewneck Sweatshirt, Black','Size','<p>\r\n	Fabric: 240 gram 100% polyester fleece. 4&quot; contrast stripe with 3M reflective tape. Roomy, warm and comfortable. Meets CSA-Z96-09 Class 1, Level 2 and ANSI 107-2010 Class 1, Level 2.</p>\r\n',0,0,1,0,6640,NULL,''),(7744,3389,NULL,4,NULL,'Work King S474 Insulated Safety Hoodie, Orange','Size','<p>\r\n	Fabric, lining and insulation are 100% polyester. Full front zipper. Detachable hood. Two large lower pockets. Knit cuffs and hem. Machine washable. Warm and comfortable. 4&quot; contrast striping with 3M reflective tape. Meets CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,0,1,0,7273,NULL,''),(7745,3389,NULL,4,NULL,'Work King S474 Insulated Safety Hoodie, Yellow','Size','<p>\r\n	Fabric, lining and insulation are 100% polyester. Full front zipper. Detachable hood. Two large lower pockets. Knit cuffs and hem. Machine washable. Warm and comfortable. 4&quot; contrast striping with 3M reflective tape. Meets CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,0,1,0,6722,NULL,''),(7746,3389,NULL,4,NULL,'Work King S474 Insulated Safety Hoodie, Black','Size','<p>\r\n	Fabric, lining and insulation are 100% polyester. Full front zipper. Detachable hood. Two large lower pockets. Knit cuffs and hem. Machine washable. Warm and comfortable. 4&quot; contrast striping with 3M reflective tape. Meets CSA-Z96-09 Class 1, Level 2 and ANSI 107-2010 Class 1, Level 2.</p>\r\n',0,0,1,0,7721,NULL,''),(7749,3401,NULL,229,NULL,'Tough Duck F7760 Lined Hi-Vis Flame Resistant Nomex IIIA Bib Overall, Navy','Size','<p>\r\n	Fabric: 6 oz 93% Nomex, 5% Kevlar, 2% Carbon. Lining: 100% FR cotton quilted to 7 oz Modacrylic insulation. 3M Scotchlite FR reflective material with 2&quot; contrast backing. YKK brass FR 2-way zippers. 2-way front zipper with storm fly closure. 2-way leg zippers from ankle to hip with protective storm fly closures. Adjustable Nomex IIIA covered elastic shoulder straps. Multi-pocket design. Made in Canada.</p>\r\n<p>\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 28 cal/cm2. Hazard Risk Category (HRC) = 3.</p>\r\n',0,0,1,0,7726,NULL,''),(7750,3402,NULL,229,NULL,'Tough Duck F7750 Lined Hi-Vis Flame Resistant Nomex IIIA Parka, Navy','Size','<p>\r\n	Fabric: 6 oz 93% Nomex, 5% Kevlar, 2% Carbon. Lining: 100% FR cotton quilted to 7 oz Modacrylic insulation. 3M Scotchlite FR reflective material with 2&quot; contrast backing. YKK brass FR zippers. Quick release hard hat hood. 2-way front zipper with protective storm fly closure. Adjustable waist with Nomex drawstring. FR knit storm cuffs. Multi-pocket design. Made in Canada.<br />\r\n	<br />\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 28 cal/cm2. Hazard Risk Category (HRC) = 3.</p>\r\n',0,0,1,0,7727,NULL,''),(7751,3402,NULL,229,NULL,'Tough Duck F35401 Lined Hi-Vis Flame Resistant Tecasafe Parka','Size','<p>\r\n	Tecasafe Plus Fabric: 7 oz 48% FR Modacrylic, 37% Lyocell, 15% Aramid. Lining: 100% FR cotton quilted to 100% Modacrylic FR insulation with vapor barrier. 3M Scotchlite FR reflective material double needle stitched. YKK FR HTN (High Tenacity Nylon) zippers. Quick-release hard-hat hood. Storm flap over front zipper. Microphone loops. Storm cuffs. Multi-pocketed. Made in Canada.</p>\r\n<p>\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 41.0 cal/cm2. Hazard Risk Category (HRC) = 4</p>\r\n<p>\r\n	Meets high visibility requirements of CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 3, Level 2.</p>\r\n',0,0,1,0,7728,NULL,''),(7752,3401,NULL,229,NULL,'Tough Duck F36401 Lined Hi-Vis Flame Resistant Tecasafe Bib Overalls','Size','<p>\r\n	Tecasafe Plus Fabric: 7 oz 48% FR Modacrylic, 37% Lyocell, 15% Aramid. Lining: 100% FR cotton quilted to 100% Modacrylic FR insulation with vapor barrier. 3M Scotchlite FR reflective material double needle stitched. 2-way ankle to hip leg zippers. Ruler pocket. Adjustable shoulder straps. Double-knees. Multi-pocket design. Made in Canada.</p>\r\n<p>\r\n	Meets performance requirements of CAN/CGSB 155.20, ASTM F1506, NFPA 2112, NFPA 70E. Arc Rating: ATPV= 41.0 cal/cm2. Hazard Risk Category (HRC) = 4</p>\r\n<p>\r\n	Meets high visibility requirements of CSA-Z96-09 Class 3, Level 2 when worn with appropriate Class 2 top and ANSI 107-2010 Class 3, Level 2 when worn with appropriate Class 2 top.</p>\r\n',0,0,1,0,7729,NULL,''),(7753,3069,NULL,215,NULL,'Hallett 30 Ultraviolet Water System by UV Pure, 1\"',NULL,'<p>\r\n	UV Pures Hallett 30 Wastewater System was developed for residential and light commercial wastewater treatment applications and outperforms all conventional UV systems with the ability to treat very low quality wastewaters (low UV transmittance) trouble free.<br />\r\n	<br />\r\n	Hallett UV water purification system models, with patented Crossfire Technology, are engineered for simple, efficient multiplex configuration, and treat flows up to 1 MGD (3785 m/day) for wastewater, reuse and potable applications.</p>\r\n<p>\r\n	30 US GPM @ 75% UVT. Certified at 40 mJ/cm2. Includes transient voltage surge protector, 1&quot; SS flex hose (2) and flow restrictor.</p>\r\n',1,0,1,0,7730,NULL,''),(7768,3406,NULL,9,NULL,'49th Parallel 100G Thinsulate Lined Full Grain Leather Gloves, 12/pk',NULL,'<p>\r\n	Striped cotton twill back. 100 g Thinsulate Insulation. Premium full grain cowhide leather. Rubberized safety cuff. Leather knuckle strap and finger tips. One size fits all. Sold per pack of 12.</p>\r\n',0,0,1,0,7743,NULL,''),(7769,3406,NULL,NULL,NULL,'DuPont Thermastat Glove Liner, 12/pk',NULL,'<p>\r\n	DuPont\'s Thermastat material is a hollow-core hydrophobic polyester fiber. It is an excellent insulator when worn alone or inside of leather winter gloves. Fast-wicking fibers keep hands warm and dry in both cold and damp environments. One size fits all. Sold per pack of 12.</p>\r\n',0,0,1,0,7748,NULL,''),(7770,3274,NULL,8,NULL,'Tough Duck Gi8606 Palm Lined Full Grain Leather Gloves, 6/pk','Size','<p>\r\n	10 oz cotton brown twill. Palm lined. Premium cowhide leather. Rubberized safety cuff. Leather knuckle strap and finger tips. Sold per pack of 6.</p>\r\n',0,0,1,0,7747,NULL,''),(7771,3406,NULL,8,NULL,'Tough Duck G69916 150G Thinsulate Lined Waterproof Brreathable Grain Leather Gloves, 6/pk','Size','<p>\r\n	10 oz cotton brown twill. Enprotex waterproof breathable 150g 3M Thinsulate Insulation. Premium cowhide. Rubberized safety cuff. Leather knuckle strap and finger tips. Sold per pack of 6.</p>\r\n',0,0,1,0,7746,NULL,''),(7779,3350,NULL,3,NULL,'Work King 7760 Deluxe Insulated Coverall, Navy','Size','<p>\r\n	Fabric: 10 oz 100% cotton duck. Lining: quilted 6 oz polyester insulation. Waterproof seat and knees. Double knees with knee pad pockets. Detachable hard hat hood (included). Inside pocket and cell pocket. Storm cuffs. Full front zipper: neck to ankle for easy access. Multi-pocket design.</p>\r\n',0,0,1,0,7208,NULL,''),(7780,3350,NULL,8,NULL,'Tough Duck 7838 Heavy Weight Coverall, Black','Size','<p>\r\n	Fabric: 12 oz 100% cotton Tough Duck. Lining: quilted 6 oz polyester insulation. Seam-sealed waterproof seat. Waterproof double knees. Heavy-duty 2-way leg zippers from ankle to hip. Elasticized back waist. 2 upper chest pockets. 2 lower patch pockets. Removable and adjustable hard hat hood. Made in Canada.</p>\r\n',0,0,1,0,7756,NULL,''),(7781,3350,NULL,8,NULL,'Tough Duck 7838 Heavy Weight Coverall, Brown','Size','<p>\r\n	Fabric: 12 oz 100% cotton Tough Duck. Lining: quilted 6 oz polyester insulation. Seam-sealed waterproof seat. Waterproof double knees. Heavy-duty 2-way leg zippers from ankle to hip. Elasticized back waist. 2 upper chest pockets. 2 lower patch pockets. Removable and adjustable hard hat hood. Made in Canada.</p>\r\n',0,0,1,0,7757,NULL,''),(7782,3350,NULL,8,NULL,'Tough Duck 7838 Heavy Weight Coverall, Navy','Size','<p>\r\n	Fabric: 12 oz 100% cotton Tough Duck. Lining: quilted 6 oz polyester insulation. Seam-sealed waterproof seat. Waterproof double knees. Heavy-duty 2-way leg zippers from ankle to hip. Elasticized back waist. 2 upper chest pockets. 2 lower patch pockets. Removable and adjustable hard hat hood. Made in Canada.</p>\r\n',0,0,1,0,7758,NULL,''),(7786,3390,NULL,124,NULL,'Viking 6006 Safety T-Shirt, Orange','Size, Qty Available','<p>\r\n	Premium non-transparent double layer polyester fabric for better breathability. Holds color longer with 2&quot; Vi-Brance tape in 4&quot; contrasting configuration provides high visibility protection. Meets WCB/Worksafe/DOT standards. Fully compliant with CSA Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,1,0,0,7763,NULL,''),(7787,3390,NULL,124,NULL,'Viking 6006 Safety T-Shirt, Yellow','Size, Qty Available','<p>\r\n	Premium non-transparent double layer polyester fabric for better breathability. Holds color longer with 2&quot; Vi-Brance tape in 4&quot; contrasting configuration provides high visibility protection. Meets WCB/Worksafe/DOT standards. Fully compliant with CSA Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 2, Level 2.</p>\r\n',0,1,0,0,7764,NULL,''),(7790,3395,NULL,NULL,NULL,'Pioneer 5514 Orange Reflective Coveralls, Regular Sizes','Size, Qty Available','<p>\r\n	100% cotton twill. Two-way brass zipper. Front swing pockets. Hammer strap/ruler pocket. Bar-tack reinforcements. Soil-release finish. Pre-shrunk to meet industrial laundry standards. 4&quot; 3M Scotchlite reflective tape on 2&quot; contrast background meets CSA-Z96-09 Class 1, Level 2.. Tall sizes are 3&quot; longer than regular sizes.</p>\r\n',0,1,0,0,7767,NULL,''),(7791,3395,NULL,NULL,NULL,'Pioneer 5514T Orange Reflective Coveralls, Tall Sizes','Size, Qty Available','<p>\r\n	100% cotton twill. Two-way brass zipper. Front swing pockets. Hammer strap/ruler pocket. Bar-tack reinforcements. Soil-release finish. Pre-shrunk to meet industrial laundry standards. 4&quot; 3M Scotchlite reflective tape on 2&quot; contrast background meets CSA-Z96-09 Class 1, Level 2.. Tall sizes are 3&quot; longer than regular sizes.</p>\r\n',0,1,0,0,7768,NULL,''),(7796,3396,NULL,124,NULL,'Viking 6210P Journeyman Heavy Duty PVC Bib Pants, Orange','Size, Qty Available','<p>\r\n	Tough 0.45mm PVC/Polyester/PVC material, superior resistance to delamination. Medium to heavy risk chemical splash protection. Excellent chemical protection against acids, animal fats, and motor oils. Good protection against foul weather wind and cold protection. 2&quot; prism reflective safety strips. Generously sized for working comfort. Durable double welded seams. H.D. elastic suspenders meet ESR standards. Reversible bib design. Adjustable waist panel for ease of entry. Large zip pocket &amp; pen holder behind bib.</p>\r\n',0,1,0,0,7773,NULL,''),(7797,3397,NULL,124,NULL,'Viking 6325JO Safety Maxx Rain Jacket, Orange','Size, Qty Available','<p>\r\n	150D polyester/PU waterproof material. Fully compliant with CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 3, Level 2.. 2&quot; 3M Scotchlite reflective material in 4&quot; configuration also meets WCB/Worksafe/DOT approvals. Multi front and back vents for breathability. Adjustable wrists and cuffs. Hood stuffs into corduroy lined collar.</p>\r\n',0,1,0,0,7774,NULL,''),(7798,3396,NULL,124,NULL,'Viking 6325PO Safety Maxx Bib Pants, Orange','Size, Qty Available','<p>\r\n	Industry level high visibility safety rainwear with CSA/ANSI compliance. 150D Premium oxford polyester with PU backing fabric makes the bib pants more softer and more flexible for added comfort with the same resistance against punctures, rips, snags while being light weight. Fully compliant with CSA-Z96-09 Class 2, Level 2 and ANSI 107-2010 Class 3, Level 2.. 2&quot; 3M Scotchlite reflective material in 4&quot; configuration also meets WCB/Worksafe/DOT approvals.</p>\r\n',0,1,0,0,7775,NULL,''),(7813,3415,NULL,210,NULL,'Harmsco Big Blue Pleated Polyester Sediment Cartridges, 4-1/2\" OD, 9.75\" Length, Case of 8','Micron Rating','<p>\r\n	Fits Harmsco, Pentek, Waterite, Shelco and all other brands of filter housings that accept 4-1/2&quot; diameter Heavy Duty BB (Big Blue) filter cartridges. Cleanable / reuseable pleated polyester filter media provides high flow rates with low initial pressure drop. Longer filter runs and higher flow capacity with fewer change outs. Certified to NSF-61. Sold per case of 8.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Filters listed here are 9.75&quot; in length. </strong></li>\r\n	<li>\r\n		<strong>All sizes below are sold and priced by the case of 8.</strong></li>\r\n</ul>\r\n',0,0,1,0,7788,NULL,''),(7814,3415,NULL,210,NULL,'Harmsco Big Blue Pleated Polyester Sediment Cartridges, 4-1/2\" OD, 20\" Length, Case of 4','Micron Rating','<p>\r\n	Fits Harmsco, Pentek, Waterite, Shelco and all other brands of filter housings that accept 4-1/2&quot; diameter Heavy Duty BB (Big Blue) filter cartridges. Cleanable / reuseable pleated polyester filter media provides high flow rates with low initial pressure drop. Longer filter runs and higher flow capacity with fewer change outs. Certified to NSF-61. Sold per case of 4.</p>\r\n<ul>\r\n	<li>\r\n		<strong>Filters listed here are 20&quot; in length. </strong></li>\r\n	<li>\r\n		<strong>All sizes below are sold and priced by the case of 4.</strong></li>\r\n</ul>\r\n',0,0,1,0,7789,NULL,'');
