INSERT INTO `uploaded_files` VALUES (1,'Some CURL Stuff','curl \"http://www.eprom.com/home/customer/product/download.php\" -H \"Accept-Encoding: gzip,deflate,sdch\" -H \"Accept-Language: en-US,en;q=0.8\" -H \"User-Agent: Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.114 Safari/537.36\" -H \"Accept: text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8\" -H \"Referer: http://www.eprom.com/home/customer/product/pricelist.php?list=Display+All\" -H \"Cookie: PHPSESSID=e10be8cebf720b6bcc8f698e226c13c3\" -H \"Connection: keep-alive\"','CURL_URL.txt','text/plain','2014-08-19 16:46:05',15),(2,'Some CSS File','html,body{margin:0px;padding:0px; height:auto; min-height:600px; font-family:Arial;min-width:800px;}\r\ndiv.content { width:99%; min-height:600px; height:auto; margin-left:10px; }\r\ndiv.logo { width:96%; height:120px; background-image:url(images/logo.png); background-repeat:no-repeat; }\r\ndiv.titlebar { width:96%; height:25px; background-color:#003399; border: solid 1px blue; padding-left:10px; color:white; font-size:21px; font-weight:bold;min-width:800px;}\r\ndiv.navigationmenu { width:96%; height:25px; margin-bottom:6px; border-bottom: solid 1px blue;}\r\ndiv.wrapper { width:96%; height:auto; min-height:700px; border: solid 1px black; background-color:#F5F5DC; padding-left:10px; padding-top:10px; min-width:800px;}\r\ndiv.errorbar { width:96%; height:auto; background-color:#CD3333; color:white; border:solid 1px red; padding-left:10px; font-weight:bold; text-align:center;}\r\ndiv.errorbarmsg { width:96%; height:auto; background-color:green; color:white; border:solid 1px lightgreen; padding-left:10px; font-weight:bold; text-align:center;}\r\nspan.lbl { font-weight:bold;}\r\ntable.navigationmenu td{ padding:3px; border-right: solid 1px blue; border-left:solid 1px blue; width:auto; }\r\ntable.navigationmenu { border-collapse:collapse; font-size:14px; }\r\ntable.navigationmenu a { text-decoration:none; height:25px; color:red; }\r\ntable.navigationmenu a.selected {  font-weight:bolder; font-size:16px; color:red;}\r\ntable.navigationmenu a.unselected {  }\r\ntable.navigationmenu a:hover { text-decoration:underline; color:darkturquoise; }\r\ndiv.userinfo { float:right; font-size:14px; text-align:right;width:350px; height:auto;}\r\ndiv.subtitlebar { width:96%; background-color:red; height:25px; padding-left:10px; background-color:lightblue; margin-top:8px; border-left: solid 1px ForestGreen; border-right: solid 1px ForestGreen;}\r\ndiv.spanwidth { width:99%; height:auto; }\r\n.modalback { position:absolute; height:100%; width:100%; top:0px; left: 0px; filter:alpha(opacity=70);opacity: 0.7;-moz-opacity:0.7; background-color: lightgrey; visibility:hidden; text-align:right; z-index:1000;}\r\nspan.reqfield { color:blue; font-weight:bold; font-size:large; margin-left:5px; width:10px; }\r\ninput.disabled { background-color:#E0E0E0; }\r\na.returnlink { font-size:13px; }\r\na { color:blue; }\r\ndiv.suggest { height:auto; width:435px; margin:auto; display:none; position:absolute; left:0px; text-align:left;background-color:white; z-index:100; }\r\ndiv.resolutioncmd { font-size:11px; margin-top:6px; font-style:italic;}\r\ndiv.nosort { color:blue; }\r\n\r\n/* main */\r\ntable.tblstatusfilter { border-collapse:collapse; font-size:14px; line-height:10px; margin-top:2px; color:white;}\r\ntable.tblstatusfilter td { padding-right:10px; border-right: solid 1px black; border-left:solid 1px black; padding-left:10px; }\r\ntable.tblstatusfilter a { text-decoration:none; color:white; }\r\ntable.tblstatusfilter a.selected { color:red; }\r\ntable.tblstatusfilter a:hover { text-decoration:underline; }\r\n\r\ntable.ticketgrid { width:80%; }\r\ntable.griddetail { width:100%; border:solid 1px white;}\r\ntable.griddetail th { background-color:skyblue; color:white; font-weight:normal; font-size:16px; width:200px;}\r\ntable.griddetail td{ font-weight:normal; font-size:16px; width:200px; background-color:#D3D3D3; font-size:14px; padding:4px; color:black;}\r\ntable.griddetail td.alt { background-color:#EBECE4; padding:4px; font-size:14px; color:black;}\r\ntable.griddetail td.emptygrid { font-style:italic; text-align:center; background-color:#FBF5E6; color:black; width:100%;}\r\n\r\n/* main */\r\n\r\n/* customers */\r\ntable.customergrid { width:80%; }\r\n\r\n/* customers */\r\n\r\n/* view ticket*/\r\ntable.ticketdetail { width:60%; font-size:14px; }\r\ntable.ticketdetail td.lbl { background-color:#D3D3D3; }\r\ntable.ticketdetail td.vals { background-color:#EBECE4; }\r\n\r\n/* view ticket */\r\n','style.css','text/css','2014-08-19 17:02:50',15);
